(10, 'Sistem Informasi Manajemen Taman Hiburan', '{\"blocks\":[{\"key\":\"5vekh\",\"text\":\"Sebuah aplikasi untuk memonitoring keuntungan per enam bulan, perharian dalam enam bulan, serta seluruh keuntungan yang pernah ada. Di dalam aplikasi juga terdapat dashboard yang sangat informatif dengan grafik line chart dan bar chart untuk mengakomodasi kebutuhan para manajer taman hiburan. Nantinya dari informasi dari sana, para manajer dapat menggunakannya untuk membuat strategi perusahaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem Informasi Manajemen Taman Hiburan.jpeg', 'https://www.youtube.com/watch?v=U4Ya2_AqL24', 'https://github.com/RashidMaulana/tubes_psi', 'https://api.informatics-expo.id/Sistem Informasi Manajemen Taman Hiburan.jpeg', 12, 8, 1, '2021-07-08 02:51:58', '2021-07-09 11:56:30'),
(11, 'Menghidupkan Sepertiga Malam', '{\"blocks\":[{\"key\":\"5p6uq\",\"text\":\"Menceritakan seorang pemuda yang giat melaksanakan sholat malam. Dalam animasi tersebut terdapat penjelasan dari manfaat sholat dan doa di sepertiga malam, dan juga diiringi oleh narasi yang dapat meningkatkan semangat kita dalam melaksanakan sholat malam.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Menghidupkan Sepertiga Malam.png', 'https://www.youtube.com/watch?v=ONgcXGeakys&t=3s', 'https://docs.google.com/presentation/d/1bIuDjuv15H7Eh8G5m5nWyhHJFwV4YoxsSACGKnluSs0/edit?usp=sharing', 'https://api.informatics-expo.id/Menghidupkan Sepertiga Malam.png', 13, 4, 1, '2021-07-08 04:37:58', '2021-07-08 04:37:58'),
(515, 'Traspick', '{\"blocks\":[{\"key\":\"5s7la\",\"text\":\"The formation of this application can help a lot of people who have problem with their household trash management, also the efficiency in terms of time. Customer just order when they want their trash to be picked up by the garbage collector. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":241,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":241,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"2mo4k\",\"text\":\"Goals :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":7,\"style\":\"color-rgb(26,26,26)\"},{\"offset\":0,\"length\":7,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Raleway, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"62r87\",\"text\":\"Provides an easier method of disposing of household waste\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":57,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":57,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":57,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":57,\"style\":\"fontsize-inhe