"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"aampn\",\"text\":\"Secured Transaction  \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":20,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}}],\"entityMap\":{}}', 'Traspick.jpeg', 'https://youtu.be/Yg-YYPVxK-E', 'https://github.com/helggaa/Expo.git', 'https://api.informatics-expo.id/Traspick.jpeg', 826, 9, 4, '2023-01-12 14:28:44', '2023-01-12 14:28:44'),
(12, 'Sistem kasir Martabak', '{\"blocks\":[{\"key\":\"eueb0\",\"text\":\"SIMAK adalah aplikasi berbasis software. SIMAK adalah kepanjangan dari  \\\"Sistem Kasir Martabak\\\". Aplikasi ini dibuat untuk mempermudah transaksi martabak di masa pandemi ini serta meminimalisir kontak fisik antara penjual dan pembeli.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem kasir Martabak.png', 'https://www.youtube.com/watch?v=7wt4vMacAJU', '', 'https://api.informatics-expo.id/Sistem kasir Martabak.png', 25, 12, 1, '2021-07-08 15:26:57', '2021-07-08 15:26:57'),
(13, 'Sistem Informasi Manajemen Kedai Kopi', '{\"blocks\":[{\"key\":\"a6unt\",\"text\":\"Sistem Informasi Manajemen Kedai Kopi yang dirancang oleh ASA TEAM\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dd65p\",\"text\":\"Sistem ini dapat mempermudah dalam pengerjaan laporan pembelian bahan baku maupun penjualan produk serta menyajikan informasi dengan visualisasi yang informatif\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem Informasi Manajemen Kedai Kopi.jpeg', 'https://youtu.be/JVTe-h8tNnI', 'https://drive.google.com/file/d/1Tut1XyuluLSVTBMPQKD96EpszDQYBwwW/view?usp=sharing', 'https://api.informatics-expo.id/Sistem Informasi Manajemen Kedai Kopi.jpeg', 29, 8, 1, '2021-07-08 15:56:32', '2021-07-08 15:56:32'),
(14, 'Kopisini', '{\"blocks\":[{\"key\":\"b5vgm\",\"text\":\"Kopisini adalah platform aplikasi yang ditujukan kepada pelaku UKM di sektor perkopian untuk mempermudah mereka dalam memasarkan produknya, serta memperkenalkan kopi khas daerah setempat sebagai bagian dari keragaman kopi nusantara \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kopisini.png', 'https://www.youtube.com/watch?v=XeQQqi-tFdI', 'https://linktr.ee/Glassolution', 'https://api.informatics-expo.id/Kopisini.png', 17, 12, 1, '2021-07-08 20:53:16', '2021-07-08 20:56:22'),
(15, 'Sidora', '{\"blocks\":[{\"key\":\"aipff\",\"text\":\"Sidora adalah sistem manajemen donor darah yang memudahkan masyarakat untuk berpartisipasi dalam program donor darah dan bagi pihak-pihak yang membutuhkan darah. Pada sistem ini pengguna dapat membuat janji donor darah dan konsultasi langsung dengan dokter serta setiap calon pendonor diberikan pilihan untuk melakukan donor darah di rumah sakit atau dirumah. Tim kesehatan akan datang kerumah sesuai dengan jadwal yang sudah ditentukan sehingga masyarakat tidak perlu repot datang ke rumah sakit.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sidora.png', 'https://www.youtube.com/watch?v=-tZ3jEiD1AY&t=14s', 'https://www.slideshare.net/AzkaNabilah/sidora-sistem-manajemen-donor-darah-249663752', 'https://api.informatics-expo.id/Sidora.png', 35, 3, 1, '2021-07-08 22:27:23', '2021-07-09 05:03:23'),
(16, 'Keutamaan Sholat', '{\"blocks\":[{\"key\":\"6pv0p\",\"text\":\"Sebuah animasi yang menceritakan tentang kemalangan seorang pemuda akibat melalaikan sholatnya. Ia tertidur di saat subuh, sebuah waktu sakral yang seharusnya pantang untuk ditinggalkan. Ayahnya sudah mencoba untuk membangunkannya. Akan tetapi...\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Keutamaan Sholat.jpeg', 'https://www.youtube.com/watch?v=VHKaietC40Q', 'https://github.com/RashidMaulana/tubes_gmm', 'https://api.informatics-expo.id/Keutamaan Sholat.jpeg', 36, 4, 1, '2021-07-08 23:10:22', '2021-07-09 14:52:41'),
(17, 'Dosa Jariyah', '{\"blocks\":[{\"key\":\"d0a1\",\"text\":\"Sebuah animasi yang mengajak para kaum wanita untuk menghapus jejak dosa jariyah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Dosa Jariyah.png', 'https://www.youtube.com/watch?v=x-sLHKwgHcU&t=11s&ab_channel=MeliniaBetha', 'https://www.canva.com/design/DAEg810ZC9o/d2B38LVMq7LZc5KVRLexOg/edit', 'https://api.informatics-expo.id/Dosa Jariyah.png', 38, 4, 1, '2021-07-09 02:04:41', '2021-07-09 02:17:26'),
(18, 'TidyCash', '{\"blocks\":[{\"key\":\"p9nh\",\"text\":\"TidyCash adalah aplikasi pencatatan transaksi dan logistik yang dikhususkan untuk bisnis-bisnis yang beroperasi pada skala kecil, terutama UMKM. Dengan TidyCash, Anda dapat melakukan pencatatan atas setiap transaksi dan melakukan tracking incomes dan expenses. Proses data barang juga jadi lebih mudah dengan fitur logistik yang tersedia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"10av4\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"elhrn\",\"text\":\"Punya bisnis tapi malas mencatat? Gunakan TidyCash!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TidyCash.png', 'https://www.youtube.com/watch?v=ernW8wDhBuM', 'https://drive.google.com/file/d/1oMVnHb-OvFiaJqs5yuPgZXZYuuP2XObM/view?usp=sharing', 'https://api.informatics-expo.id/TidyCash.png', 39, 9, 1, '2021-07-09 02:10:12', '2021-07-09 08:43:45'),
(19, 'Covid-19 prevention', '{\"blocks\":[{\"key\":\"b07tg\",\"text\":\"Menjelaskan mengenai bagaimana penerapan 5M dan ajakan untuk melakukan vaksinisasi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":84,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":84,\"style\":\"BOLD\"},{\"offset\":0,\"length\":84,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":84,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":84,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"4ullj\",\"text\":\"Dalam upaya melawan virus Covid-19 yang sedang melonjak tinggi kasusnya saat ini, karena kalo kalian sayang sama orang terdekat kalian jangan lupa patuhi protokol kesehatan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":174,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":174,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":174,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":174,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":174,\"style\":\"BOLD\"},{\"offset\":0,\"length\":174,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":174,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":174,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":174,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":174,\"style\":\"fontsize-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"kqof\",\"text\":\":) \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":2,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":2,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":2,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":2,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":2,\"style\":\"BOLD\"},{\"offset\":0,\"length\":2,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":2,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":2,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":2,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":2,\"style\":\"fontsize-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'Covid-19 prevention.png', 'https://www.youtube.com/watch?v=A2r0NBDBCr4', 'https://s.id/CseyP', 'https://api.informatics-expo.id/Covid-19 prevention.png', 42, 3, 1, '2021-07-09 03:26:17', '2021-07-09 03:26:17'),
(20, 'Nambak Dashboard', '{\"blocks\":[{\"key\":\"4lofn\",\"text\":\"Nambak dahsboard merupakan sebuah aplikasi berbasis web yang dapat digunakan oleh industri tambak ikan untuk memanajemen informasi atau data dari aktivitas tambak. Aplikasi ini dirancang agar memudahkan pencatatan informasi sekaligus memudahkan pihak manajemen tambak untuk membaca laporan harian hingga bulanan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nambak Dashboard.png', 'https://youtu.be/ZaJnZ4UYxQY', 'https://www.slideshare.net/AnnisaAlyanida/psycho-tugas-besar-pengembangan-sistem-informasi', 'https://api.informatics-expo.id/Nambak Dashboard.png', 46, 9, 1, '2021-07-09 04:59:07', '2021-07-09 13:57:13'),
(21, 'Tunas Investment', '{\"blocks\":[{\"key\":\"eqjss\",\"text\":\"Tunas Investment adalah aplikasi berbasis desktop untuk membantu para pelaku UKM mendapatkan pendanaan dari para investor. Pemodalan dari investor yang awalnya dilakukan dengan cara manual dengan aplikasi ini akan dipermudah untuk mendapatkanya melalui pendanaan digital dan masyarakat (Investor) juga lebih mudah untuk melakukan investasi guna mencapai target finansial yang lebih baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tunas Investment.jpeg', 'https://youtu.be/Hh2SG6oixjk', 'https://docs.google.com/presentation/d/13tw9rJ2NJLt-js1Ih02jwqFvWIzt4K8SpqRKlI86QME/edit?usp=sharing', 'https://api.informatics-expo.id/Tunas Investment.jpeg', 14, 9, 1, '2021-07-09 05:33:04', '2021-07-09 05:33:04'),
(22, 'Rukun Islam', '{\"blocks\":[{\"key\":\"hmmk\",\"text\":\"Sebuah animasi anak-anak yang menceritakan tentang 3 orang anak\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f2bqk\",\"text\":\"yang bernama narto, coji, dan saske. Mereka ini hendak pulang kerumah\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fu0o4\",\"text\":\"setelah mengaji disebuah masjid. Tujuan dari adanya proyek ini adalah untuk mengingatkan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"28p4s\",\"text\":\"kepada kita orang dewasa tentang pentingnya untuk tetap mengingat Rukun Islam\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2s7bn\",\"text\":\"saat kita mempelajari dahulu saat kita masih anak-anak. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Rukun Islam.png', 'https://www.youtube.com/watch?v=UOwV1j6SRHA', 'https://www.canva.com/design/DAEjnLDeZyA/8S3H6J-XimFqCEICzxKGjA/view?utm_content=DAEjnLDeZyA&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/Rukun Islam.png', 50, 5, 1, '2021-07-09 05:38:50', '2021-07-09 05:46:40'),
(24, 'NgeYogya', '{\"blocks\":[{\"key\":\"2s969\",\"text\":\"NgeYogya merupakan sebuah aplikasi berbasis web yang dibuat untuk memenuhi kebutuhan para wisatawan domestik ataupun mancanegara agar dapat memilih tujuan wisata mereka secara integratif dan sistematis. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"33mmu\",\"text\":\"Aplikasi ini dibuat sedemikian rupa bukan saja untuk memenuhi keperluan pengguna wisatawan tapi kami juga menyuguhkan beberapa tempat menarik di Yogya yang belum terekspos secara luas. Sebut saja seperti wisata alamnya yang masih jarang orang temui adalah Gumuk Pasir Parangkusumo, Blue Lagoon, Hutan Pinus Mangunan, Bukit Nglanggeran dan masih banyak lagi tempat yang jarang banyak orang tahu. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"729jo\",\"text\":\"Maka dari itu kami menyajikan paket perjalanan wisata yang di dalamnya terdapat tempat wisata yang terkenal dan juga tempat wisata yang jarang disinggahi banyak orang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NgeYogya.png', 'https://youtu.be/SXcrGaLoFvs', 'https://docs.google.com/presentation/d/1oGBHDuzjPaqNZaXvzklmFsaq7Z3Ukeygn6uCBpTebE4/edit?usp=sharing', 'https://api.informatics-expo.id/NgeYogya.png', 52, 9, 1, '2021-07-09 06:06:24', '2021-07-09 06:06:24'),
(25, 'BukuKas', '{\"blocks\":[{\"key\":\"2simo\",\"text\":\"BukuKas adalah aplikasi yang membantu pelaku pengusaha UMKM untuk mengetahui perkembangan usaha, menghitung keuntungan, menambah dan mengurangi jumlah atau stok barang, dapat memberi bukti tagihan (invoice) kepada pelanggan, serta dapat mencetak dan mengunduh laporan tarnsaksi.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BukuKas.jpeg', 'https://youtu.be/YfwrmQGd37w', 'https://drive.google.com/drive/folders/14K9nI9nUPThE5038uYQYgVZ7jE3NhdTQ', 'https://api.informatics-expo.id/BukuKas.jpeg', 55, 8, 1, '2021-07-09 06:09:06', '2021-07-09 07:06:33'),
(26, 'NgeYogya', '{\"blocks\":[{\"key\":\"6cum2\",\"text\":\"Ngeyogya merupakan sebuah aplikasi berbasis web yang dibuat untuk memenuhi kebutuhan para wisatawan domestik ataupun mancanegara agar dapat memilih tujuan wisata mereka secara integratif dan sistematis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"co55a\",\"text\":\"Aplikasi ini dibuat sedemikian rupa bukan saja untuk memenuhi keperluan pengguna wisatawan, tapi kami juga menyuguhkan beberapa tempat menarik di Yogya yang belum terekspos secara luas. Sebut saja seperti wisata alamnya yang masih jarang orang temui adalah Gumuk Pasir Parangkusumo, Blue Lagoon, Hutan Pinus Mangunan, Bukit Nglanggeran dan masih banyak lagi tempat yang jarang banyak orang tahu. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9nlbk\",\"text\":\"Maka dari itu kami menyajikan paket perjalanan wisata yang di dalamnya terdapat tempat wisata yang terkenal dan juga tempat wisata yang jarang disinggahi banyak orang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NgeYogya.png', 'https://youtu.be/SXcrGaLoFvs', 'https://docs.google.com/presentation/d/1oGBHDuzjPaqNZaXvzklmFsaq7Z3Ukeygn6uCBpTebE4/edit?usp=sharing', 'https://api.informatics-expo.id/NgeYogya.png', 56, 11, 1, '2021-07-09 06:23:36', '2021-07-09 07:20:20'),
(27, 'Tani.Spk', '{\"blocks\":[{\"key\":\"ar34q\",\"text\":\"Tani.Spk adalah aplikasi berbasis web yang mempermudah anda menjual dan membeli komoditas pertanian.Terdapat Fitur seperti :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"egnk7\",\"text\":\"Komoditas Populer untuk Rekomendasi Komoditas yang memudahkan anda untuk menjual hasil tani.\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e9q8s\",\"text\":\"Laman Pembelian yang memudahkan anda untuk membeli komoditas sesuai keinginan.\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tani.Spk.jpeg', 'https://www.youtube.com/watch?v=jMMPkNa_EjA', '', 'https://api.informatics-expo.id/Tani.Spk.jpeg', 57, 8, 1, '2021-07-09 06:33:57', '2021-07-09 06:33:57'),
(28, 'UMKM SIP', '{\"blocks\":[{\"key\":\"3u0ga\",\"text\":\"Aplikasi ini merupakan aplikasi berbasis web untuk membantu mempromosikan danmemantau perkembangan umkm dari pemasukan tiap bulannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UMKM SIP.jpeg', 'https://youtu.be/BryJJ4sO1JM', 'https://docs.google.com/presentation/d/1mLpLbmpPnHIbwsebpgtMTvFd5902GsUXaVzIZoFbMuQ/edit?usp=sharing', 'https://api.informatics-expo.id/UMKM SIP.jpeg', 37, 11, 1, '2021-07-09 06:51:24', '2021-07-09 13:19:50'),
(29, 'Wear Your Mask', '{\"blocks\":[{\"key\":\"e0m8e\",\"text\":\"Short movie berjudul Wear Your Mask yang menjelaskan tentang pentingnya menggunakan masker dan mematuhi protokol kesehatan agar angka covid di indonesia tidak melunjak. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Wear Your Mask.png', 'https://youtu.be/8wH319OgpSY', 'https://www.slideshare.net/AzkaNabilah/wear-your-mask-by-rza-entertainment', 'https://api.informatics-expo.id/Wear Your Mask.png', 48, 4, 1, '2021-07-09 06:52:16', '2021-07-10 11:10:21'),
(134, 'Manajemen Hotel', '{\"blocks\":[{\"key\":\"9fihb\",\"text\":\"Sistem yang akan memberikan informasi hotel berupa dashboard yang sehingga memudahkan pihak manajemen hotel terutama executive untuk menentukan keputusan terhadap keadaan hotel yang dapat meningkatkan keuntungan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":212,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":212,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":212,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Manajemen Hotel.png', 'https://youtu.be/5Wd9WP469JY', 'https://drive.google.com/file/d/1SdiHedAh-Bfqi_sBUNMomT1d6M-brmQE/view?usp=sharing', 'https://api.informatics-expo.id/Manajemen Hotel.png', 198, 9, 1, '2021-07-09 16:42:02', '2021-07-11 10:31:52'),
(30, 'COMMA', '{\"blocks\":[{\"key\":\"5j3nm\",\"text\":\"Comma merupakan sistem informasi berbasis web yang bertujuan untuk membantu mahasiswa untuk menemukan UKM yang sesuai minat masing-masing dengan melihat informasi yang tersedia di dalam sistem ini. Aplikasi ini juga bertujuan untuk membantu mahasiswa dalam menentukan keputusan untuk bergabung ke ukm yang mahasiswa minati.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'COMMA.png', 'https://youtu.be/vHvRrqoUCnc', 'https://docs.google.com/presentation/d/18DSyxVqPmPmsE2F7yt_IfQn3ldCLGWSI-ca4FvpmiUA/edit?usp=sharing', 'https://api.informatics-expo.id/COMMA.png', 63, 4, 1, '2021-07-09 07:10:38', '2021-07-09 07:10:38'),
(31, 'Kisah Budi : Sholat', '{\"blocks\":[{\"key\":\"dr1ud\",\"text\":\"Cerita ini di utamakan terhadap pertanyaan diatas \\\"Mengapa Kita Harus Sholat ?\\\" yang akan dijelaskan oleh Bapak dari karakter bernama Budi. untuk animasi ini kita memakai narasi antar karakter, dan beberapa soundtrack adzan, sholat, dan langkah kaki. Di cerita ini Budi masih berusia awal-awal masuk remaja jadi dia ingin mengetahui mengapa orang harus Sholat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":360,\"style\":\"color-rgb(13,13,13)\"},{\"offset\":0,\"length\":360,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":360,\"style\":\"fontsize-15\"},{\"offset\":0,\"length\":360,\"style\":\"fontfamily-Roboto, Noto, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kisah Budi : Sholat.png', 'https://youtu.be/_0qeQ6KCOhA', 'https://docs.google.com/presentation/d/1-zXezJfKamTsyapDdQRsoa5tIsOYhN7YE2LnxU6oGmw/edit?usp=sharing', 'https://api.informatics-expo.id/Kisah Budi : Sholat.png', 66, 6, 1, '2021-07-09 07:13:24', '2021-07-09 07:24:31'),
(32, 'UKM Kita', '{\"blocks\":[{\"key\":\"9erkv\",\"text\":\"UKM Kita adalah Aplikasi e-commerce untuk melakukan pembelian dan penjualan produk-produk UKM, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya aplikasi UKM Kita, penjualan produk - produk UKM menjadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat dan para pembeli yang menginginkan suatu barang tetapi tidak tersedia di daerah tempat tinggalnya dapat melakukan pembelian melalui aplikasi ini.   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":441,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":0,\"length\":442,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'UKM Kita.jpeg', 'https://youtu.be/E69YcchhzsY', 'https://docs.google.com/presentation/d/1bm0lyub9lPmSPiHINchR9lFKtHyrRurk_AcnVHxthzM/edit?usp=sharing', 'https://api.informatics-expo.id/UKM Kita.jpeg', 69, 8, 1, '2021-07-09 07:34:32', '2021-07-09 07:34:32'),
(33, 'Animasi Dakwah Islam : Keutamaan Sholat', '{\"blocks\":[{\"key\":\"2krq6\",\"text\":\"Tugas besar matkul Grafika dan Multimedia.\\nAnimasi menggunakan Processing dengan tema : Dakwah Islam.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Dakwah Islam : Keutamaan Sholat.jpeg', 'https://www.youtube.com/watch?v=BsZXBBmU7FA', '', 'https://api.informatics-expo.id/Animasi Dakwah Islam : Keutamaan Sholat.jpeg', 70, 4, 1, '2021-07-09 07:43:54', '2021-07-09 07:43:54'),
(34, 'CTIKET', '{\"blocks\":[{\"key\":\"d4un9\",\"text\":\"CTIKET merupakan aplikasi berbasis web yang dikembangkan untuk mempermudah kamu dalam hal mencari tiket hiburan. Kami akan membantu kamu dalam menemukan acara atau event yang up-to-date dengan harga yang pas dikantong anda. Dengan menggunakan CTIKET, kamu dapat memesan tiket dalam situasi apapun. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CTIKET.png', 'https://www.youtube.com/watch?v=fDWM_zYJ5Aw', 'https://www.canva.com/design/DAEjrt6WMV4/xV8HKdTPBPe4RHVeaPXNLw/view?utm_content=DAEjrt6WMV4&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/CTIKET.png', 71, 17, 1, '2021-07-09 07:54:50', '2021-07-09 07:54:50'),
(35, 'Connecting: SIE Manajemen RS Hewan', '{\"blocks\":[{\"key\":\"17r4n\",\"text\":\"Sistem Informasi Eksekutif (SIE) yang akan membantu pihak manajerial RS Hewan dalam menganalisis proses bisnis yang terjadi di dalam. Dengan melihat dashboard yang berisi berbagai iformasi dari database RS Hewan pihak manajer akan dengan mudah untuk melihat perkembangan RS Hewan. Tersedia berbagai visualisasi yang memudahkan pihak manajer untuk membuat keputusan nya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Connecting: SIE Manajemen RS Hewan.jpeg', 'https://youtu.be/EVOvV4pz86Q', 'https://www.canva.com/design/DAEjn3xdztY/T72HBkeJ-4-woG7B3Anesw/view?utm_content=DAEjn3xdztY&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/Connecting: SIE Manajemen RS Hewan.jpeg', 72, 9, 1, '2021-07-09 08:03:41', '2021-07-09 15:27:15'),
(36, 'Nasehat kucing gemoy', '{\"blocks\":[{\"key\":\"75nsh\",\"text\":\"Merupakan video animasi mengenai edukasi dari kucing lucu mengenai covid-19\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nasehat kucing gemoy.jpeg', 'https://www.youtube.com/watch?v=u3vS8nYKNho&ab_channel=keebsnvalor', 'https://drive.google.com/file/d/1s0SxNz7dGr5wAOuYJb2KX2YZx2mBZ2Nr/view?usp=sharing', 'https://api.informatics-expo.id/Nasehat kucing gemoy.jpeg', 45, 3, 1, '2021-07-09 08:10:39', '2021-07-09 13:35:15'),
(37, 'Lapakku', '{\"blocks\":[{\"key\":\"588lh\",\"text\":\"Lapakku adalah suatu sistem perangkat lunak untuk mempermudah \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7j5kg\",\"text\":\"pemilik UKM dalam memasarkan dan menjual produk nya agar \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"527oo\",\"text\":\"dapat terlihat oleh masyarakat luas sehingga meningkatkan omset \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"81guv\",\"text\":\"penjualan UKM tersebut.Aplikasi ini dibuat untuk memenuhi tugas akhir semester 2 Informatika UII.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lapakku.jpeg', 'https://www.youtube.com/watch?v=c6Tl9tCMTHA&ab_channel=PRADIPTAPUTRAABIMATA', 'https://www.figma.com/proto/JaTFCaZrYMFNsculZRnWaG/LAPAKKU-(LERES)?page-id=0%3A1&node-id=1%3A2&viewport=-181%2C-1146%2C0.44999998807907104&scaling=min-zoom', 'https://api.informatics-expo.id/Lapakku.jpeg', 75, 8, 1, '2021-07-09 08:23:05', '2021-07-09 08:23:05'),
(38, 'Li-Box', '{\"blocks\":[{\"key\":\"frkl9\",\"text\":\"Li-Box adalah aplikasi berbasis desktop dan web untuk berbagi ide bisnis UKM. Li-Box hadir untuk mempertemukan masyarakat yang memiliki ide bisnis UKM dengan yang siap menjalankan bisnis UKM. Melalui Li-Box, pemberi ide bisnis dan pelaku UKM dapat saling berdiskusi mengenai suatu ide bisnis. Dengan ini diharapkan ide bisnis UKM dapat terealisasikan sehingga dapat menggerakkan roda perekonomian masyarakat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"181qc\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Li-Box.png', 'https://www.youtube.com/watch?v=TUHKwZ9Lx6g', 'https://bit.ly/Li-Box', 'https://api.informatics-expo.id/Li-Box.png', 18, 8, 1, '2021-07-09 08:31:01', '2021-07-09 08:31:01'),
(39, 'Malam Lailatul Qadar', '{\"blocks\":[{\"key\":\"skm5\",\"text\":\"Malam Lailatul Qadar adalah malam yang mulia, penuh keberkahan dan kemuliaan.  Malam Lailatul Qadar juga disebut sebagai malam yang lebih baik dari 1000 bulan.  Pada malam ini, Allah menurunkan Alqur\'an dari Lauful Mahfudzs ke Baitul Izzah (langit) dunia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malam Lailatul Qadar.png', 'https://www.youtube.com/watch?v=b4wqdKbmFwo', 'https://drive.google.com/file/d/1f1qbSdyK8u4Z7I35ccrhmPVevWZnGlNY/view?usp=sharing', 'https://api.informatics-expo.id/Malam Lailatul Qadar.png', 77, 4, 1, '2021-07-09 08:40:21', '2021-07-09 08:40:21'),
(40, 'CRAFT.IT', '{\"blocks\":[{\"key\":\"79j8e\",\"text\":\"Craft.IT adalah aplikasi karya mahasiswa UII yang berfokus pada\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f0d0h\",\"text\":\"bidang Kerajinan tangan lokal. Aplikasi ini menyediakan layanan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"20n91\",\"text\":\"informasi seputar kerajinan tangan , jual beli Produk dan pendataan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8710a\",\"text\":\"transaksi penjualan.Aplikasi ini sangan cocok untuk UKM kecil\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b32e3\",\"text\":\"maupun besar dan masyarakat umum\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CRAFT.IT.jpeg', 'https://www.youtube.com/watch?v=gClclIPRi0k', 'https://drive.google.com/file/d/1M7fPY_pB0n0F_n3PXFppnqo9urUv5YTW/view?usp=sharing', 'https://api.informatics-expo.id/CRAFT.IT.jpeg', 59, 12, 1, '2021-07-09 08:45:43', '2021-07-09 08:45:43'),
(41, 'The EatDucation', '{\"blocks\":[{\"key\":\"eiu9l\",\"text\":\"The EatDucation adalah sebuah animasi 2D yang mengajarkan kepada kita semua tentang adab-adab makan dalam ajaran agama islam, dari makan tidak boleh sambil berdiri dan lainnya. Diharapkan animasi kami dapat menginspirasi kita semua dan menyadari betapa pentingnya adab makan itu\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'The EatDucation.png', 'https://s.id/TheEATducation', '', 'https://api.informatics-expo.id/The EatDucation.png', 15, 4, 1, '2021-07-09 09:02:31', '2021-07-09 09:05:18'),
(42, 'Tone.', '{\"blocks\":[{\"key\":\"cvaat\",\"text\":\"Tone adalah penyedia lapak online yang menjual barang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2dh3c\",\"text\":\" dari UKM kecil di daerah yang produk  nya berkuialitas \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3rpmh\",\"text\":\"tetapi jarang di lirik oleh masyarakat luas, maka dari itu kami\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3blrm\",\"text\":\"membantu memasarkan produk - produk UKM tersebut , \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"auppr\",\"text\":\"dan akan fokus memajukan UKM agar bisa dikenal seluruh Indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tone..png', 'https://www.youtube.com/watch?v=RYtL0V0sy8w', 'https://drive.google.com/file/d/158sZgHarHa6H6Eo8jhrIrnoXdAc1QQfI/view?usp=sharing', 'https://api.informatics-expo.id/Tone..png', 82, 8, 1, '2021-07-09 09:59:19', '2021-07-09 09:59:19'),
(43, 'Ez Way', '{\"blocks\":[{\"key\":\"848at\",\"text\":\"EZ Way meruapakan penyedia jasa tutor yang membatu siswa dan mahasiswa dalam mengerjakan tugasnya. Siswa dan mahasiswa dapat mengajukan permohonan untuk menyelesaikan tugasnya. Selain itu, siswa dan mahasiswa juga dapat menjad itutor tugas yang telah diajukan oleh siswa dan mahsiswa lainnya. Terdapat kategori tugas yang dapat diajukan sesuai tingkatannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4u2gc\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Ez Way.jpeg', 'https://youtu.be/IUslEsV-K5w', 'https://docs.google.com/presentation/d/1Qod5c2a8U0-vydrI-8jMIyh7S6BQ3Fc2DBAurqBtl-c/edit?usp=sharing', 'https://api.informatics-expo.id/Ez Way.jpeg', 30, 4, 1, '2021-07-09 10:27:45', '2021-07-09 10:27:45'),
(154, 'BISA(Business Idea Sharing Application)', '{\"blocks\":[{\"key\":\"cc7q7\",\"text\":\"Aplikasi ini dapat digunakan untuk para pemilik ide bisnis yang ingin menyalurkan idenya(pencetus ide) dan dapat di gunakan untuk para pencari ide bisnis(investor). Di aplikasi ini dapat melihat grafik ide bisnis yang telah tersedia di dalam aplikasi, melihat perkembangan ide melalui grafik, memasukan ide bisnis yang anda punya, mencari artikel untuk referensi ide bisnis anda, dan mencari ide bisnis yang anda inginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISA(Business Idea Sharing Application).png', 'https://youtu.be/yJO7qlYivGw', 'https://linktr.ee/agrifaldy', 'https://api.informatics-expo.id/BISA(Business Idea Sharing Application).png', 224, 8, 1, '2021-07-10 09:54:13', '2021-07-10 09:54:13'),
(45, 'Wisata Budaya', '{\"blocks\":[{\"key\":\"d127d\",\"text\":\"Indonesia memiliki kekayaan budaya yang sangat beragam. Kondisi geografis di Indonesia yang berbentuk kepulauan menjadi salah satu faktor adanya perbedaan budaya. Namun, sebagai penduduk dan warga negara Indonesia, sudahkah kamu mengenal seluruh kekayaan budayanya? Yuk, jalan-jalan bareng Wulan agar wawasan kebudayaan Indonesia kita bisa bertambah ;)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Wisata Budaya.jpeg', 'https://youtu.be/_JPfQ9cF-PM', '', 'https://api.informatics-expo.id/Wisata Budaya.jpeg', 89, 4, 1, '2021-07-09 10:38:35', '2021-07-09 10:38:35'),
(46, 'Kisah Putra & Putri', '{\"blocks\":[{\"key\":\"42l8c\",\"text\":\"alkisah siputra tanpa sengaja bertemu dengan sipujaan hatinya, yaitu siputri. siputra pun mengajak siputri untuk mengobrol tak lama kemudian siputri menanyakan tentang vaksinisasi covid.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kisah Putra & Putri.png', 'https://youtu.be/4Kyo6G2LkrE', '', 'https://api.informatics-expo.id/Kisah Putra & Putri.png', 16, 18, 1, '2021-07-09 10:40:37', '2021-07-10 01:10:49'),
(526, 'UII Student Employment', '{\"blocks\":[{\"key\":\"fo53i\",\"text\":\"UII Student Employment merupakan platform yang menyediakan ruang bagi mahasiswa untuk mencari/menemukan rekan kompetisi akademik. Selain itu, platform ini juga menjadi ruang lowongan kerja part-time/full time di lingkungan kampus bagi mahasiswa.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UII Student Employment.jpeg', '', 'https://github.com/ilham-2001/unisi_pt', 'https://api.informatics-expo.id/UII Student Employment.jpeg', 836, 17, 4, '2023-01-13 11:25:01', '2023-01-13 11:25:01'),
(48, 'AkuTemanmu', '{\"blocks\":[{\"key\":\"1imki\",\"text\":\"AkuTemanmu merupakan penyedia layanan konseling bagi mereka yang membutuhkan teman bercerita, berbagi masalah dan pastinya berdamai dengan diri sendiri. Melalui website AkuTemanmu, calon pasien dapat melakukan pendaftaran secara online dan menentukan jadwal konseling secara praktis. Sistem dari website AkuTemanmu juga diperuntukkan mempermudah manajemen klinik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AkuTemanmu.png', 'https://youtu.be/UFHLlRb5ptA', 'https://drive.google.com/file/d/1RaR4bjYAcwOGDnJm1eOUCM4Wd6rOpz0P/view?usp=sharing', 'https://api.informatics-expo.id/AkuTemanmu.png', 88, 3, 1, '2021-07-09 11:04:41', '2021-07-09 11:04:41'),
(49, 'UKM-Blog', '{\"blocks\":[{\"key\":\"e5pru\",\"text\":\"Ide yang berawal dari seorang mahasiswa yang kesulitan dalam mencari informasi UKM,  serta keanggotaan UKM yang berada pada kondisi kesulitan untuk mencari regenerasi keanggotaannya. Oleh karena itu, UKM-Blog hadir mewadahi seluruh kegiatan UKM untuk meningkatkan aktivitas dan produktifitas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKM-Blog.png', 'https://www.youtube.com/watch?v=pButCdqcLTE', 'https://bit.ly/3qZ6ZeF', 'https://api.informatics-expo.id/UKM-Blog.png', 86, 17, 1, '2021-07-09 11:09:08', '2022-01-01 03:46:39'),
(50, 'Abdul & Timin : Menatap Langit', '{\"blocks\":[{\"key\":\"c11nt\",\"text\":\"Sinopsis : Alkisah terdapat seorang pemuda yang bernama Abdul, Abdul adalah orang yang suka mengeluh karena tidak punya uang. Abdul sering bergumam kenapa tidak kunjung diberi rizki oleh Allah SWT. Abdul sering iri melihat tetangganya yang bernama Kanjeng Nani karena Kanjeng Nani adalah orang terkaya di desa tersebut. Suatu hari Abdul melihat seorang pemulung dari desa sebelah yang bernama Timin. Akibat dari pertemuan itulah hati Abdul terbuka dan merubah cara pandangnya terhadap dunia. Jangan lah terlalu menatap langit (menginginkan hal lebih) sampai lupa menginjak tanah (bersyukur).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Abdul & Timin : Menatap Langit.png', 'https://youtu.be/8d1VNaNgG88', 'https://docs.google.com/presentation/d/1TSCt_pDsBw2Krx2rbFFxmkb9tclX321dqWNbxbWjvJ8/edit?usp=sharing', 'https://api.informatics-expo.id/Abdul & Timin : Menatap Langit.png', 87, 4, 1, '2021-07-09 11:26:03', '2021-07-09 15:07:19'),
(51, 'SIDOTI', '{\"blocks\":[{\"key\":\"c5o81\",\"text\":\"SIDOTI adalah sebuah sistem informasi yang dibuat khusus untuk para produsen roti. Di SIDOTI, terdapat grafik yang memudahkan produsen roti dalam menghitung hasil penjualan, memudahkan penjualan per pabrik, dan masih banyak lagi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":229,\"style\":\"color-rgb(34,34,34)\"},{\"offset\":0,\"length\":229,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":229,\"style\":\"fontfamily-consolas, \\\"lucida console\\\", \\\"courier new\\\", monospace\"},{\"offset\":0,\"length\":229,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":6,\"style\":\"BOLD\"},{\"offset\":86,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SIDOTI.png', 'https://youtu.be/Z1WzOJjs688', 'https://www.canva.com/design/DAEjm7uAPbM/4ku6kDXRCd8huaBMvz3wZA/view?utm_content=DAEjm7uAPbM#3', 'https://api.informatics-expo.id/SIDOTI.png', 21, 9, 1, '2021-07-09 11:36:37', '2021-07-09 11:36:37'),
(52, 'Tele - Sistem Informasi Ternak Lele', '{\"blocks\":[{\"key\":\"9n1kj\",\"text\":\"Tele adalah sistem informasi yang diperuntukan bagi para peternak lele dengan berbasis web diharapkan nya tele dapat berguna untuk memudahkan peternak, dalam mengelola dan memantau perkembangan ikan lele hanya dengan menggunakan aplikasi saja.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tele - Sistem Informasi Ternak Lele.jpeg', 'https://www.youtube.com/watch?v=LpCFppWiVN4&feature=youtu.be', 'https://drive.google.com/file/d/1EgP5Uo2LKSw6M70tJGhX-8PV4TW2Tei5/view', 'https://api.informatics-expo.id/Tele - Sistem Informasi Ternak Lele.jpeg', 97, 10, 1, '2021-07-09 11:39:07', '2021-07-09 11:48:21'),
(158, 'Tele - Sistem Informasi Ternak Lele', '{\"blocks\":[{\"key\":\"1ha4u\",\"text\":\"Tele adalah sistem informasi yang diperuntukan bagi para peternak lele dengan berbasis web diharapkan nya tele dapat berguna untuk memudahkan peternak, dalam mengelola dan memantau perkembangan ikan lele hanya dengan menggunakan aplikasi saja.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c9etr\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tele - Sistem Informasi Ternak Lele.jpeg', 'https://www.youtube.com/watch?v=LpCFppWiVN4&feature=youtu.be', 'https://drive.google.com/file/d/1EgP5Uo2LKSw6M70tJGhX-8PV4TW2Tei5/view', 'https://api.informatics-expo.id/Tele - Sistem Informasi Ternak Lele.jpeg', 235, 9, 1, '2021-07-12 07:54:43', '2021-07-12 07:54:43'),
(150, 'B.I.O.T (Buy In One Tap)', '{\"blocks\":[{\"key\":\"5cudn\",\"text\":\"B.I.O.T sendiri kepanjangan dari buy in one tap, Platform penghubung antara penjual dan pembeli produk UKM adalah platform berbasis aplikasi dan web sebagai penghubung antara penjual dan pembeli produk UKM. Sistem ini berperan sebagai lapak bagi para penjual produk UKM. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":270,\"style\":\"color-rgb(255,255,255)\"},{\"offset\":0,\"length\":270,\"style\":\"bgcolor-rgb(42,57,144)\"},{\"offset\":0,\"length\":270,\"style\":\"fontsize-18pt\"},{\"offset\":0,\"length\":270,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'B.I.O.T (Buy In One Tap).jpeg', 'https://youtu.be/5cvCwZ2jXJk', 'https://docs.google.com/presentation/d/1G0yoWDv5dR1gZsn3ZeXuWPc2WOXlhZ4KtQxMK2icawE/edit?usp=sharing', 'https://api.informatics-expo.id/B.I.O.T (Buy In One Tap).jpeg', 219, 8, 1, '2021-07-10 05:33:10', '2021-07-10 05:56:31'),
(55, 'Balasan Sedekah', '{\"blocks\":[{\"key\":\"bunir\",\"text\":\"            \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":120,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":120,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-35\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"17g9k\",\"text\":\"Sesungguhnya orang-orang yang bersedekah baik laki-laki maupun perempuan dan meminjamkan kepada Allah dengan pinjaman yang baik, akan dilipatgandakan (balasannya) bagi mereka; dan mereka akan mendapat pahala yang mulia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":219,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":219,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"5hdtq\",\"text\":\"QS. Al-Hadid Ayat 18 \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":20,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":20,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Balasan Sedekah.jpeg', 'https://youtu.be/ynnyHw5H6o8', 'https://github.com/wahyucandra30/Processing-Balasan-Sedekah.git', 'https://api.informatics-expo.id/Balasan Sedekah.jpeg', 91, 4, 1, '2021-07-09 11:47:37', '2021-07-09 13:41:40'),
(56, 'SmartR+', '{\"blocks\":[{\"key\":\"80tcj\",\"text\":\"Menurut laporan Boston Consulting Group pada tahun 2013, saat ini ada sekitar 74 juta MAC (Kelas Menengah dan Konsumen Makmur) di Indonesia, dan itu akan berlipat ganda pada tahun 2020 sampai dengan 141 juta orang. Meningkatnya gaya hidup terutama di perkotaan adalah salah satu faktor meningkatnya permintaan konsumsi masyarakat. Orang-orang lebih memilih untuk membeli makan di restoran dibandingkan memasak di rumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ch9qj\",\"text\":\"Dalam rangka meningkatkan kualitas pelayanan restoran yang lebih baik di masa pandemi sekarang dan juga seiring dengan adanya perkembangan teknologi, maka dari itu kami memberikan sebuah inovasi yang melibatkan perkembangan teknologi dengan menciptakan sebuah sistem sebagai bagian dari peningkatan kualitas pelayanan. Sistem ini nantinya akan memudahkan para pelanggan dalam melakukan order, transaksi, dan lain-lain. SmartR+ ini akan menekankan self service dalam segi pelayanan bagi pelanggannya agar kegiatan makan di restoran tetap aman walaupun sedang di era pandemi ini karena meminimalisir interaksi antara pelanggan dan pelayan restoran secara langsung serta juga bisa membiasakan orang-orang untuk menggunakan teknologi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SmartR+.png', 'https://youtu.be/l0D_H8gAtxY', 'https://www.slideshare.net/IINNURINTANSAFITRI/levitate-249672014', 'https://api.informatics-expo.id/SmartR+.png', 104, 3, 1, '2021-07-09 11:47:50', '2021-07-09 12:13:00');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(57, 'E-Vent', '{\"blocks\":[{\"key\":\"3onkn\",\"text\":\"E-Vent adalah aplikasi web untuk mencari dan membeli tiket event. Pengguna dapat mendaftar sebagai pengunjung yang mencari event atau sebagai Event Organizer (EO) yang menyediakan event. Aplikasi kami memudahkan pengunjung untuk mencari tipe event yang diinginkan. Untuk para EO, aplikasi kami memberikan statistik sales tiket yang terjual di setiap event. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":356,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":356,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":356,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":356,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-Vent.png', 'https://www.youtube.com/watch?v=WPJwOQvo1pc', 'https://docs.google.com/presentation/d/1pzahkoowqiIAgcuEMJkuDejdhP5MZwYZvH8N0cVG5HI/edit#slide=id.g1f87997393_0_1544', 'https://api.informatics-expo.id/E-Vent.png', 107, 17, 1, '2021-07-09 11:56:37', '2021-07-10 08:06:50'),
(58, 'Museum', '{\"blocks\":[{\"key\":\"1l4ls\",\"text\":\"Mendegar kata museum terlintas sesuatu yang kuno dan tua, bahkan cenderung tidak menarik. Baik bagi anak-anak maupun orang dewasa enggan berkunjung ke museum. Bila ada beberapa siswa berkunjung ke suatu museum, biasanya karena tugas dari sekolah atau sekedar melengkapi paket wisata pada suatu kegiatan rekreasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"785oj\",\"text\":\"Meskipun masih ada komunitas anak muda atau kelompok yang gemar berkunjung ke beberapa museum, namun jumlahnya tidaklah banyak.Maka dari itu kita mengajak para mahasiswa dan mahasiswi untuk lebih mengenal tentang adanya museum.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Musuam Kita Bersama.png', 'https://www.youtube.com/watch?v=3hI0IPx6Eog', '', 'https://api.informatics-expo.id/Musuam Kita Bersama.png', 101, 4, 1, '2021-07-09 11:59:27', '2021-07-10 04:07:38'),
(59, 'MOUI - Mountain Information', '{\"blocks\":[{\"key\":\"2p4e4\",\"text\":\"Mountain Information yaitu sebuah aplikasi berbasis web yang menyediakan informasi mengenai gunung, SOP pendakian, serta ulasan mengenai gunung yang anda kunjungi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":163,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":163,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":163,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MOUI - Mountain Information.png', 'https://youtu.be/V9j9YTrN_og', 'https://docs.google.com/presentation/d/1VDm7OVrwTochYWQz7XbIF7C4gcs8o50RESTrFnerTD8/edit?usp=sharing', 'https://api.informatics-expo.id/MOUI - Mountain Information.png', 109, 9, 1, '2021-07-09 12:06:15', '2021-07-10 12:57:31'),
(60, 'Sistem Benih Pak Malin', '{\"blocks\":[{\"key\":\"6crp3\",\"text\":\"Sistem Benih Pak Malin\",\"type\":\"header-one\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4cad\",\"text\":\"Pembibitan Benih Pak Malin merupakan suatu usaha yang bergerak di bidang  pertanian sebagai penyedia bibit sayuran siap tanam. Dalam proses transaksinya, masih dilakukan secara manual dalam pendataan sehingga sering terjadi kesalahan dalam menghitung pesanan bibit dari petani dikarenakan pesanan yang lupa di data ataupun transaksi yang belum dicatat. Pembibitan ini juga dilayani oleh karyawannya, sehingga tidak jarang ada karyawan yang mencari kesempatan dalam menyerahkan uang dan melaporkan transaksi yang tidak sesuai. Karyawan yang tidak jujur ini dapat mengambil keuntungan pribadi dalam setiap kesempatan transaksi. Ada pula masalah pendataan secara manual yaitu ketika membuat laporan di akhir bulan diperlukan waktu yang relatif lama. Selain itu dikarenakan proses yang masih dilakukan secara pembukuan, arsip yang disimpan tidak memiliki cadangan/back up. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":869,\"style\":\"color-rgb(48,42,37)\"},{\"offset\":0,\"length\":869,\"style\":\"fontfamily-YACgEXvxf8Q 0\\\", _fb_, auto\"},{\"offset\":0,\"length\":869,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a1ojf\",\"text\":\"Dari masalah yang telah diketahui, aplikasi sistem informasi manajemen kasir ini dapat membantu mengurangi kesalahan dalam penghitungan persediaan, mempersingkat waktu ketika transaksi serta membantu dalam proses arsip pembukuan yang lebih tertata dan memiliki pendataan lebih rinci. Dengan adanya sistem ini juga diharapkan dapat mengatasi karyawan agar tidak terjadi kecurangan dalam pelaporan hasil transaksi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":412,\"style\":\"color-rgb(48,42,37)\"},{\"offset\":0,\"length\":412,\"style\":\"fontfamily-YACgEXvxf8Q 0\\\", _fb_, auto\"},{\"offset\":0,\"length\":413,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem Benih Pak Malin.jpeg', 'https://www.youtube.com/watch?v=GlD3gpvOUQI', 'https://docs.google.com/presentation/d/1W2N7bEpSsuqBO96n0WeMVxfUBjB1Y_QhmVzsMzr10uE/edit?usp=sharing', 'https://api.informatics-expo.id/Sistem Benih Pak Malin.jpeg', 111, 8, 1, '2021-07-09 12:11:51', '2021-07-09 12:39:48'),
(63, 'INVESTHERE', '{\"blocks\":[{\"key\":\"f1b2o\",\"text\":\"InvestHere adalah sebuah aplikasi investasi UKM untuk para investor membeli atau menjual saham\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'INVESTHERE.jpeg', 'https://youtu.be/lg-wqaOxpjk', 'https://www.canva.com/design/DAEjoMxRNpk/WqBRT1vjRkh-LIv2Dq_80g/view?utm_content=DAEjoMxRNpk&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/INVESTHERE.jpeg', 24, 8, 1, '2021-07-09 12:19:42', '2021-07-09 12:19:42'),
(61, 'Jujur itu lebih baik', '{\"blocks\":[{\"key\":\"3g8cv\",\"text\":\"Menceritakan seorang anak laki-laki bernama Doddy yang mencuri karena mendapatkan kesempatan, dan pembelajaran yang dialaminya karena konfrontasi seorang anak perempuan bernama Dinda.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Jujur itu lebih baik.png', 'https://youtu.be/iPiVRKHKkH4', 'https://docs.google.com/presentation/d/1jDurprcF_p_LbIJlKp6GgMSf_D-CNjErOZndfmCTot8/edit?usp=sharing', 'https://api.informatics-expo.id/Jujur itu lebih baik.png', 83, 16, 1, '2021-07-09 12:12:43', '2021-07-09 12:12:43'),
(62, 'Manasik Haji', '{\"blocks\":[{\"key\":\"9eku\",\"text\":\"Kami membuat tema manasik haji dengan alasan agar kita bisa memberi pengetahuan yang lebih dalam untuk teman-teman yang belum tau atau belum banyak mengetahui tentang manasik haji. Selain itu memperlajari manasik haji juga sangat bermanfaat untuk kita semua di kemudian hari. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":275,\"style\":\"color-rgb(57,57,57)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Manasik Haji.jpeg', 'https://youtu.be/OkdPjZKWSYM', 'https://github.com/AryaGemilangDevaP19523008/TubesGrafmul', 'https://api.informatics-expo.id/Manasik Haji.jpeg', 79, 4, 1, '2021-07-09 12:13:41', '2021-07-09 14:23:41'),
(64, 'BaliMall', '{\"blocks\":[{\"key\":\"b97la\",\"text\":\"BaliMall merupakan suatu sistem perangkat lunak E-commerce Marketplace yang berfungsi sebagai penyedia fasilitas lapak dagang untuk pemilik UKM yang ada di Bali agar dapat memasarkan produk nya. Aplikasi ini dibuat untuk memenuhi tugas akhir semester 2.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BaliMall.jpeg', 'https://youtu.be/uD-i1UifMHM', 'https://drive.google.com/file/d/10OgqgZRO2Ajah1zsH518Cw0zfhhkufnM/view?usp=sharing', 'https://api.informatics-expo.id/BaliMall.jpeg', 115, 8, 1, '2021-07-09 12:22:16', '2021-07-09 12:22:16'),
(65, 'SDVFlood', '{\"blocks\":[{\"key\":\"73g1b\",\"text\":\"SDVFlood adalah sebuah aplikasi berbasis web yang menyajikan berita terkini mengenai banjir di region Jakarta, aplikasi ini juga memiliki fitur untuk memantau pasang surut air di hulu maupun laut, dan juga memiliki fitur simulasi mencegah dan menanggulangi bencana banjir. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":272,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":272,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":272,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":272,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":272,\"style\":\"fontfamily-inherit\"},{\"offset\":95,\"length\":6,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SDVFlood.png', 'https://www.youtube.com/watch?v=6wNnDdQEsZk&t=7s', '', 'https://api.informatics-expo.id/SDVFlood.png', 116, 19, 1, '2021-07-09 12:26:24', '2021-07-09 12:26:24'),
(66, 'Sholat Sejak Dini', '{\"blocks\":[{\"key\":\"3nhp4\",\"text\":\"Animasi yang diproduksi oleh GAP TECH mengisahkan kakak beradik Namun, suatu hari Ammar tidak mengikuti perintah Allah. Animasi ini memberi pesan kepada penonton untuk wajib mengikuti perintah Allah yaitu Sholat. Walaupun Ammar belum wajib solat, mengajarinya solat sejak dini membuat anak lebih terbiasa mengerjakan solat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":212,\"style\":\"fontsize-13\"},{\"offset\":213,\"length\":110,\"style\":\"fontsize-13\"},{\"offset\":0,\"length\":212,\"style\":\"fontfamily-Helvetica Neue\"},{\"offset\":213,\"length\":110,\"style\":\"fontfamily-Helvetica Neue\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"cogtj\",\"text\":\"Karakter: Ammar, Amira, dan Bunda\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":33,\"style\":\"fontsize-13\"},{\"offset\":0,\"length\":33,\"style\":\"fontfamily-Helvetica Neue\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sholat Sejak Dini.png', 'https://youtu.be/FA8Ft0BAGFI', 'https://docs.google.com/presentation/d/1BM62V6FeVV7hrtqy7CtZqvk8MfutsG_fEhKMvnePWuo/edit?ts=60b4f898#slide=id.gd030f22b84_0_15', 'https://api.informatics-expo.id/Sholat Sejak Dini.png', 112, 1, 1, '2021-07-09 12:29:52', '2021-07-09 12:29:52'),
(67, 'Sleepy', '{\"blocks\":[{\"key\":\"e4l46\",\"text\":\"Sleepy adalah sebuah perangkat lunak berbasis web berfungsi untuk melakukan administrasi tamu hotel/pendaftaran layanan hotel. Dengan perangkat lunak ini diharapkan resepsionis hotel berkerja dengan lebih efisien dan memudahkan pendaftaran bagi tamu hotel.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Sleepy.jpeg', 'https://www.youtube.com/watch?v=XJxcP36ALJw', 'https://docs.google.com/presentation/d/1zNfbINKd9sCA8jQScLdw039nf9_NoC9HV8oOErQXp40/edit#slide=id.p', 'https://api.informatics-expo.id/Sleepy.jpeg', 127, 9, 1, '2021-07-09 12:37:28', '2021-07-09 12:37:28'),
(68, 'Pandemi Covid-19', '{\"blocks\":[{\"key\":\"e3p0i\",\"text\":\"Video animasi berisi penjelasan singkat mengenai Covid-19 beserta variannya, kasus Covid-19 yang terjadi di indonesia, gejala umum jika terinfeksi, dan cara pencegahan dengan penerapan 5M.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":188,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":188,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":188,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":188,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":188,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":188,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pandemi Covid-19.png', 'https://www.youtube.com/watch?v=SBQRk-9HwmM', 'https://drive.google.com/file/d/1YIsoWX36RT-Bc4kHpM10bmTXwt6Uw-4D/view', 'https://api.informatics-expo.id/Pandemi Covid-19.png', 128, 3, 1, '2021-07-09 12:40:34', '2021-07-09 12:40:34'),
(69, 'SIMPLE', '{\"blocks\":[{\"key\":\"bpe90\",\"text\":\"Sistem Informasi Pencarian Tempat Olahraga (SIMPEL) adalah suatu web yang bertujuan untuk memudahkan para pemain yang ingin menyewa lapangan dapat melihat dan memesan lapangan terlebih dahulu. Harapannya para pemain tidak perlu untuk datang langsung ke tempat penyewaan lapangan. Lalu untuk admin pengelola sistem yang bisa melihat statistik dari proses sewa tempat oleh para pemain dengan disajikan berupa grafik untuk membantu menentukan strategi yang tepat bagi sistem untuk kedepannya.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":279,\"style\":\"fontsize-12pt\"},{\"offset\":280,\"length\":209,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":279,\"style\":\"fontfamily-Times New Roman\\\", serif\"},{\"offset\":280,\"length\":209,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'SIMPLE.jpeg', 'https://youtu.be/9BPof-OYfIM', 'https://drive.google.com/file/d/1BoP9mddp2xRXUvXmkZ3hlnUAU6Bep-6t/view?usp=sharing', 'https://api.informatics-expo.id/SIMPLE.jpeg', 93, 8, 1, '2021-07-09 12:40:49', '2021-07-09 12:40:49'),
(70, 'UKMKita', '{\"blocks\":[{\"key\":\"c5r1d\",\"text\":\"UKMkita adalah aplikasi E-Commerce berbasis desktop khusus UKM-UKM yang ingin menjual produknya dan juga pembeli yang mencari kebutuhannya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":66,\"style\":\"color-rgb(62,57,112)\"},{\"offset\":67,\"length\":72,\"style\":\"color-rgb(62,57,112)\"},{\"offset\":0,\"length\":140,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"amdub\",\"text\":\"UKMKita berfungsi sebagai penyedia layanan pembelian dan penjualan produk-produk UKM antara penjual UKM dan pembeli. Pembelian produk-produk UKM dilakukan secara online dimana pembeli tidak harus datang ke toko penjual UKM. Selanjutnya barang diantarkan langsung oleh kurir. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":274,\"style\":\"color-rgb(62,57,112)\"},{\"offset\":0,\"length\":275,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKMKita.jpeg', 'https://youtu.be/u2Sf3AiCoxI', 'https://www.canva.com/design/DAEjno8yaUc/hlo3bepfqL73PrMCEVEBzA/view?utm_content=DAEjno8yaUc&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/UKMKita.jpeg', 117, 9, 1, '2021-07-09 12:42:34', '2021-07-09 12:47:23'),
(71, '|o| SIMOCA', '{\"blocks\":[{\"key\":\"t2l1\",\"text\":\"|o| SIMOCA (Sistem Monitoring Candi)  adalah suatu aplikasi berbasis web yang memperkenalkan dan memudahkan pengunjung domestik maupun internasional untuk eksplorasi Candi PT TWC. Terdapat empat fitur utama, yaitu: Info berupa deskripsi singkat dan sejarah mengenai candi, Gallery berupa dokumentasi foto candi untuk meningkatkan ketertarikan masyarakat, Ticketing berupa pemesanan tiket candi, serta Dashboard yang dapat diakses oleh admin untuk melihat data tiket, penjualan tiket tiga candi per hari dalam bentuk bar chart, serta total pemasukan tiket tiga candi dalam bentuk pie chart. So, what are you waiting for? Let\'s explore the temples and book your ticket with |o| SIMOCA!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":672,\"length\":11,\"style\":\"BOLD\"},{\"offset\":12,\"length\":23,\"style\":\"ITALIC\"},{\"offset\":516,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":579,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":590,\"length\":81,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', '|o| SIMOCA.png', 'https://youtu.be/xtnAnDXlfj0', 'https://www.canva.com/design/DAEjgrgxO80/J4Uv2aVIj3mse0zm5hNjYg/view?utm_content=DAEjgrgxO80&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/|o| SIMOCA.png', 62, 8, 1, '2021-07-09 12:47:04', '2021-07-09 12:47:04'),
(72, 'Di-Buka', '{\"blocks\":[{\"key\":\"aod7q\",\"text\":\"Di-Buka atau Digital Buku Akuntansi merupakan sistem yang dibuat untuk mengatasi pengelolaan keuangan UKM yang memiliki fungsi untuk mencatat keluar masuk barang dagangan, pendapatan, pengeluaran, dan menghitung seberapa banyak keuntungan yang diperoleh.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Di-Buka.png', 'https://www.youtube.com/watch?v=3JrYm5kO9FY', 'https://farhannovan.com/di-buka', 'https://api.informatics-expo.id/Di-Buka.png', 125, 9, 1, '2021-07-09 12:50:31', '2022-02-03 06:39:01'),
(75, 'Dosa Terbesar', '{\"blocks\":[{\"key\":\"4rh6e\",\"text\":\"Dosa Terbesar adalah cerita di mana seorang pemuda bernama Dalal. Dia menganggap semua dosa itu ringan asal dia tidak melakukan dosa yang dia anggap dosa terbesar yaitu makan babi. Dalal tidak tahu apa yang akan menanti dia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Dosa Terbesar.png', 'https://youtu.be/57o5SqPSwRg', 'https://docs.google.com/presentation/d/1V6pyssFMZ5VvZQO6efkk9j-CgkME4WsCTYVF2fqHFJI/edit?usp=sharing', 'https://api.informatics-expo.id/Dosa Terbesar.png', 134, 4, 1, '2021-07-09 13:00:49', '2021-07-09 13:00:49'),
(73, 'Bestnis', '{\"blocks\":[{\"key\":\"4id08\",\"text\":\"Bestnis merupakan suatu perangakat lunak untuk mencari macam ide bisnis bagi para\\npengusaha muda untuk memulai bisnis barunya serta sarana bagi para enterprenuer\\nuntuk membagikan ide ide luar biasanya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":201,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":201,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5krbq\",\"text\":\"   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Bestnis.jpeg', 'https://youtu.be/Kj7fG71KaQI', 'https://www.canva.com/design/DAEjk6wdQME/8OFtk9sYTulemhw1x16rOg/view?utm_content=DAEjk6wdQME&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/Bestnis.jpeg', 81, 8, 1, '2021-07-09 12:52:23', '2021-07-09 12:52:23'),
(74, 'Animasi Pencegahan Virus Corona', '{\"blocks\":[{\"key\":\"bcj99\",\"text\":\"Sebuah animasi yang menginformasikan tentang apa itu virus corona dan memberi tahu Bagaimana Cara penjegahannya agar kita terhindar dari persebaran Virus tersebut\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Pencegahan Virus Corona.png', 'https://youtu.be/xo9agW7X6po', 'https://drive.google.com/file/d/1PHoBdb0O7t0LJI_pOEdhO5ZaDcIENwGj/view?usp=sharing', 'https://api.informatics-expo.id/Animasi Pencegahan Virus Corona.png', 98, 4, 1, '2021-07-09 12:52:42', '2021-07-09 13:47:51'),
(76, 'Sistem Informasi Perbankan (SIP)', '{\"blocks\":[{\"key\":\"2rffn\",\"text\":\"SIP adalah suatu sistem perangkat lunak untuk pengelolaan data dalam sekala luas sebagai wadah pengguna dalam pengelolaan keuangan nasabah \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":138,\"style\":\"color-rgb(255,255,255)\"},{\"offset\":0,\"length\":138,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":0,\"length\":138,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":138,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem Informasi Perbankan (SIP).png', 'https://www.youtube.com/watch?v=0UU45EsyEJ0', '', 'https://api.informatics-expo.id/Sistem Informasi Perbankan (SIP).png', 135, 8, 1, '2021-07-09 13:04:20', '2021-07-09 13:04:20'),
(77, 'Yuk Dirumah Aja', '{\"blocks\":[{\"key\":\"2u2p5\",\"text\":\"Video animasi yang menceritakan tentang awal pandemi, dimana Indonesia sedang gencar-gencarnya melakukan lockdown dan ppkm.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Yuk Dirumah Aja.jpeg', 'https://youtu.be/d1RWeqRxTwo', '', 'https://api.informatics-expo.id/Yuk Dirumah Aja.jpeg', 137, 18, 1, '2021-07-09 13:07:21', '2021-07-09 13:07:21'),
(78, 'SISTEM INFORMASI RUMAH SAKIT ', '{\"blocks\":[{\"key\":\"blugu\",\"text\":\"SIRS adalah aplikasi yang dikembangkan dalam bidang kesehatan. SIRS dapat membantu pengguna untuk mengetahui apa saja yang tersedia pada Rumah Sakit. Di aplikasi ini juga terdapat fitur fitur, seperti Status Rumah Sakit, Daftar Kamar, Daftar Dokter, dan Pembayaran. SIRS dapat memudahkan pengguna terlebih di saat pandemi Covid-19 yang mengharuskan menjaga jarak agar tidak terpapar Covid-19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SISTEM INFORMASI RUMAH SAKIT .jpeg', 'https://youtu.be/WVcdBjiaarY', 'https://docs.google.com/presentation/d/1xPc8dEduSA7RUy9aEI8rlDLVuJ7kYldfsOxE6K2uY5Y/edit#slide=id.p', 'https://api.informatics-expo.id/SISTEM INFORMASI RUMAH SAKIT .jpeg', 136, 18, 1, '2021-07-09 13:08:26', '2021-07-09 13:08:26'),
(85, 'KafeMana', '{\"blocks\":[{\"key\":\"cgrn6\",\"text\":\"KafeMana adalah platform berbasis web yang digunakan untuk merekomendasikan kafe. Platform ini menyajikan berbagai macam kafe pilihan yang ada di Yogyakarta sesuai dengan keinginan pengguna yang mana pengguna tersebut memiliki dua kategori yaitu pemilik kafe dan pemburu kafe. KafeMana berfungsi untuk mempromosikan kafe yang ada di daerah Yogyakarta serta untuk mengetahui review kafe pada suatu kafe yang telah didaftarkan sebelumnya oleh pemburu kafe yang pernah mengunjungi kafe tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":492,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":492,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":492,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KafeMana.png', 'https://www.youtube.com/watch?v=GkPnIEqkmDQ', 'https://www.slideshare.net/SILVIANURLAILARAMADH/kafemana', 'https://api.informatics-expo.id/KafeMana.png', 78, 8, 1, '2021-07-09 13:31:36', '2021-07-09 13:49:10'),
(80, 'Coronavirus Disease', '{\"blocks\":[{\"key\":\"96v5\",\"text\":\"Jauhi kerumunan dan dekati tuhan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Coronavirus Disease.jpeg', 'https://youtu.be/kC5cyznx2H8', '', 'https://api.informatics-expo.id/Coronavirus Disease.jpeg', 61, 2, 1, '2021-07-09 13:10:44', '2021-07-09 13:10:44'),
(81, 'Amalan Sunnah di Bulan Ramadhan', '{\"blocks\":[{\"key\":\"6mmnq\",\"text\":\"Terdapat beberapa alaman sunnah yang dianjurkan oleh Rasulullah saw. pada Bulan Ramadhan. Diantaranya melaksanakan sahur, berbuka puasa dengan kurma dan air putih, serta mengerjakan shalat tarawih.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Amalan Sunnah di Bulan Ramadhan.png', 'https://www.youtube.com/watch?v=csev0bj3wpw', 'https://www.slideshare.net/NaufalFadhlurrohman2/amalan-sunnah-di-bulan-ramadhan', 'https://api.informatics-expo.id/Amalan Sunnah di Bulan Ramadhan.png', 95, 4, 1, '2021-07-09 13:10:50', '2021-07-11 12:00:49'),
(82, 'BUDGETIN', '{\"blocks\":[{\"key\":\"5qut4\",\"text\":\"Sebuah aplikasi untuk pengajuan proposal pada suatu instansi agar dapat mengelola keuangan secara rinci dan efisien.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BUDGETIN.png', 'https://youtu.be/PWgBcZv4Q_I', 'https://drive.google.com/file/d/10GNQJFgrKcEQPqYqolxYJK-je_KRYePf/view?usp=sharing', 'https://api.informatics-expo.id/BUDGETIN.png', 138, 8, 1, '2021-07-09 13:11:44', '2021-07-09 17:10:10'),
(83, 'ALBON', '{\"blocks\":[{\"key\":\"c34m4\",\"text\":\"Albon Adalah sebuah sistem atau website yang kami buat untuk membantu para pedagang untuk mengatur barang mereka agar dapat membuat para pedagang untuk tidak kesushan dalam melihat atau mengakses barang mereka \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":209,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ALBON.jpeg', 'https://youtu.be/9_-kVcNYS0g', 'https://www.canva.com/design/DAEjnkxjI-s/VarrQZfDgoCIe42uXOZHZQ/view?utm_content=DAEjnkxjI-s&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/ALBON.jpeg', 140, 9, 1, '2021-07-09 13:25:51', '2021-07-09 13:49:42'),
(84, 'Animasi - Pandemi Dirumah aja', '{\"blocks\":[{\"key\":\"4jcbs\",\"text\":\"Animasi yang dibuat menggunakan Cartoon Animator 4 yang mengangkat tema Pandemi Covid 19. Karakter akan menjelaskan dampak dari pandemi dan menjelaskan protokol kesehatan upaya mencegah penyebaran Covid 19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi - Pandemi Dirumah aja.png', 'https://www.youtube.com/watch?v=TT6TFGuXNks', 'https://www.slideshare.net/AnnisaAlyanida/grafika-multimedia-animasi', 'https://api.informatics-expo.id/Animasi - Pandemi Dirumah aja.png', 129, 4, 1, '2021-07-09 13:26:47', '2021-07-10 07:12:22'),
(86, 'DEALERKU', '{\"blocks\":[{\"key\":\"4ri1k\",\"text\":\"Memiliki rekomendasi kendaraan\\nterbaik dan menjamin bahwa \\nkendaraan yang anda pilih tidak salah. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DEALERKU.png', 'https://youtu.be/VwRxSKPITUw', 'https://github.com/AryaGemilangDevaP19523008/TubesPSI', 'https://api.informatics-expo.id/DEALERKU.png', 80, 9, 1, '2021-07-09 13:35:22', '2021-07-09 13:38:36'),
(87, 'SEJARAH SHALAT GERHANA', '{\"blocks\":[{\"key\":\"6nusn\",\"text\":\"Menjelaskan sejarah dan asal usul shalat gerhana\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SEJARAH SHALAT GERHANA.png', 'https://youtu.be/-SpcWjPmo7Q', '', 'https://api.informatics-expo.id/SEJARAH SHALAT GERHANA.png', 150, 4, 1, '2021-07-09 13:38:03', '2021-07-09 13:38:03'),
(88, 'KASKITA', '{\"blocks\":[{\"key\":\"b0ufb\",\"text\":\"KASKITA adalah aplikasi pengelolaan keuangan yang ditujukan untuk para pengusaha UKM agar dapat mengelola dan memonitor keuangan usahanya sehingga pengelolaan keuangan dapat dilakukan secara  efektif dan efisien.  Untuk dapat mengelola keuangan secara efektif dan efisien, pengusaha UKM dapat menggunakan beberapa fungsionalitas/fitur yang tersedia di dalam aplikasi KASKITA. Di antaranya adalah pengusaha UKM dapat mencatat, mengedit, dan menghapus transaksi keuangan usahanya.  Selain itu, pengusaha UKM dapat melihat laporan keuangan berupa  total saldo, total pemasukan, total pengeluaran, dan proporsi total pemasukan dan total pengeluaran  yang secara otomatis dibuatkan oleh sistem. Tidak hanya itu,  pengusaha UKM dapat mengelola keuangan usahanya secara bersama-sama dengan membagikan akses pengelolaan kepada orang lain. Bahkan, pengusaha UKM dapat membuat target atau pencapaian-pencapaian yang ingin dicapai sehingga usahanya memiliki master plan dan akan terus berkembang. Selain itu, masih terdapat fitur pendukung lain yang tentunya sangat dibutuhkan dalam mengelola keuangan UKM seperti backup data, history aktivitas, dan sebagainya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":245,\"length\":399,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":645,\"length\":62,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":859,\"length\":291,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":245,\"length\":399,\"style\":\"fontsize-16\"},{\"offset\":645,\"length\":62,\"style\":\"fontsize-16\"},{\"offset\":859,\"length\":291,\"style\":\"fontsize-16\"},{\"offset\":245,\"length\":399,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":645,\"length\":62,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":859,\"length\":291,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":947,\"length\":11,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KASKITA.png', 'https://youtu.be/t-xBqPguaSI', 'https://www.canva.com/design/DAEjsiUgT_g/Qoj4koreNOkwvAQOuW92Ng/view?utm_content=DAEjsiUgT_g&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton#4', 'https://api.informatics-expo.id/KASKITA.png', 130, 9, 1, '2021-07-09 13:39:41', '2021-07-09 13:56:26'),
(89, 'iMEDICINE', '{\"blocks\":[{\"key\":\"b8u1m\",\"text\":\"iMEDICINE adalah aplikasi desktop yang berguna untuk para admin apotek merecord data hasil penjualan obat\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'iMEDICINE.jpeg', 'https://youtu.be/Dmn0uoVAcZ4', '', 'https://api.informatics-expo.id/iMEDICINE.jpeg', 157, 18, 1, '2021-07-09 13:47:18', '2021-07-09 13:47:18'),
(90, 'Inspire Gate ', '{\"blocks\":[{\"key\":\"c8oq3\",\"text\":\"Inspire gate adalah suatu sistem perangkat lunak yang berperan sebagai pihak ketiga antara para pengusaha UMKM, investor, dan pihak-pihak terkait lainnya. Apabila terdapat seorang pengusaha UMKM yang memiliki ide bisnis tetapi terbatas/terhalang akan faktor modal maka dimungkinkan penyuntikan dana oleh investor serta dapat digarap bersama dengan pihak-pihak yang tertarik dengan konsep ide pengusaha tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6cdfe\",\"text\":\"Inspire gate ini dimaksudkan menjadi perantara antara para pelaku bisnis di kalangan masyarakat yang memiliki ide bisnis dengan pihak investor. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4gs0i\",\"text\":\"Dengan adanya aplikasi ini, diharapkan masyarakat yang memiliki impian membangun bisnis dapat terbantu dalam menghimpun dana sehingga impian bisnis yang mereka miliki dapat terealisasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dh83j\",\"text\":\"What are you waiting for? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dvnet\",\"text\":\"Come on, Let\'s start your dreams!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"418tk\",\"text\":\"--- Just share your idea, your dreams can come true! ---\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Inspire Gate .jpeg', 'https://youtu.be/JwSG4L852LQ', 'https://www.canva.com/design/DAEjoWGO2B8/d_jPUlMZ8jXS9PeFxUrehw/view?utm_content=DAEjoWGO2B8&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/Inspire Gate .jpeg', 146, 9, 1, '2021-07-09 13:47:21', '2021-07-09 13:55:27'),
(149, 'M-Society', '{\"blocks\":[{\"key\":\"bqr0d\",\"text\":\"M-Society merupakan sebuah aplikasi  yang membantu pemilik UKM dalam menjual produk-produk milik-nya, dengan aplikasi kami para penjual produk dapat mendaftarkan berbagai produk dan mengotrol toko dengan mudah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'M-Society.png', 'https://youtu.be/I4aFGyuPEak', 'https://docs.google.com/presentation/d/11qCcFkAiHa3lZBWLYcwiTSAAKuMOEoxk8Y9z9K6RT38/edit?usp=sharing', 'https://api.informatics-expo.id/M-Society.png', 218, 9, 1, '2021-07-10 04:44:22', '2021-07-10 04:44:22'),
(92, 'FUNDAMENTAL SYSTEM', '{\"blocks\":[{\"key\":\"cp7rf\",\"text\":\"FUNDAMENTAL SYSTEM merupakan sistem manajemen informasi yang mengatasi masalah manajemen pada coffee shop yang menggunakan sistem ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FUNDAMENTAL SYSTEM.jpeg', 'https://www.youtube.com/watch?v=FnH_38wSkQM', 'https://docs.google.com/presentation/d/1-cIkFxCAFzZWPl1c3zUtxlWY9w1R-4AtbcMSNxbXhoo/edit?usp=sharing', 'https://api.informatics-expo.id/FUNDAMENTAL SYSTEM.jpeg', 144, 8, 1, '2021-07-09 13:52:25', '2021-07-09 15:15:45'),
(280, 'Fit Mass', '{\"blocks\":[{\"key\":\"atrlq\",\"text\":\"Fit Mass adalah sebuah aplikasi berbasis android dengan tema Kesehatan. Fit Mass memiliki fitur utama yaitu Calorie Calculator dan Body Mass Index (BMI) Calculator dimana sistem dapat menghitung kalori dalam tubuh dan berat masa ideal user melalui data berat badan, tinggi badan, jenis kegiatan, dan umur. \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":306,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":306,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":306,\"style\":\"fontsize-25pt\"},{\"offset\":0,\"length\":306,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":108,\"length\":19,\"style\":\"ITALIC\"},{\"offset\":131,\"length\":16,\"style\":\"ITALIC\"},{\"offset\":153,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Fit Mass.png', 'https://youtu.be/ORxSHwPLRFg', 'https://github.com/wahyucandra30/FitMass', 'https://api.informatics-expo.id/Fit Mass.png', 253, 3, 2, '2022-01-01 13:57:02', '2022-01-01 18:01:29'),
(94, 'GO-DANG ( gudang digital )', '{\"blocks\":[{\"key\":\"6e52r\",\"text\":\"GO_DANG merupakan sebuah aplikasi yang menyediakan gudang penyimpanan yang dapat di pesan secara online dimana customer dapat memantau jumlah barang mereka secara online menggunakan gadget mereka.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GO-DANG ( gudang digital ).png', 'https://www.youtube.com/watch?v=4LbyKcWqgQA', 'https://github.com/19523156/GO_DANG-gudang-digital-', 'https://api.informatics-expo.id/GO-DANG ( gudang digital ).png', 143, 9, 1, '2021-07-09 13:55:16', '2021-07-09 13:55:16'),
(95, 'UKM Cerdas', '{\"blocks\":[{\"key\":\"4vdif\",\"text\":\"UKM Cerdas adalah suatu sistem perangkat lunak untuk  pengelolaan Keuangan UKM; khususnya pada pembuatan laporan keuangan harian dan dapat menampilkan rekapitulasi keuangan UKM. UKM Cerdas juga mencakup catatan hutang piutang dan gaji karyawan. UKM Cerdas bukan untuk pengelolaan Jual Beli Produk UKM maupun proses investasi UKM.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":255,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":256,\"length\":73,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":245,\"style\":\"bgcolor-transparent\"},{\"offset\":256,\"length\":73,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":245,\"style\":\"fontsize-11.04pt\"},{\"offset\":256,\"length\":73,\"style\":\"fontsize-11.04pt\"},{\"offset\":0,\"length\":255,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":256,\"length\":73,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":178,\"length\":10,\"style\":\"BOLD\"},{\"offset\":245,\"length\":10,\"style\":\"BOLD\"},{\"offset\":245,\"length\":10,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"9193j\",\"text\":\"UKM Cerdas dimaksudkan untuk menggantikan pengelolaan keuangan UKM yang selama ini dilakukan secara manual menggunakan lembar kerja Microsoft Excel. Dengan UKM Cerdas, diharapkan pencatatan pengelolaan keuangan akan menjadi lebih efektif dan efisien, sehingga dalam mengelola keuangan UKM terasa lebih memuaskan bagi para pelaku UKM.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":11,\"length\":322,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":10,\"style\":\"fontsize-16\"},{\"offset\":156,\"length\":10,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":10,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":11,\"length\":322,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":156,\"length\":10,\"style\":\"BOLD\"},{\"offset\":11,\"length\":145,\"style\":\"bgcolor-transparent\"},{\"offset\":166,\"length\":167,\"style\":\"bgcolor-transparent\"},{\"offset\":11,\"length\":145,\"style\":\"fontsize-11.04pt\"},{\"offset\":166,\"length\":167,\"style\":\"fontsize-11.04pt\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKM Cerdas.jpeg', 'https://youtu.be/c1eIPTChnCU', 'https://www.figma.com/proto/QaT5XQ1ncfchWEuVPvAo54/Smatec-In?node-id=0%3A1&scaling=contain&page-id=0%3A1', 'https://api.informatics-expo.id/UKM Cerdas.jpeg', 74, 8, 1, '2021-07-09 13:57:35', '2021-07-09 13:57:35'),
(96, 'Cara Berpakaian Sesuai Syariat', '{\"blocks\":[{\"key\":\"9riku\",\"text\":\"Zaman sekarang banyak orang yang lebih mementingkan fasion daripada menutup aurat. Untuk itu, kami dari R&B Team akan menjelaskan cara berpakain sesuai dengan syariat islam. Penasaran? Yuk simak videonya dengan mengklik tombol video di bawah ini...\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cara Berpakaian Sesuai Syariat.jpeg', 'https://youtu.be/QJC2b-MxiGQ', 'https://www.slideshare.net/RahmatiaSumanjayanti/ppt-grafika', 'https://api.informatics-expo.id/Cara Berpakaian Sesuai Syariat.jpeg', 22, 2, 1, '2021-07-09 13:58:17', '2021-07-10 09:06:02'),
(156, 'Retect.id', '{\"blocks\":[{\"key\":\"d88eu\",\"text\":\"Assallamualaikum, rekan-rekan kampus perjuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"808rt\",\"text\":\"                 Kami dari Team Analyst menperkenalkan dan mengembangkan aplikasi bernama Retect.id Aplikasi ini berjalan di ruang lingkup kampus UII yang berfungsi untuk melakukan penanganan cepat penanggulangan PDP dan ODP covid-19.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":32,\"length\":7,\"style\":\"BOLD\"},{\"offset\":90,\"length\":10,\"style\":\"BOLD\"},{\"offset\":90,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4o8cp\",\"text\":\"                Dengan memanfaatkan pengolahan data yang valid serta diambil berdasarkan pertanyaan secara berkala setiap harinya kepada pengguna. Dalam hal ini pengguna adalah dosen dan mahasiswa Fakultas Teknologi Industri. Kemudian, dari data tersebut akan diolah sedemikian rupa sehingga menghasilkan informasi yang aktraktif, variatif dan informatif. Dimana data tersebut akan disajikan sebagai manajemen informasi Covid 19 diruang lingkup kampu s Universitas Islam Indonesia khususnya di Fakultas Teknologi Industri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Retect.id.png', 'https://youtu.be/rfcB3FKxul0', 'https://marvelapp.com/prototype/66f23f2/screen/80771790', 'https://api.informatics-expo.id/Retect.id.png', 231, 9, 1, '2021-07-10 14:43:50', '2021-07-10 15:44:53'),
(98, 'Perihal yang Harus Diingat Saat Pandemi', '{\"blocks\":[{\"key\":\"6s3pn\",\"text\":\"Apa yang harus kita lakukan saat pandemi? yuk simak animasi berikut\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Perihal yang Harus Diingat Saat Pandemi.jpeg', 'https://www.youtube.com/watch?v=2_ZGZuB3RSs', '', 'https://api.informatics-expo.id/Perihal yang Harus Diingat Saat Pandemi.jpeg', 162, 18, 1, '2021-07-09 14:02:46', '2021-07-09 14:02:46'),
(99, 'onlyChef', '{\"blocks\":[{\"key\":\"ad5d9\",\"text\":\"Aplikasi ini bertujuan agar pengguna dapat berkomunikasi dengan juru masak. fitur-fitur dari aplikasi ini adalah chat dengan juru masak dan berbagi pengalaman melalui artikel\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'onlyChef.png', 'https://www.youtube.com/watch?v=C3_-_XfxmGE', 'https://github.com/Timduasatu/OnlyChef', 'https://api.informatics-expo.id/onlyChef.png', 164, 3, 1, '2021-07-09 14:13:38', '2021-07-14 04:26:22'),
(100, 'Sistem Informasi Manajemen Sekolah', '{\"blocks\":[{\"key\":\"9vouf\",\"text\":\"Sistem Informasi Manajemen Sekolah untuk membantu dan memudahkan pekerjaan manusia dalam mengolah data pada akademik sekolah dan yang pasti tingkat keakuratan yang sangat tinggi sekaligus waktu yang lebih cepat untuk mengolah data  akademik sekolah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistem Informasi Manajemen Sekolah.jpeg', 'https://youtu.be/VOgTuFrEPAA', 'https://docs.google.com/presentation/d/1qzpgIHOkRjVaxh2DASBFFmaoI2lHWV_PXHOuqUCttuU/edit?usp=sharing', 'https://api.informatics-expo.id/Sistem Informasi Manajemen Sekolah.jpeg', 165, 9, 1, '2021-07-09 14:27:07', '2021-07-09 14:32:05'),
(101, 'BISNISLY', '{\"blocks\":[{\"key\":\"7m5tb\",\"text\":\"Bisnisly adalah wadah untuk saling sharing mengenai ide bisnis sesama pengguna bisnisly. Dengan adanya wadah sharing bisnisly ini memungkinkan terbentuknya suatu ide bisnis yang lebih baik dan matang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISNISLY.png', 'https://youtu.be/3bdKAOeVRe0', 'https://docs.google.com/presentation/d/1OlAiaRwoL8Y6hMsu218yTmCctuc5XkkExTb6MI-jwkE/edit?usp=sharing', 'https://api.informatics-expo.id/BISNISLY.png', 158, 9, 1, '2021-07-09 14:27:50', '2021-07-09 14:48:05'),
(102, 'Adab Makan', '{\"blocks\":[{\"key\":\"3nr2c\",\"text\":\"Animasi yang menceritakan pentingnya menerapkan adab-adab makan dalam Islam\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Adab Makan.png', 'https://youtu.be/mMU7K9MWiBs', 'https://docs.google.com/presentation/d/1D-oYZPTV-OlBppFahkn5CMtQPLVRkYsnJ0740Chp2vs/edit?usp=sharing', 'https://api.informatics-expo.id/Adab Makan.png', 154, 6, 1, '2021-07-09 14:32:24', '2021-07-10 00:50:04'),
(157, 'CALOO', '{\"blocks\":[{\"key\":\"b92c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CALOO.jpeg', 'https://youtu.be/eBvkdaYfFNI', 'https://drive.google.com/file/d/1XQ1CUcAc1ljo5RXE0nOQ_vEW3B3xgRsr/view?usp=sharing', 'https://api.informatics-expo.id/CALOO.jpeg', 234, 8, 1, '2021-07-11 16:10:00', '2021-07-11 16:10:00'),
(104, 'Berbakti Kepada Orangtua', '{\"blocks\":[{\"key\":\"egqsd\",\"text\":\"Animasi kami menceritakan tentang Andi yang asyik menonton tv hingga tidak mau dimintai tolong oleh ibunya. Kemudian ayahnya Andi menasehati Andi untuk selalu berbakti kepada orangtuanya. Andi akhirnya menyesal dan meminta maaf kepada ibunya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":242,\"style\":\"color-rgb(64,71,75)\"},{\"offset\":0,\"length\":242,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":242,\"style\":\"fontsize-22pt\"},{\"offset\":0,\"length\":242,\"style\":\"fontfamily-Manjari, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Berbakti Kepada Orangtua.png', 'https://youtu.be/8BQBXFXlcQs', '', 'https://api.informatics-expo.id/Berbakti Kepada Orangtua.png', 163, 4, 1, '2021-07-09 14:41:59', '2021-07-09 14:41:59'),
(105, 'TraCo', '{\"blocks\":[{\"key\":\"cj0le\",\"text\":\"TraCo adalah Sistem yang menyajikan Informasi untuk mengetahui klaster terbanyak yang berisiko menjadi tempat penyebaran COVID-19 sehingga pemerintah dan masyarakat mengetahui tempat-tempat yang memiliki potensi terbesar dalam penyebaran COVID-19 dan dapat memberi regulasi lebih lanjut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":287,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":287,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":287,\"style\":\"fontsize-27pt\"},{\"offset\":0,\"length\":287,\"style\":\"fontfamily-Poppins\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'TraCo.jpeg', 'https://youtu.be/uOxtI-DVpP0', 'https://docs.google.com/presentation/d/1UYTy03Zxu8G7ngHIlQ_fofAxsMZYwh2YAtMyyJ4494A/edit#slide=id.p1', 'https://api.informatics-expo.id/TraCo.jpeg', 110, 10, 1, '2021-07-09 14:43:33', '2021-07-09 15:32:00'),
(106, 'YESSHOP', '{\"blocks\":[{\"key\":\"dser0\",\"text\":\"Aplikasi YESSHOP merupakan aplikasi marketplace barang dan jasa yang akan dikembangkan. Aplikasi ini diciptakan agar para pemilik UKM  memperoleh keuntungan maksimal dari penjualan barang atau jasa secara online. Di dalamnya tersedia toko-toko online yang dapat diakses oleh pemilik UKM dan masyarakat umum sebagai pembeli.  Masing masing pengguna aplikasi ini mempunyai akun untuk dapat  memesan dan membeli barang-barang atau menggunakan jasa yang ada di dalam aplikasi. Sistem memilih kualitas barang Pemilik UKM sehingga barang yang dibeli dapat disukai oleh pembeli.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":571,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":571,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":571,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":571,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'YESSHOP.png', 'https://youtu.be/8hvzhvyTOb0', '', 'https://api.informatics-expo.id/YESSHOP.png', 171, 8, 1, '2021-07-09 14:56:04', '2021-07-09 14:56:04'),
(107, 'WeCare', '{\"blocks\":[{\"key\":\"apa53\",\"text\":\"WeCare merupakan salah satu sistem layanan bantuan yang digunakan oleh Badan Nasional Penanggulangan Bencana (BNPB). Tujuan pengembangan sistem ini adalah untuk menanggulangi bencana alam di Indonesia lebih cepat untuk diatasi. Kami lampirkan laporan dari sistem WeCare  Laporan WeCare \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":271,\"length\":14,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://drive.google.com/drive/folders/15xK0g9AfcyXd_exYJSKvWKCtvHzztwZW?usp=sharing\",\"targetOption\":\"_self\"}}}}', 'WeCare.jpeg', 'https://s.id/WeCare', 'https://s.id/WeCarePrototype', 'https://api.informatics-expo.id/WeCare.jpeg', 73, 19, 1, '2021-07-09 15:00:18', '2021-07-09 15:30:37'),
(108, 'Exploria', '{\"blocks\":[{\"key\":\"2nu9o\",\"text\":\"Kami membuat sistem informasi yang ditujukan untuk membantu pihak pengelola tempat wisata sehingga pengelola bisa lebih mudah mengetahui kekurangan dan kelebihan tempat wisatanya, dengan begitu kami berharap sistem informasi yang kami buat bisa membantu untuk perkembangan tempat wisata yang dikelola.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Exploria.jpeg', 'https://youtu.be/IAweAahP0PA', 'https://github.com/wahyucandra30/Exploria', 'https://api.informatics-expo.id/Exploria.jpeg', 176, 8, 1, '2021-07-09 15:03:17', '2021-07-09 15:03:17'),
(109, 'Malam Lailatul Qadr', '{\"blocks\":[{\"key\":\"ashaq\",\"text\":\"Kami membuat animasi berjudul Malam Lailatul Qadr yang kami tujukan agar kita semua semakin mengetahui kebaikan dan ciri-ciri mengenai adanya Malam Lailatul Qadr\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malam Lailatul Qadr.jpeg', 'https://youtu.be/SPlw3feHmJE', '', 'https://api.informatics-expo.id/Malam Lailatul Qadr.jpeg', 178, 4, 1, '2021-07-09 15:11:11', '2021-07-09 15:11:11'),
(110, 'Explore Papua', '{\"blocks\":[{\"key\":\"3sefg\",\"text\":\"Kami hadir untuk menjawab keresahan para wisatawan dengan menghadirkan sebuah sistem yang dapat memberikan informasi mengenai tempat wisata dan biaya yang dibutuhkan tiap wisata disana.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":185,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":185,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":185,\"style\":\"fontsize-15pt\"},{\"offset\":0,\"length\":185,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"right\"}}],\"entityMap\":{}}', 'Explore Papua.png', 'https://www.youtube.com/watch?v=Y6JJNhU8rLU', 'https://docs.google.com/presentation/d/1zUmCXVGKv8ExnRZgTR_VQRFnUtgnRfz8-dYR98zsMEg/edit?usp=sharing', 'https://api.informatics-expo.id/Explore Papua.png', 147, 9, 1, '2021-07-09 15:14:50', '2021-07-09 15:14:50');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(111, 'Animasi Dakwah Adab-Adab Bertetangga', '{\"blocks\":[{\"key\":\"frgsm\",\"text\":\"Assalamualaikum Wr Wb Kami dari kelompok Leviathan Team Yang beranggotakan: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":76,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"7iar9\",\"text\":\"Alan Chandra Darmawan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":22,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"8a07q\",\"text\":\"Hitawasana Adhyatma Atmadi \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":27,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"4oej0\",\"text\":\"Farrel Muhammad Shihab \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":23,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"47iss\",\"text\":\"Akan mempresentasikan hasil tugas besar mata kuliah grafika multimedia Kami telah membuat animasi dakwah berdurasi 2 setengah menit dengan judul Adab-Adab Bertetangga Animasi ini disajikan dengan grafik 2dimensi, yang dibuat dengan menggunakan tools processing dengan bahasa pemrograman java Animasi terdiri 13scene yang digabungkan menjadi satu dengan void draw. Animasi dijelaskan dan diceritakan dengan audio yang disampaikan secara dubbing tiap2 tokohnya. Audio ini digabungkan dengan animasi melalui import sound library yang telah disediakan tools Processing.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":565,\"style\":\"fontsize-16\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'Animasi Dakwah Adab-Adab Bertetangga.png', 'https://youtu.be/1zyxf2Q88ys', 'https://drive.google.com/drive/folders/1l9TM9b9hLR_iMpO_FTMSyWlAszt70Mmj?usp=sharing', 'https://api.informatics-expo.id/Animasi Dakwah Adab-Adab Bertetangga.png', 177, 16, 1, '2021-07-09 15:15:31', '2021-07-09 15:16:25'),
(112, 'Moneycisto', '{\"blocks\":[{\"key\":\"cm62v\",\"text\":\"Moneycisto adalah suatu sistem perangkat lunak untuk pengelolaan keuangan untuk pelaku UKM, khususnya pada pencatatan transaksi yang masuk berupa pendapatan dan, transaksi pengeluaran. Moneycisto juga mencakup pencatatan utang piutang, dan fitur tagihan. Untuk mendukung fungsi tersebut, Moneycisto juga dilengkapi dengan fitur pengingat, sebagai pengingat waktu jatuh tempo hutang. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":383,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":383,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":383,\"style\":\"fontsize-11.04pt\"},{\"offset\":0,\"length\":383,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"7.07169pt\"}},{\"key\":\"1uoms\",\"text\":\"Moneycisto ditujukan agar pencatatan keuangan bisnis skala kecil, seperti ukm, dapat dilakukan lebih efektif dan efisien via digital, mengurangi bahkan menghilangkan catatan konvensional diatas kertas yang rentan hilang dan rusak. \\n \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":231,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":231,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":231,\"style\":\"fontsize-11.04pt\"},{\"offset\":0,\"length\":231,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"7.07169pt\"}}],\"entityMap\":{}}', 'Moneycisto.jpeg', 'https://youtu.be/0DMqNVTQM_Q', 'https://drive.google.com/file/d/1dqLVq4NZS-d762hX_Iy8zu3pzYO19WN0/view?usp=sharing', 'https://api.informatics-expo.id/Moneycisto.jpeg', 139, 9, 1, '2021-07-09 15:25:58', '2021-07-09 15:25:58'),
(113, 'Stickman Menjaga Kesehatan', '{\"blocks\":[{\"key\":\"7d4nv\",\"text\":\"Stickman yang baru bangun lalu pergi jalan jalan namun tidak lupa mengenakan masker.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Stickman Menjaga Kesehatan.jpeg', 'https://youtu.be/U1b0Vbl8KcY', 'https://drive.google.com/drive/folders/1hERBweCrSMvO0gfLn02mXYXKSW0HPgVq?usp=sharing', 'https://api.informatics-expo.id/Stickman Menjaga Kesehatan.jpeg', 184, 3, 1, '2021-07-09 15:26:29', '2021-07-11 16:58:23'),
(114, 'RENTS', '{\"blocks\":[{\"key\":\"6jq62\",\"text\":\"Aplikasi sewa fasilitas yang terintegrasi menjadi satu sistem yang dapat menghasilkan informasi yang mudah dipahami oleh menejemen.\\n \\nAplikasi yang interaktif, antara calon penyewa dan pengelola fasilitas.\\nAplikasi yang mudah, karena menggunakan desain yang sederhana dan mudah dipahami.\\nAplikasi yang praktis, karena proses dilakukan secara digital.\\n\\n--TRUST ME--\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'RENTS.png', 'https://youtu.be/weazvWC5enU', 'https://docs.google.com/presentation/d/1ooIoCj1ku2YSmJkTo8pl1tra7kIB4Vn-K9n3f1huiE8/edit?usp=sharing', 'https://api.informatics-expo.id/RENTS.png', 155, 8, 1, '2021-07-09 15:30:07', '2021-07-09 15:30:07'),
(115, 'Covid-19, pengertian, gejala, dan dampak', '{\"blocks\":[{\"key\":\"7uibq\",\"text\":\"Animasi yang menceritakan hal mengenai wabah Covid19 yang tengah melanda seluruh negeri. Bercerita mengenai apa itu Covid-19, gejala, hingga dampak yang dirasakan karena adanya Covid-19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Covid-19, pengertian, gejala, dan dampak.png', 'https://youtu.be/OIyfSnuLDDY', '', 'https://api.informatics-expo.id/Covid-19, pengertian, gejala, dan dampak.png', 188, 3, 1, '2021-07-09 15:37:04', '2021-07-09 15:37:04'),
(116, 'Sukses dengan D.U.I.T', '{\"blocks\":[{\"key\":\"nsre\",\"text\":\"Sukses dengan D.U.I.T (Doa Usaha Ikhtiar Tawakal)\\nDoa dan Usaha adalah suatu hal yang harus dijalani berbarengan. Setelah kedua hal dilakukan selanjutnya kita harus berserah diri kepada Allah SWT (Tawakal) untuk mencapai kesuksesan.\\n\\nDoa tanpa usaha dan usaha tanpa doa tidak cukup. Kedua hal tersebut tidak dapat dipisahkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":325,\"style\":\"color-rgb(13,13,13)\"},{\"offset\":0,\"length\":325,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":325,\"style\":\"fontsize-15\"},{\"offset\":0,\"length\":325,\"style\":\"fontfamily-Roboto, Noto, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sukses dengan D.U.I.T.jpeg', 'https://youtu.be/gY4Te_pfU2g', 'https://www.canva.com/design/DAEjoHWB2VU/UiOS4HCK6wAi_rXfYfA90A/view?utm_content=DAEjoHWB2VU&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/Sukses dengan D.U.I.T.jpeg', 194, 8, 1, '2021-07-09 15:44:31', '2021-07-09 15:44:31'),
(117, 'Apa Itu Zakat?', '{\"blocks\":[{\"key\":\"2cbgt\",\"text\":\"\\\"Apa Itu Zakat?\\\" adalah sebuah animasi yang didalamnya terdapat penjelasan tentang pengertian zakat, macam-macam zakat, dan hadits tentang zakat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Apa Itu Zakat?.png', 'https://youtu.be/maeJHtybix4', 'https://docs.google.com/presentation/d/1xDuXQr9anR27ERMHLc9O1bQifdTYeMC6Ej52NL8nyMI/edit?usp=sharing', 'https://api.informatics-expo.id/Apa Itu Zakat?.png', 169, 16, 1, '2021-07-09 15:50:46', '2021-07-09 15:50:46'),
(118, 'BisnisYuu', '{\"blocks\":[{\"key\":\"5lmok\",\"text\":\"Aplikasi ini berguna bagi orang-orang yang memiliki niat untuk membangun sebuah bisnis tetapi terhalang oleh tidak adanya ide-ide untuk memulai bisnis mereka. Aplikasi BisnisYuu dikembangkan untuk membantu memberikan berbagai ide bisnis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BisnisYuu.jpeg', 'https://youtu.be/UpvP49E2edg', 'https://docs.google.com/presentation/d/1y1Mes5-lHhbupemc9IKugv8mdmqREOBHOwRoaVeo_Cc/edit#slide=id.ge3dd2a9078_0_250', 'https://api.informatics-expo.id/BisnisYuu.jpeg', 189, 8, 1, '2021-07-09 15:51:26', '2021-07-11 03:08:55'),
(119, 'Festival budaya', '{\"blocks\":[{\"key\":\"4ta75\",\"text\":\"Festival budaya adalah dimana semua karya lukisan ataupun karya budaya lainnya dipamerkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Festival budaya.png', 'https://youtu.be/33gLDe6ARIA', 'https://www.canva.com/design/DAEhhIej_LQ/share/preview?token=zEtOPC7aKbqOF_hQ4k5CIA&role=EDITOR&utm_content=DAEhhIej_LQ&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton', 'https://api.informatics-expo.id/Festival budaya.png', 195, 4, 1, '2021-07-09 15:54:13', '2021-07-09 15:54:13'),
(120, 'ReSkinS - KPI Regional Skincare Sales', '{\"blocks\":[{\"key\":\"14aqa\",\"text\":\"ReSkinS adalah Sistem Informasi yang membantu suatu organisasi untuk memudahkan menganalisis apakah organisasi tersebut telah mencapai target dalam penjualan produk Skincare pada cabang perusahaan di setiap wilayah \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":214,\"style\":\"color-rgb(35,31,32)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ReSkinS - KPI Regional Skincare Sales.jpeg', 'https://youtu.be/BsAbZTlyUpg', 'https://drive.google.com/file/d/173KvKFMQG1CNQTj1YWl0pMAWMf0HmxNr/view?usp=sharing', 'https://api.informatics-expo.id/ReSkinS - KPI Regional Skincare Sales.jpeg', 170, 12, 1, '2021-07-09 15:55:19', '2021-07-09 15:55:19'),
(121, 'Budaya di Tanah Magelang', '{\"blocks\":[{\"key\":\"6pmln\",\"text\":\"Dua orang sahabat yang berjumpa, mereka berlibur di Tanah Magelang, Borobudur dikala pandemi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Budaya di Tanah Magelang.png', 'https://youtu.be/fgg2pDvnrWA', 'https://docs.google.com/presentation/d/1J8WPpfM6uz8wcOG8xgNpKsmooLbmZQnCoTwKLHuGad0/edit?usp=sharing', 'https://api.informatics-expo.id/Budaya di Tanah Magelang.png', 192, 4, 1, '2021-07-09 15:55:45', '2021-07-09 15:55:45'),
(122, 'YukBisnis', '{\"blocks\":[{\"key\":\"bt7kc\",\"text\":\"Yuk bisnis merupakan sebuah aplikasi yang dapat mempertemukan seorang pemilik ide bisnis yang cemerlang dengan para pemilik modal ataupun investor untuk melakukan kerjasama. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":173,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'YukBisnis.png', 'https://youtu.be/K_g2YlE8tZE', 'https://drive.google.com/file/d/1OBB7-BaJgdZyyHyIoUrGcUbo110pNhYc/view?usp=sharing', 'https://api.informatics-expo.id/YukBisnis.png', 85, 8, 1, '2021-07-09 16:03:02', '2021-07-09 16:19:44'),
(124, 'Gerakan Melawan Covid-19', '{\"blocks\":[{\"key\":\"48nq6\",\"text\":\"Gerakan Melawan Covid-19 dengan mematuhi ptorokol kesehatan 5M (Memakai masker, Mencuci tangan, Menjauhi kerumunan, Menjaga jarak, dan Membatasi Mobilitas) dan berhenti menyebarkan berita Hoaks covid-19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Gerakan Melawan Covid-19.png', 'https://www.youtube.com/watch?v=iY-jMhAMNO4', '', 'https://api.informatics-expo.id/Gerakan Melawan Covid-19.png', 196, 18, 1, '2021-07-09 16:08:30', '2021-07-09 16:08:30'),
(123, 'Wisata bersama', '{\"blocks\":[{\"key\":\"7ibh4\",\"text\":\" Keadaan pandemi membuat kita tetap dirumah, namun saat pandemi ini telah berakhir kita ingin menikmati waktu liburan kita dan pasti lebih terasa luar biasa maka dari itu MARI KITA LIBURAN!!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Wisata bersama.jpeg', 'https://youtu.be/SvPwCcL8UnU', 'https://drive.google.com/file/d/1aQBxwFMYVj9Z5T8ojNzGmVhgPKyrkOSR/view?usp=sharing', 'https://api.informatics-expo.id/Wisata bersama.jpeg', 174, 4, 1, '2021-07-09 16:03:57', '2021-07-09 16:03:57'),
(125, 'AdaIde', '{\"blocks\":[{\"key\":\"caii0\",\"text\":\"Adaide merupakan aplikasi yang menjadi wadah bagi orang untuk saling berbagi inspirasi ide bisnis sekaligus juga sebagai tempat bagi mereka yang mencari inspirasi untuk membangun bisnis mereka.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AdaIde.png', 'https://youtu.be/4mSW9L9Lw5k', 'https://linktr.ee/sixsens', 'https://api.informatics-expo.id/AdaIde.png', 64, 8, 1, '2021-07-09 16:09:11', '2021-07-09 16:09:11'),
(126, 'SuperMart', '{\"blocks\":[{\"key\":\"49dj2\",\"text\":\"Aplikasi SuperMart merupakan sebuah aplikasi MIS yang diperuntukan bagi Manajer dan Kasir dalam sebuah perusahan penjualan atau pelaku ritel seperti Supermarket. Dengan adanya aplikasi SuperMart maka perusahaan akan dapat terbantu dalam pengelolaan perusahaan dengan visualisasi data penjualan yang detail dan terperinci. Dari visualisasi ini pengelola perusahaan akan dapat terbantu untuk melakukan keputusan bisnis seperti halnya promosi produk tertentu.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":457,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":457,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":457,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SuperMart.png', 'https://youtu.be/9n6hx0rYHvI', 'https://github.com/aamaheswara/tubes-PSI', 'https://api.informatics-expo.id/SuperMart.png', 166, 8, 1, '2021-07-09 16:09:49', '2021-07-09 17:02:33'),
(127, 'Perpus.On', '{\"blocks\":[{\"key\":\"3ihro\",\"text\":\"Perpus.On merupakan sistem yang dapat memudahkan peminjam mengakses dan mencari buku yang akan dipinjam di perpustakaan. Pada perpustakaan biasa kebanyakan peminjam yang ingin mencari buku yang akan dipinjam masih secara manual dengan cara menanyakan terlebih dahulu ada tidaknya buku yang akan dicari kepada petugas perpustakaan ataupun dengan mencari sendiri secara langsung ke bagian rak-rak perpustakaan. Hal-hal itulah yang dirasa kurang efektif dan menguras waktu peminjam dalam mencari buku sehingga membuat kami memilih untuk membuat sistem ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Perpus.On.jpeg', 'https://youtu.be/1q5U1GmWy2I', 'https://docs.google.com/presentation/d/1zEVJ1Ee4YSsuYgOBtOIGY8Vmr3kDHjDWeXqEV9zP3kQ/edit?usp=sharing', 'https://api.informatics-expo.id/Perpus.On.jpeg', 197, 4, 1, '2021-07-09 16:13:12', '2021-07-09 20:50:07'),
(128, 'myMoney', '{\"blocks\":[{\"key\":\"b27hh\",\"text\":\"\\\"My Money Is an Accounting  Application, recording daily finances and also a free financial application that can be used by all types of business.\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8lh5b\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'myMoney.jpeg', 'https://youtu.be/Siub_lLN6dk', 'https://gitlab.com/Sapexxx/my-money.git', 'https://api.informatics-expo.id/myMoney.jpeg', 185, 8, 1, '2021-07-09 16:13:20', '2021-07-09 16:20:24'),
(129, 'Micro Invest', '{\"blocks\":[{\"key\":\"4k6m\",\"text\":\"Micro Invest merupakan sebuah aplikasi yang dirancang untuk mempermudah UKM dalam menemukan pemodal agar UKM dapat berjalan lancar.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Micro Invest.png', 'https://youtu.be/gkUhjllVROI', 'https://gitlab.com/Yusuf_12/micro-invest_decodeline/-/tree/master/Tugas_Besar', 'https://api.informatics-expo.id/Micro Invest.png', 159, 11, 1, '2021-07-09 16:24:04', '2021-07-09 17:06:17'),
(130, 'SIPP ', '{\"blocks\":[{\"key\":\"bq7o1\",\"text\":\"Sebuah platform berbasis web yang menyediakan layanan peer to peer antara investor dan petani sehingga mereka dapat melakukan transaksi secara langsung dengan sistem yang kita sediakan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":45,\"style\":\"color-black\"},{\"offset\":46,\"length\":47,\"style\":\"color-black\"},{\"offset\":94,\"length\":8,\"style\":\"color-black\"},{\"offset\":103,\"length\":6,\"style\":\"color-black\"},{\"offset\":110,\"length\":5,\"style\":\"color-black\"},{\"offset\":116,\"length\":9,\"style\":\"color-black\"},{\"offset\":126,\"length\":9,\"style\":\"color-black\"},{\"offset\":136,\"length\":15,\"style\":\"color-black\"},{\"offset\":152,\"length\":6,\"style\":\"color-black\"},{\"offset\":159,\"length\":16,\"style\":\"color-black\"},{\"offset\":176,\"length\":8,\"style\":\"color-black\"},{\"offset\":0,\"length\":45,\"style\":\"fontsize-28pt\"},{\"offset\":46,\"length\":47,\"style\":\"fontsize-28pt\"},{\"offset\":94,\"length\":8,\"style\":\"fontsize-28pt\"},{\"offset\":103,\"length\":6,\"style\":\"fontsize-28pt\"},{\"offset\":110,\"length\":5,\"style\":\"fontsize-28pt\"},{\"offset\":116,\"length\":9,\"style\":\"fontsize-28pt\"},{\"offset\":126,\"length\":9,\"style\":\"fontsize-28pt\"},{\"offset\":136,\"length\":15,\"style\":\"fontsize-28pt\"},{\"offset\":152,\"length\":6,\"style\":\"fontsize-28pt\"},{\"offset\":159,\"length\":16,\"style\":\"fontsize-28pt\"},{\"offset\":176,\"length\":8,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":45,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":46,\"length\":47,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":94,\"length\":8,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":103,\"length\":6,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":110,\"length\":5,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":116,\"length\":9,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":126,\"length\":9,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":136,\"length\":15,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":152,\"length\":6,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":159,\"length\":16,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":176,\"length\":8,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SIPP .jpeg', 'https://youtu.be/oNzK6zD7wEA', 'https://drive.google.com/file/d/1vz4N_EIrqjhuyphagvbEfQQzxH5e01TK/view?usp=sharing', 'https://api.informatics-expo.id/SIPP .jpeg', 153, 9, 1, '2021-07-09 16:24:49', '2021-07-10 09:21:45'),
(131, 'VacaTrend', '{\"blocks\":[{\"key\":\"7j8vf\",\"text\":\"Vacatrend adalah sebuah web platform yang berguna untuk membandingkan dan memberi rekomendasi soal objek objek wisata yang ada di Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9pkgm\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'VacaTrend.jpeg', 'https://youtu.be/EvR_Hp5tkJ0', 'https://www.slideshare.net/RahmatiaSumanjayanti/pengembangan-sistem-informasi-249673149', 'https://api.informatics-expo.id/VacaTrend.jpeg', 148, 9, 1, '2021-07-09 16:26:03', '2021-07-09 16:36:33'),
(132, 'e-Commtick', '{\"blocks\":[{\"key\":\"b4nob\",\"text\":\"e-Commtick adalah aplikasi web yang mendukung SIM(Sistem Informasi Manajemen) dan DSS (Decision Support System) untuk membantu manajer perusahan untuk melihat dashboard mengenai data penjualan dalam sistem. Pengguna juga dapat melihat statistik dari data akun pengguna yang terdaftar, data penjualan terbanyak, data ketertarikan pengguna, data keuangan perusahaan, dan data yang paling sering dilihat oleh pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e-Commtick.png', 'https://www.youtube.com/watch?v=gYWjpfezMAg&feature=youtu.be', '', 'https://api.informatics-expo.id/e-Commtick.png', 124, 17, 1, '2021-07-09 16:30:58', '2021-07-09 16:30:58'),
(133, 'Manajemen Hotel', '{\"blocks\":[{\"key\":\"5tqt0\",\"text\":\"Sistem yang akan memberikan informasi hotel berupa dashboard yang sehingga memudahkan pihak manajemen hotel terutama executive untuk menentukan keputusan terhadap keadaan hotel yang dapat meningkatkan keuntungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Manajemen Hotel.png', '', 'https://drive.google.com/file/d/1SdiHedAh-Bfqi_sBUNMomT1d6M-brmQE/view?usp=sharing', 'https://api.informatics-expo.id/Manajemen Hotel.png', 198, 2, 1, '2021-07-09 16:39:30', '2021-07-09 16:39:30'),
(135, 'Delta Shop the Future Ecommerce', '{\"blocks\":[{\"key\":\"3kr54\",\"text\":\"Si Agung adalah platform perdagangan online dimana pembeli dapat membeli\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"o8sd\",\"text\":\"kebutuhan berupa Alat Gunung. Si Agung menyediakan berbagai peralatan Gunung \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"giak\",\"text\":\"yang komplit sehingga dapat memudahkan pengguna untuk mencari barang yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9ujcv\",\"text\":\"diinginkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Delta Shop the Future Ecommerce.jpeg', 'https://youtu.be/KYVwPhIETEw', 'https://github.com/Devanoz/JAVA-/tree/main/SiAgung_V3_1_Beta07_Latest_Version_Final', 'https://api.informatics-expo.id/Delta Shop the Future Ecommerce.jpeg', 23, 9, 1, '2021-07-09 16:44:35', '2021-07-09 16:44:35'),
(148, 'KebudSum', '{\"blocks\":[{\"key\":\"6220m\",\"text\":\"KebudSum adalah website E-learning untuk mempelajari kebudayaan sumatra\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KebudSum.jpeg', 'https://youtu.be/oFLZyNagjpo', '', 'https://api.informatics-expo.id/KebudSum.jpeg', 212, 4, 1, '2021-07-10 01:12:13', '2021-07-10 01:12:13'),
(153, 'INVESTMO', '{\"blocks\":[{\"key\":\"4ssuh\",\"text\":\"INVESTMO adalah suatu sistem perangkat lunak untuk sarana investasi bagi investor dan sarana pengajuan modal bagi penjual. Investmo mencakup berbagai jenis usaha kecil menengah (UKM)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'INVESTMO.png', 'https://youtu.be/dLcIg1VVB4c', 'https://docs.google.com/presentation/d/1e6CTLu-KWiK4yFLPnEiSQcp17yNryWmQybBouI0TAfM/edit?usp=sharing', 'https://api.informatics-expo.id/INVESTMO.png', 41, 9, 1, '2021-07-10 08:22:21', '2021-07-11 00:26:56'),
(138, 'KEUTAMAAN SHOLAT BERJAMAAH DIMASJID', '{\"blocks\":[{\"key\":\"as867\",\"text\":\"Animasi ini menceritakan tentang Keutamaan sholat berjamaah di masjid\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KEUTAMAAN SHOLAT BERJAMAAH DIMASJID.jpeg', 'https://youtu.be/VAvFRmoZAlQ', '', 'https://api.informatics-expo.id/KEUTAMAAN SHOLAT BERJAMAAH DIMASJID.jpeg', 202, 4, 1, '2021-07-09 16:51:21', '2021-07-09 20:42:15'),
(139, 'SEMII', '{\"blocks\":[{\"key\":\"5vj41\",\"text\":\"Semi adalalah sebuah sistem untuk melakukan investasi secara langsung antara masyarakat dengan pelaku Ukm. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":106,\"style\":\"color-rgb(32,39,75)\"},{\"offset\":0,\"length\":106,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"1lc22\",\"text\":\"sistem ini di buat karena pelaku ukm yang sebenarnya bisa lebih mengembangkan usahanya terhambat karena kurangnya dana sehingga keuntungan yang si capai tidak maksimal dan masyarakat yang tidak memiliki waktu serta tenaga untuk menjalan usaha agar memperoleh keuntungan. maka di buat lah sistem ini untuk berinvestasi kepada pelaku ukm tersebut, sehinga di kedua belah pihak pada akhirnya akan saling mendapatkan keuntungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SEMII.jpeg', 'https://youtu.be/HVZg5svjA78', 'https://www.canva.com/join/qxn-nnn-gwy', 'https://api.informatics-expo.id/SEMII.jpeg', 131, 2, 1, '2021-07-09 16:56:37', '2021-07-09 16:56:37'),
(161, 'Kopid Mantul', '{\"blocks\":[{\"key\":\"fkhf6\",\"text\":\"Kopid Mantul adalah game bertema covid-19 dimana karakter utama yang digunakan berupa virus itu sendiri dan akan menghancurkan karakter manusia tanpa masker yang ada di dalam area tertutup berupa dinding yang akan memantulkan bola virus. Namun virus tidak dapat menghancurkan karakter manusia yang menggunakan masker. Dilengkapi dengan paddle untuk user mengontrol kemana virus itu akan dipantulkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kopid Mantul.png', 'https://youtu.be/Ii0Ohe7osWE', 'https://drive.google.com/file/d/1ZCQMf8_kQKciWayCWS15oAOZOxzNQvCx/view?usp=sharing', 'https://api.informatics-expo.id/Kopid Mantul.png', 242, 18, 2, '2021-12-28 13:33:26', '2022-01-03 13:59:44'),
(276, 'BISAKERJA.ID', '{\"blocks\":[{\"key\":\"726kb\",\"text\":\"Semenjak masuknya virus Covid-19 ke Indonesia, banyak perusahaan yang mengalami penurunan pendapatan. Mereka harus melakukan Pemutusan Hubungan Kerja (PHK) pada sebagian pekerjanya, untuk mengurangi pengeluaran perusahaan. Sehingga banyak masyarakat yang kehilangan pekerjaannya. Maka dari itu, kita berfikir untuk membuat aplikasi yang bisa memudahkan mereka, yang kami beri nama BISAKERJA.ID.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":394,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d5s4i\",\"text\":\"BISAKERJA.ID adalah platform yang berguna untuk menyediakan informasi mengenai lowongan pekerjaan yang sedang dibuka dan memudahkan masyarakat dalam melamar pekerjaan. Aplikasi ini dapat menghubungkan antara pencari tenaga kerja dengan pencari pekerjaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":254,\"style\":\"fontsize-14\"},{\"offset\":143,\"length\":5,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":143,\"length\":5,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISAKERJA.ID.jpeg', 'https://youtu.be/6mdoijLmYKs', 'https://www.figma.com/proto/BOhrNHfkq5iWyHWjwt1puc/desain-bisaKerja.id?node-id=1%3A473&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A528', 'https://api.informatics-expo.id/BISAKERJA.ID.jpeg', 299, 8, 2, '2022-01-01 13:45:54', '2022-01-02 01:32:06'),
(278, 'SHADES', '{\"blocks\":[{\"key\":\"8l54g\",\"text\":\"SHADES adalah aplikasi berbasis web, yang dapat membantu orang untuk memiliki bisnis melalui franchise-franchise yang sudah ada. Disisi lain, Shades juga membantu para pengusaha(franchisor) untuk mempromosikan bisnis mereka yang sudah berhasil.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"aga7l\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SHADES.png', 'https://youtu.be/B1LW9J9KNMo', '', 'https://api.informatics-expo.id/SHADES.png', 439, 9, 2, '2022-01-01 13:48:56', '2022-01-01 14:00:33'),
(162, 'LeftOver', '{\"blocks\":[{\"key\":\"7mt8i\",\"text\":\"LeftOver adalah sebuah wadah yang bertujuan untuk mengurangi limbah sisa makanan yang memungkinkan penggunanya untuk membeli makanan dengan setengah harga dan membantu para pelaku bisnis untuk bisa menekan kerugian yang disebabkan oleh makanan yang tidak habis terjual\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LeftOver.jpeg', 'https://youtu.be/PUFnutqzNx4', '', 'https://api.informatics-expo.id/LeftOver.jpeg', 244, 12, 2, '2021-12-28 14:06:07', '2021-12-28 14:06:07'),
(141, 'manageKuy!', '{\"blocks\":[{\"key\":\"9d0li\",\"text\":\"manageKuy! adalah aplikasi berbasis website yang berguna untuk mencatat pengeluaran dan pemasukan uang anda\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'manageKuy!.png', 'https://youtu.be/IjT_TTttKWg', 'https://github.com/aimanfurqon/Expo2021', 'https://api.informatics-expo.id/manageKuy!.png', 205, 13, 1, '2021-07-09 17:01:33', '2021-07-09 17:30:42'),
(155, 'Modalin', '{\"blocks\":[{\"key\":\"7fl0o\",\"text\":\"Modalin merupakan aplikasi untuk berinvestasi spesifik hanya di UKM. Modalin merupakan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1u0cc\",\"text\":\"perantara antara UKM yang kekurangan modal dengan masyarakat yang memiliki uang untuk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3ehg6\",\"text\":\"diinvestasikan tetapi tidak berminat untuk berinvestasi di instrumen investasi seperti reksadana,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7f49u\",\"text\":\"saham, atau usaha pribadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"pgu\",\"text\":\"Dengan adanya aplikasi ini diharapkan pelaku UKM dapat dipertemukan dengan investor yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3536c\",\"text\":\"ingin berinvestasi di sektor UKM dan meningkatkan rasa lebih berani bagi pelaku UKM untuk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"aeb6v\",\"text\":\"membuka atau melanjutkan UKM di masa sekarang dan tidak takut akan kekurangan modal.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"25cen\",\"text\":\"Fungsi Modalin adalah sebagai wadah yang menyediakan berbagai pilihan UKM untuk bisa\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"61m3v\",\"text\":\"diberikan modal oleh investor. Para investor yang telah mendaftarkan diri dapat memilih daftar UKM\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"658ll\",\"text\":\"yang menarik untuk diinvestasikan. Dengan adanya Modalin pelaku UKM dapat memiliki\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eo1j9\",\"text\":\"kesempatan untuk diberi dukungan modal oleh investor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"gna3\",\"text\":\"Dalam prosesnya, transaksi yang telah dilakukan oleh investor tidak dapat dikembalikan langsung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1u2pl\",\"text\":\"UKM yang telah mendapatkan modal dari investor akan mengelola dana tersebut terlebih dahulu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"coshr\",\"text\":\"Nantinya investor akan mendapatkan dana yang telah diinvestasikan (beserta keuntungan atau\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"978no\",\"text\":\"kerugian yang diperoleh) setelah UKM selesai mengelola dana tersebut. Proses ini berlangsung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"13nmk\",\"text\":\"dalam waktu yang tidak dapat ditentukan. Setelah proses ini selesai, investor dapat mengambil\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"33gop\",\"text\":\"semua dananya atau melakukan investasi kembali.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Modalin.jpeg', 'https://www.youtube.com/watch?v=199es5Xrpj8', 'https://www.figma.com/proto/0K9OX4fNafj3cDAUaNM1YO/RPL-Desain?node-id=1%3A7&scaling=contain&page-id=0%3A1', 'https://api.informatics-expo.id/Modalin.jpeg', 230, 8, 1, '2021-07-10 11:45:57', '2021-07-10 13:27:38'),
(142, 'ADAB SEBELUM TIDUR', '{\"blocks\":[{\"key\":\"b5g5c\",\"text\":\"Animasi bercerita tentang seorang anak yang terbangun dari tidurnya karena mengalami mimpi buruk.Ia pun memanggil ibunya lalu ia menjelaskan apa yang terjadi.Kemudian sang ibu pun yang mengajarkan kebiasaan baik sebelum tidur kepada anaknya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ADAB SEBELUM TIDUR.jpeg', 'https://youtu.be/6dhJDcBNnS4', 'https://docs.google.com/presentation/d/1MKpHmXvOe7wvhZKGcXQrn7c2CdNF3xCQV2R8nVvUweE/edit?usp=sharing', 'https://api.informatics-expo.id/ADAB SEBELUM TIDUR.jpeg', 204, 4, 1, '2021-07-09 17:09:56', '2021-07-10 04:02:36'),
(143, 'Sekaten', '{\"blocks\":[{\"key\":\"fhtj5\",\"text\":\"Sekaten adalah rangkaian kegiatan tahunan sebagai peringatan Maulid Nabi Muhammad yang diadakan oleh keraton Surakarta dan Yogyakarta yang berlangsung dari tanggal 5 dan berakhir pada tanggal 12 Mulud penanggalan Jawa atau Rabiul Awal penanggalan Hijriah.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":108,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":109,\"length\":91,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":201,\"length\":33,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":235,\"length\":20,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":108,\"style\":\"fontsize-16\"},{\"offset\":109,\"length\":91,\"style\":\"fontsize-16\"},{\"offset\":201,\"length\":33,\"style\":\"fontsize-16\"},{\"offset\":235,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":108,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":109,\"length\":91,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":201,\"length\":33,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":235,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":108,\"style\":\"fontsize-inherit\"},{\"offset\":109,\"length\":91,\"style\":\"fontsize-inherit\"},{\"offset\":201,\"length\":33,\"style\":\"fontsize-inherit\"},{\"offset\":235,\"length\":20,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":108,\"style\":\"fontfamily-inherit\"},{\"offset\":109,\"length\":91,\"style\":\"fontfamily-inherit\"},{\"offset\":201,\"length\":33,\"style\":\"fontfamily-inherit\"},{\"offset\":235,\"length\":20,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[{\"offset\":73,\"length\":8,\"key\":0},{\"offset\":101,\"length\":7,\"key\":1},{\"offset\":109,\"length\":9,\"key\":2},{\"offset\":123,\"length\":10,\"key\":3},{\"offset\":195,\"length\":5,\"key\":4},{\"offset\":201,\"length\":16,\"key\":5},{\"offset\":223,\"length\":11,\"key\":6},{\"offset\":235,\"length\":19,