(144, 'Wudhu', '{\"blocks\":[{\"key\":\"bclbu\",\"text\":\"Video animasi yang berisikan tata cara wudhu yang baik dan benar, pada video disertai dengan niat dan do\'a. al Wudhu dengan dhommah, berarti pekerjaan bersuci dan dengan huruf wawunya (Wadhu), berarti air yang dipergunakan untuk berwudhu. Wudhu menurut bahasa artinya bersih dan indah, sedang menurut syara artinya membersihkan anggota wudhu untuk menghilangkan hadats kecil mengutip dari Risalah Tuntunan Shalat Lengkap oleh Moh. Rifai.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Wudhu.jpeg', 'https://www.youtube.com/watch?v=IHU7OcoGiuk', '', 'https://api.informatics-expo.id/Wudhu.jpeg', 193, 4, 1, '2021-07-09 17:25:47', '2021-07-09 17:25:47'),
(145, 'ModalMudah', '{\"blocks\":[{\"key\":\"1v0a7\",\"text\":\"Di era sekarang ini,  memiliki sebuah usaha sendiri adalah impian banyak kalangan orang , mulai dari yang muda hingga yang tua,banyak orang berlomba lomba membuat inovasi dalam membuat suatu usaha, mulai dari usaha makanan, fashion, transportasi, sampai usaha kerajinan. Tetapi terkadang tidak sedikit dari usaha yang sudah dibangun terhenti di tengah jalan, dikarenakan modal yang tidak mencukupi, karena itulah Modal mudah hadir untuk anda.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bi8am\",\"text\":\"Aplikasi yang memberikan anda kemudahan untuk mendapatkan modal usaha. Modal mudah hadir dengan fitur yang memberikan kenyamanan bagi penggunanya. Modal mudah membawa misi untuk memajukan ukm yang ada di Indonesia, dengan memudahkan para ukm dalam mendapatkan modal. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"143fi\",\"text\":\"Dengan modal mudah mendapatkan modal dana jadi lebih mudah\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ModalMudah.png', 'https://youtu.be/EbQ7CdQ6QwI', 'https://linktr.ee/ModalMuah', 'https://api.informatics-expo.id/ModalMudah.png', 208, 8, 1, '2021-07-09 18:31:47', '2021-07-10 02:12:58');
