(146, 'Reksator', '{\"blocks\":[{\"key\":\"cjo2t\",\"text\":\"Reksator menghubungkan para pengusaha UKM dari berbagai daerah di Indonesia dengan para Investor. Melihat banyak UKM di indonesia yang terkendala finansial dalam pengembangan bisnisnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"12kes\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7cmov\",\"text\":\"Melihat masalah tersebut, kami Alpha Engineer meluncurkan Reksator dengan tujuan untuk memberikan pembiayaan bagi para pengusaha UKM di Indonesia. Dengan bantuan pembiayaan dari para funder, maka diharapkan ukm di Indonesia dapat mengembangkan usahanya. Selain itu, masyarakat Indonesia dapat ikut serta membantu meningkatkan perekonomian Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Reksator.jpeg', 'https://youtu.be/_xapji73lN0', 'https://www.figma.com/proto/nz1pwI3Y5Btsp8MEsbb67b/Reksator-1.0?page-id=0%3A1&node-id=18%3A449&viewport=113%2C349%2C0.08804518729448318&scaling=min-zoom', 'https://api.informatics-expo.id/Reksator.jpeg', 167, 9, 1, '2021-07-09 22:42:35', '2021-07-09 22:42:35'),
(147, 'Do\'s and Don\'ts Ramadhan Edition', '{\"blocks\":[{\"key\":\"2pf40\",\"text\":\"Animasi yang mengangkat tema Dakwah / Islami, kami mengambil judul yaitu \\\"Do\'s and Don\'ts Ramadhan Edition\\\". Ramadhan adalah bulan kesembilan dalam kalender Islam (Hijriyah) dan dirayakan oleh seluruh umat Muslin di dunia dengan puasa. Sehingga, penting bagi kita untuk mengetahui dan memperhatikan apa saja \\\"Do\'s\\\" (amalan / hal yang boleh dilakukan) dan \\\"Don\'ts\\\" (larangan / hal yang tidak boleh dilakukan) pada saat berpuasa di bulan suci Ramadhan. Animasi ini dibuat menggunakan software Processing 3. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Do\'s and Don\'ts Ramadhan Edition.jpeg', 'https://youtu.be/thY2rbRaE20', '', 'https://api.informatics-expo.id/Do\'s and Don\'ts Ramadhan Edition.jpeg', 142, 3, 1, '2021-07-09 22:51:38', '2021-07-09 22:51:38'),
(163, 'Pepe and The Rise of CoronaVirus', '{\"blocks\":[{\"key\":\"1tuh0\",\"text\":\"Game ini berlatar belakang pada tahun 2020, dimana terdapat sebuah tenaga kesehatan yang harus melalui beberapa rintangan-rintangan untuk mengakhiri pandemi yang terjadi pada saat itu. Objek dalam game ini adalah mengalahkan semua musuh yang merupakan sebuah virus corona yang ada dalam stage dan mengalahkan bos yang ada pada stage terakhir. Maksud dari gim ini adalah untuk edukasi mengenai pentingnya berhati-hati terhadap bahayanya virus corona saat ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":458,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":458,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":458,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":458,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pepe and The Rise of CoronaVirus.png', 'https://www.youtube.com/watch?v=uZGAFJHSq5I', 'https://github.com/ilham-2001/pepe-and-the-rise-of-coronavirus', 'https://api.informatics-expo.id/Pepe and The Rise of CoronaVirus.png', 245, 19, 2, '2021-12-28 14:49:32', '2021-12-28 14:49:32'),
(164, 'Me Against Monster', '{\"blocks\":[{\"key\":\"sqnr\",\"text\":\"Me Against Monster adalah game bergenre Adventure, Platformer. Player akan merasakan sensasi penuh petualangan dan tantangan melawan monster.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Me Against Monster.png', 'https://www.youtube.com/watch?v=RXsECa2RwOw', '', 'https://api.informatics-expo.id/Me Against Monster.png', 247, 9, 2, '2021-12-29 08:12:07', '2022-01-01 13:15:28'),
(165, 'CAU GEDANG', '{\"blocks\":[{\"key\":\"a3utc\",\"text\":\"CAU GEDANG ini adalah aplikasi pengelola keuangan ukm, yang mana di dalam aplikasi ini bisa mencatat pemasukkan dan pengluaran. aplikasi ini juga dapat menampilkan rekapitulasi bulanan dan bisa juga untuk melihat riwayat transaksi yang pernah di lakukan. tujuan aplikasi ini adalah untuk mengganti cara pengelolaan UKM yang masi menggunakan cara manual seperti menggunakan buku catatan ke cara yang lebih mudah dan lebih aman dari resiko catatan hilang atau rusak.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CAU GEDANG.png', 'https://youtu.be/LMGO39_5WJg', 'https://github.com/RezaPahlevi156/caugedang', 'https://api.informatics-expo.id/CAU GEDANG.png', 250, 8, 2, '2021-12-29 09:10:15', '2022-01-01 13:51:44'),
(166, 'Brain Game', '{\"blocks\":[{\"key\":\"33l6e\",\"text\":\"Gim ringan dan singkat untuk mengasah daya ingat anak-anak, wawasan islami anak-anak, dan kemampuan berhitung anak-anak. Gim yang dapat memacu anak-anak untuk mempelajari lebih lanjut tentang agama islam, matematika, dan sedikit kemampuan dasar mengingat sesuatu. Gim ini cocok digunakan di sekolah dasar islam manapun.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Brain Game.png', 'https://www.youtube.com/watch?v=ZfSFwOQpM4I', 'https://github.com/RashidMaulana/Brain-Game-FInal', 'https://api.informatics-expo.id/Brain Game.png', 258, 4, 2, '2021-12-30 01:02:47', '2021-12-30 01:02:47'),
(167, 'NOKET', '{\"blocks\":[{\"key\":\"ddkcu\",\"text\":\"Noket adalah aplikasi pencatatan dan pengelolaan keuangan UKM berbasis web  yang sasaran utamanya adalah pelaku UKM. Noket dibuat memiliki tujuan untuk membantu pelaku UKM mencapai keberhasilan manajemen keuangan agar menunjang kemajuan dari UKM itu sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NOKET.png', 'https://youtu.be/lLQIqGDn0kQ', '', 'https://api.informatics-expo.id/NOKET.png', 249, 17, 2, '2021-12-30 01:49:13', '2022-01-05 05:54:41'),
(168, 'Lunga', '{\"blocks\":[{\"key\":\"ba9ol\",\"text\":\"Lunga adalah aplikasi pariwisata yang menampilkan informasi tentang pariwisata yang jarang dikunjungi di Daerah Istimewa Yogyakarta.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lunga.png', 'https://youtu.be/Spvw2tqzwGI', '', 'https://api.informatics-expo.id/Lunga.png', 248, 3, 2, '2021-12-30 05:12:35', '2022-01-05 12:11:49'),
(171, 'COKINI', '{\"blocks\":[{\"key\":\"58hgo\",\"text\":\"COKINI adalah aplikasi equity crowdfunding berbasis web yang memiliki tujuan  untuk  membantu UMKM local mengembangkan bisnisnya supaya kondisi ekonomi di sekitarnya  makmur dan merata.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":186,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":186,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":186,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'COKINI.png', 'https://youtu.be/VOGvI57c_2o', 'https://github.com/NichtsElse/COKINI', 'https://api.informatics-expo.id/COKINI.png', 280, 8, 2, '2021-12-30 12:30:44', '2022-01-02 17:50:11'),
(172, 'SampahKu', '{\"blocks\":[{\"key\":\"4dg15\",\"text\":\"    Sejak kemunculan kasus pertama Covid-19 di Indonesia pada tanggal 2 Maret 2020, banyak orang yang menjadi malas untuk beraktivitas di luar ruangan karena adanya penerapan kebiasaan  hidup baru (new normal) yang mengharuskan mereka untuk mengurangi aktivitas di luar ruangan sebanyak mungkin. Hal ini tentunya sangat berpengaruh terhadap berbagai hal, salah satunya adalah kebiasaan membuang sampah. Dulu, ketika pandemi belum menyerang negara kita, sebagian besar masyarakat terbiasa untuk membuang sampah pada tempatnya meskipun tidak sedikit juga orang-orang yang membuang sampah mereka secara sembarangan. Namun, ketika pandemi Covid-19 mulai datang di Indonesia, masyarakat dipaksa untuk mengurangi aktivitas di luar ruangan sebanyak mungkin. Kebijakan ini berlangsung sampai berbulan-bulan lamanya hingga memicu efek samping. Efek samping tersebut adalah kemalasan. Sekarang, mereka menjadi malas untuk membuang sampah pada tempatnya dan lebih memilih untuk membuangnya secara sembarangan. Hal ini tentu sangat berbahaya bagi lingkungan kita. Pasalnya, penimbunan sampah di lingkungan atau sungai dapat menjadi sumber penyakit dan pemicu banjir. Badan nasional penanggulan bencana (BNPB) mencatat, ada 487 kejadian banjir sejak 1 januari hingga 10 april 2021. Apabila solusi dari permasalahan tersebut tidak segera dibuat, maka dampaknya akan semakin besar. Oleh karena itu, kami, kelompok Pemuda Pancasila, memberikan suatu solusi  terkait permasalahan tersebut dalam bentuk pembuatan aplikasi layanan angkut sampah yang bernama SampahKu \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":70,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1155,\"length\":395,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":70,\"style\":\"bgcolor-transparent\"},{\"offset\":1155,\"length\":395,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":1550,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":1550,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":70,\"length\":1085,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":70,\"length\":1085,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":198,\"length\":12,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}},{\"key\":\"f0tik\",\"text\":\"    Apa itu SampahKu ? SampahKu adalah aplikasi layanan angkut sampah prabayar yang yang bekerja sama dengan pemerintah daerah. Aplikasi ini dibuat berdasarkan tiga tujuan utama : (1) Mengurangi pencemaran sampah di lingkungan ,(2) meningkatkan kualitas layanan kebersihan kota, (3) membuka lapangan pekerjaan baru. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":232,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":0,\"length\":232,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":232,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":316,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":232,\"length\":84,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":232,\"length\":84,\"style\":\"bgcolor-transparent\"},{\"offset\":232,\"length\":84,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b8j79\",\"text\":\"    Mengapa aplikasi SampahKu merupakan solusi yang tepat untuk permasalahan yang sudah dibahas sebelumnya? Sebab, pengguna dapat memesan layanan angkut sampah secara online sehingga mereka tidak perlu untuk keluar dari rumah mereka. Ditambah lagi,aplikasi ini dibuat dengan konsep yang hampir mirip dengan aplikasi yang sudah terbukti keefektifannya, yaitu aplikasi Gojek. Pengguna dapat melacak posisi driver truk pengangkut sampah secara real-time pada tampilan map yang ada di aplikasi SampahKu. Mereka juga dapat melihat history dari pemesanan layanan angkut sampah sehingga apabila mereka secara tidak sengaja membuang barang berharga mereka di tas/plastik sampah, mereka dapat menghubungi customer service SampahKu dan memberikan informasi-informasi yang diperlukan untuk melakukan prosedur pengambilan barang.   \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":820,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":0,\"length\":820,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":820,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":820,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":441,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SampahKu.png', 'https://youtu.be/AO0p0g_fovM', 'https://www.figma.com/proto/0y4fKwE1rGrE9vwFmJ6qsf/Aplikasi-SampahKu?node-id=1%3A2112&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2112', 'https://api.informatics-expo.id/SampahKu.png', 277, 15, 2, '2021-12-30 12:33:44', '2021-12-30 12:33:44'),
(173, 'The Boy', '{\"blocks\":[{\"key\":\"ov0e\",\"text\":\"Kehidupan di hutan Indonesia memiliki banyak misteri yang mana karakter utama akan bertemu dengan berbagai makhluk mitologi khas indonesia (misal. buto ijo) dan  flora dan fauna yang beraneka ragam. Dengan beraneka ragam makhluk dan misteri yang ada di dalam hutan bisa menghalangi karakter utama, selain itu juga ada yang akan membantu karakter untuk menyelesaikan tujuan nya di dalam hutan tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":401,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":401,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":401,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":401,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'The Boy.png', 'https://www.youtube.com/watch?v=z56JchlsTPY', '', 'https://api.informatics-expo.id/The Boy.png', 283, 4, 2, '2021-12-30 13:58:51', '2021-12-30 13:58:51'),
(174, 'Sino the virus killer', '{\"blocks\":[{\"key\":\"246ov\",\"text\":\"Sino the virus killer adalah gim yang berlatar belakang pada pandemi Covid-19 yang mewabah di seluruh belahan dunia. Karakter utama dari gim ini adalah Sino sebagai representasi dari salah satu vaksin yang bernama sinovac. Tujuan utama dari gim ini adalah melawan semua virus yang ada dan jangan sampai terbunuh. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":312,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":312,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":312,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":312,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sino the virus killer.jpeg', 'https://youtu.be/y1HElFygQ4E', '', 'https://api.informatics-expo.id/Sino the virus killer.jpeg', 284, 19, 2, '2021-12-30 14:08:14', '2021-12-30 14:08:14'),
(175, 'VSID ', '{\"blocks\":[{\"key\":\"9u9n6\",\"text\":\"VSID adalah Sistem informasi berbasis web yang dapat menampilkan berbagai pilihan franchise. Dapat dijual oleh pemilik franchise (perusahaan) dan dapat dibeli oleh siapa saja yang membutuhkan franchise.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'VSID .png', 'https://youtu.be/SgOB3SKYG9Y', '', 'https://api.informatics-expo.id/VSID .png', 286, 8, 2, '2021-12-30 14:21:10', '2022-01-02 17:13:01'),
(176, 'Cofight', '{\"blocks\":[{\"key\":\"d1j90\",\"text\":\"Cofight adalah gim yang menceritakan seorang dokter yang berjuang menyelamatkan pasien yang berada di desa pedalaman namun ditengah jalan terhalang oleh musuh yang berupa virus dan ia diharuskan untuk menghindari dengan selamat untuk menyelesaikan misinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cofight.jpeg', 'https://youtu.be/oROk2cO3FQ8', '', 'https://api.informatics-expo.id/Cofight.jpeg', 288, 19, 2, '2021-12-30 16:30:47', '2021-12-30 16:30:47'),
(177, 'InMate', '{\"blocks\":[{\"key\":\"4lu2q\",\"text\":\"InMate merupakan game 2D Platformer, dalam game ini karakter utamanya ada seorang penyihir api (Wizard fire) yang berusaha kabur dari sebuah gua tahanan, karena diduga melakukan kejahatan. Namun, ternyata gua tahanan tersebut memiliki sebuah rahasia yaitu sebuah dunia lain. Penyihir tersebut nantinya akan menjelajahi gua tersebut untuk kabur. Gim ini hanya dapat dimainkan oleh satu orang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":390,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":390,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"aomue\",\"text\":\"Konsep dari  gim ini  akan memiliki genre petualangan (adventure), aksi (action-platformer games), dan juga semi-survival. Dimana penyihir tersebut melewati berbagai rintangan seperti jebakan-jebakan dan monster/musuh-musuh yang ada di sekitarnya untuk kabur.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":259,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":259,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":259,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":259,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"34at\",\"text\":\"Platformer game menggunakan PC/Laptop yang dikendalikan dengan keyboard. Pada tampilan game terdapat background gua yang dalam dan berbagai environment/lingkungan yang beragam sebagai poin adventure dari game ini.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":213,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":213,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":213,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":213,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'InMate.jpeg', 'https://www.youtube.com/watch?v=jlwDXCnumqg', '', 'https://api.informatics-expo.id/InMate.jpeg', 263, 16, 2, '2021-12-30 16:37:04', '2021-12-30 16:37:04'),
(178, 'Nyari Dana', '{\"blocks\":[{\"key\":\"c78o9\",\"text\":\"NyariDana merupakan sebuah platform untuk membantu para pelaku usaha mencari sumber dana bagi usaha mereka agar dapat berkembang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nyari Dana.png', 'https://youtu.be/DFBkQdbFZ1k', '', 'https://api.informatics-expo.id/Nyari Dana.png', 279, 17, 2, '2021-12-31 00:36:27', '2022-01-02 08:39:36'),
(179, 'Vaccine, Go!', '{\"blocks\":[{\"key\":\"fbc1n\",\"text\":\"Wabah virus mematikan yang bernama COVID-19 telah melanda dunia. Tom berusaha untuk terhindar dari wabah ini dengan cara mendapatkan vaksin. Wabah dapat membunuh Tom secara perlahan jika ia tidak melawannya. Let\'s play Vaccine, Go!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":231,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":231,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":231,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":231,\"style\":\"fontfamily-Arial\"},{\"offset\":208,\"length\":23,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Vaccine, Go!.png', 'https://youtu.be/IREcGp3KxdY', '', 'https://api.informatics-expo.id/Vaccine, Go!.png', 290, 18, 2, '2021-12-31 00:52:03', '2021-12-31 00:52:03'),
(180, 'Bished Rent Car', '{\"blocks\":[{\"key\":\"3rh9g\",\"text\":\"BISHED RENT AR adalah platform rental mobil yang dapat mempermudah mobilitas. rental mobil di BISHE RENT CAR dijamin aman, nyaman dan terpercaya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1e5hu\",\"text\":\"BISHED Rent Car merupakan website rental mobil yang ditujukan untuk membantu masyarakat terkait permasalahan kebingungan masyarakat akan mobilitas dari dalam maupun luar Kota Yogyakarta yang akan melakukan wisata atau ziarah dengan nyaman, aman, dan tentunya terjangkau.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dk8ab\",\"text\":\"BISHED Rent Car akan dikembangkan sebagai sistem berbasis web yang bisa diakses menggunakan Internet.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"80hg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bished Rent Car.png', 'https://youtu.be/QxbKGRDDlVc', 'https://www.figma.com/proto/LjjzL7MOusO6NPSfivz1f9/BISHED?node-id=387%3A2&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=387%3A2', 'https://api.informatics-expo.id/Bished Rent Car.png', 292, 8, 2, '2021-12-31 02:12:12', '2022-07-23 06:05:12'),
(181, 'Matching Things', '{\"blocks\":[{\"key\":\"d434\",\"text\":\"Matching Things merupakan game bertemakan edukasi untuk anak-anak usia 4-12 tahun. Dalam game ini pemain akan bermain sambil belajar mengenal hal-hal disekitar rumahnya seperti hewan, tumbuhan, makanan dan warna. Cara memainkan game adalah dengan mencocokan tiap gambar pada board hingga semua gambar menghilang agar dapat lanjut ke level berikutnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Matching Things.jpeg', 'https://youtu.be/4nBpcceUd7c', '', 'https://api.informatics-expo.id/Matching Things.jpeg', 303, 4, 2, '2021-12-31 06:46:54', '2022-01-01 16:25:16'),
(182, 'DELIFREE', '{\"blocks\":[{\"key\":\"1ie0t\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bjd8o\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c5hfk\",\"text\":\"\\\"DELIFREE\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ad88f\",\"text\":\"Meningkatnya tingkat infeksi Covid-19 membuat pemerintah menetapkan Lockdown dan peraturan PSBB, semua aktivitas yang dianggap tidak penting tidak diperbolehkan, juga patroli dan pendirian posko yang dilakukan penegak hukum untuk menegaskan peraturan tersebut bisa kita lihat di sekitar kita.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"foq69\",\"text\":\"Dengan adanya lockdown dan PSBB membatasi mobilitas masyarakat, akses ke sumber bahan makanan atau makanan menjadi semakin sulit. Solusi yang ada sekarang adalah aplikasi pemesanan online namun proses pemesanan masih menjadi proses yang rumit dan belum optimal karena aplikasi-aplikasi belum  menyelesaikan permasalahan seperti beragamnya prosedur kesehatan dalam setiap daerah, juga informasi dan status kesehatan kurir.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"30nso\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3q6ab\",\"text\":\"DELIFREE adalah aplikasi pemesanan makanan dan bahan pangan yang mengutamakan kemudahan pengguna saat Lockdown \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9v4ol\",\"text\":\"DELIFREE memiliki berbagai fitur yang dapat membantu pengguna dalam Lockdown seperti detail prosedur kesehatan daerah, pemesanan social distancing dan informasi kesehatan kurir.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DELIFREE.png', 'https://youtu.be/9WgcLeARZaE', 'https://www.figma.com/proto/edt1gvJgiXMdbSXNv2mwjH/rismoi?page-id=0%3A1&node-id=1%3A3&viewport=241%2C48%2C0.15&scaling=scale-down&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/DELIFREE.png', 301, 2, 2, '2021-12-31 07:32:24', '2021-12-31 07:32:24'),
(183, 'Covid Run', '{\"blocks\":[{\"key\":\"dmtvp\",\"text\":\"Pada tahun 2019 sebuah virus menyerang kota dan menyebabkan pandemi diseluruh dunia. hal ini disebabkan karena sebuah pabrik biologiss yang meledak menyebabkan virus tersebut tersebar. satu satunya cara untuk menyelamatkan dunia yaitu dengan mencari vaksin di bangunan pabrik yang sudah hancur dan penuh dengan virus. Ghazi sebagai pemuda yang sehat bervoluntir untuk mencari vaksin tersebut. mampukah ghazi menyelamatkan dunia?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Covid Run.jpeg', 'https://youtu.be/YZamORYQY_g', '', 'https://api.informatics-expo.id/Covid Run.jpeg', 307, 18, 2, '2021-12-31 08:00:19', '2021-12-31 08:06:14'),
(184, 'Yahuut!', '{\"blocks\":[{\"key\":\"fq395\",\"text\":\"Yahuut! adalah sebuah game berupa quiz yang memiliki macam soal umum dan pilihan jawaban untuk menambah wawasan yang ada di Indonesia teruntuk orang yang memainkannya. \",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":167,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":167,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":167,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":167,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"-4.6pt\"}}],\"entityMap\":{}}', 'Yahoot!.png', 'https://youtu.be/IztwWTRz7xA', '', 'https://api.informatics-expo.id/Yahoot!.png', 310, 4, 2, '2021-12-31 08:45:10', '2022-01-01 07:49:18'),
(185, 'NGONSUL', '{\"blocks\":[{\"key\":\"7j4ks\",\"text\":\"Pandemi COVID-19 memberikan tantangan bagi manusia untuk terus beradaptasi dengan cepat, banyak sektor-sektor terdampak yang dituntut untuk beradaptasi dan bertransformasi agar dapat terus bertahan dalam menjalankan sektor. Salah satu sektor terdampak adalah sektor kesehatan. Sektor kesehatan pada masa pandemi ini menjadi sektor yang paling krusial pada pandemi COVID-19. Banyaknya pasien-pasien COVID-19 yang terus bertambah tanpa henti yang menjadi perhatian utama pemerintah. Akan tetapi, akibat pandemi ini ternyata bukanlah hanya masalah penyakit COVID-19 yang bermunculan, tetapi masalah tentang mental health masyarakat Indonesia pun semakin meningkat. Berangkat dari permasalahan tersebut, kami berinisiatif untuk menciptakan sebuah solusi untuk masyarakat yang memiliki masalah kesehatan mental namun terhalang akan mobilitas yang sulit terutama pada masa pandemi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"74mui\",\"text\":\"Dengan NGONSUL anda dapat memesan pertemuan dengan psikolog dengan cepat dan mudah dengan aplikasi Ngonsul! Ngonsul membuka suatu gerbang kemudahan baru dalam menunjang kesehatan mental anda. Dengan puluhan hingga ratusan ahli psikolog yang kredibel, Ngonsul memberikan pengalaman layanan kesehatan yang interaktif, berkualitas, dan efektif. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c30dp\",\"text\":\"BOOKING PERTEMUAN DENGAN PSIKOLOG\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5nk03\",\"text\":\"Pilih puluhan hingga ratusan ahli psikolog kredibel yang siap melayani anda dengan pilihan pertemuan langsung ataupun secara on-line.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"849j2\",\"text\":\"MEDITASI\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c9vkv\",\"text\":\"Ingin mudah untuk mengontrol emosi? Ngonsul menyediakan fitur meditasi untuk pengguna melakukan guided meditation secara step-by-step.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dqpvb\",\"text\":\"CONNECT WITH PEOPLE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6ghs6\",\"text\":\"Berhubunglah dengan pengguna Ngonsul yang lain! dengan fitur connect with people/add friend, Ngonsul memberikan kemudahan untuk menemukan dan mendapatkan teman antar sesama pengguna aplikasi!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"na87\",\"text\":\"CHAT WITH FRIENDS\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"86d1\",\"text\":\"Merasa kesepian? Berkomunikasilah dengan teman sesama pengguna! Ngonsul memberikan kemudahan pengguna untuk berkomunikasi antar sesama pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NGONSUL.png', 'https://youtu.be/OukCMZonG0M', 'https://www.figma.com/proto/LTwqAiVTEKOuKVBMO8iH0x/BISMILLAH-BEST-APP-2022?page-id=0%3A1&node-id=15%3A2&viewport=241%2C48%2C0.63&scaling=scale-down&starting-point-node-id=15%3A2', 'https://api.informatics-expo.id/NGONSUL.png', 304, 3, 2, '2021-12-31 09:17:26', '2021-12-31 09:17:26'),
(186, 'CovFree', '{\"blocks\":[{\"key\":\"67cum\",\"text\":\"Di masa pandemi yang seperti ini, covid-19 pun terus berlanjut. Bahkan angka persentase orang yang terkena covid-19 bisa meningkat pesat dalam sehari. Masyarakat awam yang tidak tahu harus melakukan apa ketika sedang menjalani isolasi mandiri. Pada akhirnya, mereka pun tetap kebingungan dan kadang kesulitan dalam mencari informasi terkait covid-19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3tp46\",\"text\":\"CovFree merupakan suatu aplikasi yang bergerak dibidang kesehatan yang bertujuan membantu para penderita covid-19 dalam masa isolasi mandirinya. Di dalam aplikasi ini terdapat fitur-fitur yang menjadi arahan untuk mempermudah para penderita covid yang sedang menjalani isolasi mandiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8f5nm\",\"text\":\"Kami menghadirkan beberapa fitur yang diantaranya ada fitur Konsultasi, untuk melakukan konsultasi dengan dokter mengenai keluhan yang dirasakan pengguna, fitur delivery, untuk melakukan pengantaran obat/vitamin kepada pengguna, fitur aktivitas,untuk menyarankan kegiatan yang membantu peningkatan imun pengguna, fitur reminder,untuk membantu user dalam mengingat apa saja yang harus dilakukannya selama menggunakan aplikasi ini,kami juga menyediakan tutorial video untuk menggunakan aplikasi agar pengguna tidak kebingungan ketika sedang menggunakan aplikasi CovFree dan yang perlu kalian ketahui aplikasi ini bekerja sama dengan bpjs.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fqroo\",\"text\":\" Konsep yang kami buat ini terinspirasi dari aplikasi kesehatan yang sudah tersedia lebih dulu seperti Halodoc, dan Peduli Lindungi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CovFree.png', 'https://youtu.be/4MoWiXvC6I0', 'https://www.figma.com/proto/GBq1bR0HIfu2QsWJh4kvIG/2gether?node-id=46%3A21&scaling=scale-down&page-id=2%3A1003&starting-point-node-id=46%3A21&show-proto-sidebar=1', 'https://api.informatics-expo.id/CovFree.png', 306, 18, 2, '2021-12-31 09:31:30', '2021-12-31 09:31:30'),
(187, 'JualinYuk', '{\"blocks\":[{\"key\":\"259uc\",\"text\":\"Aplikasi JualinYuk merupakan aplikasi marketplace yang diprogram untuk mempermudah para UKM lokal untuk memperjual belikan dagangannya secara online, dengan begini para pelaku UKM yang berbasis ekonomi menengah kebawah dan hanya bermain sekitar daerah atau lokal mampu menembus pasar yang lebih luas dan dikenal baik didalam dan luar daerah seperti batik daerah dan buah tangan khas daerah masing-masing yang memang memiliki corak desain dan cita rasa yang unik \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":462,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":462,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fmd8d\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JualinYuk.jpeg', 'https://youtu.be/22VzEzMA7Yw', '', 'https://api.informatics-expo.id/JualinYuk.jpeg', 254, 8, 2, '2021-12-31 10:16:27', '2023-02-17 20:21:29'),
(188, 'FinancialMu', '{\"blocks\":[{\"key\":\"2eieg\",\"text\":\"FinancialMu adalah aplikasi \'Personal Budget Management\' yang digunakan untuk mengatur keuangan pengguna. FinancialMu dapat mencatat pengeluaran dan pemasukan, sesuai dengan kebutuhan yang telah ditentukan oleh pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":220,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":220,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":220,\"style\":\"fontfamily-Poppins, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FinancialMu.png', 'https://youtu.be/lECrbyZPXh4', 'https://github.com/udangRakus/Financialmu_Expo-uii-2022', 'https://api.informatics-expo.id/FinancialMu.png', 316, 1, 2, '2021-12-31 10:53:25', '2022-01-02 23:59:44'),
(191, 'Don\'t Go Crowd', '{\"blocks\":[{\"key\":\"bl7ej\",\"text\":\"Virus Covid-19 adalah Virus yang sangat berbahaya, penyebarannya sangat cepat menular terhadap orang sekita. Maka dari itu menjaga jarak adalah solusi terbaik untuk menghindari terkena virus tersebut. Ayo bantu PakPol untuk membasmi para Virus yang tersebar di jalanan dan mengingatkan warga untuk berjaga jalan dan memakai masker. Mainkan sekarang!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Don\'t Go Crowd.jpeg', 'https://www.youtube.com/watch?v=IRWwAxx8ahg', 'https://play.unity.com/mg/other/dont-t-go-crowd', 'https://api.informatics-expo.id/Don\'t Go Crowd.jpeg', 321, 19, 2, '2021-12-31 12:53:57', '2022-01-01 11:40:02'),
(190, 'Hotel Of Angker', '{\"blocks\":[{\"key\":\"13hv8\",\"text\":\"Meningkatnya jumlah korban yang meninggal di Hotel of Angker, membuat aktivitas paranormal semakin meresahkan warga. Anda sebagai pemain yang terjebak di hotel ini ditantang untuk mencari jalan keluar rahasia agar dapat menyelamatkan diri. Selama perjalanan, kalian akan bertemu dengan berbagai jenis hantu yang mengerikan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":45,\"length\":16,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"9g37f\",\"text\":\"Gunakan kesempatan yang tersedia untuk dapat keluar dari Hotel of Angker. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":57,\"length\":15,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2p4o7\",\"text\":\"Jika Anda tertantang, main dan selesaikan misi yang ada! \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":57,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hotel Of Angker.png', 'https://www.youtube.com/watch?v=ZRvOSozZb1g&ab_channel=OktoNugroho', 'https://www.mediafire.com/file/38dszsv0mdcgrza/EarlyAccessHotelOfAngker.rar/file', 'https://api.informatics-expo.id/Hotel Of Angker.png', 317, 16, 2, '2021-12-31 12:00:00', '2022-01-01 10:31:35'),
(192, 'Cuanin', '{\"blocks\":[{\"key\":\"b6bgm\",\"text\":\"UKM merupakan salah satu sektor bisnis penggerak roda perekonomian masyarakat. Banyaknya transaksi yang dihasilkan oleh UKM mengakibatkan pencatatan yang dihasilkan hariannya pun tidak sedikit. Maka dari itu, tidak sedikit UKM kewalahan dalam mengelola keuangan tersebut. Akibatnya UKM kesulitan untuk menelusuri jumlah keuntungan yang dihasilkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"af6to\",\"text\":\"Oleh karena itu, Cuanin hadir untuk mengatasi permasalahan tersebut. Cuanin merupakan aplikasi berbasis web yang berfokus untuk membantu pengelolaan keuangan para penggiat UKM. Cuanin memiliki misi yaitu untuk membantu para penggiat UKM di Indonesia dalam memonitor dan mengatur arus keuangan secara lebih baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cuanin.png', 'https://youtu.be/0cOsOkiMI0s', 'https://farhannovan.com/cuanin', 'https://api.informatics-expo.id/Cuanin.png', 329, 9, 2, '2021-12-31 14:47:31', '2021-12-31 15:23:46'),
(193, 'Breakout', '{\"blocks\":[{\"key\":\"4ailt\",\"text\":\"Breakout adalah game di mana Anda seorang subjek eksperimen terjebak di sebuah penjara lab yang para ilmuan jahat melakukan berbagai eksperimen kepada Anda. Kaburlah dari lab tersebut dengan mempelajari bahasa pemrograman untuk meretas pintu-pintu yang ada pada lab tersebut dan carilah jalan keluarnya!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Breakout.jpeg', 'https://www.youtube.com/watch?v=zEHDwUlIz3o', '', 'https://api.informatics-expo.id/Breakout.jpeg', 330, 4, 2, '2021-12-31 15:01:27', '2021-12-31 15:01:27'),
(194, 'IdeaShop', '{\"blocks\":[{\"key\":\"3eqk6\",\"text\":\"Idea Shop adalah aplikasi berbasis web untuk memfasilitasi bertemunya pelaku UKM secara online. Disini pelaku UKM disediakan tempat untuk berdiksusi seputar bisnis UKM dan bagi yang tidak memiliki ide, akan tetapi memiliki biaya/budget bisa mengikuti bisnis UKM yang diinginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":278,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'IdeaShop.jpeg', 'https://youtu.be/f_VinqLmvnc', 'https://ideasp.000webhostapp.com/welcome.php', 'https://api.informatics-expo.id/IdeaShop.jpeg', 332, 9, 2, '2021-12-31 15:29:52', '2022-01-01 15:56:36'),
(197, 'Localation', '{\"blocks\":[{\"key\":\"f7h3m\",\"text\":\"Sebuah aplikasi berbasis Android yang bisa digunakan dimana saja dan kapan saja ketika pengguna ingin berwisata di daerah Yogyakarta. Aplikasi ini memiliki dua fitur utama yaitu untuk menyediakan tour wisata yang direkomendasikan dan memberikan rating di setiap lokasi wisata yang dikunjungi untuk memberi masukan terhadap tempat wisata yang dikunjungi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lolalation.jpeg', 'https://youtu.be/v0MxkEhzvCE', '', 'https://api.informatics-expo.id/Lolalation.jpeg', 335, 11, 2, '2021-12-31 16:07:07', '2022-01-01 01:09:14'),
(198, 'Cakep (Cegah Kena Penipuan', '{\"blocks\":[{\"key\":\"d42t1\",\"text\":\"Sepanjang tahun 2021 ini, Kementerian Kominfo menerima laporan aduan penipuan transaksi online sebanyak 115.756 laporan. Jika dibandingkan dengan angka laporan penipuan online dari tahun 2020 yang berjumlah 167.675 laporan, maka terjadi penurunan jumlah laporan di tahun 2021,\\\" kata Juru Bicara Kominfo, Dedy Permadi \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1,\"style\":\"color-rgb(32,33,34)\"},{\"offset\":0,\"length\":1,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":1,\"style\":\"fontsize-10.5pt\"},{\"offset\":0,\"length\":1,\"style\":\"fontfamily-Arial\"},{\"offset\":1,\"length\":317,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1,\"length\":317,\"style\":\"bgcolor-transparent\"},{\"offset\":1,\"length\":317,\"style\":\"fontsize-12pt\"},{\"offset\":1,\"length\":317,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2vv3c\",\"text\":\"Mayoritas laporan tersebut berisikan laporan terhadap transaksi jual-beli di e-commerce,serta sedikit tentang penipuan lewat pengosongan saldo di e-wallet.Modus yang diceritakan di beberapa laporan penipuan, penipu mengajak korban untuk bertransaksi selain lewat e-commerce,namun menggunakan rekening pribadi.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":309,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":309,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":309,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":309,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"24vre\",\"text\":\"Meskipun bukti laporan nya menurun, masih banyak terjadi penipuan di Indonesia.Oleh karena itu kami mencoba untuk membangun aplikasi Cakep ini untuk mengedukasi masyarakat dan membantu memeriksa keamanan sebelum transaksi.Aplikasi kami juga  dapat menjadi wadah bagi para korban sehingga kasus yang sama tidak terulang lagi. konsep aplikasi kami dapat mengakomodir pengguna untuk melaporkan kasus penipuan sehingga laporan korban dapat terkumpul dan menindaklanjuti kasus tersebut.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":481,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":481,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":481,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":481,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5t7e6\",\"text\":\"Dengan menggunakan aplikasi tersebut, masyarakat diharapkan dapat semakin bijak dalam bertransaksi melalui media digital dan pemberantasan penipuan online dapat semakin efektif.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":177,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":177,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":177,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cakep (Cegah Kena Penipuan.png', 'https://youtu.be/Gsq9uHdG710', 'https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbjQzQkNoQVdPUnZkcllKa0o3dUhQUC1VclEyZ3xBQ3Jtc0trSW1ybjVCclMwcDNQcDZVLWg3ZzM1aFZDNENjTjRVeXVGYTZadmpWNnRSVm10bXhEZ01ydm9HSEQyVzhkSHZrRmcweGdVbGVTRTBsa1pTVkxGd0hQRW1JREdwczdRbW5tSFVTbGJWWC1WV0g3aUg4cw&q=https%3A%2F%2Fwww.figma.com%2Fproto%2FGEF5EZMCNxYmnhXzbdSIO1%2Fnew-app%3Fnode-id%3D124%253A1218%26scaling%3Dscale-down%26page-id%3D0%253A1%26starting-point-node-id%3D124%253A1218', 'https://api.informatics-expo.id/Cakep (Cegah Kena Penipuan.png', 338, 16, 2, '2021-12-31 16:26:56', '2022-01-01 03:33:17'),
(199, 'SERIUS \"BELAJAR\" ', '{\"blocks\":[{\"key\":\"6rfrq\",\"text\":\"Aplikasi SERIUS BELAJAR  merupakan aplikasi berbasis pendidikan yang dapat dijangkau semua kalangan karena tidak perlu berlangganan apalagi mengeluarkan biaya, oleh karena adanya pandemi covid 19 ini sektor yang terdampak tidak hanya perekonomian saja tapi pendidikan juga ikut terdampak, banyak orang yang terdampak secara ekonomi sehingga mereka mengalami kesulitan dalam membiayai pendidikan anak anaknya, terutama pendidikan tambahan diluar sekolah seperti kebutuhan untuk bimbel, maka dari itu kami berniat menghadirkan sebuah aplikasi yang dapat menjangkau mereka itu, agar mereka dapat merasakan suatu pembelajaran yang menyenangkan dari sebuah video yang tersedia, karena aplikasi yang kami kembangkan ini dapat diakses secara gratis untuk perantara belajar siswa/siswi . Selain itu, minat siswa/siswi dalam belajar daring juga masih tergolong rendah, oleh karenanya membutuhkan sebuah terobosan agar siswa/siswi dimasa pandemi ini dimana mayoritas pembelajaran disekolah dilaksanakan secara daring dapat tetap semangat dalam belajar, karena pandemi bukan suatu hambatan bagi kita semua untuk tetap belajar menuntut ilmu, dari hal tersebut aplikasi kami menyediakan sebuah gift yang akan diberikan kepada siswa/siswi yang semangat dalam menjalankan pembelajaran melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"32a24\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cg62\",\"text\":\"Aplikasi SERIUS BELAJAR merupakan solusi yang tepat atas permasalahan diatas karena fitur yang tersedia pada aplikasi SERIUS BELAJAR  ini menurut kami sudah sangat membantu pengguna atau siswa agar lebih mudah dalam mencari sebuah video pembelajaran. Kami menghadirkan fitur diantaranya fitur search dan filter video, sehingga mereka dapat lebih spesifik untuk mencari video yang mereka inginkan, fitur notifikasi, jadi pengguna dapat langsung mengetahui video pembelajaran apa yang telah dibuat oleh creator yang mereka follow,  fitur share dan download, tentu saja itu sangat berguna bagi para pengguna aplikasi ini, karena jika mereka ingin men-share video materi pembelajaran mereka dapat melakukannya dengan membagikannya via media sosial atau aplikasi pesan instan tentu ini memberikan manfaat karena pengguna juga dapat menyebarkan video kepada teman temannya sehingga diharapkan ilmu yang bermanfaat dapat tersebar luas dan apabila mereka ingin menonton tanpa menggunakan koneksi internet mereka juga dapat mendownloadnya, fitur gift yang diharapkan dapat mendorong semangat belajar bagi siswa/siswi dan yang terakhir yaitu fitur klip, dengan video yang berdurasi panjang pengguna hanya perlu beberapa langkah saja bisa memilih letak momen menariknya dan juga fitur playlist yang dapat mengelompokkan video berdasarkan kategori.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SERIUS \"BELAJAR\" .jpeg', 'https://youtu.be/6QJCXnq_Fno', 'https://www.figma.com/proto/nCbI1DKbJWVXkr3CC9RXay/aplikasi-pendidikan?node-id=525%3A67&scaling=scale-down&page-id=0%3A1&starting-point-node-id=525%3A67', 'https://api.informatics-expo.id/SERIUS \"BELAJAR\" .jpeg', 339, 4, 2, '2021-12-31 16:37:49', '2021-12-31 16:37:49'),
(200, 'Halo Farmasi', '{\"blocks\":[{\"key\":\"alc7q\",\"text\":\"Perkembangan teknologi semakin berinovasi memberikan tantangan bagi manusia untuk terus beradaptasi dengan cepat. Salah satu inovasi dibidang teknologi yaitu inovasi aplikasi. Banyak aplikasi sekarang yang berguna untuk manusia. Zaman modern seperti saat ini kurang lengkap jika kita tidak menggunakan aplikasi secara online. Masyarakat sekarang sudah mulai sibuk dengan kegiatannya masing masing dan juga masyarakat ingin mempunyai aplikasi yang dapat mempermudah pekerjaan. Apalagi saat ini sedang dalam pandemic covid 19, masyarakat takut keluar karena banyaknya kasus terkena virus tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dbm09\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1ohak\",\"text\":\"Maka dari itu, dengan HALO FARMASI anda dapat memesan obat tanpa harus ke apotek. Anda juga dapat melakukan konsultasi dengan dokter secara cepat dan mudah. Dan diaplikasi ini,  juga menyediakan fitur Paylater sehingga anda dapat mendapat obat terlebih dahulu dan membayar belakangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cfi5q\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b2a5\",\"text\":\"MEMBELI OBAT MENGGUNAKAN HANDPHONE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4a6mj\",\"text\":\"Sekarang tidak perlu lagi bersusah-susah untuk pergi ke apotek, tinggal duduk manis lalu obat akan diantar ke alamat anda.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e34et\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"59n6d\",\"text\":\"MENYEDIAKAN FITUR BAYAR NANTI (Paylater)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7g6hd\",\"text\":\"Bagi pengguna yang belum memiliki uang juga bisa membeli obat, tentunya dengan syarat dan ketentuan tertentu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"38vk4\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8mdbf\",\"text\":\"BERKONSULTASI DENGAN DOKTER\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5amq5\",\"text\":\"Kami menghadirkan fitur chat untuk berkonsultasi langsung dengan dokter mengenai penyakit dan obatnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Halo Farmasi.jpeg', 'https://youtu.be/2qOMqOC8Yx8', 'https://www.figma.com/proto/eDi7rPnIhQE6wpSMU6KKhE/Halo-Farmasi?node-id=460%3A429&scaling=min-zoom&page-id=103%3A194&starting-point-node-id=324%3A61', 'https://api.informatics-expo.id/Halo Farmasi.jpeg', 325, 3, 2, '2021-12-31 16:41:33', '2021-12-31 17:27:57');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(223, 'KELASIK', '{\"blocks\":[{\"key\":\"1kvv5\",\"text\":\"Di Masa Pandemi saat ini,banyak siswa yang merasa tertinggal atau tidak mengerti tentang pelajaran di sekolah dikarenakan pembelajaran yang dilakukan secara daring,solusinya mau tidak mau mereka harus mendaftar di bimbingan belajar,masalah yang sering muncul adalah banyak pelajar tidak mendapatkan kuota di bimbel tersebut dan biaya bimbel yang terbilang mahal,selain itu juga karena banyak pelajar yang lebih menyukai pembelajaran secara privat,tetapi kebanyakan hanya berasal dari kenalan guru atau teman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9rdb1\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"kb5f\",\"text\":\"Oleh Karena itu,Kami membuat solusi berupa aplikasi KELASIK. KELASIK merupakan aplikasi pencari pengajar privat yang tidak dipungut biaya dan menampilkan banyak fitur-fitur untuk mencari pengajar privat sehingga mereka dapat memilih belajar apa,metode pembelajaran seperti offline atau online,serta partisipan pembelajaran dan fitur lain seperti materi,informasi universitas,games,quiz,dll yang user friendly dan dapat diakses oleh semua pelajar yang membutuhkan pengajar privat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dmkci\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8jk1c\",\"text\":\"Aplikasi ini diharapkan dapat menyelesaikan masalah yang dapat membantu para pelajar dalam menambah pengetahuan baru dan ilmu  baru yang tidak diajarkan disekolah serta aplikasi ini dapat menyediakan lapangan pekerjaan bagi para pengajar yang belum memiliki pekerjaan dikarenakan susahnya mencari pekerjaan di masa pandemi saat ini.Harapannya aplikasi ini dapat membuat pelajar menjadi mandiri dan memiliki kebebasan untuk dapat belajar dan memilih pengajar yang diinginkan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"22gbe\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9uv1u\",\"text\":\"Konsep aplikasi kami berbeda dengan aplikasi pendidikan lainnya seperti ruangguru,Zenius,dll karena kami ingin menciptakan inovasi baru dalam dunia pendidikan dan menerapkan pentingnya belajar privat serta mandiri dan bebas dalam memilih pembelajaran yang diinginkan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KELASIK.jpeg', 'https://youtu.be/nDtIAJSmZwU', 'https://www.figma.com/proto/od39QuPw0x7GpA4Vpo1f6y/Aplikasi-Kelasik?node-id=1%3A3&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/KELASIK.jpeg', 367, 4, 2, '2022-01-01 04:17:32', '2022-01-01 04:17:32'),
(202, 'Box.id', '{\"blocks\":[{\"key\":\"5b8g8\",\"text\":\"Why Box.id?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5e2nu\",\"text\":\"Bisnis UKM menjadi salah satu alternatif mencari penghasilan di masa pandemi Covid-19 seperti sekarang ini. Oleh karena itu, Box.id hadir untuk bantu wujudkan bisnis UKM masyarakat dan pulihkan kembali perekonomian Indonesia. Go Rangers!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Box.id.png', 'https://youtu.be/kIF3mUQOKBU', '', 'https://api.informatics-expo.id/Box.id.png', 340, 9, 2, '2021-12-31 16:52:41', '2021-12-31 16:52:41'),
(294, 'Genkin itbo', '{\"blocks\":[{\"key\":\"1gaks\",\"text\":\"Proyek ini dibuat karena banyak pelaku usaha kesulitan dalam merekap catatan akhir keuangan usaha mereka, sehingga kami menciptakan aplikasi berbasis web yang kegunaannya untuk mencatat keuangan. Aplikasi ini diberi nama Genkin itbo, guna membantu pelaku UKM dalam mencatat dan merekap catatan akhir keuangan dan meminimalisasi kesalahan dalam perekapan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a85mq\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Genkin itbo.png', 'https://youtu.be/to_jBpkYxYA', '', 'https://api.informatics-expo.id/Genkin itbo.png', 466, 8, 2, '2022-01-01 15:32:58', '2022-01-01 15:32:58'),
(204, 'Crazy Car', '{\"blocks\":[{\"key\":\"63t3e\",\"text\":\"Hero Car adalah seorang relawan yang betugas mengantar vaksin melalui rintangan/obstacle jalanan seperti zombie dan crazy car, vaksin diambil dari checkpoint rumah sakit atau puskesmas penyedia vaksin kemudian diantar ke rumah sakit untuk pasien covid. Dapatkah mobil relawan tersebut berhasil melewati rintangan untuk menyelamatkan pasien covid?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Crazy Car.jpeg', 'https://youtu.be/eZCHpK-N000', '', 'https://api.informatics-expo.id/Crazy Car.jpeg', 331, 9, 2, '2021-12-31 17:48:26', '2021-12-31 17:48:26'),
(205, 'Turispot', '{\"blocks\":[{\"key\":\"943uq\",\"text\":\"Turispot merupakan aplikasi yang digunakan untuk membuat pengguna dapat mengetahui objek-objek wisata yang ada di Yogyakarta yang mungkin belum banyak diketahui oleh masyarakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Turispot.jpeg', 'https://youtu.be/wTQwJXUY_-c', '', 'https://api.informatics-expo.id/Turispot.jpeg', 342, 9, 2, '2021-12-31 18:26:32', '2022-01-02 08:19:51'),
(206, 'Edu-Planner', '{\"blocks\":[{\"key\":\"ff2il\",\"text\":\"Edu-Planner merupakan aplikasi belajar yang membantu pelajar dalam mengorganisir kegiatan belajarnya secara mandiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Edu-Planner.jpeg', 'https://youtu.be/TjA4OSHfS4U', '', 'https://api.informatics-expo.id/Edu-Planner.jpeg', 343, 4, 2, '2021-12-31 18:27:40', '2022-01-01 12:42:56'),
(207, 'Digital Elektronik Shoes', '{\"blocks\":[{\"key\":\"1l7j\",\"text\":\"Digital Elektronik Shoes (Deshoes) merupakan sebuah website marketplace yang berfungsi sebagai sarana bagi pelaku UMKM pengrajin sepatu untuk dapat menjual produk mereka dan mendapatkan jangkauan pasar yang lebih luas. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":219,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"67kih\",\"text\":\"Proyek ini bertujuan untuk membantu para pelaku UMKM khususnya sektor kerajinan  sepatu untuk mendapatkan jangkauan pasar yang lebih luas. Tidak hanya itu, lingkungan yang kami khususkan hanya untuk para pelaku umkm di bidang sepatu yang dimana nantinya  diharapkan mampu untuk menjaga agar pelaku umkm mendapat lingkungan bisnis yang lebih suportif sehingga bisa mngembangkan bisnisnya ke tahap yang lebi baik dan lebih besar lagi.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":433,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":433,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":433,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":433,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":433,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Digital Elektronik Shoes.jpeg', 'https://youtu.be/1ZFA3-kDhtI', 'https://deshoesmarketplace.000webhostapp.com/', 'https://api.informatics-expo.id/Digital Elektronik Shoes.jpeg', 345, 8, 2, '2021-12-31 19:26:54', '2021-12-31 19:26:54'),
(208, 'Turney', '{\"blocks\":[{\"key\":\"bljs\",\"text\":\"Turney Merupakan sebuah aplikasi yang digunakan mahasiswa/i dalam mencari event yang diselenggarakan oleh penyelenggara event serta digunakan mahasiswa/i dalam mencari teman bermain. Digunakan oleh penyelenggara event untuk menyalurkan informasi/mempromosikan event mereka. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":273,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":273,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":273,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":273,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Turney.jpeg', 'https://www.youtube.com/watch?v=5jir2GQvreg', 'https://github.com/Mul101/Turney-App', 'https://api.informatics-expo.id/Turney.jpeg', 346, 9, 2, '2021-12-31 19:30:10', '2021-12-31 19:30:10'),
(213, 'Piyo And The Gangs', '{\"blocks\":[{\"key\":\"dsbha\",\"text\":\"Piyo and the gangs merupakan game 2D platformer yang memberikan keseruan game bertema turn base attack dengan metode baru dengan digabungkan dengan edukasi. Sehingga anak dapat bermain sekaligus belajar pada satu waktu yang sama\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Piyo And The Gangs.png', 'https://www.youtube.com/watch?v=OqQ9ictDE_E&t=11s', 'https://drive.google.com/drive/folders/1RlaEwGU9so2tazv48Z6YyC-1YkPlY--o?usp=sharing', 'https://api.informatics-expo.id/Piyo And The Gangs.png', 276, 4, 2, '2022-01-01 01:03:13', '2022-01-01 01:03:13'),
(299, 'World Goodnes', '{\"blocks\":[{\"key\":\"fbc24\",\"text\":\"World Goodness is a help-based application by helping our less fortunate brothers and sisters \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'World Goodnes.png', 'https://youtu.be/m7n3MuCfJug', 'https://www.figma.com/proto/fkVR1aVIkHmkAPoY9YPuI9/World-goodness?node-id=316%3A1235&scaling=scale-down&page-id=0%3A1&starting-point-node-id=219%3A1454', 'https://api.informatics-expo.id/World Goodnes.png', 476, 2, 2, '2022-01-02 08:09:11', '2022-01-02 08:09:11'),
(300, 'Adventure Of Azura', '{\"blocks\":[{\"key\":\"1c0lq\",\"text\":\"Petualangan Azura dimulai ketika ia ingin menemukan benda pusaka untuk menyelamatkan hutan sekitar. Ia pun berjalan semakin dalam dan ternyata ia tersesat dan harus bertahan hidup di hutan. Ketika Azura sudah lama tersesat, Azura pun merasa lapar dan mulai mencari makanan di dalam hutan. Dihutan ada banyak buah-buahan yang bisa ia makan, ketika ia mengumpulkan buah-buahan tiba-tiba Azura bertemu monster yang bernama Ducky, Azura harus melawan monster tersebut agar bisa bertahan hidup dihutan. Ketika Azura telah mengalahkan monster Ducky, Azura melanjutkan petualangannya dan tiba-tiba ia bertemu sebuah monster yang besar dan lebih kuat dibandingkan monster Ducky yaitu Ducking ternyata dia adalah pemimpin di hutan yang jahat karena suka menyiksa makhluk hidup yang ada di hutan. Oleh karena itu, Azura harus melawannya agar dapat menyelamatkan hutan serta dapat keluar dari hutan. Ayo bantu Azura melawan bebek! \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":920,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":920,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":920,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":920,\"style\":\"fontfamily-Arial\"},{\"offset\":889,\"length\":31,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Adventure Of Azura.png', 'https://youtu.be/ysdMtOCwNbQ', 'https://drive.google.com/file/d/1FnXHWsl_GN046NVRoOpad8VHQ789_Drs/view?usp=sharing', 'https://api.informatics-expo.id/Adventure Of Azura.png', 472, 17, 2, '2022-01-02 08:59:14', '2022-01-02 14:36:45'),
(301, 'Covid Fighter', '{\"blocks\":[{\"key\":\"jhp5\",\"text\":\"Assallamualaikum, rekan-rekan kampus perjuangan.                 \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6bj3m\",\"text\":\"             Kami dari Team Pandemia menperkenalkan dan mengembangkan aplikasi gim bernama Covid Fighter. Aplikasi gim ini bertema covid-19, dimana hari ini masih menjadi momok bagi umat manusia di seluruh muka bumi. Anda akan menjadi seorang dokter yang setiap harinya bekerja di sebuah rumah sakit dan bertahan dari serangan virus Covid-19 yang berbahaya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":28,\"length\":8,\"style\":\"ITALIC\"},{\"offset\":91,\"length\":13,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bqa33\",\"text\":\"                Dengan memanfaatkan gim ini, developer menyajikan gim yang membawa player untuk mengenal lebih jauh berbagai jenis virus covid-19 yang berada saat ini. Dengan gaya penyuluhan yang asik dan berbeda, gim Covid Fighter menyasar anak-anak sebagai target pasar karena diketahui anak-anak masih minim pengetahuan virus Covid-19. Lets go mencoba pengalaman bermain bersama Pandemia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Covid Fighter.jpeg', 'https://www.youtube.com/watch?v=MSR0uc3Z3og', 'https://drive.google.com/file/d/1_k9nP0aVq8MctYYL2x263rYzbkYOOSPF/view?usp=sharing', 'https://api.informatics-expo.id/Covid Fighter.jpeg', 295, 18, 2, '2022-01-02 10:04:05', '2022-01-08 16:23:57'),
(211, 'Upskilling ', '{\"blocks\":[{\"key\":\"778qj\",\"text\":\"Upskilling adalah aplikasi berbasis e-learning yang mempertemukan antara siswa dan mentor untuk mengembangkan keterampilan softskill.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":133,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":133,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":133,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":133,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":133,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"e47vb\",\"text\":\"Kami menyadari softskill sangat diperlukan dalam dunia kerja dan untuk masa depan yang lebih baik. Namun saat ini belum ada tempat khusus untuk mempelajarinya, selain itu karena softskill tidak diresmikan sebagai pelajaran wajib di sekolah, masyarakat menjadi sangat kesulitan jika ingin mempelajari softskill. Sehingga mengakibatkan minimnya kualitas keterampilan softskill dan meningkatnya angka pegangguran.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":410,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":410,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":410,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":410,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":410,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"c2jkp\",\"text\":\"Cara untuk mengembangkan keterampilan softskill begitu banyak, seperti dengan mengikuti seminar atau menonton video dari youtube. Tetapi biasanya kita kesulitan dalam mencari seminar atau video yang terpercaya dan tidak adanya bimbingan langsung dari mentor. Sebab itulah kami tim poseidon mengembangkan aplikasi upskilling ini dengan fitur :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":342,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":342,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":342,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":342,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":342,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"d8rjn\",\"text\":\"1. AKSES VIDEO & LATIHAN SOAL berbagai jenis softskill dari mentor yang ahli\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":76,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":76,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":76,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":76,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":76,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":30,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a8e\",\"text\":\"2. TIMELINE berisi informasi lowongan pekerjaan dan webinar\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":59,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":59,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":59,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":59,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":59,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":12,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a5d5g\",\"text\":\"3. LIVE CHAT yaitu chat dengan mentor secara langsung untuk meminta bimbingan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":77,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":77,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":77,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"f9dk0\",\"text\":\"Pengguna juga dapat memilih apakah ingin menjadi mentor atau ingin menjadi siswa, disini tidak hanya belajar tetapi kita juga dapat mengajarkan softskill yang telah kita miliki. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":177,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":177,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-inherit\"},{\"offset\":49,\"length\":7,\"style\":\"BOLD\"},{\"offset\":75,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"8kdn6\",\"text\":\"Fitur yang lengkap dan sangat dibutuhkan ini akan memudahkan pengguna untuk memaksimalkan proses pengembangan softskill.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":120,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'Upskilling .png', 'https://youtu.be/iX728vQFCmc', 'https://www.figma.com/proto/1EfVQy0WyiRAqj28kg65qx/UPSKILLING-by-POSEIDON?scaling=scale-down&page-id=0%3A1&starting-point-node-id=21%3A223&show-proto-sidebar=1&node-id=21%3A223', 'https://api.informatics-expo.id/Upskilling .png', 349, 4, 2, '2021-12-31 23:11:13', '2022-01-04 16:46:18'),
(212, 'Dive Into Danger', '{\"blocks\":[{\"key\":\"9sio9\",\"text\":\"Dive Into Danger merupakan gim platformer 2D yang memiliki genre adventure.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8tjhg\",\"text\":\"Di suatu kerajaan terdapat tuan putri yang dicintai rakyatnya. Suatu hari saat tuan putri dan pengawalnya pergi ke luar kerajaan, mereka diserang oleh gerombolan monster dan tuan putri diculik oleh para monster. Saat mendengar kabar putrinya diculik oleh monster, raja segera membuat pengumuman yang berisi siapa saja yang berhasil menyelamatkan putrinya akan diberi harta yang banyak. Kabar tuan putri yang diculik dan pengumuman sang raja sampai di telinga Edward, kesatria miskin yang ingin merubah hidupnya. Edward pun tertarik untuk masuk ke sarang para monster dan menyelamatkan tuan putri lalu menjadi kaya. Mampukah Edward menyelamatkan tuan putri? Atau malah nasib buruk yang menghampiri Edward?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Dive Into Danger.png', 'https://youtu.be/w6TXN4acGi8', 'https://github.com/alifmaulanarizqi/Gim-Platformer-2D', 'https://api.informatics-expo.id/Dive Into Danger.png', 326, 19, 2, '2021-12-31 23:18:09', '2022-01-08 06:06:39'),
(214, 'Missing Other Side', '{\"blocks\":[{\"key\":\"b7ue5\",\"text\":\"Seorang bernama Sri Romanoff kehilangan saudaranya yang dicurigai diculik oleh monster-monster yang didalangi oleh seseorang. Sri Romanoff harus menyelamatkan saudaranya dengan melewati beberapa rintangan dan musuh yang dilalui. Selamatkan saudara yang hilang bersama Sri Romanoff!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":281,\"style\":\"color-rgb(13,13,13)\"},{\"offset\":0,\"length\":281,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":281,\"style\":\"fontsize-15\"},{\"offset\":0,\"length\":281,\"style\":\"fontfamily-Roboto, Noto, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Missing Other Side.png', 'https://www.youtube.com/watch?v=vcOPBTNx_l8', '', 'https://api.informatics-expo.id/Missing Other Side.png', 352, 16, 2, '2022-01-01 01:16:15', '2022-01-01 01:23:28'),
(215, 'Faisal Covidventure', '{\"blocks\":[{\"key\":\"cn8e7\",\"text\":\"Di suatu kota yang ditempati Faisal sedang mengalami kasus covid yang cukup memprihatinkan. Banyak warga dan virus covid yang bergerak bebas disana. Faisal yang harus mengunjungi rumah nenek nya harus menghindari hal tersebut dengan menjaga jarak, dan di sepanjang perjalanan Faisal dapat menemui vitamin yang akan menambah daya tahannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Faisal Covidventure.png', 'https://www.youtube.com/watch?v=4sjtFn1egq0', 'https://drive.google.com/file/d/1bJt5rvWR31Lcw8tuYTmxx7NS6SDomafn/view?usp=sharing', 'https://api.informatics-expo.id/Faisal Covidventure.png', 353, 3, 2, '2022-01-01 01:17:54', '2022-01-06 17:05:53'),
(216, 'Stranger', '{\"blocks\":[{\"key\":\"u1vb\",\"text\":\"Platform Stranger ditujukan kepada anak dan remaja yang menjadi korban kekerasan agar dapat bangkit dari trauma dan dapat menjalani kehidupan secara normal dengan mendorong mereka melakukan serangkaian aktivitas yang dijadikan sebagai target harian. Tujuan utama adalah membantu user untuk membentuk kebiasaan baru secara menyenangkan dan mengurangi efek tekanan akibat trauma. Dengan Stranger, user dapat membuat custom avatar dan menentukan karakter avatar dengan diberikan beberapa pilihan karakter serta aktivitas yang ingin user jadikan rutinitas. Setiap aktivitas pada daftar memiliki batas waktu dan status, apabila user lupa mengubah status dari lakukan menjadi selesai maka setelah melewati batas waktu sistem akan mengubah status default yaitu tidak terlaksana. Setiap aktivitas memiliki poin dan akumulasi poin harian menjadi tolak ukur bagi psikiater dalam memantau perkembangan pasien. Untuk melihat dokumentasi dari pengembangan apk Stranger dapat di akses melalui link dibawah ini :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":997,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":997,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":997,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":997,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":9,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7n4gh\",\"text\":\"Dokumen Final Report \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":21,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":21,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":21,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":21,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[{\"offset\":0,\"length\":20,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://drive.google.com/file/d/1dGUWFE5UVENkxFx71bOhPeQSRnljZDx8/view?usp=sharing\",\"targetOption\":\"_self\"}}}}', 'Stranger.jpeg', 'https://www.youtube.com/watch?v=VkIlDokj4_8', 'https://www.slideshare.net/AzkaNabilah/stranger-mobile-apps-by-the-celestial', 'https://api.informatics-expo.id/Stranger.jpeg', 354, 18, 2, '2022-01-01 01:43:53', '2022-01-05 09:29:04'),
(217, 'BOBOT', '{\"blocks\":[{\"key\":\"b5pe7\",\"text\":\"BOBOT adalah Web untuk membantu UKM-UKM kecil mendapatkan Investor\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BOBOT.png', 'https://youtu.be/1jyv-6mQlGc', '', 'https://api.informatics-expo.id/BOBOT.png', 358, 9, 2, '2022-01-01 01:57:47', '2022-01-01 01:57:47'),
(218, 'Stargazing', '{\"blocks\":[{\"key\":\"b2gcb\",\"text\":\"Stargazing adalah aplikasi pendidikan modern di bidang astronomi dengan menerapkan tema gamifikasi yang bisa membuat proses pembelajaran menjadi lebih asik serta menyenangkan dengan menerapkan fitur-fitur yang baru dan unik sesuai dengan minat dan usia pengguna, yaitu anak Sekolah Dasar dengan kelas 4, 5, dan 6.\\n\\nGamifikasi yang diterapkan yaitu dengan menciptakan fitur quiz yang dilengkapi dengan progress bar agar pengguna bisa mengetahui sejauh mana dalam mengerjakan quiz. Setelah pengguna mengerjakan quiz, muncul score yang didapatkan dan score tersebut bisa dicompare dengan pengguna lain dengan adanya fitur leaderboard.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":373,\"length\":4,\"style\":\"BOLD\"},{\"offset\":401,\"length\":12,\"style\":\"BOLD\"},{\"offset\":619,\"length\":11,\"style\":\"BOLD\"},{\"offset\":373,\"length\":4,\"style\":\"ITALIC\"},{\"offset\":401,\"length\":12,\"style\":\"ITALIC\"},{\"offset\":619,\"length\":11,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Stargazing.png', 'https://youtu.be/KcrNoO5y01M', 'https://github.com/yoesran/stargazing', 'https://api.informatics-expo.id/Stargazing.png', 243, 4, 2, '2022-01-01 01:59:30', '2022-01-01 01:59:30'),
(219, 'Asep : Perjalanan di Kota Virus ', '{\"blocks\":[{\"key\":\"abgti\",\"text\":\"Kota Amanesu terserang virus berbahaya! Virus-virus tersebut  dengan cepat menyebar dengan sentuhan maupun dari udara dalam jarak yang sangat dekat. Asep sebagai kurir harus mengantarkan paket makanan dari satu tempat ke tempat lain dengan aman agar para penduduk tidak kelaparan di saat pandemi berlangsung. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":308,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":308,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":308,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Asep : Perjalanan di Kota Virus .png', 'https://youtu.be/9_Mw8Y6R2DY', '', 'https://api.informatics-expo.id/Asep : Perjalanan di Kota Virus .png', 359, 18, 2, '2022-01-01 02:03:28', '2022-01-02 16:49:46'),
(220, 'Chabit', '{\"blocks\":[{\"key\":\"90s6d\",\"text\":\"Climate change is a significant change in climate, air temperature and rainfall. What we have experienced is the decline in air health due to motorized vehicles or forest fires. Besidesthat, garbage also greatly affects the quality of the natural environment and it is also very disturbing to living things around us. To solve this problem we introduce you to an application called Chabit. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dlvnn\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cr1ge\",\"text\":\"Chabit is an application that helps you to change your life habits tobe more environmentally friendly. We want to invite you to help reduce the impact of climate change, caring about the environment, and also make people more aware about the importance of caring for the environment.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"144ce\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"et4rg\",\"text\":\"Chabit provides several interesting features such as:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bog9\",\"text\":\"1. Pacer\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"210ch\",\"text\":\"Pacer is a feature that supports the movement to reduce air pollution that is if you choose to walk then you can convert your number of steps to coins.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ebjsr\",\"text\":\"2. Sell Ur Trash\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5elll\",\"text\":\"Sell Ur Trash is a feature that invites you to manage the amount of trash. You can sell your trash and get incentives.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ed2ei\",\"text\":\"3. Recycle Marketplace\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"v6jb\",\"text\":\"The marketplace in our app is more unique than others because we sell recycled goods that can be reused and be useful again.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Chabit.png', 'https://youtu.be/l8q7o1UQwd4', 'https://www.figma.com/proto/MTyKI559FFiY7UOSHECTmp/Group-1-CYBERISE-Chabit-Design-Thinking-Project?node-id=380%3A20538&scaling=scale-down&starting-point-node-id=477%3A18168&show-proto-sidebar=1', 'https://api.informatics-expo.id/Chabit.png', 356, 13, 2, '2022-01-01 02:18:00', '2022-01-01 02:18:00'),
(221, 'AstronautGo', '{\"blocks\":[{\"key\":\"1fphg\",\"text\":\"AstronautGo merupakan gim dua dimensi, dalam gim ini ada seorang astronaut yang memiliki tujuan untuk mendapatkan sebanyak-banyaknya rocket agar dapat kembali ke bumi. Gim ini hanya dapat dimainkan oleh 1 orang. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":11,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"131qe\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3vo9m\",\"text\":\"Gim ini akan dibangun dengan tema luar angkasa dimana pemain harus terus bergerak dan menembak musuhnya dan menghindari rintangan yang ada. Pemain dapat mengumpulkan rocket sebanyak-banyaknya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":167,\"length\":5,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"ds3qp\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"csv4a\",\"text\":\"Jumlah rocket yang dikumpulkan nantinya akan digunakan sebagai skor pemain,jika bintang tercukupi maka rocket dapat digunakan oleh sang astronaut untuk pulang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":7,\"length\":6,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dh52d\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4hu1u\",\"text\":\"Platformer gim menggunakan PC yang dikendalikan dengan keyboard. Pada tampilan game terdapat background luar angkasa dengan pemandangan galaxy yang indah sebagai bentuk kita menyayangi planet kita.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":14,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AstronautGo.png', 'https://youtu.be/or99fU2ZVLI', '', 'https://api.informatics-expo.id/AstronautGo.png', 270, 9, 2, '2022-01-01 02:24:17', '2022-01-02 13:21:54'),
(222, 'YukBisnis!', '{\"blocks\":[{\"key\":\"9l7ff\",\"text\":\"Wanna be an entrepreneur but got stuck on finding a nice idea? Well, others share their ideas on YukBisnis!, so people like you can find inspirations! You can share your ideas too, so others can give you the feedbacks you need~ Join the growing community of entrepreneurs on YukBisnis!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":285,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":285,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":285,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":285,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":285,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"a9af5\",\"text\":\"We make no claim, it is all on you! \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'YukBisnis!.jpeg', 'https://youtu.be/8k2JMMY60bc', 'http://yukbisnis-super-sentai.herokuapp.com/', 'https://api.informatics-expo.id/YukBisnis!.jpeg', 362, 8, 2, '2022-01-01 02:47:50', '2022-01-01 12:30:30'),
(224, 'BaliCraft', '{\"blocks\":[{\"key\":\"5n69a\",\"text\":\"Bali Craft merupakan suatu sistem perangkat lunak Ecommerce marketplace yang memberikan fasilitas kepada pelaku UKM agar dapat berpartisipasi mempromosikan lapak dagang serta menjual produk bisnis yang mana merupakan produk khas asli dari bali. Bali Craft dimaksudkan untuk membantu pelaku UKM setempat agar dapat memulihkan kembali perekonomian sekaligus diharapkan dapat membantu program we love Bali movement sehingga dapat bermanfaat untuk perekonomian Bali agar bisa kembali pulih\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":485,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":485,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":485,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":485,\"style\":\"fontfamily-Arial\"},{\"offset\":50,\"length\":21,\"style\":\"ITALIC\"},{\"offset\":390,\"length\":21,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BaliCraft.png', 'https://youtu.be/uODqXr53rC4', 'https://linktr.ee/BaliCraft', 'https://api.informatics-expo.id/BaliCraft.png', 300, 8, 2, '2022-01-01 04:38:12', '2022-01-02 00:29:31'),
(225, 'UKMZone', '{\"blocks\":[{\"key\":\"8ui9r\",\"text\":\"Aplikasi berbasis web untuk jual beli buah-buahan di daerah sekitaran jogjakarta\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKMZone.png', 'https://youtu.be/vTC26eN0pr4', 'https://github.com/hamidibm/EXPO--FutureRoad', 'https://api.informatics-expo.id/UKMZone.png', 302, 8, 2, '2022-01-01 04:42:32', '2022-04-11 23:39:41'),
(226, 'Healthy Life', '{\"blocks\":[{\"key\":\"9k2ds\",\"text\":\"Menurut data WHO dan UNICEF menyebutkan bahwa saat ini jumlah orang dewasa yang kelebihan berat badan di Indonesia telah berlipat ganda selama dua dekade terakhir. Obesitas pada anak-anak juga meningkat dengan satu dari lima anak usia sekolah dasar dan satu dari tujuh usia remaja di Indonesia kelebihan berat badan menurut Survei Riset Kesehatan Dasar (RISKESDAS) nasional tahun 2018. Oleh karena itu, Healthy Life dikembangkan untuk mengatasi beberapa permasalahan tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":476,\"style\":\"color-black\"},{\"offset\":0,\"length\":476,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":476,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3dd08\",\"text\":\"Healthy Life merupakan sebuah aplikasi mobile yang bergerak pada bidang kesehatan. Aplikasi ini nantinya akan menyediakan berbagai macam fitur kesehatan seperti fitur pengukuran Body Mass Index (BMI), tips dan trik yang dapat membantu pengguna agar bisa hidup lebih sehat, penyedia informasi tentang berbagai macam penyakit gizi, dan fitur workout.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":200,\"style\":\"color-black\"},{\"offset\":201,\"length\":147,\"style\":\"color-black\"},{\"offset\":0,\"length\":200,\"style\":\"fontsize-12pt\"},{\"offset\":201,\"length\":147,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":200,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"},{\"offset\":201,\"length\":147,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Healthy Life.png', 'https://youtu.be/Y26WweKY67M', '', 'https://api.informatics-expo.id/Healthy Life.png', 255, 18, 2, '2022-01-01 05:11:55', '2022-01-03 14:26:35'),
(227, 'Polaris', '{\"blocks\":[{\"key\":\"eg3r9\",\"text\":\"Masa pandemi sekarang mengubah perilaku manusia terutama di bidang \\npendidikan. Pembelajaran harus berubah menjadi pembelajaran daring dan \\npara murid harus membiasakan diri dengan suasana belajar yang baru. \\nmencari materi pun akan sullit dan jika ingin berlangganan aplikasi \\nbelajar online akan mahal harganya. di situasi seperti ini lah Polaris \\nmuncul\\n\\nPolaris adalah aplikasi pembelajaran online khusus SMA yang berfokus \\npada 3 mata pelajaran, yaitu matematika, bahasa indonesia, dan bahasa \\ninggris. aplikasi ini dibuat sedemikian rupa sehingga dapat dipahami \\noleh semua orang dan aplikasi ini bebas biaya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Polaris.jpeg', 'https://youtu.be/vhaHWBw4IeU', 'https://www.figma.com/proto/f8RSAXtYTurM8bXywGbjgG/POLARIS?node-id=5%3A11&scaling=scale-down&page-id=0%3A1&starting-point-node-id=5%3A11', 'https://api.informatics-expo.id/Polaris.jpeg', 374, 4, 2, '2022-01-01 05:42:18', '2022-01-01 05:42:18'),
(228, 'Escape The Cave', '{\"blocks\":[{\"key\":\"8oc34\",\"text\":\"Di bawah kota Rex City terdapat sebuah gua tersembunyi yang tidak pernah diketahui sebelumnya. Gua tersebut sebelumnya dibuat oleh seorang ilmuwan gila yang melakukan penelitian di dalam gua dan ia menyembunyikan penemuannya  tersebut. Gua tersebut berisi labirin-labirin yang terkunci dan dipenuhi oleh teka-teki. Apabila seseorang memasuki gua tersebut maka harus menyelesaikan labirin-labirin tersebut untuk keluar.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Escape The Cave.jpeg', 'https://youtu.be/tvHiE_JahbQ', '', 'https://api.informatics-expo.id/Escape The Cave.jpeg', 252, 4, 2, '2022-01-01 05:47:30', '2022-01-01 05:47:30'),
(229, 'Funden', '{\"blocks\":[{\"key\":\"7f7oo\",\"text\":\"Funden adalah sebuah aplikasi berbasis web untuk membantu para pelaku UKM untuk mendapatkan donasi/dana dari investor.   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":118,\"style\":\"fontfamily-Helvetica Neue\"},{\"offset\":0,\"length\":121,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Funden.jpeg', 'https://www.youtube.com/watch?v=5msHN1Zfpi0', '', 'https://api.informatics-expo.id/Funden.jpeg', 259, 8, 2, '2022-01-01 05:49:50', '2022-01-01 05:49:50'),
(230, ' KaUM', '{\"blocks\":[{\"key\":\"bvhqo\",\"text\":\"KaUM adalah sebuah aplikasi dibidang pencatatan keuangan dan pengeluaran UMKM yang dimana membantu para usaha kecil dan menengah dalam mengelola pengeluaran dan pemasukan keuangan setiap harinya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', ' KaUM.png', 'https://youtu.be/yI2iUd-YH1Q', '', 'https://api.informatics-expo.id/ KaUM.png', 311, 8, 2, '2022-01-01 05:54:32', '2022-01-01 14:47:42'),
(231, 'Pirate Of Nirvana', '{\"blocks\":[{\"key\":\"d75ib\",\"text\":\"Di sebuah pulau terdapat seorang bajak laut yang bernama Nirvana. Pada suatu hari bajak laut bajak laut Nirvana datang ke sebuah pulau untuk mencari harta Karun yang ada di pulau tersebut. Di dalam perjalanannya Nirvana bertemu dengan monster - monster serta perangkap yangdapat mengganggu perjalanannya untuk mencari harta karun. Untuk berhasil mendapatkan harta karun itu Nirvana harus menghindari perangkap serta melawan serangan monster itu terlebih dahulu.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":462,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":462,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":462,\"style\":\"fontfamily-Calibri\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pirate Of Nirvana.png', 'https://youtu.be/i4qYZRXUK04', '', 'https://api.informatics-expo.id/Pirate Of Nirvana.png', 314, 9, 2, '2022-01-01 06:27:26', '2022-01-01 06:27:26'),
(232, 'Your Trainer', '{\"blocks\":[{\"key\":\"bgb43\",\"text\":\"Your Trainer merupakan aplikasi pendamping workout dan olahraga anda. Pandemi seperti saat ini seharusnya tidak menjadi sebuah halangan untuk kita tetap berolahraga dan menerapkan gaya hidup sehat. Namun, karena pandemi ini juga banyak fasilitas kesehatan yang ditutup serta masyarakat banyak menghabiskan waktunya dirumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1ap5c\",\"text\":\"Your Trainer hadir menjawab permasalahan ini, dengan mengusung konsep 3in1, aplikasi ini membungkus tiga fitur utama yang biasanya terpisah kini menjadi satu dalam aplikasi ini. Fitur yang pertama adalah video workout yang dapat anda gunakan sebagai asisten pribadi anda dari balik layar untuk melakukan olahraga, tersedia ratusan video dan jenis olahraga yang dapat anda pilih agar stay fit walau dari rumah. Fitur \\\"Meal Plan\\\" berisikan palnning makan dan minum anda yang dapt mengatur pola makan sehat yang dapat membantu anda menjaga pola makan, pada fitur ini anda dapat menemukan ratusan resep makan sehat. Dan yang terakhir adalah \\\"Health Center\\\" dan \\\"Schedule\\\", dalam fitur ini anda dapat melihat progres olahraga anda, mengatur jadwal dan melihat banyak tips kesehatan lainnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7u9jj\",\"text\":\"Your Trainer hadir memudahkan hidup anda, tunggu apalagi nantikan kehadiran kami. Teruslah bergerak!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Your Trainer.png', 'https://youtu.be/GtY4cxkaP-Y', 'https://www.figma.com/proto/2tC5mfPCuVs5Gi4VaanVnl/Prototype-Design-Thinking?node-id=304%3A10&scaling=scale-down&page-id=0%3A1&starting-point-node-id=304%3A10', 'https://api.informatics-expo.id/Your Trainer.png', 318, 3, 2, '2022-01-01 06:35:09', '2022-01-01 06:35:09'),
(233, 'Inflow', '{\"blocks\":[{\"key\":\"9chns\",\"text\":\"INFLOW adalah sebuah aplikasi mobile (mobile app) yang berisi tentang perkembangan seputar dunia entertainment khususnya video game. Dengan INFLOW pengguna dapat membaca dan menulis review video game, dan juga berinteraksi dengan review tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Inflow.png', 'https://rebrand.ly/inflowVideo', '', 'https://api.informatics-expo.id/Inflow.png', 388, 9, 2, '2022-01-01 06:59:10', '2022-01-02 16:31:27'),
(234, 'Start Up', '{\"blocks\":[{\"key\":\"ddff7\",\"text\":\"Start Up merupakan sebuah program yang melayani investasi berbasis website. Dalam perkembangan jaman saat ini teknologi makin hari semakin menggila atau bisa dikatakan semakin canggih, salah satunya adalah dalam berinvestasi. Dan Start Up hadir dan fokus kepada investasi UKM. investor dapat berinvetasi dengan sangat mudah, karena hal tersebut bisa dilakukan secara daring atau online.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Start Up.png', 'https://youtu.be/YVKAXI4TZ58', 'https://docs.google.com/presentation/d/1zK5UxIWEeDYhIEO871DtTZhj-TdtU7L8N8SD0eh5J6E/edit#slide=id.g10b595daf6e_0_109', 'https://api.informatics-expo.id/Start Up.png', 389, 9, 2, '2022-01-01 07:10:24', '2022-01-02 14:00:07'),
(235, 'PENKU', '{\"blocks\":[{\"key\":\"f8ka\",\"text\":\"Masyarakat di Indonesia sangat banyak yang bergantung pada pekerjaan UKM, tetapi terdapat masalah yang banyak dialami oleh pelaku UKM. Salah satu masalah utama pelaku UKM yaitu kesulitan dalam mengatur keuangan seperti, mengatur pengeluaran, pendapatan, keuntungan dan kerugian penjualan produk para UKM dan juga banyak ukm yang mengalami kehilangan data dikarenakan masih menggunakan pencatatan manual.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":403,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":403,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":403,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":403,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"42hg8\",\"text\":\"Maka dari itu PENKU hadir untuk Anda!!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b43f8\",\"text\":\"PENKU atau Pengatur Keuangan adalah aplikasi berbasis website untuk melakukan pencatatan keuangan seperti mencatat pendapatan dan pengeluaran bagi pelaku ukm di Yogyakarta agar memudahkan dalam menunjang usaha kedepannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":221,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":221,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":221,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":221,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PENKU.png', 'https://youtu.be/ao05CB6oEFM', '', 'https://api.informatics-expo.id/PENKU.png', 387, 8, 2, '2022-01-01 07:13:20', '2022-01-01 07:13:20'),
(236, 'BISA (Business Idea Sharing Application)', '{\"blocks\":[{\"key\":\"92sf4\",\"text\":\"Sebuah platform untuk  mempertemukan masyarakat yang memiliki ide bisnis dengan masyarakat luar yang sedang mencari ide bisnis dan juga memungkinkan masyarakat luar untuk melakukan kerja sama dengan pemilik ide dalam bentuk franchise.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISA (Business Idea Sharing Application).png', 'https://youtu.be/KUooCLwgxZs', '', 'https://api.informatics-expo.id/BISA (Business Idea Sharing Application).png', 390, 8, 2, '2022-01-01 07:56:14', '2022-01-01 07:56:14'),
(237, 'FlagQuizz', '{\"blocks\":[{\"key\":\"9tjs2\",\"text\":\"Aplikasi ini merupakan aplikasi quiz mengenai bendera-bendera untuk siswa Sekolah Dasar dari 4-6 yang masih bingung bentuk bendera negara di dunia ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FlagQuizz.png', 'https://youtu.be/U1Rxq1V8Yjk', '', 'https://api.informatics-expo.id/FlagQuizz.png', 373, 4, 2, '2022-01-01 07:56:18', '2022-01-01 07:56:18');
