(238, '2nd\'Chance', '{\"blocks\":[{\"key\":\"3en2t\",\"text\":\"Kita saat ini berada pada \\\"Kode Merah\\\" untuk umat manusia di bumi, karenanya UN (United Nations) menggagas SDG ( Sustainable Development Goals) yang memiliki 17 Goals, dan pada proyek ini kami mengambil goal nomor 13 yaitu Climate Action. Dengan majunya teknologi dan semakin banyaknya informasi yang tersedia di internet. Kedua kemajuan di aspek ini dapat memberi dampak baik dan buruk juga. Saat ini dengan banyaknya informasi yang bersebaran di internet, pengguna internet dapat menemukan banyak informasi juga seputar perubahan iklim, namun karena banyaknya informasi juga dapat membuat seseorang kewalahan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"442gf\",\"text\":\"2nd\'Chance adalah aplikasi untuk membantu seseorang mengetahui tindakan apa saja yang dapat dilakukan individu dengan mudah untuk mengurangi dampak perubahan iklim, serta menambah teman yang memiliki keinginan yang sama. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"bqvm5\",\"text\":\"Aplikasi Kami pun memiliki beberapa fitur yang bisa digunakan oleh para pengguna kami:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"b0cbf\",\"text\":\"-\\tFitur Lonceng\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"f8266\",\"text\":\"Fitur Lonceng memungkin pengguna untuk mendapatkan pengingat/alarm dari aksi yang telah dipilih oleh pengguna setelah melihat keterangan dari aksi dan melihat tips bagaimana cara untuk melakukan tindakan tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"3dnlg\",\"text\":\"-\\tFitur Peringkat Mingguan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"b87do\",\"text\":\"Fitur Peringkat Mingguan memungkinkan pengguna untuk mendapatkan motivasi dan semangat yang lebih untuk melakukan aksi yang tertera pada aplikasi kami. Kami juga memberikan 3 peringkat spesial untuk para pengguna yaitu jika pengguna berada di posisi pertama pengguna akan mendapatkan gold medal, jika pengguna berada di posisi kedua pengguna akan mendapatkan silver medal, dan jika pengguna berada di posisi ketiga pengguna akan mendapatkan bronze medal.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"459ju\",\"text\":\"-\\tFitur Eksplorasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"8uvji\",\"text\":\"Fitur Eksplorasi memungkinkan pengguna untuk melihat apa yang dikatakan pengguna lainnya dengan topik yang luas karena kami tidak membatasi ruang diskusi yang ada.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5o0jh\",\"text\":\"-\\tFitur Tambah Teman\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"e0q01\",\"text\":\"Fitur Tambah Teman memungkinkan pengguna untuk menambahkan teman dari berbagai macam level dan peringkat. Jika pengguna sudah menambah teman, pengguna bisa melihat peringkat apa saja yang telah dicapai oleh pengguna tersebut \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5bmdi\",\"text\":\"-\\tFitur Berdasarkan Kategori\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5o0sn\",\"text\":\"Fitur Berdasarkan Kategori memungkinkan pengguna untuk mensortir aksi yang ingin dilihat berdasarkan kategori yang ada yaitu makanan, transportasi, sumber daya, Luar Ruangan, dan komunitas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"divp6\",\"text\":\"-\\tFitur Kostumisasi Profil\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"4u6da\",\"text\":\"Fitur Kostumisasi Profil memungkinkan pengguna untuk mengkostumisasi profilnya sesuai keinginan pengguna seperti info/bio dan gambar profil.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"6q1j\",\"text\":\"-\\tFitur XP (experience point)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"710m3\",\"text\":\"Fitur XP (experience point) memungkinkan pengguna untuk mendapatkan poin disetiap aksi yang sudah dilakukan oleh pengguna itu sendiri. Poin ini juga akan direpresentasikan oleh level yang dimiliki pengguna itu sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', '2nd\'Chance.png', 'https://youtu.be/zSAe87HRUUU', 'https://www.figma.com/proto/AKJ16hVXRRnGub4NxRU0Jx/2nd\'Chance?node-id=15%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=15%3A2', 'https://api.informatics-expo.id/2nd\'Chance.png', 397, 13, 2, '2022-01-01 08:11:33', '2022-01-01 09:01:34'),
(239, 'GYM Care', '{\"blocks\":[{\"key\":\"39tgr\",\"text\":\"Sebuah aplikasi yang bisa memberikan reminder untuk melakukan aktivitas olahraga bagi pengguna. Kita juga dapat melakukan konsultasi dengan instruktur olahraga guna menemukan pola olahraga yang sesuai dengan aktivitas harian kita. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":230,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":230,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":230,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":230,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":37,\"length\":8,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GYM Care.jpeg', 'https://youtu.be/k3KB5fbLyZw', '', 'https://api.informatics-expo.id/GYM Care.jpeg', 398, 18, 2, '2022-01-01 08:15:49', '2022-01-02 07:57:24'),
(240, 'SCHEFOC', '{\"blocks\":[{\"key\":\"7m170\",\"text\":\"Pada masa pandemi ini kegiatan pembelajaran mulai dilaksanakan secara online atau daring. Banyak sekali masalah yang dihadapi dalam pembelajaran daring ini salah satunya adalah terlambat, seperti terlambat dalam masuk pertemuan sinkron, terlambat dalam mengumpulkan tugas, dan terlambat dalam ujian.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"21ljp\",\"text\":\"Oleh karena itu kami membuat aplikasi yaitu SCHEFOC yang dapat membantu mengatasi permasalahan tersebut. SCHEFOC merupakan aplikasi penjadwalan yang dikhususkan untuk menjadwalkan kegiatan pembelajaran online mulai dari pertemuan sinkron dari google meet, zoom, dan sebagainya. Juga membantu menjadwalkan untuk pengumpulan tugas dan quiz dan pelaksanaan ujian. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fndn7\",\"text\":\"Aplikasi ini menghadirkan beberapa fitur seperti scheduler. Scheduler merupakan fitur utama yang ada diaplikasi kami. fitur ini membantu kita untuk membuat jadwal dan menampilkan jadwal tersebut. Selanjutnya adalah Reminder, fitur ini dapat membantu kita untuk mengingatkan jadwal yang sudah kita buat. Aplikasi ini tidak seperti Google Kalender atau Kalender pada umumnya karena aplikasi ini dibuat khusus pembelajaran online sehingga tampilannya lebih sederhana dan mudah untuk digunakan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SCHEFOC.png', 'https://youtu.be/SyeWkpUICIE', 'https://www.figma.com/proto/oddU78k5ReyVOSsVuc9Vew/Schefoc-(Scheduler-for-online-class)?page-id=0%3A1&node-id=1%3A41&viewport=241%2C48%2C0.5&scaling=scale-down&starting-point-node-id=1%3A41&hotspot-hints=0', 'https://api.informatics-expo.id/SCHEFOC.png', 308, 4, 2, '2022-01-01 08:34:01', '2022-01-01 08:34:01'),
(241, 'BuyMe', '{\"blocks\":[{\"key\":\"5aacu\",\"text\":\"BuyMe, aplikasi jual beli produk UKM berbasis web merupakan aplikasi yang memiliki tujuan untuk menciptakan media yang dapat memperkenalkan produk-produk UKM, termasuk memfasilitasi masyarakat untuk membeli produk-produk ini karena para Usaha Kecil dan Menengah masih kurang dilirik oleh masyarakat, padahal UKM atau Usaha Kecil dan Menengah dapat menjadi salah satu sektor bisnis yang menggerakkan roda perekonomian masyarakat dan secara kualitas, produk-produk luaran UKM ini memiliki banyak keunggulan, termasuk dari sisi harga yang tentunya lebih terjangkau dibandingkan produk yang dihasilkan oleh usaha-usaha besar. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7i2ct\",\"text\":\"BuyMe memiliki beberapa fitur yang diharapkan dapat membantu para pengusaha UKM untuk mengembangkan produk-produknya serta memudahkan para pelanggan untuk dapat berbelanja dengan aman dan nyaman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BuyMe.png', 'https://youtu.be/pBtL1i1Na0U', 'https://youtu.be/pBtL1i1Na0U?t=68', 'https://api.informatics-expo.id/BuyMe.png', 400, 8, 2, '2022-01-01 08:42:01', '2022-01-01 08:42:01'),
(242, 'Koma,', '{\"blocks\":[{\"key\":\"d6121\",\"text\":\"Sistem KOMA adalag sebuah platform marketplace untuk jual beli khusus produk bahan bangunan. Fokus utama UTAMA disamping sistem jual belinya adalah mendorong kompetisi antar penjual melalui fitur leaderboard dan badge berbasis ulasan dari pembeli.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dj3ov\",\"text\":\"Leaderboard adalah sebuah fitur untuk mengurutkan nilai ulasan toko untuk setiap kategori. Kategori yang diberikan meliputi : tingkat kecepatan respon pesan, keramahan, kualitas pengemasan, serta kesesuain deskripsi dan foto terhadap produk yang sudah dibeli. Sedangkan badge adalah penanda bagi setiap toko apabila toko tersebut memiliki nilai yang bagus pada kategori penilaian yang ada. Diharapkan dengan adanya kedua fitur tersebut dapat mendorong penjual untuk selalu meningkatkan layanan dan produk yang diberikan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Koma,.jpeg', 'https://youtu.be/lLWWiXmbEuE', 'https://github.com/farizbaiquni/marketplace-to-buy-and-sell-building-materials', 'https://api.informatics-expo.id/Koma,.jpeg', 365, 17, 2, '2022-01-01 09:03:17', '2022-01-01 09:03:17'),
(250, 'SCHOOLARIA', '{\"blocks\":[{\"key\":\"3unk9\",\"text\":\"Di era teknologi yang serba canggih ini, dimana kita dapat dengan mudah untuk mendapatkan informasi dan akses belajar. Salah satunya untuk kebutuhan mahasiswa dalam hal kelancaran proses belajar dan mengajar.\\n\\nMelihat masalah tersebut, kami Voyager Spacecraft menciptakan Schoolaria dengan tujuan untuk mendukung kegiatan belajar dan mengajar mahasiswa di kampus maupun diluar kampus, memperkenalkan kualitas teknologi dalam pendidikan, dan membantu proses belajar mahasiwa tanpa batasan ruang dan waktu.\\n\\nSchoolaria menggunakan konsep yang semenarik mungkin yang bisa membuat suasana yang menyenangkan, dan tanpa kejenuhan.\\n\\nTim kami berharap dapat membantu pengguna untuk tumbuh dan berkembang dengan wawasan lingkungan yang berdimensi kosmologis, sosiologis dan teologis. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":774,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":774,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":774,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":774,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SCHOOLARIA.jpeg', 'https://youtu.be/pOGUb8eV_Tc', 'https://www.figma.com/proto/CbQHoikdN4bUs601C3dUa6/VoyagerSpaceCraft?node-id=365%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/SCHOOLARIA.jpeg', 411, 4, 2, '2022-01-01 10:01:11', '2022-01-01 10:01:11'),
(248, 'FunMath', '{\"blocks\":[{\"key\":\"9rq24\",\"text\":\"Funmath adalah sebuah game edukasi yang asik, tidak membosankan, dan dapat membantu anak meningkatkan kemampuannya dalam mengasah keterampilan menghitung operasi dasar matematika seperti bilangan penjumlahan, pengurangan, perkalian, pembagian.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FunMath.jpeg', 'https://youtu.be/D_lFaC6Z11U', 'https://youtu.be/iNmw4RpwYAA', 'https://api.informatics-expo.id/FunMath.jpeg', 391, 4, 2, '2022-01-01 09:52:56', '2022-01-01 09:52:56'),
(244, 'MyOcean', '{\"blocks\":[{\"key\":\"1dei3\",\"text\":\"MyOcean adalah Aplikasi yang berguna dalam upaya membantu melestarikan kebersihan laut yang berbasis edukasi serta pemasaran produk-produk daur ulang dari limbah pesisir. Dari pada membuang dan membiarkan sampah berserakan di pantai, Anda dapat memanfaatkannya kembali lalu menjualnya. \\n\\nUntuk mendapatkan inspirasi mengenai produk yang akan dijual, Anda dapat menonton video-video edukasi dari aplikasi ini. Lalu, Anda bisa menjual hasil karya/kerajinan yang dibuat di aplikasi ini juga. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":490,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2af3o\",\"text\":\"HOME/BERANDA \\n\\nPada beranda terdapat fitur-fitur: \\n\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":51,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"frsbh\",\"text\":\"Pasar : untuk jual beli produk daur ulang sampah pesisir ataupun sampah pesisir itu sendiri yang masih bisa dimanfaatkan.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":121,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fr4o1\",\"text\":\"Video Edukasi : berisi video-video edukasi tentang cara melestarikan laut serta pengelolaan dan pemanfaatan sampah pesisir. Anda dapat mencari ide bisnis produk kerajinan dari video-video yang tersedia. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":203,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"e2ck1\",\"text\":\"History : berisi riwayat pembelian, penjualan, dan tontonan video. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":67,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"cm6st\",\"text\":\"Berita : berisi berita terkini tentang kelautan/kemaritiman. \\n\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":62,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b085\",\"text\":\"INBOX : \\n\\nPada Inbox terdapat fitur-fitur: \\n\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":44,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"do6uj\",\"text\":\"Chat : terdapat dua fitur yaitu percakapan pengguna sebagai pembeli dan percakapan pengguna sebagai penjual. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":109,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bruia\",\"text\":\"Notification : berisi notifikasi yang dikirimkan kepada pengguna sebagai pembeli dan juga penjual. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":99,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3o5ru\",\"text\":\"MENU UTAMA : \\n\\nPada Menu Utama  terdapat fitur-fitur:\\n \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":55,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7eg3\",\"text\":\"Akun : untuk melihat dan mengubah informasi akun.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":49,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"1e3qh\",\"text\":\"Toko Saya : untuk membuat toko dan menjual produk daur ulang/kerajinan dari sampah pesisir.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":91,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6d1se\",\"text\":\"Log Out : untuk keluar dari aplikasi\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":36,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MyOcean.jpeg', 'https://youtu.be/Wx31oaHfAHE', 'https://www.figma.com/proto/HstJEMn7r5sm1deraD609l/Project-LINUX?node-id=65%3A188&scaling=scale-down&page-id=3%3A25&starting-point-node-id=65%3A188', 'https://api.informatics-expo.id/MyOcean.jpeg', 401, 14, 2, '2022-01-01 09:09:36', '2022-01-01 13:01:37'),
(249, 'Mari Kerja ', '{\"blocks\":[{\"key\":\"drbvb\",\"text\":\"Mari Kerja merupakan aplikasi untuk mencari lowongan pekerjaan dengan mudah. Tersedia berbagai fitur seperti jenis pekerjaan yang dipilih,gaji dan riwayat pekerjaan yang di lamar. Aplikasi ini juga menyediakan fitur untuk orang orang yang sedang mencari karyawan. Semoga aplikasi ini dapat membantu dan mempermudah anda untuk mencari pekerjaan dan mencari karyawan \",\"type\":\"code\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'Mari Kerja .png', 'https://youtu.be/EE42MYH99dw', 'https://www.figma.com/proto/4nOh2voEoQcplXLl5VbnMS/Project-Satam-Stone-1-Final?node-id=1%3A2&scaling=scale-down&page-https://www.figma.com/proto/4nOh2voEoQcplXLl5VbnMS/Project-Satam-Stone-1-Final?node-id=1%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Mari Kerja .png', 403, 8, 2, '2022-01-01 09:56:31', '2022-01-01 09:56:31'),
(251, 'dr.Nabah the story of kampung singa', '{\"blocks\":[{\"key\":\"8rt54\",\"text\":\"Seorang dokter muda mendedikasikan hidupnya untuk membantu mengobati warga di sebuah kampung bernama kampung singa , dikampung ini masi mempercayai hubungan penyakit dengan mistis akibat pengaruh dari seorang dukun yang ada di desa itu.nabah datang untuk memperkenalkan pengobatan sains modern dan membebaskan warga desa dari pengaruh yang tidak baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'dr.Nabah the story of kampung singa.jpeg', 'https://youtu.be/WCfCPhLpcsk', 'https://drive.google.com/file/d/1pb1baM5Wjjfd35O0x-rNHz7JePla0iNC/view?usp=sharing', 'https://api.informatics-expo.id/dr.Nabah the story of kampung singa.jpeg', 412, 18, 2, '2022-01-01 10:04:19', '2022-01-02 10:04:35'),
(302, 'ZING!', '{\"blocks\":[{\"key\":\"cb7sm\",\"text\":\"Pernahkah kalian memikirkan bagaimana rasanya berperang?\\n\\nApakah kamu takut? Penasaran?\\n\\nKalian dapat menemukannya disini, Seorang Ninja yang ingin menyelamatkan Dunia.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ZING!.png', 'https://youtu.be/szX6Z-bZ0ls', '', 'https://api.informatics-expo.id/ZING!.png', 479, 1, 2, '2022-01-02 10:34:04', '2022-01-02 10:34:04'),
(252, 'Invest Saiki', '{\"blocks\":[{\"key\":\"e6d64\",\"text\":\"Invest Saiki adalah aplikasi berbasis web yang berguna untuk memfasilitasi masyarakat untuk berinvestasi ke usaha kecil atau menengah(UKM).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Invest Saiki.png', 'https://www.youtube.com/watch?v=g5ZzrX522qY', '', 'https://api.informatics-expo.id/Invest Saiki.png', 415, 1, 2, '2022-01-01 10:24:37', '2022-01-01 10:24:37'),
(253, 'e-WalletQ', '{\"blocks\":[{\"key\":\"6vcl6\",\"text\":\"e-WalletQ adalah platform berbasis mobile app untuk membantu pengguna dalam melakukan manajemen keuangannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7legv\",\"text\":\"Platform ini berfungsi dalam membantu manajemen keuangan. Membantu dalam menabung dan juga membantu pengguna dalam mewujudkan pembelian barang yang ingin dibeli. Akan ada rekomendasi pilihan yang diberikan kepada pengguna untuk opsi jangka waktu dan juga nominal repetitif tabungan agar barang yang diinginkan dapat dibeli. Ketika barang yang diinginkan dapat dibeli aplikasi akan memberikan reward seperti voucher yang dapat ditukarkan saat pembelian barang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":459,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":459,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":459,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":459,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e-WalletQ.png', 'https://www.youtube.com/watch?v=KKwpWtU6YzE', 'https://www.youtube.com/watch?v=VSIOQEJcUgY&t=9s', 'https://api.informatics-expo.id/e-WalletQ.png', 417, 17, 2, '2022-01-01 10:28:20', '2022-01-01 10:37:02'),
(254, 'JiwaKu', '{\"blocks\":[{\"key\":\"d7uee\",\"text\":\"JiwaKu adalah platform edukasi dan konsultasi yang bertujuan untuk meningkatkan akses publik terhadap layanan kesehatan mental. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6cs1p\",\"text\":\"1. All in one app : Dengan fitur utama edukasi dan konseling, JiwaKu memiliki fitur tambahan lainnya, seperti nomor darurat konseling pencegahan bunuh diri, meditasi, rumah sakit terdekat, tantangan, dan catatan kebaikan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4toqb\",\"text\":\"2. Layanan konseling gratis: Untuk berpartisipasi dalam mengurangi ketimpangan akses layanan kesehatan mental, JiwaKu menyediakan fitur konseling gratis yang akan didampingi oleh tenaga profesional berpengalaman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"40hd0\",\"text\":\"3. Pusat informasi yang up to date: Segala informasi yang ada pada aplikasi JiwaKu akan diupdate secara berkala, jadi jangan khawatir tertinggal informasi seputar kesehatan mental, ya!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JiwaKu.png', 'https://youtu.be/MRwy9cpYgf4', 'https://www.figma.com/proto/CHz0Vt2bZoDnZiQZaRZhnK/JiwaKu?page-id=0%3A1&node-id=52%3A77&viewport=241%2C48%2C0.5&scaling=scale-down&starting-point-node-id=240%3A165', 'https://api.informatics-expo.id/JiwaKu.png', 414, 3, 2, '2022-01-01 10:32:56', '2022-01-01 10:32:56'),
(255, 'BisnisYuk', '{\"blocks\":[{\"key\":\"8k9vj\",\"text\":\"Sebuah media bagi para peminat bisnis untuk saling berdiskusi seputar dunia bisnis, dan untuk mempermudah para pebisnis untuk menjalin kerjasama dengan investor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BisnisYuk.jpeg', 'https://youtu.be/xPdHKUy3044', '', 'https://api.informatics-expo.id/BisnisYuk.jpeg', 416, 8, 2, '2022-01-01 10:47:31', '2022-01-01 10:52:34'),
(256, 'Hewanku ', '{\"blocks\":[{\"key\":\"292rv\",\"text\":\"\\n\\nDalam mengelola kesehatan hewan piaraan Anda, penting untuk tetap terinformasi dan teratur. Aplikasi \\\"HEWANKU\\\" mengatur piaraan Anda tetap sehat dengan menaruh semua informasi yang dibutuhkan di satu tempat. Ini alat yang bagus untuk siapa saja dengan satu hewan peliharaan, beberapa hewan peliharaan, dan mereka yang memiliki banyak perawatan hewan peliharaan penyedia termasuk dokter hewan, groomer, walker, pengasuh, dan banyak lagi.\\n\\nkami menerapkan beberapa fitur yaitu:\\n\\nCEK KONDISI HEWAN\\nidentifikasi penyakit dan gejala hewan jadi lebih mudah, menyediakan beberapa produk makanan hewan terpilih supaya kondisi hewan peliharaan tetap terjaga.\\n\\nINFORMASI KLINIK HEWAN DAN RUMAH SAKIT HEWAN \\npara user bisa mengetahui informasi seputar klinik hewan dan rumah sakit hewan terdekat jadi pengguna bisa ketempat dimana hewan Anda bisa dirawat. Para user bisa berkonsultasi secara daring dengan dokter hewan, atau membuat jadwal pertemuan dengan dokter hewan sesuai hari dan tanggal yang kita inginkan.\\n\\nEKSPLOR DAN BERGABUNG DENGAN SEBUAH KOMUNITAS\\nbangun sebuah komunitas dimana para user bisa bebas berekspresi, dan berbagi momen-momen yang menarik seputar hewan peliharaan Anda, dll.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hewanku .jpeg', 'https://www.youtube.com/watch?v=5dXo1URG3TI&t=23s', 'https://www.figma.com/proto/lsb8WwBh7Rl41RJNlO5ygi/Animaru-UI-(Community)?page-id=0%3A1&node-id=1%3A363&viewport=241%2C48%2C1.12&scaling=scale-down&starting-point-node-id=1%3A363', 'https://api.informatics-expo.id/Hewanku .jpeg', 421, 18, 2, '2022-01-01 10:54:49', '2022-01-01 10:54:49'),
(257, 'E-nake', '{\"blocks\":[{\"key\":\"ddv47\",\"text\":\"E-nake adalah sebuah social media dengan memiliki tujuan untuk masyarakat bisa dengan mudah menemukan, hidden gem atau tempat makan kaki lima yang murah dan enak\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-nake.png', 'https://youtu.be/5xvG3h8Sg_U', '', 'https://api.informatics-expo.id/E-nake.png', 420, 12, 2, '2022-01-01 10:58:36', '2022-01-01 10:58:36'),
(258, 'Celana Kotak-Run', '{\"blocks\":[{\"key\":\"e2pq3\",\"text\":\"Game yang terinspirasi dari kartun Nickelodeon yaitu spongebob, game ini bercerita tentang spongebob yang harus berlari ketempat kerja dengan menghindari beberapa obstacle dan juga harus mendapatkan skore setinggi-tingginya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Celana Kotak-Run.jpeg', 'https://youtu.be/wvxWE2Lki6w', '', 'https://api.informatics-expo.id/Celana Kotak-Run.jpeg', 422, 14, 2, '2022-01-01 11:12:19', '2022-01-01 11:12:19'),
(259, 'Donasi Disini', '{\"blocks\":[{\"key\":\"91bnk\",\"text\":\"Dasi merupakan aplikasi online berbasis mobile yang bertujuan untuk membantu dalam kegiatan donasi terutama dalam keadaan pandemi yang mengharuskan melakukan kegiatan dari rumah atau online. Selain itu dasi juga bertujuan untuk mempermudah dalam pengajuan donasi dan pengiriman donasi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Donasi Disini.png', 'https://youtu.be/eYv03hgk780', 'https://github.com/KKP21/PAB.git', 'https://api.informatics-expo.id/Donasi Disini.png', 246, 17, 2, '2022-01-01 11:26:43', '2022-01-02 15:22:45'),
(285, 'LIMITATORE', '{\"blocks\":[{\"key\":\"d037c\",\"text\":\"Limitatore merupakan aplikasi yang membatasi penggunaan smartphone bagi masyarakat. Aplikasi ini bertujuan agar pengguna dapat mengurangi kecanduan akan suatu aplikasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LIMITATORE.png', 'https://youtu.be/1u3HbWAAj8A', 'https://www.canva.com/design/DAE0YNKsARY/cKxBkoP5XWQC6dvf4oCypw/view?utm_content=DAE0YNKsARY&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/LIMITATORE.png', 285, 3, 2, '2022-01-01 14:12:35', '2022-01-07 15:54:33'),
(286, 'Parazzle', '{\"blocks\":[{\"key\":\"acahf\",\"text\":\"Parazzle adalah game bertemakan teka-teki untuk anak yang mengambil alphabet sebagai media pembelajaran dalam bermain game, anak dituntut untuk mengingat urutan dan pola gambar yang sesuai dengan huruf, metode ini diharapkan dapat membantu pembelajaran anak terkait alphabet dengan mudah & menyenangkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'Parazzle.png', 'https://youtu.be/aZlLuv_3VFM', '', 'https://api.informatics-expo.id/Parazzle.png', 458, 4, 2, '2022-01-01 14:35:35', '2022-01-01 14:35:35'),
(287, 'TopJob', '{\"blocks\":[{\"key\":\"9rfrf\",\"text\":\"TopJob is an application that helps someone in finding a job. TopJob has many job fields you can choose according to your expertise. You can download TopJob on your platform. With us making TopJob we hope to help many people who are in need of work\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TopJob.png', 'https://youtu.be/rQaN0Dbd_Bc', '', 'https://api.informatics-expo.id/TopJob.png', 462, 8, 2, '2022-01-01 14:36:36', '2022-01-01 14:36:36'),
(261, 'Disc Geek', '{\"blocks\":[{\"key\":\"ekjjs\",\"text\":\"Disk Geeks Store adalah suatu website untuk mempermudah konsumen dalam mencari dan membeli CD musik album agar dapat dilihat oleh masyarakat luas.Produk yang dijual biasanya berwujud gambar yang disertai segala bentuk keterangan barang yang interaksi penjual dan pembelinya dilakukan secara tertulis di forum virtual dalam situs terkait dan pembayarannya dilakukan dengan cara mentransfer sejumlah uang dalam rekening penjual. Melalui online shop pembelian dapat dilakukan tanpa terbatas oleh tempat. Seseorang yang berada di salah satu negara dapat melakukan pembelian barang yang berada di negara lain dengan mudah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Disc Geek.jpeg', 'https://youtu.be/A9-vZ6AUGLg', 'https://github.com/abdulzzm/Disc-Geek', 'https://api.informatics-expo.id/Disc Geek.jpeg', 298, 8, 2, '2022-01-01 11:55:47', '2022-01-01 11:55:47'),
(262, 'Restoran Binjai', '{\"blocks\":[{\"key\":\"9arei\",\"text\":\"Restoran Binjai adalah aplikasi E-Commmerce berbasis web untuk melakukan pembelian dan penjualan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Binjai, penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat dan para pembeli yang menginginkan suatu makanan bisa memesannya dari mana saja dan kapan saja. Dan untuk pelaku UKM sendiri bisa memperluas jangkauan customer yang selama ini terhalan oleh jarak dan waktu\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Binjai.png', 'https://youtu.be/CX5Z8ZtxKpc', 'https://www.canva.com/design/DAEzEG6P9gQ/NMpotMdnelTlC2bVn085kQ/view?utm_content=DAEzEG6P9gQ&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/Restoran Binjai.png', 344, 9, 2, '2022-01-01 12:01:29', '2022-01-01 12:01:29'),
(323, 'IDEAFY', '{\"blocks\":[{\"key\":\"3ntt5\",\"text\":\"Website jual beli ide bisnis dengan metode frachise\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IDEAFY.jpeg', 'https://youtu.be/nIsE2abI_m4', '', 'https://api.informatics-expo.id/IDEAFY.jpeg', 496, 8, 2, '2022-01-02 16:35:08', '2022-01-02 16:35:08'),
(263, 'GROW UP', '{\"blocks\":[{\"key\":\"7r81m\",\"text\":\"Project ini akan mengembangkan sebuah aplikasi dengan nama Grow Up. Grow Up\\nmerupakan aplikasi berbagi ide bisnis yang terbuka untuk siapa saja. Di Dalam aplikasi\\npengguna dapat mencurahkan ide bisnisnya sehingga di kemudian waktu ide bisnis tersebut\\ndilihat oleh investor yang juga merupakan bagian dari pengguna. Nantinya penyumbang ide\\nakan bernegosiasi dengan investor untuk tindak lanjut ide yang sudah disepakati. Pengguna\\njuga dapat berdiskusi dengan komunitas untuk mematangkan ide bisnis. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GROW UP.png', 'https://youtu.be/lYYYRiYy-t4', '', 'https://api.informatics-expo.id/GROW UP.png', 425, 8, 2, '2022-01-01 12:09:38', '2022-01-01 12:09:38'),
(264, 'TRASH - IN', '{\"blocks\":[{\"key\":\"2iqer\",\"text\":\"TRASH-IN adalah platform untuk penjemputan sampah terpilah berbasis teknologi yang diimplementasikan dalam bentuk aplikasi digital menggunakan smartphone. Aplikasi TRASH-IN juga memuat berbagai informasi terkait masalah sampah atau masalah kebersihan lingkungan, juga sebagai tempat untuk mengajukan sebuah fasilitas kebersihan kepada pihak terkait. Aplikasi ini bertujuan untuk membantu masyarakat agar dapat menghemat waktunya ketika akan membuang sampah tanpa harus keluar rumah, menjaga keseimbangan lingkungan akibat pembuangan sampah sembarangan dan untuk peningkatan kualitas kebersihan lingkungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":9,\"style\":\"BOLD\"},{\"offset\":164,\"length\":8,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TRASH - IN.jpeg', 'https://youtu.be/HvX6EdHLUIk', 'https://www.figma.com/proto/dQeV7ah3kJZQl8d5u6Cp8N/RYZEN?node-id=18%3A6&scaling=scale-down&page-id=18%3A4&starting-point-node-id=18%3A6&show-proto-sidebar=1', 'https://api.informatics-expo.id/TRASH - IN.jpeg', 413, 12, 2, '2022-01-01 12:34:46', '2022-01-02 08:54:34'),
(267, 'Fets - Animal Care', '{\"blocks\":[{\"key\":\"152vn\",\"text\":\"Everything necessary to take care of your animal is here. For farm animals and companion animals.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96if2\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"46oog\",\"text\":\"Taking care for the needs and health of our animals can be difficult sometimes. With our most complete animal-care digital platform, Fets will help you take better care for your animals in a more convenient way.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8uki2\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5bpqp\",\"text\":\"Fets\' features are specifically designed to help you with everything you might need for your animals:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f3pko\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"77jel\",\"text\":\"1. Grooming\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9hcf2\",\"text\":\"2. Pet Adoption\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"89l0m\",\"text\":\"3. Vaccination\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3983s\",\"text\":\"4. Reminders for medication, food and appointments\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2sbi1\",\"text\":\"5. Online/Face-to-face consultation\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bl8g5\",\"text\":\"6. Pet profile that you can share to your veterinarian or pet-sitter\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"317ed\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"btu44\",\"text\":\"And many more! We know that caring for your animals has never been so easy. That\'s why we from Paradigm Shifter have developed the best application to help you with that. Come join us with more than 100 petshops and veterinarians partnered with our application.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fets - Animal Care.png', 'https://youtu.be/ug8U0sJIhho', 'https://www.figma.com/proto/4eU6Eg9uXlyGuETZYkaloK/GROUP-6---Design-Thinking-Project?page-id=0%3A1&node-id=24%3A58&viewport=281%2C48%2C0.2&scaling=scale-down&starting-point-node-id=10%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Fets - Animal Care.png', 436, 8, 2, '2022-01-01 12:55:52', '2022-01-01 13:07:23'),
(266, 'Edulock', '{\"blocks\":[{\"key\":\"ah91f\",\"text\":\"Edulock merupakan aplikasi yang ditujukan untuk mengurangi kecanduan anak dengan membatasi penggunaan smartphone dengan cara yang unik yaitu aplikasi edulock akan dapat disetel untuk mengunci aplikasi yang diinginkan oleh orang tua dan anak harus mengerjakan soal-soal edukasi untuk membuka aplikasi yang terkunci.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Edulock.png', 'https://youtu.be/wmfzO6S_gvc', 'https://drive.google.com/file/d/1oMMktLsDXkRJWxr0gCzxca6Mnty2g-QO/view?usp=sharing', 'https://api.informatics-expo.id/Edulock.png', 372, 4, 2, '2022-01-01 12:50:15', '2022-01-01 12:50:15'),
(268, 'Emilio', '{\"blocks\":[{\"key\":\"dhjlf\",\"text\":\"Aplikasi Emilio merupakan aplikasi untuk meningkatkan technical dan soft skill di berbagai bidang yang dipersembahkan bagi para pelajar dan mahasiswa. Karena di era revolusi industri 4.0 di mana merupakan era yang menuntut kita untuk memiliki berbagai macam skill maupun softskill yang kini sangat diperlukan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2eqq\",\"text\":\"Emilo memiliki fitur unggulan yakni Study Stream, seperti sebuah komunitas belajar yang memberikan ruang bagi user Emilio untuk belajar bersama dan bertukar pikiran dengan user lain melalui platform Zoom dan Discord.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":36,\"length\":12,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5esdk\",\"text\":\"Emilio juga memberikan akses live session mentoring pribadi eksklusif dan beberapa exam serta self asessment. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2prq\",\"text\":\"Dengan menggunakan aplikasi ini, diharapkan dapat membantu para pengguna untuk memenuhi dan mengetahui kebutuhan serta passion mereka. Selain itu, juga dapat membantu dalam proses pengembangan self awareness, kemampuan serta potensi dalam dirinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Emilio.png', 'https://youtu.be/GfKTP1ohtAU', 'https://www.figma.com/file/mbWxg8VbXq2O8oEv4hErKR/JSON-BERRA?node-id=0%3A1&t=IfSoU1k4FKcAmUV3-1', 'https://api.informatics-expo.id/Emilio.png', 433, 4, 2, '2022-01-01 13:06:37', '2022-12-14 13:01:57'),
(269, 'REZERVA', '{\"blocks\":[{\"key\":\"em7mf\",\"text\":\"Rezerva merupakan sebuah sistem informasi reservasi restoran yang berfungsi untuk memanajemen pengelolaan restoran Dengan berbagai fitur.Pembuatan Rezerva dilatarbelakangi oleh keinginan dari tim rezerva untuk membantu berbagai restoran di indonesia dalam mengelola proses pemesanan,pembayaran hingga pengelolaan restoran itu sendiri seperti pengelolaan keuangan,pendapatan, makanan dan sejenisnya.Target aplikasi Rezerva adalah untuk restoran restoran yang kesulitan dalam mengelola restorannya dikarenakan semakin berkembangnya restoran yang menyebabkan semakin banyaknya pelanggan dan karyawan sehingga menyebabkan kesulitan dalam pengelolaanya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9v7qe\",\"text\":\"Rezerva sendiri terdiri dari dua subsistem yaitu sistem untuk Customer dan sistem untuk admin. Untuk Customer terdapat Fitur Seperti memilih Pesanan/menu, pembayaran pesanan, memberikan rating, dan Keranjang. Disisi lain Admin memiliki Fitur yang cukup superior yaitu Dashboard,Pengelolaan daftar pesanan,Laporan Pendapatan,Laporan Menu,Kelola Menu,Kelola Kategori , dan Kelola Admin. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"341bg\",\"text\":\"Dengan Adanya aplikasi Rezerva ini diharapkan dapat memudahkan sistem pengelolaan pada restoran sehingga meningkatkan kemungkinan pendapatan dan produktivitas pada restoran yang menggunakan aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'REZERVA.jpeg', 'https://www.youtube.com/watch?v=in1XfDB1pnI', 'https://rezerva.my.id/', 'https://api.informatics-expo.id/REZERVA.jpeg', 386, 2, 2, '2022-01-01 13:20:33', '2022-01-03 12:54:07'),
(270, 'U-Kaeem', '{\"blocks\":[{\"key\":\"btjei\",\"text\":\"Proyek U-Kaeem merupakan proyek Berbasis Web yang digunakan untuk memfasilitasi UMKM untuk memasarkan produk nya. selain untuk memfasilitasi UMKM, tujuan dibuat proyek ini adalah untuk membranding pola pemikiran mengenai produk dalam negri yang tidak kalah saing dengan produk luar negri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":31,\"style\":\"color-rgb(17,60,97)\"},{\"offset\":32,\"length\":128,\"style\":\"color-rgb(17,60,97)\"},{\"offset\":161,\"length\":127,\"style\":\"color-rgb(17,60,97)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'U-Kaeem.jpeg', 'https://youtu.be/iO0LkJukgM0', '', 'https://api.informatics-expo.id/U-Kaeem.jpeg', 438, 8, 2, '2022-01-01 13:23:52', '2022-01-01 13:26:23'),
(271, 'Seluncur', '{\"blocks\":[{\"key\":\"7km5s\",\"text\":\"Seluncur adalah platform funding untuk pelaku usaha pakaian di Daerah Istimewa Yogyakarta.\\n\\nSetiap pelaku usaha dapat membagikan desain pakaian ciptaannya dan mengatur target dan batas waktu urunan dana, durasi produksi dan durasi pengiriman.\\n\\nApabila pengunjung web menyukai desainnya, mereka dapat memesan pakaian tersebut dengan melakukan pre-order sebagai bentuk urunan dana.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":90,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Seluncur.jpeg', 'https://youtu.be/-rvGtWHC9-c', '', 'https://api.informatics-expo.id/Seluncur.jpeg', 427, 8, 2, '2022-01-01 13:27:48', '2022-01-02 16:31:22'),
(272, 'easyBuy', '{\"blocks\":[{\"key\":\"5tfjn\",\"text\":\"easyBuy adalah sistem perangkat lunak berbasis website untuk pengelolaan system informasi e-commerce dengan fokus penjualan tanaman hias dan berbagai jenis bunga\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5f03c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'easyBuy.jpeg', 'https://youtu.be/Lh7GVK4P6KM', 'https://youtu.be/Lh7GVK4P6KM', 'https://api.informatics-expo.id/easyBuy.jpeg', 444, 8, 2, '2022-01-01 13:28:38', '2022-01-01 13:28:38'),
(273, 'K-TICKET', '{\"blocks\":[{\"key\":\"1tt8j\",\"text\":\"Platform untuk para wisatawan yang ingin memasuki tempat wisata tanpa perlu menggunakan tiket kertas melainkan beralih menjadi tiket digital atau paperless. Melalui platform ini, pengunjung dapat dengan mudah memperoleh tiket tanpa harus ada kontak dengan pegawai tiket.  Hanya dengan memindai QR-code wisatawan dapat masuk ke tempat wisata dengan mudah.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":355,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":355,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":355,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":355,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"},{\"offset\":146,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'K-TICKET.png', 'https://www.youtube.com/watch?v=nsClz3l0hVM', '', 'https://api.informatics-expo.id/K-TICKET.png', 289, 9, 2, '2022-01-01 13:29:01', '2022-01-04 18:06:40'),
(275, 'FLIPCARD', '{\"blocks\":[{\"key\":\"27m1j\",\"text\":\"Flipcard adalah permainan memori kartu. Klik salah satu kartu untuk melihat simbol apa yang ditemukan dan membuka kartu lain untuk menemukan simbol yang cocok di bawah kartu lainnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":182,\"style\":\"color-rgb(14,36,51)\"},{\"offset\":0,\"length\":182,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":182,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":182,\"style\":\"fontfamily-Maven Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"dkooi\",\"text\":\"Temukan dua simbol yang cocok sekaligus untuk memenangkan permainan. Dalam game ini tersedia berbagai fitur yang menarik serta memberikan level atau tingkat kesulitan permainan sehingga dapat memberikan tantangan bagi para pemainnya.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":233,\"style\":\"color-rgb(14,36,51)\"},{\"offset\":0,\"length\":233,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":233,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":233,\"style\":\"fontfamily-Maven Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'FLIPCARD.png', '', '', 'https://api.informatics-expo.id/FLIPCARD.png', 447, 9, 2, '2022-01-01 13:41:54', '2022-01-01 13:41:54'),
(314, 'ATIKAN', '{\"blocks\":[{\"key\":\"6ruim\",\"text\":\"ATIKAN merupakan aplikasi belajar yang menyediakan berbagai macam materi pembelajaran. Tidak hanya materi, di dalam aplikasi ini juga disediakan video dan latihan soal. Aplikasi ini khususnya dibuat untuk para pelajar SD-SMA di daerah pedalaman yang dimana mereka kesulitan untuk mendapatkan buku pelajaran. Tujuan dari pembuatan aplikasi ini adalah kami berharap masalah pelajar di daerah pedalaman yang kesulitan dalam mendapatkan buku pelajaran dapat terselesaikan sehingga kualitas pendidikan di indonesia jadi merata.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'ATIKAN.png', 'https://youtu.be/bJx5ejsCRXQ', 'https://www.figma.com/proto/RRJQdnKnynRCg9B3EhUoSl/Annanova?node-id=30%3A6&scaling=scale-down&page-id=0%3A1&starting-point-node-id=30%3A6', 'https://api.informatics-expo.id/ATIKAN.png', 485, 4, 2, '2022-01-02 14:30:45', '2022-01-02 14:30:45'),
(281, 'Lethal Virus', '{\"blocks\":[{\"key\":\"79dnb\",\"text\":\"Virus telah menyerang kawasan pemukiman manusia. Virus ini dapat menyerang dan membunuh membunuh manusia dengan menempel/menyentuh ke inangnya (manusia), oleh karena itu, manusia harus membela dirinya sebaik mungkin agar dapat melawan dan terhindar dari serangan virus tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lethal Virus.jpeg', 'https://youtu.be/EUPTyjit-3o', 'https://drive.google.com/file/d/1hjyLOFYeRqKgG_4EiGpHqsD6qJYGXipf/view?usp=sharing', 'https://api.informatics-expo.id/Lethal Virus.jpeg', 431, 19, 2, '2022-01-01 14:00:34', '2022-01-03 00:01:38'),
(282, 'Nakia', '{\"blocks\":[{\"key\":\"23v6f\",\"text\":\"Kekerasan seksual seringkali diabaikan oleh sebagian orang. Salah satu sebabnya adalah adanya rasa malu ketika ingin melapor bahkan sulitnya seseorang mendapat ruang untuk mengungkapkannya. Nakia hadir sebagai aplikasi yang digunakan untuk mempermudah pelaporan ketika seseorang mengalami kekerasan seksual. Selain dapat diakses oleh siapa saja dan dimana saja, aplikasi ini terintegrasi dengan pihak berwajib sehingga nantinya akan mempermudah sistem. Melalui aplikasi Nakia ini kami berharap pelecehan seksual dapat dicegah hingga ditindak secara tegas untuk memberikan efek jera bagi para pelakunya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3fmlb\",\"text\":\"Bersama Nakia, wujudkan dunia yang setara!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nakia.jpeg', 'https://youtu.be/MBVJKX7XGGU', 'https://www.figma.com/proto/Fw3GxvFsTRDQmh4RhqaoEk?node-id=', 'https://api.informatics-expo.id/Nakia.jpeg', 351, 5, 2, '2022-01-01 14:01:38', '2022-01-01 15:28:12');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(283, 'GO-LEARN', '{\"blocks\":[{\"key\":\"eg41v\",\"text\":\"Go-Learn adalah aplikasi pembelajaran yang ditujukan untuk siswa yang sedang mempersiapkan diri untuk menghadapi UTBK, dengan fitur fitur yang beragam dan menarik tentunya membuat pembelajaran tidak membosankan, ditambah lagi terdapat fitur permainan untuk mengasah otak, dimana para siswa bisa bermain dengan siswa lain yang membuat para siswa mempunyai jiwa kompetitif dan semangat yang tinggi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GO-LEARN.png', 'https://youtu.be/0FWksnWa-Fs', 'https://www.figma.com/proto/3Gl30zco0wTsAFEmAw4ihI/Sebuah-Mahakarya?node-id=5%3A7&scaling=scale-down&page-id=0%3A1&starting-point-node-id=5%3A7', 'https://api.informatics-expo.id/GO-LEARN.png', 442, 4, 2, '2022-01-01 14:05:33', '2022-01-01 14:05:33'),
(284, 'UKM Bahagia', '{\"blocks\":[{\"key\":\"7uqa9\",\"text\":\"UKM Bahagia adalah aplikasi berbasis web yang berfungsi mengelola pencatatan keuangan bagi para pelaku UKM. Setiap pelaku UKM dapat membuat akun dan login ke aplikasi ini untuk mengakses fitur yang terdapat di dalamnya, seperti dashboard untuk menampilkan keuntungan atau kerugian tiap bulannya, pencatatan pemasukan maupun pengeluaran tiap transaksi berdasarkan kategorinya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":375,\"style\":\"color-rgb(255,255,255)\"},{\"offset\":0,\"length\":375,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":0,\"length\":375,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":375,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKM Bahagia.jpeg', 'https://www.youtube.com/watch?v=r7AO7SLXnKg', 'https://github.com/Ramz09/UKMBahagia2', 'https://api.informatics-expo.id/UKM Bahagia.jpeg', 452, 8, 2, '2022-01-01 14:05:56', '2022-01-02 14:50:20'),
(288, 'Water Goo', '{\"blocks\":[{\"key\":\"8lp3p\",\"text\":\"\\\"Water Goo\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fn5ar\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"98ngh\",\"text\":\"Aplikasi ini dibuat untuk membantu masyarakat yang terdampak kekurangan air bersih, isi dalam aplikasi ini yaitu penyediaan pembelian air bersih dan pembangunan sumur bor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Water Goo.jpeg', 'https://youtu.be/oVXSM4wqJik', 'https://www.figma.com/proto/eW49EWoy20Zbaj12xdpBXo/Andromeda?node-id=166%3A277&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A26&show-proto-sidebar=1', 'https://api.informatics-expo.id/Water Goo.jpeg', 461, 6, 2, '2022-01-01 14:37:32', '2022-01-01 15:44:04'),
(289, 'IMMUNITY', '{\"blocks\":[{\"key\":\"gefb\",\"text\":\"Immunity adalah aplikasi yang dipergunakan dalam mendukung pelaksanaan vaksinasi covid 19 oleh Pemerintah Republik Indonesia dalam rangka menangani penyebaran covid 19. Aplikasi immunity memiliki fungsi utama yaitu mengetahui jadwal dan tempat vaksinasi covid. Pengguna aplikasi immunity terutama yang belum melaksanakan vaksinasi dapat dengan mudah melaksanakan vaksinasi covid dalam upaya menghentikan penyebaran covid.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IMMUNITY.jpeg', 'https://youtu.be/Jcw5gy0E-Pc', 'https://www.figma.com/proto/RlTvg7mBBbBkZcaBiGG9MP/Untitled?node-id=47%3A111&scaling=scale-down&page-id=32%3A2&starting-point-node-id=47%3A111', 'https://api.informatics-expo.id/IMMUNITY.jpeg', 455, 18, 2, '2022-01-01 14:40:49', '2022-01-02 06:48:50'),
(290, 'SURE APP', '{\"blocks\":[{\"key\":\"11tk3\",\"text\":\"Aplikasi Sure adalah aplikasi yang berperan sebagai jembatan antara penyelenggara acara yang membutuhkan volunteer dengan pengguna yang ingin menjadi volunteer, selain itu proyek aplikasi Sure ini juga akan bisa digunakan untuk penggalangan dana yang bersifat kemanusian\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SURE APP.jpeg', 'https://youtu.be/QqU7VUpQ2I4', '', 'https://api.informatics-expo.id/SURE APP.jpeg', 460, 11, 2, '2022-01-01 14:41:57', '2022-01-03 09:07:00'),
(291, 'JOBSKUY', '{\"blocks\":[{\"key\":\"dvi5s\",\"text\":\"Jobskuy adalah website yang berfungsi untuk mempermudah masyarakat khususnya pengguna dalam memberi dan mencari pekerjaan.\",\"type\":\"header-four\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":122,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}},{\"key\":\"9hhgt\",\"text\":\"Explore more : https://jobskuy.rf.gd/ \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":15,\"style\":\"fontsize-18\"},{\"offset\":15,\"length\":22,\"style\":\"color-var(--yt-endpoint-color,var(--yt-spec-call-to-action))\"},{\"offset\":15,\"length\":22,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":15,\"length\":22,\"style\":\"fontsize-14\"},{\"offset\":15,\"length\":22,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":15,\"length\":23,\"style\":\"BOLD\"}],\"entityRanges\":[{\"offset\":15,\"length\":22,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbF81eHNmc2wzYjJHV0gxNGJjYnRoYnpQdHVQZ3xBQ3Jtc0tudVRTMUlaZDREc0lQRWxhcVV6aTBZQ1Jzd1ZHT3F3Y18wSUZZczh3bHVyZ1pZMHBDT0YwVXpOTzYwUlpJMDhYanJmMl81WHNxYjFOWnp2dERrTjBHWjlEZnV4TEFYTEhZSjY4Tmk1anotN1VVZml0UQ&q=https%3A%2F%2Fjobskuy.rf.gd%2F\",\"title\":\"https://jobskuy.rf.gd/\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbF81eHNmc2wzYjJHV0gxNGJjYnRoYnpQdHVQZ3xBQ3Jtc0tudVRTMUlaZDREc0lQRWxhcVV6aTBZQ1Jzd1ZHT3F3Y18wSUZZczh3bHVyZ1pZMHBDT0YwVXpOTzYwUlpJMDhYanJmMl81WHNxYjFOWnp2dERrTjBHWjlEZnV4TEFYTEhZSjY4Tmk1anotN1VVZml0UQ&q=https%3A%2F%2Fjobskuy.rf.gd%2F\",\"title\":\"https://jobskuy.rf.gd/\",\"targetOption\":\"_blank\"}}}}}}', 'JOBSKUY.jpeg', 'https://www.youtube.com/watch?v=IdRUewF57nU', 'https://github.com/FaishalAlbadri/jobskuy', 'https://api.informatics-expo.id/JOBSKUY.jpeg', 441, 8, 2, '2022-01-01 14:47:45', '2022-01-02 13:56:23'),
(292, 'Hunting Pusaka', '{\"blocks\":[{\"key\":\"aeq52\",\"text\":\"Indonesia merupakan salah satu negara dengan budaya yang sangat beragam. Salah satu budaya yang berkembang di masyarakat khususnya di wilayah Jawa yaitu keberadaan dukun atau paranormal. Maka dari itu, kami berinisiatif membuat gim menggunakan karakter dukun serta keris sebagai bentuk upaya untuk memperkenalkan budaya Indonesia ke masyarakat indonesia hingga mancanegara. Gim 2D ini dioperasikan di platform PC yang dimainkan dengan keyboard. Menggunakan beberapa tampilan background serta tingkat kesulitan yang disesuaikan dengan level yang sedang dimainkan sebagai perubahan untuk pendukung suasana. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":604,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hunting Pusaka.png', 'https://youtu.be/bkM-eCUBnlM', '', 'https://api.informatics-expo.id/Hunting Pusaka.png', 297, 16, 2, '2022-01-01 14:55:05', '2022-01-01 14:55:05'),
(293, 'Go-Gath', '{\"blocks\":[{\"key\":\"8tq5k\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"margin-left\":\"-4pt\"}},{\"key\":\"3t0uh\",\"text\":\"Platform untuk mahasiswa informatika UII. Melalui platform ini mahasiswa dapat membentuk solidaritas tim  sesama mahasiswa informatika UII melalui kegiatan olahraga yang diselenggarakan di informatika antara lain futsal, badminton, dan basket. Di platform ini, mahasiswa dapat membentuk tim dan memilih jadwal bermain yang tertera serta dimana tempat bermainnya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":362,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":362,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":362,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":362,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"-0.1pt\"}}],\"entityMap\":{}}', 'Go-Gath.png', 'https://youtu.be/CKEZWlLnm-Y', '', 'https://api.informatics-expo.id/Go-Gath.png', 393, 9, 2, '2022-01-01 15:09:28', '2022-01-01 15:09:28'),
(295, 'Belanja-In', '{\"blocks\":[{\"key\":\"bbo0o\",\"text\":\"Belanja-In adalah sebuah aplikasi yang mengangkat masalah \\\"Decent Work and Economic Growth\\\" yang terinspirasi dari keadaan pandemic yang sedang terjadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"djihu\",\"text\":\".\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2ecl2\",\"text\":\".\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4bhtl\",\"text\":\"Belanja-In menghadirkan solusi untuk pengguna agar tetap di rumah dan menekan angka penyebaran Covid-19. Belanja-In memudahkan pengguna untuk memesan bahan pokok atau kebutuhan sehari-hari tanpa keluar rumah. Belanja-In menghadirkan fitur untuk berinteraksi langsung dengan penjual untuk memudahkan pencarian bahan pokok. Belanja-In bisa disebut pasar virtual. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Belanja-In.png', 'https://youtu.be/27f7eKZCjG4', 'https://www.figma.com/proto/aP1feClvdJ83N2QXnfqPKP/Kura-kura?node-id=65%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=65%3A2', 'https://api.informatics-expo.id/Belanja-In.png', 269, 8, 2, '2022-01-01 15:53:00', '2022-01-01 15:54:56'),
(296, 'DONASIKU', '{\"blocks\":[{\"key\":\"2v8v\",\"text\":\"    Sumbangan atau donasi merupakan kegiatan memberikan secara suka rela terhadap orang lain yang pada umumnya sedang dalam kondisi membutuhkan. kegiatan tersebut sangat berkaitan erat dengan kontak langsung antara penerima dan pemberi sumbangan. Akan tetapi kegiatan tersebut masih banyak yang terbilang konvensional dan kurang praktis. Masalah lain muncul saat di masa pendemi yang diharuskan untuk menjaga jarak sehingga mempersulit melakukan kegiatan donasi. akibatnya bermunculan banyak aplikasi donasi yang tidak jelas asal usulnya dan belum terjamin keamanannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":569,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":569,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":569,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":569,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"85o17\",\"text\":\"     Dari kondisi tersebut, untuk mengubah ekonomi salah oleh aplikasi yang dapat membantu meratakan ekonomi seperti aplikasi yang dapat membantu kegiatan donasi. Salah satu kondisi terkini yang terjadi yaitu sulitnya akses untuk mendapatkan akses mengenai kegiatan donasi ditambah lagi dengan banyaknya penyalur donasi yang tidak aman dan tidak dapat dipercaya.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":364,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":364,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":364,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":364,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"cu0u9\",\"text\":\"     DONASIKU merupakan sebuah aplikasi yang bertujuan untuk memudahkan kegiatan pengumpulkan donasi kepada orang yang membutuhkan secara digital dan instan dengan berbagai macam platfom pembayaran yang sudah terjamin keamanannya oleh berbagai pihak ketiga. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":258,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":258,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":258,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":258,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"1ojbk\",\"text\":\"Fitur-fitur aplikasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":20,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":20,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":20,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"c8s38\",\"text\":\"- Inbox\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":7,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"845eo\",\"text\":\"     Pada fitur ini akan memberi tahu user berbagai macam info mulai dari promo, status akun, hingga notifikasi seputar donasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":127,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":127,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":127,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":127,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"39msu\",\"text\":\"- News and tips of the day\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":26,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":26,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":26,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":26,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7ij25\",\"text\":\"     Fitur ini merupakan sebuah cara kami untuk saling berkomunikasi pada user dengan menampilkan berbagai informasi dan hal yang menarik yang berbeda setiap harinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":166,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":166,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":166,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":166,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dr9gb\",\"text\":\"- Riwayat donasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":16,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":16,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":16,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":16,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"drauc\",\"text\":\"     Fitur yang digunakan untuk melihat status donasi yang anda lakukan, jika donasi sudah diterima oleh pihak yang membutuhkan maka anda bisa melihat bukti berupa surat, video dan bukti receipt(tanda terima).\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":209,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":209,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":209,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":209,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DONASIKU.png', 'https://www.youtube.com/watch?v=k9KI3IfTdMg&ab_channel=BINTANGRAHMATULLAH', 'https://www.figma.com/proto/H0Z3SsIUlol93Oi3CU4Ukx/VACANCY?node-id=152%3A36&scaling=scale-down&page-id=0%3A1&starting-point-node-id=152%3A36', 'https://api.informatics-expo.id/DONASIKU.png', 251, 1, 2, '2022-01-01 18:24:44', '2022-01-01 18:25:25'),
(297, 'Foodie Buddy', '{\"blocks\":[{\"key\":\"fuunj\",\"text\":\"Foodie Buddy merupakan sebuah aplikasi untuk mengakses destinasi kuliner di Yogyakarta serta menyediakan kumpulan ulasan restoran yang dapat diakses oleh pengguna. Pengguna dapat melihat restoran terpopuler, memberikan ulasan untuk restoran yang telah dikunjungi, serta nantinya pengguna pun bisa mendapatkan reward berupa poin. So, let\'s share your review with Foodie Buddy! \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":375,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":375,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":375,\"style\":\"fontsize-12.5pt\"},{\"offset\":0,\"length\":375,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":378,\"style\":\"fontsize-18\"},{\"offset\":329,\"length\":47,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Foodie Buddy.png', 'https://youtu.be/g465o0tzu5U', '', 'https://api.informatics-expo.id/Foodie Buddy.png', 296, 9, 2, '2022-01-02 04:40:47', '2022-01-02 04:40:47'),
(298, 'Rumah Kinclong', '{\"blocks\":[{\"key\":\"4j89v\",\"text\":\"Rumah Kinclong adalah sebuah aplikasi yang mengangkat masalah \\\"Decent Work and Economic Growth\\\" yang sangat dibutuhkan pada masa saat ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":138,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":138,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":138,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":138,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":138,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"do2bn\",\"text\":\"Dalam kondisi pandemi saat ini, banyak pegawai kantoran yang di PHK dan lapangan pekerjaan saat ini sangatlah sedikit, untuk itulah kami menghadirkan Rumah Kinclong yang dapat membantu orang - orang mendapatkan pekerjaan yang layak dan juga dapat membantu pegawai kantoran yang sibuk agar tetap dapat merawat rumah.Disini  tidak cuma menyediakan jasa pembersih namun disini juga ada terdapat jasa tukang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":404,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":404,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":404,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":404,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":404,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"cbl11\",\"text\":\"Berikut adalah beberapa contoh fitur yang ada di Rumah Kinclong:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":64,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":64,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":64,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":64,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":64,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"fvqd7\",\"text\":\"Pemeliharaan Rumah\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":18,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":18,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":18,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":18,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"aevn4\",\"text\":\"Berfungsi untuk memperbaiki atau memperindah rumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":51,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":51,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":51,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":51,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":51,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"27sq2\",\"text\":\"Pembersihan Rumah\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"5i9gi\",\"text\":\" Berfungsi untuk membersihkan dalam serta halaman rumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":56,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":56,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":56,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":56,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":56,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"583sp\",\"text\":\"Bangun dan Renovasi\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":19,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":19,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":19,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":19,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":19,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"b0dog\",\"text\":\"Berfungsi untuk membangun rumah atau ingin membuat suatu bangunan sesuai keinginan pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":92,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":92,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":92,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":92,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":92,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'Rumah Kinclong.jpeg', 'https://youtu.be/2OCeO8RTUyM', 'https://www.figma.com/proto/0B200VTHjThZLpf9Zk3oGw/Bill-Gates?page-id=0%3A1&node-id=925%3A2871&viewport=241%2C48%2C0.25&scaling=scale-down&starting-point-node-id=925%3A2871', 'https://api.informatics-expo.id/Rumah Kinclong.jpeg', 475, 8, 2, '2022-01-02 05:52:26', '2022-01-02 05:52:26'),
(303, 'Diet Healthy', '{\"blocks\":[{\"key\":\"crdtu\",\"text\":\"Aplikasi diet yang ramah buat bagi segala aspek masyarakat umum dengan berbagai fitur yang menarik \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":98,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":98,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":98,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Diet Healthy.jpeg', '', '', 'https://api.informatics-expo.id/Diet Healthy.jpeg', 481, 18, 2, '2022-01-02 11:18:57', '2022-01-02 11:18:57'),
(304, 'Fantasy Realm', '{\"blocks\":[{\"key\":\"evolp\",\"text\":\"Fantasy Realm adalah game berjenis 2D Platformer Game, yang berceritakan tentang suatu kota yang bernama kizek dan terjadi perperangan antara bangsa Minatour dan Satyr, dan perperangan itu dimenangkan oleh satyr dan menyesikan satu minatour kecil yang berhasil kabur dari perperangan tersebut, dan seiring berjalannya waktu minatour ini tumbuh serta berlatih untuk membalaskan dendamnya kepada bangsa satyr seorang diri, apakah dia akan berhasil?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":446,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":446,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":446,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3jbq5\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fantasy Realm.jpeg', 'https://youtu.be/rUzVFRdUfj4', 'https://drive.google.com/drive/u/1/folders/1j5BRpRQijbAgWTaL9EK0s9UJgaAUE4k2', 'https://api.informatics-expo.id/Fantasy Realm.jpeg', 483, 16, 2, '2022-01-02 11:28:25', '2022-01-03 19:38:50'),
(305, 'Kas-Len', '{\"blocks\":[{\"key\":\"s171\",\"text\":\"Proyek ini bernama Kas-Len dimana memiliki tujuan untuk mengatur segala pemasukan dan pengeluaran uang kas yang terjadi pada karang taruna sebagai pelaku UMKM.Proyek ini sangat penting bagi pelaku UMKM karena mengingat pentingnya dalam mengelola keuangan dan dapat mengelolanya sebuah keunggulan bagi pelaku bisnis agar dapat memprediksi langkah yang akan dilakukan oleh pelaku bisnis pada masa mendatang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kas-Len.png', 'https://youtu.be/jDCtdb3Bb6k', '', 'https://api.informatics-expo.id/Kas-Len.png', 478, 9, 2, '2022-01-02 11:51:24', '2022-01-02 11:51:24'),
(306, 'Beasiswa Kita', '{\"blocks\":[{\"key\":\"8i7pg\",\"text\":\"Beasiswa Kita merupakan aplikasi yang dikembangakan untuk membantu pelajar dalam mencari beasiswa di dalam negeri. Pelajar dapat mencari daftar beasiswa yang tersedia pada waktu tertentu. Informasi terkait beasiswa akan ditampilkan secara lengkap melalui aplikasi dan menyediakan forum pertanyaan untuk pelajar.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":311,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":311,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":311,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":311,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Beasiswa Kita.jpeg', 'https://youtu.be/nrg3IeTUYK4', '', 'https://api.informatics-expo.id/Beasiswa Kita.jpeg', 291, 4, 2, '2022-01-02 12:17:17', '2022-01-02 12:17:17'),
(307, 'JOB.FIND', '{\"blocks\":[{\"key\":\"1bhtb\",\"text\":\"Di era yang serba digital membawa perubahan besar bagi manusia dalam mengakses berbagai macam informasi dengan sangat mudah termasuk mencari informasi lowongan pekerjaan yang dapat dengan mudah diakses hanya dengan melalui website atau aplikasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dern\",\"text\":\"JOB.FIND merupakan salah satu aplikasi penyedia lapangan pekerjaan yang dapat dengan mudah diakses dimana saja & kapan saja. JOB.FIND dapat menampilkan informasi lowongan pekerjaan dari berbagai jenjang pendidikan, karir, perusahaan, dan agen rekrutmen, sehingga dapat memudahkan pengguna dalam mencari pekerjaan sesuai dengan kriteria pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JOB.FIND: Find Your Job Here!.png', 'https://youtu.be/T3OMc4HFhJc', 'https://www.figma.com/proto/PbGxZvdDP9Y56gpbrKmXBy/JOB.FIND?node-id=129%3A1688&starting-point-node-id=3%3A159', 'https://api.informatics-expo.id/JOB.FIND: Find Your Job Here!.png', 360, 8, 2, '2022-01-02 12:37:40', '2022-01-02 15:52:04'),
(308, 'HandMade', '{\"blocks\":[{\"key\":\"8nt2v\",\"text\":\"HandMade adalah aplikasi Penjualan Hasil Kerajinan Tangan Berbasis Web yang nantinya akan digunakan oleh para UKM. Dimana disini kami berikan solusi permasalahan berupa aplikasi web dimana penjual dan peminat kerajinan tangan dapat melakukan proses jual beli hasil kerajinan tangan, dengan mengandalkan chat dimana pembeli dapat mengkustom sendiri kerajinan tangan yang diinginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HandMade.png', 'https://youtu.be/pzmJMYOxHcI', 'https://github.com/Fauzantriananta/HandMade.git', 'https://api.informatics-expo.id/HandMade.png', 287, 9, 2, '2022-01-02 12:53:22', '2022-01-02 12:53:22'),
(309, 'Bird Hunter', '{\"blocks\":[{\"key\":\"a1ksu\",\"text\":\"bird hunter adalah sebuah game yang menyunsung tema game jadul tentang perburuan burung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bird Hunter.png', 'https://youtu.be/1RqIU3PmBzQ', '', 'https://api.informatics-expo.id/Bird Hunter.png', 486, 2, 2, '2022-01-02 13:11:44', '2022-01-06 07:49:33'),
(310, 'Mental Care', '{\"blocks\":[{\"key\":\"bkbkt\",\"text\":\"mental care ialah sebuah aplikasi yang berguna untuk membantu masyarakat dalam mengatasi gangguan kecemasan berlebih.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Mental Care.png', 'https://youtu.be/4QJckxsP0To', '', 'https://api.informatics-expo.id/Mental Care.png', 487, 3, 2, '2022-01-02 13:15:54', '2022-01-03 02:58:18'),
(311, 'HungHelp', '{\"blocks\":[{\"key\":\"dqmnc\",\"text\":\"Our application solves one of the biggest problems facing the world, which is hunger. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5aemd\",\"text\":\"Some people do not know how to volunteer or how to donate or where, so we made this application because it will be:  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e1rcu\",\"text\":\"1. It is run by charities. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5u3ij\",\"text\":\"2. Easy to use, one-click to donate or volunteer. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cvn42\",\"text\":\"You can donate and be a volunteer in a case. You can also post a a case if someone near you need help. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a820o\",\"text\":\"What\'s featured in the app? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"edo7f\",\"text\":\"1. You can be a volunteer and a donator at the same time \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cd1u5\",\"text\":\"2. Easy to use and find cases quickly \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dltql\",\"text\":\"3. It\'s easy to communicate with other volunteers without the need for a personal account \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"354pk\",\"text\":\"4. Easy to do a payments, you can pay when you are at home without any hassle   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HungHelp.jpeg', 'https://youtu.be/TfTxyiJSffE', 'https://www.figma.com/proto/942kvgtfxn2P1hSXweSlZa/Untitled?page-id=0%3A1&node-id=373%3A377&viewport=241%2C48%2C0.54&scaling=scale-down&starting-point-node-id=373%3A377', 'https://api.informatics-expo.id/HungHelp.jpeg', 488, 2, 2, '2022-01-02 13:33:38', '2022-01-02 13:33:38'),
(312, 'Body Secret', '{\"blocks\":[{\"key\":\"9lv4c\",\"text\":\"Aplikasi BodySecret membantu dan mempermudah seseorang untuk mengetahui berat badan idealnya, Aplikasi ini dapat dijadikan ukuran yang digunakan seseorang untuk membantu mengetahui berat badan seseorang ideal atau tidak, serta membantu untuk mencapai berat badan idealnya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Body Secret.jpeg', '', '', 'https://api.informatics-expo.id/Body Secret.jpeg', 275, 3, 2, '2022-01-02 14:03:39', '2022-01-02 14:03:39'),
(313, 'One Goal', '{\"blocks\":[{\"key\":\"1vki\",\"text\":\"Aplikasi berbasis web yang ditujukan untuk orang orang yang ingin membangun bisnis. One Goal mampu menjadi media penghubung antara pemilik ide bisnis dan orang orang yang ingin membangun bisnis bersama\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'One Goal.jpeg', 'https://youtu.be/w1f73Q4ncaQ', 'http://onegoal.great-site.net/index2.html', 'https://api.informatics-expo.id/One Goal.jpeg', 470, 8, 2, '2022-01-02 14:03:45', '2022-01-02 14:03:45'),
(315, 'Pendekar Nusantara', '{\"blocks\":[{\"key\":\"fugc4\",\"text\":\"Pendekar Nusantara adalah sebuah game platformer yang mengandung unsur play & learn. Memiliki unsur cerita asli sejarah perjuangan bangsa Indonesia. Bermainlah sebagai tokoh pahlawan perjuangan, pilih satu dari banyak tokoh pahlawan dan berjuanglah demi kemerdekaan bangsa Indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pendekar Nusantara.jpeg', 'https://youtu.be/prejfDEA82Y', '', 'https://api.informatics-expo.id/Pendekar Nusantara.jpeg', 489, 4, 2, '2022-01-02 14:30:55', '2022-01-02 14:30:55'),
(316, 'Jual.in', '{\"blocks\":[{\"key\":\"agdi2\",\"text\":\"Jual.in merupakan aplikasi berbasis web yang bertujuan untuk mengembangkan UKM dan memberikan kesempatan bagi orang yang baru memulai bisnis atau yang ingin mengembangkan bisnisnya lebih luas lagi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Jual.in.jpeg', 'https://youtu.be/lTeAnmmCz0E', 'https://github.com/twentyone07/Informatics-Expo', 'https://api.informatics-expo.id/Jual.in.jpeg', 418, 8, 2, '2022-01-02 14:40:35', '2022-01-02 14:40:35'),
(317, 'Fishy Fish', '{\"blocks\":[{\"key\":\"85elf\",\"text\":\"Fishy Fish adalah aplikasi digital wellbeing yang bertujuan untuk mengurangi penggunaan gadget berlebih pada pelajar SD dan SMP. Penggunaan gadget berlebih dapat menyebabkan ketergantungan dan gangguan kesehatan, terutama di jaman pandemi ini yang mana gadget dan internet dimanfaatkan sebagai pengganti pertemuan tatap muka.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fishy Fish.png', 'https://youtu.be/GiJhYRs19WY', '', 'https://api.informatics-expo.id/Fishy Fish.png', 490, 3, 2, '2022-01-02 14:51:09', '2022-01-02 14:51:09'),
(318, 'Nutrition.Edu', '{\"blocks\":[{\"key\":\"1fboh\",\"text\":\"Seperti yang kita tahu masyarakat di Indonesia seringkali mengabaikan kesehatan diri sendiri seperti jarang beraktivitas makan makanan yang tinggi kalori maupun kekurangan sumber gizi pada anak anak mereka, yang dimana kekurangan gizi pada anak sendiri akan berdampak serius kedepannya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":46,\"length\":61,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":108,\"length\":75,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":184,\"length\":73,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":258,\"length\":29,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":46,\"length\":61,\"style\":\"fontsize-16\"},{\"offset\":108,\"length\":75,\"style\":\"fontsize-16\"},{\"offset\":184,\"length\":73,\"style\":\"fontsize-16\"},{\"offset\":258,\"length\":29,\"style\":\"fontsize-16\"},{\"offset\":46,\"length\":61,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":108,\"length\":75,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":184,\"length\":73,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":258,\"length\":29,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"aqbk2\",\"text\":\"Nutrition.edu adalah aplikasi yang bertujuan untuk mengedukasi pengguna supaya lebih mengetahui tentang gizi yang ada dalam makanan dan minuman sehari-hari. Alasan kami membuat aplikasi seperti ini agar dapat membantu masyarakat awam yang belum memahami lebih dalam apa itu gizi serta manfaatnya di dalam kehidupan sehari  hari. Dengan adanya aplikasi ini kami berharap dapat menciptakan lingkungan masyarakat yang sehat secara jasmani\\nmaupun rohani.    \\n\\n\\n\\n\\n\\n\\n\\n\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":62,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":63,\"length\":72,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":136,\"length\":72,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":209,\"length\":75,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":285,\"length\":168,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":455,\"length\":1,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":62,\"style\":\"fontsize-16\"},{\"offset\":63,\"length\":72,\"style\":\"fontsize-16\"},{\"offset\":136,\"length\":72,\"style\":\"fontsize-16\"},{\"offset\":209,\"length\":75,\"style\":\"fontsize-16\"},{\"offset\":285,\"length\":168,\"style\":\"fontsize-16\"},{\"offset\":455,\"length\":1,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":62,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":63,\"length\":72,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":136,\"length\":72,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":209,\"length\":75,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":285,\"length\":168,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":455,\"length\":1,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":362,\"length\":91,\"style\":\"fontsize-inherit\"},{\"offset\":362,\"length\":91,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nutrition.Edu.png', 'https://youtu.be/vxUlei0dOMo', 'https://www.figma.com/proto/xirUG2Ihy4TrMCdiVs9Izw/Nutrition.edu?node-id=114%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=20%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Nutrition.Edu.png', 492, 4, 2, '2022-01-02 15:24:09', '2022-01-02 15:40:09'),
(319, 'Hidrasee', '{\"blocks\":[{\"key\":\"dn2jf\",\"text\":\"At first, we want to do a project that could help the poor people who are in a shortage of\\nsupplies, such as food, clean water and so on. We want to focus on just one problem, in which\\nwe took a theme from Sustainable Development Goals (SDG) by the United Nations, which is 6.\\nClean Water and Sanitation. Funny story, at first there was a misunderstanding that we thought\\nwe were told to create a device and almost actually took that idea much further, until we were\\ntold that the assignment is to develop an application project. Despite that sudden realization and\\nfollowing the assignment due, we still took the idea for our application. Our first idea to that is to\\nhelp the communities who are in a clean water shortage, and currently still using dirty\\nunhygienic water for their daily basis. But to come up with enough budget to do such a project,\\nwe decided to do water deliveries and took inspiration from Gojek, Grab to come up with the\\nidea and a few designs for an application. This water delivery application will sent water\\nproducts such as gallons, boxes, ice cubes, etc. from our partnerships with stores and water\\ndepots to make water deliveries much easier. We then call this project Project Hidrasee with\\nthe vision to help and support small water depots, help the community with an easier water\\naccess and also to help those people who were in need of clean water.\\n     \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1385,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":1385,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":1385,\"style\":\"fontfamily-ArialMT\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Hidrasee.png', 'https://youtu.be/GeMV1hX0MDE', 'https://www.figma.com/proto/2fAv0Dq6hHXQBHVpETWi5N/HIDRASEE?page-id=0%3A1&node-id=208%3A2&viewport=241%2C48%2C0.09&scaling=scale-down&starting-point-node-id=208%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Hidrasee.png', 469, 6, 2, '2022-01-02 15:31:08', '2022-01-02 15:31:08'),
(320, 'DokterKu : Your Personal Health Care', '{\"blocks\":[{\"key\":\"1mh0e\",\"text\":\"Aplikasi Dokterku merupakan aplikasi berbasis kesehatan jarak jauh yang dapat membantu pengguna dalam mencegah dan mengobati berbagai penyakit. Aplikasi ini juga dilengkapi dengan fitur konsultasi dokter yang dapat memudahkan pengguna untuk mengidentifikasi penyakit dan proses pengobatan dilakukan dengan lebih praktis dan efisien.  kemudian ada fitur identifikasi obat, yang berguna untuk mencari berbagai jenis obat serta dilengkapi dengan kegunaan dan cara penggunaan. Aplikasi ini dibuat untuk membantu mempermudah pengguna dalam bidang kesehatan, maka dari itu kami menambahkan vitur pengumpulan point yang dapat di tukarkan menjadi voucher potongan harga, sehingga aplikasi ini bisa meringankan biaya pengobatan dan konsultasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DokterKu : Your Personal Heatlh Care.png', 'https://youtu.be/voCMnCMly3Q', 'https://www.figma.com/proto/Qg2RQqioC99qpRQp4LGuaQ/Calon-Masa-Depanmu?node-id=587%3A3388&scaling=scale-down&page-id=0%3A1&starting-point-node-id=587%3A3388', 'https://api.informatics-expo.id/DokterKu : Your Personal Heatlh Care.png', 493, 18, 2, '2022-01-02 15:36:07', '2022-01-02 16:43:12'),
(321, 'TemuEdu', '{\"blocks\":[{\"key\":\"9gs8f\",\"text\":\"TemuEdu adalah Aplikasi yang diciptakan untuk menunjang pendidikan di Indonesia dimana semua anak di Indonesia bisa merasakan pendidikan secara mudah dan gratis\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"59n6q\",\"text\":\"Didalam aplikasi ini juga seorang relawan pengajar dapat membuat event untuk menunjang pendidikan di Indonesia contohnya kegiatan pergi ke daerah dengan kualitas pendidikan yang tertinggal\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dcak9\",\"text\":\"Dan di aplikasi ini juga kita dapat melakukan donasi yang dimana donasi ini akan di gunakan untuk membantu kegiatan serta kebutuhan untuk pendidikan di Indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TemuEdu.png', 'https://youtu.be/fSDx2EeZor4', 'https://www.figma.com/proto/kuQ55Xj3u4nnzxqcWrcQeL/Apple?node-id=262%3A974&scaling=scale-down&page-id=0%3A1&starting-point-node-id=262%3A974&show-proto-sidebar=1', 'https://api.informatics-expo.id/TemuEdu.png', 494, 4, 2, '2022-01-02 15:38:16', '2022-01-02 15:38:16'),
(322, 'e-Kampung', '{\"blocks\":[{\"key\":\"6lv4t\",\"text\":\"e-Kampung merupakan aplikasi berbasis android yang dapat menolong pemerintahan RW/RT dalam meningkatkan kualitas dan kuantitas sosial di lingkungannya. Aplikasi ini mengizinkan RW untuk mengadakan challenge yang dilakukan oleh warga. Sehingga nantinya warga akan melaksanakan challenge tersebut dan RT akan mengirimkan bukti kegiatan challenge sebagai pertimbangan penilaian untuk memunculkan pemenang challenge. Pemenang challenge akan mendapatkan hadiah sesuai dengan ketentuan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4fl52\",\"text\":\"Kotak kritik saran lapor diperuntukkan untuk warga agar dapat menyampaikan ide atau perasaan yang dialaminya di lingkungan tersebut kepada perangkat RT/RW. Hal ini dimaksudkan agar pemerintahan berjalan dengan lebih baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dfc3n\",\"text\":\"Warga tentu juga bisa mendapatkan informasi ter-up to date dari RT/RW  secara akurat dan real-time sehingga dapat mengurangi miskomunikasi antar pemerintahan dan warga.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eaf50\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2p3ig\",\"text\":\"e-Kampung memungkinkan Anda untuk:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":9,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fb7ls\",\"text\":\"1. Melakukan challenge dan menjadi pemenang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4gpta\",\"text\":\"2. Melaporkan hal yang terjadi di lingkungan sekitar\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8hpsi\",\"text\":\"3. Memberi kritik/saran kepada pemerintahan yang bersangkutan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9j1oe\",\"text\":\"4. Mendapat informasi secara realtime dan akurat dari perangkat RT/RW\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e-Kampung.png', 'https://youtu.be/__1pvYjoY0k', '', 'https://api.informatics-expo.id/e-Kampung.png', 484, 11, 2, '2022-01-02 16:26:26', '2022-01-02 16:26:26'),
(324, 'Mobius Trip', '{\"blocks\":[{\"key\":\"c4sa5\",\"text\":\"Lead a group of travelers on a cross-country road trip in a world full of deadly robots in this turn based action strategy game. Swing, kick, shoot, and hack your way trough an army of killer robots to reach the east coast.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Mobius Trip.png', 'https://youtu.be/kjHq7XtYU5E', 'https://wahyu-candra.itch.io/mobius-trip', 'https://api.informatics-expo.id/Mobius Trip.png', 257, 19, 2, '2022-01-02 16:35:35', '2022-01-02 17:11:13'),
(325, 'DONT WASTE', '{\"blocks\":[{\"key\":\"93p13\",\"text\":\" Kami melihat banyak pebisnis kuliner khususnya di bidang\\nbakery dan fast food yang memproduksi makanan untuk dijual tetapi masih banyak\\nyang belum laku yang kemudian dibuang (sudah kadaluarsa). Saat kami ditugaskan\\nuntuk menentukan SDGs sebagai tema dari aplikasi yang akan dibuat, kami melalui\\nbanyak riset baik internet maupun sosial media, terdapat salah satu masalah\\nyang menarik perhatian kami yaitu seputar dunia kuliner. Jika melihat usaha\\nbakery atau fast food, banyak dari pelaku usaha tersebut membuang\\nmakanan-makanan yang masih layak konsumsi karena tidak mencapai target\\npenjualan produk, yang di mana hal ini sangat disayangkan karena masih\\nbanyaknya orang-orang yang membutuhkan makanan tersebut tetapi terkendala\\nsecara finansial. Maka dari itu kami memutuskan untuk mengambil SDGs No 2 (Zero\\nHunger). Setelah itu, kami melakukan pertemuan dan berdiskusi sembari\\nmengerjakan lembar tugas yang diberikan seperti menentukan permasalahan yang\\ndiberikan dan solusi tepat yang harus kami pikirkan dengan matang. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":1,\"length\":1022,\"style\":\"fontsize-12pt\"},{\"offset\":1,\"length\":1022,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"190v1\",\"text\":\"Proses yang kami lalui guna menemukan solusi yang dibutuhkan\\noleh masyarakat tidaklah singkat, wawancara secara langsung dengan masyarakat\\nsangat diperlukan. Jika bertumpu hanya berdasar informasi internet yang ada,\\ntidaklah begitu relevan. Solusi muncul atas masalah atau keresahan yang dialami\\noleh masyarakat. Berhubung prototipe aplikasi kami bergerak di bidang kuliner,\\nmaka kami mulai melakukan wawancara terhadap calon pengguna terkait aplikasi\\nkami. Pertanyaan yang kami berikan kepada calon pengguna seputar pendapat\\nmereka terkait produk makanan yang terbuang karena tidak laku terjual, selain\\nitu kami juga meminta pendapat mereka tentang aplikasi kami, fitur yang\\ndibutuhkan, dan juga saran serta masukan dari mereka. Sembari menghimpun saran\\ndan masukan dari para calon user, kami juga secara langsung mendatangi\\ntoko-toko bakery dan menanyai mereka dengan pertanyaan yang kami berikan kepada\\ncalon pengguna. Diharapkan para pebisnis bakery ingin bekerja sama dengan kami\\njika aplikasi kami dapat terealisasikan. Setelah memahami semua pendapat yang\\nada, kami menyimpulkan bahwa aplikasi kami merupakan salash satu solusi yang\\ndibutuhkan oleh masyarakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1167,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":1167,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"bvlct\",\"text\":\"Maka\\ndari itu kami berinisiatif untuk membuat sebuah aplikasi yang bertujuan\\nmembantu pebisnis kuliner untuk mengurangi makanan yang masih layak dikonsumsi\\ntetapi dibuang.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":171,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":171,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'DONT WASTE.jpeg', 'https://www.youtube.com/watch?v=bg1tydOAsBk', '', 'https://api.informatics-expo.id/DONT WASTE.jpeg', 498, 2, 2, '2022-01-02 16:40:23', '2022-01-02 16:40:23');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(326, 'e - SmartGov', '{\"blocks\":[{\"key\":\"7n7mt\",\"text\":\"e - SmartGov merupakan sebuah aplikasi yang berbasis andorid.Hadirnya aplikasi ini bertujuan untuk memudahkan masyarakat dalam pembuatan KTP secara efektif dan efisien tanpa  harus datang ke kantor pelayanan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e - SmartGov.png', 'https://youtu.be/GJ4ixWB4FRY', '', 'https://api.informatics-expo.id/e - SmartGov.png', 380, 11, 2, '2022-01-02 16:46:21', '2022-01-03 07:46:16'),
(327, 'Aplikasi Sehat Bergizi', '{\"blocks\":[{\"key\":\"3n45u\",\"text\":\"Aplikasi sehat bergizi berguna supaya masyarakat sadar betapa pentingnya mengatur dan menjaga pola kesehatan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Aplikasi Sehat Bergizi.png', 'https://youtu.be/TaYfDJpkAWU', '', 'https://api.informatics-expo.id/Aplikasi Sehat Bergizi.png', 467, 3, 2, '2022-01-03 03:01:30', '2022-01-08 04:32:24'),
(328, 'DASIDU', '{\"blocks\":[{\"key\":\"1aimh\",\"text\":\"Dasidu merupakan aplikasi dakwah yang memiliki berbagai macam fitur menarik, yang akan menambah wawasan seputar agama islam. Aplikasi ini juga diawasi oleh lembaga khusus sehingga apapun yang disebarkan merupakan berita yang sudah pasti benar kebenarannya.  \",\"type\":\"header-one\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":256,\"style\":\"color-rgb(37,37,37)\"},{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-24\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DASIDU.png', 'https://youtu.be/jeG7ek49yZ8', '', 'https://api.informatics-expo.id/DASIDU.png', 499, 4, 2, '2022-01-06 15:03:57', '2022-01-06 15:03:57'),
(330, 'Catatkeun ', '{\"blocks\":[{\"key\":\"3gi2r\",\"text\":\"Catatkeun merupakan sistem informasi akuntansi pencatat keuangan untuk UKM. Aplikasi ini dapat menyimpan data transaksi untuk banyak toko untuk satu akun pemilik. Selain itu aplikasi ini dapat menampilkan grafik persentase pendapatan setiap toko, grafik pendapatan dan pengeluaran perbulan serta grafik keuntungan disetiap bulannya. Aplikasi ini juga membantu pemilik UKM untuk mengelola akun karyawannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Catatkeun .png', 'https://youtu.be/fU3_Qk4GBU8', '', 'https://api.informatics-expo.id/Catatkeun .png', 509, 8, 3, '2022-07-22 13:52:22', '2022-07-22 13:52:22'),
(331, 'Rent a Car', '{\"blocks\":[{\"key\":\"er1e3\",\"text\":\"Rent a Car adalah sistem informasi berbasis web untuk rental mobil. Sistem ini dibangun untuk mempermudah perusahaan dalam menganalisis data demi membantu manajemen perusahaan untuk membuat keputusan dan pengolahan data. Sistem yang akan di bangun termasuk kepada Management Level System karena dirancang untuk melayani pengamatan, pengendalian, pembuatan keputusan, dan aktivitas administratif dalam level manager menengah. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":424,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":424,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":424,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":424,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":264,\"length\":23,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Rent a Car.png', 'https://youtu.be/fuPXJvkv0B8', 'https://github.com/zanafiii/rentalmobil', 'https://api.informatics-expo.id/Rent a Car.png', 511, 17, 3, '2022-07-22 14:55:23', '2022-07-22 14:55:23'),
(332, 'Bajuju', '{\"blocks\":[{\"key\":\"399ak\",\"text\":\"Bajuju merupakan aplikasi berbasis web. Aplikasi ini merupakan aplikasi jual beli baju yang diperuntukan oleh UMKM penjual baju lokal. Aplikasi ini dapat membantu mereka untuk memasarkan produknya sehingga dapat lebih dikenal oleh publik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bajuju.jpeg', 'https://youtu.be/G0vR7UXUVmg', 'https://github.com/gabriel-tama/tubes_psi', 'https://api.informatics-expo.id/Bajuju.jpeg', 510, 8, 3, '2022-07-22 15:12:45', '2022-07-22 15:12:45'),
(333, 'GoTIk Marketplace', '{\"blocks\":[{\"key\":\"bnqcc\",\"text\":\"Go Batik (GoTik) merupakan sebuah marketplace yang menjual produk kerajinan batik. GoTIk memiliki tujuan untuk membantu pengusaha UMKM khususnya dibidang pengrajin batik untuk mendapat jangkauan pasar yang lebih luas serta lingkungan bisnis yang lebih suportif. GoTik diharapkan menjadi salah satu sarana untuk membangkitkan perekonomian masyarakat. Ada beragam cara untuk mendukung produk buatan Indonesia. Yuk jadikan produk lokal sebagai tuan rumah di negri sendiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":469,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":469,\"style\":\"fontsize-medium\"},{\"offset\":0,\"length\":469,\"style\":\"fontfamily-Poppins, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GoTIk Marketplace.jpeg', 'https://youtu.be/bQGxWViNEJ4', '', 'https://api.informatics-expo.id/GoTIk Marketplace.jpeg', 513, 8, 3, '2022-07-22 20:08:05', '2022-07-22 20:08:05'),
(334, 'NgemilSini', '{\"blocks\":[{\"key\":\"124m6\",\"text\":\"NgemilSini merupakan platform jual beli produk UMKM berbasis web yang menjual berbagai jenis camilan, baik berupa camilan kering, camilan basah, camilan instan, permen, cokelat, dan masih banyak lagi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":61,\"length\":3,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d7tp1\",\"text\":\"Apabila selama ini penjualan produk camilan hanya dilakukan secara tradisional, maka platform ini menghadirkan penjualan produk tidak terbatas di mana pembeli tidak harus datang ke toko untuk membeli produk dan penjual tidak harus memiliki toko untuk memasarkan produk-produknya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"11d74\",\"text\":\"Melalui NgemilSini, pembeli dapat memesan produk dengan mudah dan penjual dapat memasarkan produk-produknya ke ranah yang lebih luas. NgemilSini juga memiliki fitur-fitur yang memudahkan penjual dalam me-manage produk-produknya dan memantau perkembangan usahanya yang dapat disajikan melalui grafik maupun tabel.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":8,\"length\":10,\"style\":\"BOLD\"},{\"offset\":134,\"length\":10,\"style\":\"BOLD\"},{\"offset\":204,\"length\":6,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NgemilSini.png', 'https://youtu.be/oZPc0IhAF3s', 'https://youtu.be/oZPc0IhAF3s?t=48', 'https://api.informatics-expo.id/NgemilSini.png', 508, 8, 3, '2022-07-23 01:01:39', '2022-07-23 01:07:07'),
(335, 'DeCraft', '{\"blocks\":[{\"key\":\"7crr7\",\"text\":\"Pada saat ini banyak UMKM yang berkembang. Namun, untuk mencapai\\nperkembangan yang pesat, usaha kecil menghadapi komplikasi hambatan,\\nseperti: sistem produksi yang kurang efisien, strategi pemasaran yang kurang\\njitu, minimnya teknologi yang digunakan, dan lain sebagainya. Oleh karena itu,\\nDeCraft hadir untuk dapat membantu UMKM untuk berkembang pesat dengan cara\\nmemasarkan produknya, khususnya pada UMKM kerajinan tangan yang berada\\ndi Yogyakarta. \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":290,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DeCraft.jpeg', 'https://youtu.be/CeZCEqzhq_s', '', 'https://api.informatics-expo.id/DeCraft.jpeg', 515, 8, 3, '2022-07-23 06:21:54', '2022-07-23 06:21:54'),
(336, 'LUCAS RENT', '{\"blocks\":[{\"key\":\"avoca\",\"text\":\"LUCAS RENT merupakan sistem informasi rental Sepeda dan Skuter. Aplikasi ini dapat menyewa skuter ataupun sepeda. Selain itu aplikasi ini dapat menampilkan grafik Stok yang ada pada gudang penyimpanan yang dimana akan selalu diupdate setiap harinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LUCAS RENT.jpeg', 'https://youtu.be/RMP7OK9UWGM', '', 'https://api.informatics-expo.id/LUCAS RENT.jpeg', 518, 8, 3, '2022-07-25 09:57:38', '2022-07-25 09:57:38'),
(338, 'Nony.ku', '{\"blocks\":[{\"key\":\"85aps\",\"text\":\"Nony.Ku adalah aplikasi berbasis web yang akan dikembangkan sebagai aplikasi pencatatan keuangan UKM. Tujuan aplikasi yang akan dikembangkan bisa digunakan untuk mencatat pengeluaran, pemasukan. Aplikasi ini juga dapat menyajikan data tersebut dengan grafik sehingga memudahkan untuk dibaca pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":300,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":300,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":300,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":300,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nony.ku.jpeg', 'https://youtu.be/CfORT-Md-9k', 'https://github.com/rasyad777/TubesPsi', 'https://api.informatics-expo.id/Nony.ku.jpeg', 504, 9, 3, '2022-07-25 11:40:50', '2022-07-26 08:00:36'),
(339, 'InstaDrive', '{\"blocks\":[{\"key\":\"9hk4e\",\"text\":\"InstaDrive MIS merupakan Management Information System (MIS) berbasis web yang bertujuan untuk menunjang usaha sewa kendaraan. InstaDrive MIS bertujuan untuk memperluas jangkauan pasar dan mempermudah manajemen ketersediaan kendaraan sewa.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'InstaDrive.png', 'https://youtu.be/-BJR-qoD4Hc', '', 'https://api.informatics-expo.id/InstaDrive.png', 521, 9, 3, '2022-07-26 13:12:51', '2022-07-26 14:01:31'),
(340, 'CoffeeKu', '{\"blocks\":[{\"key\":\"5pvkk\",\"text\":\"CoffeeKu adalah sistem informasi yang diperuntukan kepada pelaku UKM di sektor perkopian untuk mempermudah mereka dalam penjualan dan pencatatan hasil penjualan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CoffeeKu.png', 'https://www.youtube.com/watch?v=pv8Q8rQjtJo', '', 'https://api.informatics-expo.id/CoffeeKu.png', 525, 8, 3, '2022-07-27 15:50:37', '2022-07-27 16:39:11'),
(341, 'KasLen', '{\"blocks\":[{\"key\":\"cgdn\",\"text\":\"Proyek ini bernama Kas-Len dimana memiliki tujuan untuk mengatur segala pemasukan dan pengeluaran uang kas yang terjadi pada pelaku UMKM. Proyek ini sangat penting bagi pelaku UMKM karena mengingat pentingnya dalam mengelola keuangan dan dapat mengelolanya dengan baik merupakan sebuah keunggulan bagi pelaku bisnis agar dapat memprediksi langkah yang akan dilakukan oleh pelaku bisnis pada masa mendatang. Sistem ini juga menyediakan laporan keuangan dan laporan riwayat keuangan.\\n \\n \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":481,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":481,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":481,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":481,\"style\":\"fontfamily-Arial\"},{\"offset\":19,\"length\":7,\"style\":\"BOLD\"},{\"offset\":176,\"length\":4,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'KasLen.png', 'https://youtu.be/87NsUSuspeg', '', 'https://api.informatics-expo.id/KasLen.png', 530, 8, 3, '2022-07-27 18:02:21', '2022-07-27 18:02:21'),
(342, 'NyatatJO', '{\"blocks\":[{\"key\":\"5ora6\",\"text\":\"NyatatJO adalah sebuah sistem perangkat lunak yang dibuat dan dirancang untuk memudahkan pelaku usaha Burjo dalam mengelola data yang ada sehingga mampu menjalakan bisnis dengan efektif dan efisien.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":198,\"style\":\"color-rgb(23,22,28)\"},{\"offset\":0,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"a6nc1\",\"text\":\"Dengan aplikasi NyatatJO dapat mengelola setiap kegiatan transaksi bisnis yang terkait menginput proses pemasukan dan pengeluaran, memonitor stok bahan baku, hingga laporan yang manfaatnya sangat membantu sebuah Burjo untuk berkembang lebih cepat. Dengan demikian penggunaan alat seperti NyatatJO akan sangat besar dampak baiknya bagi perjalanan suatu bisnis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":359,\"style\":\"color-rgb(23,22,28)\"},{\"offset\":0,\"length\":359,\"style\":\"fontfamily-YACgEQNAr7w 0\\\", _fb_, auto\"},{\"offset\":16,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":288,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[{\"offset\":288,\"length\":1,\"key\":0}],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5vblr\",\"text\":\" \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.jurnal.id/id/software-accounting-indonesia-untuk-akunting/\",\"title\":\"N\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.jurnal.id/id/software-accounting-indonesia-untuk-akunting/\",\"title\":\"N\",\"targetOption\":\"_blank\"}}}}}}', 'NyatatJO.png', 'https://www.youtube.com/watch?v=wWyGzKmxED8', '', 'https://api.informatics-expo.id/NyatatJO.png', 531, 17, 3, '2022-07-27 20:18:38', '2022-07-27 20:18:38'),
(343, 'APEM (Aplikasi Pengelolaan Masjid)', '{\"blocks\":[{\"key\":\"6db09\",\"text\":\"APEM adalah sistem perangkat lunak untuk pengelolaan informasi antara pengurus dan jamaah, khususnya untuk menyebarkan kegiatan yang akan dilaksanakan masjid. Tujuan dari adanya aplikasi ini adalah untuk memudahkan pengurus masjid dalam menyebarkan informasi kegiatan juga dalam mengelola anggaran masjid.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":305,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":305,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":305,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":305,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6kqj0\",\"text\":\"Dengan adanya aplikasi ini, penyebaran informasi antara pengurus dan jamaah bisa lebih mudah dan tidak memakan banyak biaya.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":124,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":124,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":124,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":124,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'APEM (Aplikasi Pengelolaan Masjid).png', 'https://youtu.be/vW_75gcvauI', 'https://drive.google.com/file/d/1aCUrgZ9vxV25HollWSDMC4ccm64oxOj_/view?usp=sharing', 'https://api.informatics-expo.id/APEM (Aplikasi Pengelolaan Masjid).png', 532, 8, 3, '2022-07-28 05:42:51', '2022-07-28 05:42:51'),
(344, 'Gobooks', '{\"blocks\":[{\"key\":\"7hmoh\",\"text\":\"sistem informasi Perpustakaan ini didasari kesulitan petugas dalam mengelola perpustakaan seperti ketersediaan buku, jumlah peminjam buku, dll. Serta mempermudah anggota perpustakaan dalam meminjam buku.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Gobooks.png', 'https://www.youtube.com/watch?v=NkNtbNfg5JI', '', 'https://api.informatics-expo.id/Gobooks.png', 537, 4, 3, '2022-07-28 14:22:29', '2022-07-28 14:22:29'),
(345, 'PenKu X Azka Roti', '{\"blocks\":[{\"key\":\"aivg1\",\"text\":\"Salah satu aspek penting bagi kemajuan usaha adalah adanya catatan dan laporan keuangan. Catatan dan laporan keuangan dapat dilakukan dengan akutansi di mana akutansi ini nantinya akan menghasilkan informasi keuangan yang mampu menjadi gambaran bagi pelaku UMKM dalam mengambil keputusan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8f3d\",\"text\":\"Penku X Azka Roti merupakan sistem informasi pencatatan keuangan berbasis web yang dikhususkan untuk UMKM Azka Roti dengan tujuan membantu Azka Roti dalam melakukan penctatan keuangan dan pelaporan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PenKu X Azka Roti.jpeg', 'https://youtu.be/Khp7qZmWo2o', '', 'https://api.informatics-expo.id/PenKu X Azka Roti.jpeg', 526, 9, 3, '2022-07-28 14:35:43', '2022-07-29 04:55:15'),
(347, 'Saman', '{\"blocks\":[{\"key\":\"3qsfc\",\"text\":\"Tugas Besar matakuliah Grafika dan Multimedia membuat animasi. Animasi ini bertema budaya dimana kita mengambil budaya Tari Saman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Saman.png', 'https://youtu.be/28yfuRxJu0c', '', 'https://api.informatics-expo.id/Saman.png', 556, 4, 3, '2022-07-29 07:05:59', '2022-07-29 07:09:44'),
(387, 'GAMELANCE', '{\"blocks\":[{\"key\":\"2kerq\",\"text\":\"Aplikasi Gamelance memiliki fungsi utama sebagai media komunikasi antar gamers sehingga mampu mengirimkan pesan berupa teks, suara, gambar, video, maupun file. Pengguna dapat berinteraksi melalui chat (asinkron) ataupun live chat (sinkron), menampilkan game yang sedang dimainkan melalui fitur share screen, mengikuti atau membuat room chat, memilih kategori game, berbagi media, maupun menambah teman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GAMELANCE(GL).jpeg', '', 'https://github.com/ghaniyyea/GameLance.git', 'https://api.informatics-expo.id/GAMELANCE(GL).jpeg', 594, 11, 3, '2022-07-29 13:28:46', '2022-08-01 12:14:45'),
(386, 'Master Rent Car Yogyakarta', '{\"blocks\":[{\"key\":\"75kha\",\"text\":\"Master Rent Car adalah sistem yang dikhususkan untuk admin dalam mengelola pedapatan harian, bulanan, serta tahunan. Admin dapat mengetahui jumlah dan jenis mobil yang banyak  disewa setiap bulan nya. Selain itu sistem ini mempermudah admin dalam mencatat laporan penyewaan dan transaksi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Master Rent Car Yogyakarta.png', 'https://youtu.be/BrmXWa1xg2Y', '', 'https://api.informatics-expo.id/Master Rent Car Yogyakarta.png', 589, 9, 3, '2022-07-29 13:20:27', '2022-07-29 13:20:27'),
