(382, 'SIPER (Sistem Informasi Pekerjaan)', '{\"blocks\":[{\"key\":\"a3224\",\"text\":\"Apa itu SIPER ? SIPER adalah sebuah layanan masyarakat yang bergerak di bidang pekerjaan dan dibuat untuk membantu masyarakat menemukan pekerjaan yang sesuai dengan kemampuannya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":8,\"length\":6,\"style\":\"BOLD\"},{\"offset\":16,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SIPER (Sistem Informasi Pekerjaan).jpeg', 'https://youtu.be/9xDTbSjMFu8', 'https://drive.google.com/file/d/1JH38VTWUXFf1w7sgSmzj71FLBKJbYihX/view?usp=sharing', 'https://api.informatics-expo.id/SIPER (Sistem Informasi Pekerjaan).jpeg', 580, 8, 3, '2022-07-29 11:29:55', '2022-07-30 10:13:59'),
(381, 'Goldarium', '{\"blocks\":[{\"key\":\"5040h\",\"text\":\"Goldarium adalah aplikasi pengumpul informasi golongan darah yang bertujuan untuk memudahkan masyarakat dan penyedia layanan kesehatan dalam mencari calon pendonor saat keadaan darurat.\\n\\nFitur Goldarium Admin:\\n1. Cari Data: Telusuri data berdasarkan domisili atau golongan darah\\n2. Kelola Data:  Tambah, hapus, dan perbaharui data calon pendonor sesuai kebutuhan\\n3. Statistik: Memetakan jumlah calon pendonor berdasarkan golongan darahnya dalam bentuk chart.\\n4. Konfirmasi Permintaan: Meneruskan permintaan pencarian donor darah melalui pesan siaran ke seluruh pengguna Goldarium yang bergolongan darah sama.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":609,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":609,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":609,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":609,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":9,\"style\":\"BOLD\"},{\"offset\":186,\"length\":23,\"style\":\"BOLD\"},{\"offset\":210,\"length\":13,\"style\":\"BOLD\"},{\"offset\":279,\"length\":15,\"style\":\"BOLD\"},{\"offset\":363,\"length\":14,\"style\":\"BOLD\"},{\"offset\":459,\"length\":25,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Goldarium.png', 'https://youtu.be/BznmrDnEiQk', 'https://www.canva.com/design/DAFGOWq9tkQ/w3hPY-LIlnT0N6wLOIFXPQ/view?utm_content=DAFGOWq9tkQ&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/Goldarium.png', 579, 3, 3, '2022-07-29 10:16:14', '2022-07-29 10:16:14'),
(380, 'GOVJOB', '{\"blocks\":[{\"key\":\"fe8bb\",\"text\":\"Govjob adalah website yang berfungsi untuk mempermudah masyarakat\\nkhususnya pengguna dalam memberi dan mencari pekerjaan. Selain itu, website\\nini juga langsung menampilkan list pekerjaan yang masih tersedia dan kisaran\\npendapatan yang akan diberikan secara langsung saat pekerjaan sudah selesai.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GOVJOB.jpeg', 'https://youtu.be/7tGVJdYwrJk', '', 'https://api.informatics-expo.id/GOVJOB.jpeg', 578, 8, 3, '2022-07-29 10:12:43', '2022-07-30 01:35:16'),
(378, 'Melestarikan Lagu Daerah', '{\"blocks\":[{\"key\":\"7095p\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Melestarikan Lagu Daerah.png', 'https://youtu.be/UsAN40LrAkE', '', 'https://api.informatics-expo.id/Melestarikan Lagu Daerah.png', 577, 4, 3, '2022-07-29 10:01:12', '2022-07-29 17:00:05'),
