(383, 'Animasi Lomba Lari 17 Agustus', '{\"blocks\":[{\"key\":\"98sm8\",\"text\":\"\\nTugas Besar matakuliah Grafika dan Multimedia Animasi Budaya Lomba Lari 17 Agustus\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":1,\"length\":82,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1,\"length\":82,\"style\":\"fontsize-16\"},{\"offset\":1,\"length\":82,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Lomba Lari 17 Agustus.jpeg', 'https://www.youtube.com/watch?v=CZduIbnbCfw&t=3s', '', 'https://api.informatics-expo.id/Animasi Lomba Lari 17 Agustus.jpeg', 587, 17, 3, '2022-07-29 12:48:06', '2022-07-29 12:48:06'),
(377, 'EasyBuy - Sistem Informasi Manajemen Stok Barang', '{\"blocks\":[{\"key\":\"qui9\",\"text\":\"EasyBuy adalah sistem ini dikhususkan untuk admin dengan tujuan mempermudah dalam mengurus dan mengelola stok barang yang tersedia di gudang.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":141,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'EasyBuy - Sistem Informasi Manajemen Stok Barang.png', 'https://youtu.be/i2gXY1nLqPM', '', 'https://api.informatics-expo.id/EasyBuy - Sistem Informasi Manajemen Stok Barang.png', 574, 8, 3, '2022-07-29 09:44:02', '2022-08-01 00:42:14'),
(375, 'Asal Usul Reog Ponorogo', '{\"blocks\":[{\"key\":\"eq2i2\",\"text\":\"Kisah perjuangan Kelana Sewandana menaklukan Singo Barong untuk mendapatkan sang pujaan hati Putri Kediri Dewi Dyah Ayu Sangga Langit.  Apakah ia akan berhasil?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Asal Usul Reog Ponorogo.png', 'https://youtu.be/Xrpt7SVyvpM', '', 'https://api.informatics-expo.id/Asal Usul Reog Ponorogo.png', 572, 4, 3, '2022-07-29 09:35:13', '2022-07-29 09:35:13'),
(376, 'IHC (Intergreted Health Center) ', '{\"blocks\":[{\"key\":\"1begj\",\"text\":\"IHC/ Intergreted Health Center adalah suatu sistem perangkat lunak untuk saranan posyandu bagi bidan ata kader bidan. Bertujuan untuk memudahkan dalam memasukan data dan membuat laporan kesehatan.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Intergreted Health Center .png', 'https://youtu.be/AuGKHDzwBGc', 'https://www.figma.com/file/jLWEU4UbS05gmkz7OpCY7P/Vanof?node-id=0%3A1', 'https://api.informatics-expo.id/Intergreted Health Center .png', 546, 18, 3, '2022-07-29 09:37:18', '2022-07-29 12:26:52'),
(371, 'De\'kost', '{\"blocks\":[{\"key\":\"1i9rc\",\"text\":\"DeKost merupakan aplikasi berbasis web yang secara fungsionalitas terbagi ke dalam dua fungsi, yaitu DeKost sebagai Transaction Processing System (TPS) dan DeKost sebagai Management Information System (MIS). Sebagai TPS, DeKost merupakan sebuah aplikasi berbasis web yang diperuntukkan untuk membantu masyarakat umum terkhususnya mahasiswa dalam mencari tempat tinggal yang nyaman secara daring tanpa perlu mendatangi tempatnya secara langsung. Sementara sebagai MIS, DeKost merupakan sebuah sistem informasi kos berbasis web yang menyajikan informasi aktual kepada pemilik kos terkait kos yang dimilikinya, serta informasi-informasi terkait yang dapat membantu pemilik kos meningkatkan kualitas kos miliknya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":714,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":714,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":714,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":714,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":0,\"length\":714,\"style\":\"fontsize-18\"},{\"offset\":118,\"length\":29,\"style\":\"ITALIC\"},{\"offset\":174,\"length\":29,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e3945e00db7_902450De\'Kost [POSTER].png', 'https://youtu.be/4EXjhEvtnFQ', 'https://github.com/ilham-2001/dekost', 'https://api.informatics-expo.id/62e3945e00db7_902450De\'Kost [POSTER].png', 539, 9, 3, '2022-07-29 08:03:42', '2022-07-29 08:09:59'),
(369, 'ANIMASI MUDIK', '{\"blocks\":[{\"key\":\"ebmv8\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e3905f562fd_73157poster.png', 'https://youtu.be/TxP9cMyu9nE', '', 'https://api.informatics-expo.id/62e3905f562fd_73157poster.png', 560, 1, 3, '2022-07-29 07:46:39', '2022-07-29 07:46:39'),
(370, 'Bu-Comp', '{\"blocks\":[{\"key\":\"748i1\",\"text\":\"Bu-Comp adalah sebuah website jual beli online seputar aksesoris dan perangkat dari pc dan laptop. Dari website ini harapannya bisa memudahkan pengguna dalam membeli barang seputar pc dan laptop serta bisa menambahkan kepercayaan pelanggan untuk bertransaksi dalam website kami \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":98,\"style\":\"color-rgb(18,18,18)\"},{\"offset\":99,\"length\":178,\"style\":\"color-rgb(18,18,18)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bu-Comp.jpeg', 'https://youtu.be/4OdMtsX5PSw', '', 'https://api.informatics-expo.id/Bu-Comp.jpeg', 562, 8, 3, '2022-07-29 07:55:07', '2022-07-29 07:55:07'),
(368, 'MariBantu', '{\"blocks\":[{\"key\":\"b27k8\",\"text\":\"MariBantu adalah aplikasi berbasis website yang ditujukan untuk masyarakat umum, aplikasi ini bertujuan untuk membantu masyarakat dalam kegiatan berdonasi. Tidak hanya berdonasi, MariBantu juga memiliki fitur Galang Dana dan Zakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":231,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":231,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":231,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e38f53d7d53_227801Poster Paling Baru.png', '', 'https://www.canva.com/design/DAFHxnELQW4/n280za3EMRYo73j2tX2zEg/view?utm_content=DAFHxnELQW4&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/62e38f53d7d53_227801Poster Paling Baru.png', 553, 1, 3, '2022-07-29 07:42:12', '2022-07-29 14:28:26'),
(422, 'Plesiran', '{\"blocks\":[{\"key\":\"7ilsq\",\"text\":\"Plesiran adalah suatu aplikasi yang dapat dijadikan panduan bagi para wisatawan ketika ingin berkunjung ke suatu destinasi wisata. Selain itu, aplikasi ini juga mewadahi para pengelola wisata dan pengelola UMKM lokal agar wisata dan usahanya dapat dikenal luas oleh masyarakat umum. Di dalam aplikasi ini terdapat beberapa fitur seperti tambah wisata, tambah toko, lihat wisata serta lihat toko. Dengan kehadiran fitur - fitur tersebut diharapkan dapat membantu para pengelola wisata dan pengelola UMKM lokal untuk mempromosikan wisata dan usahanya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":508,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":488,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":488,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Plesiran.png', 'https://youtu.be/VbJ1bF-ED60', 'https://www.canva.com/design/DAFGjGGSvuI/QDnF0_F67nUDYAtUGEBKzg/view?utm_content=DAFGjGGSvuI&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton#10', 'https://api.informatics-expo.id/Plesiran.png', 653, 11, 3, '2022-07-29 18:49:51', '2022-07-30 09:14:30'),
(390, 'E-Kerja', '{\"blocks\":[{\"key\":\"9pmbf\",\"text\":\"E-kerja merupakan suatu sistem yang membantu pemerintah untuk mempermudah Pegawai memantau bawahan pegawainya dengan melihat laporan kinerja yang di input oleh bawahan pegawai tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-Kerja.jpeg', 'https://youtu.be/uNO6eKs6OIc', '', 'https://api.informatics-expo.id/E-Kerja.jpeg', 593, 9, 3, '2022-07-29 13:33:21', '2022-07-29 13:33:21'),
(395, 'CyberKriminal', '{\"blocks\":[{\"key\":\"1pu9j\",\"text\":\"CyberKriminal adalah sebuah layanan bertujuan mempermudah masyarakat dalam melapor tindakan kriminalitas dan juga pihak layanan darurat mudah mendapatkan laporan sekaligus mudah mendeteksi lokasi terjadinya kriminalitas.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bstuh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CyberKriminal.jpeg', 'https://youtu.be/hUhTvTUuiek', '', 'https://api.informatics-expo.id/CyberKriminal.jpeg', 592, 16, 3, '2022-07-29 13:41:10', '2022-07-31 00:43:02'),
(423, 'Restoran Klitih Versi 1.0', '{\"blocks\":[{\"key\":\"18jg7\",\"text\":\"Restoran Klitih adalah Sistem Informasi berbasis web untuk melakukan pencatatan transaksi dan pengkontrolan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Klitih,  penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat, dengan mempermudah manajemen untuk memutuskan dari permasalahan yang sering terjadi yang bisa diambil dari sistem informasi yang Restoran Klitih berikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":488,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"et7pe\",\"text\":\"Email = admin@binjai.com\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":24,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":24,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":24,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":24,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":24,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"b5d9t\",\"text\":\"Pass = 1 \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":8,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":8,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":8,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":8,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Klitih Versi 1.0.jpeg', 'https://youtu.be/MGqYnPsYXGs', 'https://www.slbkundur.sch.id/restoran/', 'https://api.informatics-expo.id/Restoran Klitih Versi 1.0.jpeg', 611, 9, 3, '2022-07-30 00:37:53', '2022-07-30 07:05:34'),
(397, 'Pameran Batik ', '{\"blocks\":[{\"key\":\"6oi4c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pameran Batik .jpeg', 'https://youtu.be/IN40JjSL_NU', '', 'https://api.informatics-expo.id/Pameran Batik .jpeg', 608, 4, 3, '2022-07-29 13:42:31', '2022-07-30 12:44:44'),
(400, 'Ekatepe.', '{\"blocks\":[{\"key\":\"26qj1\",\"text\":\"Proyek yang kami buat ini hasil pertimbangan dari isu masalah yang muncul salah satunya yaitu Pembangunan daerah yang belum merata menyebabkan beberapa akses jalan menuju DISDUKCAPIL yang sulit dijangkau khususnya di daerah pelosok. Oleh karena itu, dengan adanya aplikasi ini kami berharap dapat memberikan kenyamanan kepada masyarakat yang mengalami dampak tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":368,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":368,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":368,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":368,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Ekatepe..jpeg', 'https://www.youtube.com/watch?v=O79HHFyXwEA', '', 'https://api.informatics-expo.id/Ekatepe..jpeg', 549, 8, 3, '2022-07-29 14:08:00', '2022-07-29 14:08:19'),
(442, 'AmalBaik', '{\"blocks\":[{\"key\":\"1d4ht\",\"text\":\"AmalBaik merupakan platform zakat & infaq berbasis aplikasi yang dibuat untuk membudahkan kita sebagai seorang muslim dalam menyempurnakan ibadah kita terutama dalam membayar zakat dan berinfaq guna membantu saudaara kita yang membutuhkan bantuan diluar sana\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AmalBaik.png', 'https://youtu.be/eX4_9A79uG4', 'https://www.figma.com/proto/SFnEGg2t3afAughocVZXwH/AmalBaik?node-id=1%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/AmalBaik.png', 502, 2, 3, '2022-07-30 06:15:59', '2022-07-30 06:15:59'),
(443, 'Sejarah Batik Kawung Yogyakarta', '{\"blocks\":[{\"key\":\"isgo\",\"text\":\"Batik dianggap sebagai ikon budaya penting di Indonesia. Batik adalah kerajinan yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"32pjr\",\"text\":\"memiliki nilai seni tinggi dan telah menjadi bagian dari budaya Indonesia (khususnya Pulau\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"efvj1\",\"text\":\"Jawa) sejak lama. Dari sekian banyak motif batik yang ada di Indonesia, salah satu yang sangat\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9k01g\",\"text\":\"terkenal adalah batik Kawung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"78p7e\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"42hat\",\"text\":\"Dari hal tersebut, kami mengangkat motif Kawung ini sebagai tema budaya dari animasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dc5qv\",\"text\":\"kami yang menceritakan seorang wisatawan yang berlibur ke Yogyakarta dan bingung terhadap\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"p6cv\",\"text\":\"barang apa yang harus ia beli untuk oleh-oleh. Salah satu warga lokal menghampirinya lalu ia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bsur0\",\"text\":\"memberikan saran yaitu membeli batik Kawung untuk dijadikan oleh-oleh dari Yogyakarta yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"89p50\",\"text\":\"terkenal dengan nilai seni yang tinggi serta sangat menarik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sejarah Batik Kawung Yogyakarta.png', 'https://youtu.be/YBJt1DvtE1Y', '', 'https://api.informatics-expo.id/Sejarah Batik Kawung Yogyakarta.png', 688, 2, 3, '2022-07-30 06:21:59', '2022-07-30 06:21:59'),
(402, 'E-Bako', '{\"blocks\":[{\"key\":\"5esic\",\"text\":\"Sebuah aplikasi bernama E - Bako ini adalah aplikasi jual beli yang menjual khusus bahan bahan sembako. Aplikasi ini dapat membantu masyarakat dan toko kelontong dalam membeli sembako, serta mempermudah penjual sembako dalam memantau penjualan barang, dan mempermudah penjual sembako dalam pengelolaan stock barang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-Bako.png', 'https://youtu.be/kvi_2PR7PSA', '', 'https://api.informatics-expo.id/E-Bako.png', 542, 8, 3, '2022-07-29 14:18:20', '2022-07-29 14:18:20'),
(403, 'Cerita Rakyat Candi Prambanan', '{\"blocks\":[{\"key\":\"crjpe\",\"text\":\"Cerita Rakyat tentang bagaimana Sejarah Candi Prambanan dibuat\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cerita Rakyat Candi Prambanan.jpeg', 'https://youtu.be/ZurUozAAzF0', '', 'https://api.informatics-expo.id/Cerita Rakyat Candi Prambanan.jpeg', 571, 4, 3, '2022-07-29 14:29:04', '2022-07-29 14:29:04'),
(404, 'StudioKala', '{\"blocks\":[{\"key\":\"2gtju\",\"text\":\"StudioKala merupakan perangkat lunak berbasis web online sebagai platform untuk menyalurkan hasil karya dibidang seni lukis bagi para seniman. StudioKala diharapkan dapat memberi akses pengguna untuk mengunggah dan memamerkan karya mereka secara online dan juga menyebarkan informasi mengenai pameran yang akan diselenggarakan oleh para seniman dengan tujuan agar lebih banyak khalayak umum yang mengetahui dan\\ndapat mengikuti pameran tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":11,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":21,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":31,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":37,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":46,\"length\":3,\"style\":\"fontsize-11pt\"},{\"offset\":50,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":57,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":65,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":74,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":80,\"length\":17,\"style\":\"fontsize-11pt\"},{\"offset\":98,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":113,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":118,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":124,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":129,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":154,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":165,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":171,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":179,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":185,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":194,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":200,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":215,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":226,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":232,\"length\":13,\"style\":\"fontsize-11pt\"},{\"offset\":246,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":253,\"length\":3,\"style\":\"fontsize-11pt\"},{\"offset\":257,\"length\":16,\"style\":\"fontsize-11pt\"},{\"offset\":274,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":284,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":293,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":301,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":306,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":311,\"length\":52,\"style\":\"fontsize-11pt\"},{\"offset\":364,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":370,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":377,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":386,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":391,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":396,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":407,\"length\":27,\"style\":\"fontsize-11pt\"},{\"offset\":435,\"length\":9,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"dvdou\",\"text\":\"Selain itu, perangkat lunak ini dapat digunakan sebagai wadah agar para  seniman dapat menerima umpan balik mengenai karya mereka, baik dari sesama seniman maupun dari khalayak umum yang menikmati seni lukis. Dengan adanya fitur telah kami sediakan, para seniman dapat mengadakan lelang untuk karya yang ingin diperjual belikan untuk mendapatkan harga terbaik yang ditawarkan, serta dengan mengunggah karya lukis dalam waktu bersamaan pelukis dapat menjadikan bukti hak cipta karya yang mereka ciptakan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":12,\"length\":43,\"style\":\"fontsize-11pt\"},{\"offset\":56,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":62,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":73,\"length\":43,\"style\":\"fontsize-11pt\"},{\"offset\":117,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":123,\"length\":39,\"style\":\"fontsize-11pt\"},{\"offset\":163,\"length\":13,\"style\":\"fontsize-11pt\"},{\"offset\":177,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":182,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":187,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":197,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":202,\"length\":52,\"style\":\"fontsize-11pt\"},{\"offset\":255,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":263,\"length\":16,\"style\":\"fontsize-11pt\"},{\"offset\":280,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":287,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":293,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":299,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":304,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":310,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":320,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":328,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":334,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":346,\"length\":18,\"style\":\"fontsize-11pt\"},{\"offset\":365,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":377,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":383,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":390,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":401,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":407,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":413,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":419,\"length\":15,\"style\":\"fontsize-11pt\"},{\"offset\":435,\"length\":24,\"style\":\"fontsize-11pt\"},{\"offset\":460,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":466,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":476,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":482,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":487,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":494,\"length\":9,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'StudioKala.png', 'https://youtu.be/hc3JxYio7xs', '', 'https://api.informatics-expo.id/StudioKala.png', 595, 11, 3, '2022-07-29 14:36:08', '2022-07-30 13:16:54');
