(405, 'FundFare', '{\"blocks\":[{\"key\":\"vps1\",\"text\":\"Di masa sekarang, banyak orang yang berprofesi menjadi streamer. Namun, pendapatan yang mereka dapat sekarang sedang menurun dikarenakan iklan yang dipasang sangat sedikit akibat dari pandemi. Di saat seperti ini FundFare muncul.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4d37v\",\"text\":\"FundFare adalah sistem perangkat lunak yang bisa digunakan untuk melakukan sumbangan ke streamer. Penonton bisa melakukan sumbangan ke streamer saat dia sedang melakukan livestream dan mereka bisa mengetik pesan-pesan yang ingin mereka sampaikan ke streamer tersebut. FundFare juga bisa digunakan untuk charity yang dimana semua donasi yang didapat akan langsung disalurkan ke orang yang membutuhkan lewat instansi donasi terkait.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e95uu\",\"text\":\"Dengan adanya FundFare, diharapkan para streamer bisa mendapatkan pendapatan tambahan dan instansi donasi terkait bisa mendapatkan donasi lebih yang bisa digunakan untuk membantu orang-orang yang membutuhkan uang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FundFare.png', 'https://youtu.be/YUoECtXZUKY', 'https://drive.google.com/file/d/1rfrIAROuWGVDGHLScB26_uaA-oDnYzG0/view?usp=sharing', 'https://api.informatics-expo.id/FundFare.png', 554, 8, 3, '2022-07-29 15:07:39', '2022-07-30 03:10:03'),
(407, 'Alun-alun Yogyakarta', '{\"blocks\":[{\"key\":\"17pp2\",\"text\":\"Ada 2 alun-alun di Yogyakarta, Alun-alun Utara dan Alun-alun Kidul.Alun-alun pada zaman dahulu digunakan prajurit keraton untuk berlatih. Alun-alun juga digunakan  untuk tempat untuk melakukan tradisi daerah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"emm6c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Alun-alun Yogyakarta.jpeg', 'https://youtu.be/EhJbx3cghQY', '', 'https://api.informatics-expo.id/Alun-alun Yogyakarta.jpeg', 619, 4, 3, '2022-07-29 15:13:26', '2022-07-30 08:46:02'),
(408, 'TraFix', '{\"blocks\":[{\"key\":\"3rvts\",\"text\":\"People usually burn the trash\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fdtj\",\"text\":\"instead of recycling it to\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f49lk\",\"text\":\"reduce it. it will cause air\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"72s57\",\"text\":\"pollution.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5uj8v\",\"text\":\"Thats why we crete Trafix,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bbvll\",\"text\":\"We developed a desktop\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d6u10\",\"text\":\"application that eases the\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8g2kb\",\"text\":\"process of management of\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7d7i8\",\"text\":\"collecting and recycling\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f9up2\",\"text\":\"trash.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TraFix.png', 'https://youtu.be/7ESri_AvQQ8', 'https://www.figma.com/proto/RJM4gXSQ2dlOKmxEsS8m6t/For-Pc?page-id=231%3A921&node-id=231%3A1461&viewport=537%2C789%2C0.13&scaling=scale-down&starting-point-node-id=231%3A1461', 'https://api.informatics-expo.id/TraFix.png', 614, 9, 3, '2022-07-29 15:17:50', '2022-07-29 15:17:50'),
(409, 'IdeaShop', '{\"blocks\":[{\"key\":\"9s7ue\",\"text\":\"Ideashop adalah Sistem penjualan Ide bisnis berupa franchise dalam lingkup usaha UMKM. di mana kami selaku founder aplikasi ini akan menyediakan usaha-usaha yang bisa diikuti/dijalankan oleh masyarakat menengah kebawah dengan harga terjangkau.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4ncq3\",\"text\":\"Tujuan dibuatnya Ideashop ini adalah untuk membantu dan menambah pengetahuan, pengalaman, inisiatif, dan kecerdasan user mengenai ide bisnis yang ada. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":150,\"style\":\"color-rgb(55,55,55)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IdeaShop.jpeg', 'https://youtu.be/43QoHSuJxlw', '', 'https://api.informatics-expo.id/IdeaShop.jpeg', 564, 8, 3, '2022-07-29 15:20:48', '2022-07-29 15:26:02'),
(410, 'AyoZakat - Layanan Pendataan Zakat', '{\"blocks\":[{\"key\":\"9vhq6\",\"text\":\"AyoZakat merupakan aplikasi yang khusus untuk pelayanan pendataan zakat para muzakki\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AyoZakat - Layanan Pendataan Zakat.png', 'https://youtu.be/UGaiPAXQ4GQ', 'https://www.figma.com/proto/dDoaEiVpj7CIz6i4UBkuIx/Untitled?node-id=17%3A398&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=17%3A398&show-proto-sidebar=1', 'https://api.informatics-expo.id/AyoZakat - Layanan Pendataan Zakat.png', 596, 4, 3, '2022-07-29 15:23:13', '2022-07-29 15:23:13'),
(411, 'MedClick', '{\"blocks\":[{\"key\":\"7mo98\",\"text\":\"MedClick  merupakan aplikasi yang dirancang untuk memudahkan manajemen data klinik anda, serta dalam memberikan pelayanan terhadap pasien. Selain itu aplikasi ini juga bisa digunakan pasien dalam melakukan reservasi untuk berobat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MedClick.jpeg', 'https://youtu.be/dz2VGxQIe2w', 'https://www.canva.com/design/DAFHzzW6jks/9gR8a2G7YLYKT4iFLenOxw/view?utm_content=DAFHzzW6jks&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton', 'https://api.informatics-expo.id/MedClick.jpeg', 621, 3, 3, '2022-07-29 15:43:53', '2022-07-29 15:43:53'),
(412, 'Sistar', '{\"blocks\":[{\"key\":\"4of77\",\"text\":\"Seiring berkembangnya zaman dan teknologi kebutuhan akan penelitian dan pengembangan dalam segala bidang semakin meningkat pesat, terutama dalam bidang platform aplikasi. Hal yang mendasarkan kemajuan teknologi ini adalah semakin dibutuhkannya material baru guna menunjang bidang industri yang lain. Maka dari itu, kami selaku kelompok Beyonder telah membuat aplikasi SISTAR atau SISTEM LAYANAN PENGANTAR SKCK KELURAHAN agar mempermudah masyarakat dalam pengurusan pengantar skck di kelurahan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":368,\"length\":7,\"style\":\"BOLD\"},{\"offset\":380,\"length\":39,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistar.jpeg', 'https://youtu.be/edwWiz_SfoU', '', 'https://api.informatics-expo.id/Sistar.jpeg', 617, 16, 3, '2022-07-29 15:46:24', '2022-07-29 15:46:24'),
(413, 'FinCo', '{\"blocks\":[{\"key\":\"3tu7p\",\"text\":\"FinCo merupakan aplikasi berbasis website yang akan membantu para pelaku UKM untuk bisa mengatur dan mengelola keuangan dari proses bisnis yang dimiliki. Aplikasi ini diperuntukkan agar pelaku UKM dapat mencatat pengeluaran dan pendapatan keuangan serta mengetahui keuntungan dan kerugian dari pendapatan dan pengeluaran.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FinCo.png', 'https://youtu.be/oE3Ui9CAxV0', '', 'https://api.informatics-expo.id/FinCo.png', 623, 8, 3, '2022-07-29 15:47:05', '2022-07-29 15:47:05'),
(414, 'Umkm-ku', '{\"blocks\":[{\"key\":\"94smd\",\"text\":\"UMKM-KU adalah sebuah aplikasi yang akan digunakan untuk memantau UMKM yang berada dikawasan Yogyakarta. Aplikasi ini nantinya akan berguna untuk meningkatkan kesejahteraan UMKM sendiri seperti contohnya adalah pemantauan pengunaan modal UMKM, feedback kepada UMKM setelah memberikan laporan dll. Oleh karena itu, kami ingin membuat sistem informasi yang dapat meningkatkan informasi yang ada guna membangun sebuah UMKM yang memiliki kualitas dan mutu yang baik terkhusus dalam yogyakarta sendiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":497,\"style\":\"color-rgb(20,17,15)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Umkm-ku.jpeg', 'https://youtu.be/cYmOKfoKJzo', '', 'https://api.informatics-expo.id/Umkm-ku.jpeg', 624, 9, 3, '2022-07-29 15:53:41', '2022-07-29 15:53:41'),
(421, 'KOMA (Toko Material)', '{\"blocks\":[{\"key\":\"68c8t\",\"text\":\"KOMA adalah Sistem Informasi yang difungsikan untuk memudahkan masyarakat yang ingin membeli bahan bangunan tanpa harus keluar rumah, yang tentunya lebih mudah dan praktis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KOMA (Toko Material).png', 'https://youtu.be/MEYUxg2RN4w', 'https://komastore-frontend.vercel.app/', 'https://api.informatics-expo.id/KOMA (Toko Material).png', 559, 9, 3, '2022-07-29 16:50:28', '2022-07-29 16:50:28'),
(416, 'Meditor', '{\"blocks\":[{\"key\":\"5jo06\",\"text\":\"Meditor merupakan suatu sistem berbasis web yang membantu pihak rumah sakit dalam mendaftarkan pasiennya, serta membantu bagian manajerial rumah sakit dalam mengelola data data penting yang dibutuhkan untuk operasional rumah sakit.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Meditor.jpeg', 'https://www.youtube.com/watch?v=XtwHtPyQoCQ&t=5s', 'https://www.youtube.com/watch?v=XtwHtPyQoCQ&t=5s', 'https://api.informatics-expo.id/Meditor.jpeg', 524, 18, 3, '2022-07-29 16:06:19', '2022-07-29 16:06:19'),
(418, 'Kepuhunan', '{\"blocks\":[{\"key\":\"10p9c\",\"text\":\"Kepuhunan (bahasa Banjar: Kapuhunan) adalah sebuah mitos masyarakat lokal di Kalimantan, istilah ini digunakan ketika seseorang ingin pergi ditawari makan dan minum tetapi tidak mengindahkan dan akhirnya tertimpa musibah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kepuhunan.jpeg', 'https://youtu.be/7KtdDL18Of0', '', 'https://api.informatics-expo.id/Kepuhunan.jpeg', 534, 4, 3, '2022-07-29 16:07:20', '2022-07-30 11:46:42'),
(419, 'Cuanin', '{\"blocks\":[{\"key\":\"e8j3o\",\"text\":\"Cuanin adalah sistem informasi manajemen akuntansi online dengan fitur terbaik untuk memberikan solusi automasi usaha yang mudah, efisien, kapanpun dan dimanapun. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":162,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":162,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":162,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Cuanin.jpeg', 'https://www.youtube.com/watch?v=5--EJwlj1eo', 'https://www.figma.com/proto/d22MiyQUSMOoJnhpqufZPi/Cuanin-2.0?node-id=35%3A2059&scaling=min-zoom&page-id=35%3A703&starting-point-node-id=35%3A2059', 'https://api.informatics-expo.id/Cuanin.jpeg', 631, 9, 3, '2022-07-29 16:11:34', '2022-07-31 14:15:29'),
(420, 'BuyMe by Skkrr', '{\"blocks\":[{\"key\":\"3qj4\",\"text\":\"Buyme by Skkrr merupakan pengembangan aplikasi pada sistem informasi yang diharapkan dapat memebantu penjual dalam melakukan jual beli\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BuyMe by Skkrr.png', 'https://youtu.be/O1Zlxb6Rqps', 'https://youtu.be/1iIf6sWbkkM', 'https://api.informatics-expo.id/BuyMe by Skkrr.png', 627, 8, 3, '2022-07-29 16:12:07', '2022-07-31 03:28:04'),
(425, 'Restoran Klitih Versi 1.1', '{\"blocks\":[{\"key\":\"3delc\",\"text\":\"Restoran Klitih adalah Sistem Informasi berbasis web untuk melakukan pencatatan transaksi dan pengkontrolan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Klitih,  penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat, dengan mempermudah manajemen untuk memutuskan dari permasalahan yang sering terjadi yang bisa diambil dari sistem informasi yang Restoran Klitih berikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":488,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"14tks\",\"text\":\"Email = admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"6ofsl\",\"text\":\"Pass = admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":12,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":12,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":12,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":12,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":12,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"e1uc1\",\"text\":\"https://slbkundur.sch.id/food/admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Klitih Versi 1.1.jpeg', '', 'https://slbkundur.sch.id/food/', 'https://api.informatics-expo.id/Restoran Klitih Versi 1.1.jpeg', 667, 9, 3, '2022-07-30 01:10:06', '2022-07-30 07:04:41'),
(426, 'Kebudayaan Yogyakarta', '{\"blocks\":[{\"key\":\"7b0cs\",\"text\":\"Kisah perjalanan 3 orang sahabat ke Yogyakarta untuk mengenal lebih jauh budaya di Yogyakarta bersama seorang ahli budaya Yogyakarta. Ikuti keseruan mereka!!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kebudayaan Yogyakarta.png', 'https://youtu.be/a4apwpGsFDw', 'https://www.canva.com/design/DAFHr7jiwKw/z3UY82hmp8kSFaCjLfHUtA/view?utm_content=DAFHr7jiwKw&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/Kebudayaan Yogyakarta.png', 626, 4, 3, '2022-07-30 01:43:00', '2022-07-30 01:43:00'),
(427, 'Jariyah', '{\"blocks\":[{\"key\":\"arvuo\",\"text\":\"Aplikasi Jariyah merupakan aplikasi manajemen keuangan yang dibuat untuk para pengurus masjid yang memiliki tanggung jawab untuk mengurus keuangan masjid. Dengan menggunakan aplikasi jariyah, admin masjid bisa mencatat pemasukan dan pengeluaran masjid dengan mudah dan efektif. Sebab, proses penginputan data bisa dilakukan dengan cepat dan mudah. Apabila admin masjid melakukan kesalahan input data, admin masjid bisa mengubah/menghapus data tersebut dengan cepat dan mudah. Semua komponen yang menggunakan data yang telah diubah tersebut akan ikut berubah juga. Selain itu, aplikasi Jariyah dilengkapi dengan fitur pencarian data dimana admin masjid bisa mencari data pemasukan dan pengeluaran dengan memasukkan keyword yang berkaitan dengan ID, berita transaksi, nominal transaksi, dan jenis transaksi. Selanjutnya, aplikasi Jariyah juga dilengkapi dengan fitur keamanan berupa verifikasi saat login dan membuat akun baru. Admin masjid hanya bisa login apabila sudah terdaftar di aplikasi Jariyah dan memasukkan username dan password dengan benar. Lalu, admin baru hanya bisa login apabila permintaan pendaftarannya diterima oleh admin utama/yang sudah ada.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1161,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":1161,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":1161,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4a1946462e_757545JARIYAHKU.png', 'https://youtu.be/8YfSJRd-AcQ', 'https://github.com/nabiilNajm26/AplikasiJariyahFinal', 'https://api.informatics-expo.id/62e4a1946462e_757545JARIYAHKU.png', 557, 9, 3, '2022-07-30 03:12:20', '2022-07-30 03:12:20'),
(428, 'Suasana Jogja', '{\"blocks\":[{\"key\":\"50dlf\",\"text\":\"Sebuah Vlog pendek yang berisi tentang asal usul tugu jogja dan suasana angkringan di jogja\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Suasana Jogja.jpeg', 'https://youtu.be/wF_DRJQrG9Q', '', 'https://api.informatics-expo.id/Suasana Jogja.jpeg', 671, 4, 3, '2022-07-30 03:20:19', '2022-07-30 03:20:19'),
(429, 'Pergi ke Festival Seni', '{\"blocks\":[{\"key\":\"buupo\",\"text\":\"Sebuah film animasi pendek tentang pengalaman ke festival seni\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pergi ke Festival Seni.jpeg', 'https://youtu.be/fH_cbLJOA3E', '', 'https://api.informatics-expo.id/Pergi ke Festival Seni.jpeg', 672, 4, 3, '2022-07-30 03:23:55', '2022-07-30 03:23:55'),
(430, 'Nasi Padang', '{\"blocks\":[{\"key\":\"97kkt\",\"text\":\"Sebuah animasi yang membahas budaya kuliner yakni Nasi Padang \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":61,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":61,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":61,\"style\":\"fontsize-medium\"},{\"offset\":0,\"length\":61,\"style\":\"fontfamily-ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, \\\"Segoe UI\\\", Roboto, \\\"Helvetica Neue\\\", Arial, \\\"Noto Sans\\\", sans-serif, \\\"Apple Color Emoji\\\", \\\"Segoe UI Emoji\\\", \\\"Segoe UI Symbol\\\", \\\"Noto Color Emoji\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nasi Padang.png', 'https://youtu.be/gHjDt-Hy5F8', '', 'https://api.informatics-expo.id/Nasi Padang.png', 673, 4, 3, '2022-07-30 03:47:03', '2022-07-30 03:48:03'),
(431, 'Si Rambut Gimbal', '{\"blocks\":[{\"key\":\"2kndl\",\"text\":\"Kebudayaan unik cukuran anak gimbal merupakan tradisi turun temurun yang dilakukan\\noleh masyarakat dataran tinggi Dieng. Anak-anak tersebut dianggap istimewa di mata penduduk\\nsetempat. Konon anak gimbal dianggap sebagai titisan Kyai Kolo Dete dan Nini Roro Ronce.\\nPasangan asal mataram kuno tersebut ditugaskan memperluas wilayah kekuasaan kerajaan\\nmataram. Karena pada saat ini Kyai Kolo Dete adalah seseorang yang sakti dan pembela rakyat\\nkecil. Selain memperluas wilayah. pasangan ini juga mendapat wahyu dari Nyi Roro Kidul untuk\\nmenjaga kesejahteraan masyarakat dieng. Wangsit tersebut ditandai dengan munculnya anak gimbal\\ndi daerah dieng.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Si Rambut Gimbal.jpeg', 'https://youtu.be/6T9cm7wC-9U', '', 'https://api.informatics-expo.id/Si Rambut Gimbal.jpeg', 676, 4, 3, '2022-07-30 04:01:43', '2022-07-30 04:38:37'),
(432, 'SocialMusic', '{\"blocks\":[{\"key\":\"9ddf5\",\"text\":\"SocialMusic adalah aplikasi sosial media di bidang hobi musik yang bertujuan sebagai wadah untuk mengembangkan minat dalam bermusik bagi para musisi atau komunitas musik seperti band dan tempat untuk mencari teman yang memiliki minat yang sama yaitu bermusik dengan berkomunikasi atau bahkan membentuk band melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9s9ah\",\"text\":\"SocialMusic dibuat karena sulitnya para musisi tunggal untuk membentuk band karena kebanyakan masih sekedar dari kenalan,baik itu teman komunitas atau teman ekstrakulikuler.Maka dari itu,SocialMusic memberikan kemudahan dan kebebasan para musisi untuk dapat menunjukkan bakat musiknya sehingga jika ada teman atau musisi lain yang tertarik terhadap kemampuan musisi tersebut,mereka bisa berkomunikasi dengan aplikasi SocialMusic ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SocialMusic.jpeg', 'https://youtu.be/vfcZnFTJTco', '', 'https://api.informatics-expo.id/SocialMusic.jpeg', 548, 11, 3, '2022-07-30 04:22:10', '2022-07-30 07:55:37'),
(433, 'Wayang Kulit', '{\"blocks\":[{\"key\":\"52qmt\",\"text\":\"Animasi yang mengangkat tema tentang Ragam Budaya Indonesia yang dikemas dengan pertunjukan wayang kulit  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":104,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":104,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":104,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":104,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4b311819d6_1472288png_20220730_110117_0000.png', 'https://youtu.be/XtqfDbXiLA8', '', 'https://api.informatics-expo.id/62e4b311819d6_1472288png_20220730_110117_0000.png', 668, 4, 3, '2022-07-30 04:26:57', '2022-07-30 04:26:57'),
(434, 'Museum Senjata', '{\"blocks\":[{\"key\":\"br28\",\"text\":\"Animasi yang membahas tentang senjata senjata tradisional Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Museum Senjata.jpeg', 'https://www.youtube.com/watch?v=yWw41cHp_9E', '', 'https://api.informatics-expo.id/Museum Senjata.jpeg', 681, 4, 3, '2022-07-30 04:37:31', '2022-07-30 04:41:07'),
(435, 'JOBPEDIA', '{\"blocks\":[{\"key\":\"6k3lb\",\"text\":\"JOBPEDIA adalah sebuah aplikasi pencari lowongan pekerjaan bagi yang membutuhkan pekerjaan, khususnya di kalangan mahasiswa, loker ini mempunyai beberapa fitur yang sangat berguna bagi para user yang ingin mencari pekerjaan, di antaranya fitur pekerjaan berdasarkan tempat, gaji, waktu, pekerjaan apa yang dilakukan, umur dan masih banyak lagi. loker juga mempunyai fitur testimoni yang dibuat oleh user untuk user, testimoni bertujuan untuk menampilkan bagaimana user lain menggunakan aplikasi loker\\ntersebut.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"fontfamily-Times New Roman\\\", \\\"serif\"},{\"offset\":9,\"length\":501,\"style\":\"fontfamily-Times New Roman\\\", \\\"serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JOBPEDIA.png', 'https://youtu.be/lOEPJNV9MQ4', '', 'https://api.informatics-expo.id/JOBPEDIA.png', 679, 8, 3, '2022-07-30 04:41:38', '2022-07-30 04:41:38'),
(436, 'Sangkuriang', '{\"blocks\":[{\"key\":\"4mht8\",\"text\":\"legenda cerita lokal masyarakat sunda tentang Sangkuriang dan Nyi Dayang Sumbi di wilayah Lembang Jawa Barat. Cerita legenda ini terkenal dari jaman ke jaman mengenai asal usul adanya gunung tangkuban perahu .\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":207,\"style\":\"color-rgb(51,51,51)\"},{\"offset\":0,\"length\":207,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":207,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":207,\"style\":\"fontfamily-Helvetica Neue\\\", Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sangkuriang.png', 'https://youtu.be/wK2pczZPwMY', '', 'https://api.informatics-expo.id/Sangkuriang.png', 683, 4, 3, '2022-07-30 05:33:37', '2022-07-31 17:04:09'),
(437, 'Cerita Pendek Malin Kundang - Processing', '{\"blocks\":[{\"key\":\"5umtd\",\"text\":\"Animasi Kartun: Malin Kundang dari Tanah Minang, Pulau Sumatera.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":16,\"length\":47,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"15nv9\",\"text\":\"Malin Kundang menolak untuk mengakui ibunya yang miskin dan tua setelah ia menjadi saudagar kaya. Ibunya merasa sangat sedih dan berdoa kepada Tuhan untuk menghukum putranya yang tidak berbakti.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d6sfb\",\"text\":\"Akankah doanya dikabulkan?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8qgfs\",\"text\":\"Sebuah cerita pendek  yang penuh dengan pelajaran moral, untuk segala usia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cerita Pendek Malin Kundang - Processing.png', 'https://youtu.be/XlG_OdsWijE', '', 'https://api.informatics-expo.id/Cerita Pendek Malin Kundang - Processing.png', 687, 4, 3, '2022-07-30 05:40:28', '2022-07-30 05:40:28'),
(438, 'LEB(Layanan Edukasi Bertani)', '{\"blocks\":[{\"key\":\"a5dbp\",\"text\":\"LEB adalah aplikasi yang menyediakan layanan edukasi mengenai pertanian untuk orang awam yang ingin belajar tentang pertanian namun masih terkendala sulitnya mengakses informasi tersebut.pada aplikasi ini terdapat berbagai informasi yang disusun dalam bentuk materi ataupun berupa video penjelasn yang di gunakan untuk mempermudah penggguna memahami informasi tersebut.Dengan adanya aplikasi ini di harapkan pengguna mampu memecahkan masalah yang di hadapi seputar pertanian \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":474,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":474,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":474,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":474,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":474,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'LEB(Layanan Edukasi Bertani).jpeg', 'https://youtu.be/tEqJyI-bn9M', 'https://www.figma.com/proto/tclEFiI1Ggc8MiW3KBBgfF/LEB---MSI?node-id=1%3A8&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A8', 'https://api.informatics-expo.id/LEB(Layanan Edukasi Bertani).jpeg', 685, 4, 3, '2022-07-30 05:45:59', '2022-07-30 05:45:59'),
(439, 'BANTAL', '{\"blocks\":[{\"key\":\"149g0\",\"text\":\"BANTAL adalah sebuah aplikasi Bantuan Kesehatan Mental  yang membantu pengguna kesehatan mental agar bisa  memdapatkan konseling  secara online dan praktis  , serta  memudahkan pengguna untuk menjadwalkan konsultasi dengan tenaga ahli professional, Selain itu pengguna juga dapat melacak perkembangan mood, gejala kesehatan mental Dan faktor lain yang memengaruhi kesehatan mental seperti durasi tidur.Aplikasi ini juga memiliki beberapa fitur tambahan seperti dapat mengetahui layanan tenaga ahli terdekat serta dapat berbagi pendapat dengan pengguna lain.\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":61,\"length\":105,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":61,\"length\":105,\"style\":\"fontsize-16\"},{\"offset\":61,\"length\":105,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}}],\"entityMap\":{}}', 'BANTAL.jpeg', 'https://www.youtube.com/watch?v=1H33QjdYAdg', 'https://www.figma.com/proto/jl7XQusPhKMVRWxhdEuMeD/BANTAL?node-id=13%3A50&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=13%3A50', 'https://api.informatics-expo.id/BANTAL.jpeg', 678, 3, 3, '2022-07-30 05:50:16', '2022-07-30 05:50:16'),
(440, 'Siklus', '{\"blocks\":[{\"key\":\"6kies\",\"text\":\"Siklus: Plastik Dibalik Pangan Kita\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c26tu\",\"text\":\"Menggambarkan siklus yang terlahir akibat budaya konsumtif manusia akan plastik dan penyebabnya terhadap pangan kita (microplastic).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Siklus.jpeg', 'https://youtu.be/dmVqogTqGcs', '', 'https://api.informatics-expo.id/Siklus.jpeg', 586, 11, 3, '2022-07-30 05:50:48', '2022-07-31 06:09:15'),
(444, 'ALUR (Aplikasi Administrasi Kelurahan)', '{\"blocks\":[{\"key\":\"fj3gb\",\"text\":\"ALUR (Aplikasi Administrasi Kelurahan) merupakan sebuah aplikasi yang berkaitan dengan pelayanan administrasi kependudukan. Aplikasi ini bertujuan untuk mempermudah masyarakat dalam memproses pembuatan surat-surat penting serta dapat mempermudah penyusunan data administrasi bagi pihak Kelurahan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":296,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":296,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":296,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":296,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":296,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":38,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"mtfb\",\"text\":\"Jenis surat yang dapat diajukan adalah:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"av154\",\"text\":\"Surat Keterangan Kematian\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":25,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":25,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":25,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":25,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":25,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"1sb7i\",\"text\":\"Surat Keterangan Tidak Mampu\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"8bbf3\",\"text\":\"Surat Keterangan Penghasilan \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}}],\"entityMap\":{}}', 'ALUR (Aplikasi Administrasi Kelurahan).jpeg', 'https://youtu.be/0PCDibDNbFY', 'https://www.canva.com/design/DAFHxrFEbVQ/h0gIX64X9hWFoh6b62vyuQ/view?utm_content=DAFHxrFEbVQ&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/ALUR (Aplikasi Administrasi Kelurahan).jpeg', 613, 9, 3, '2022-07-30 06:36:43', '2022-07-30 12:20:42'),
(446, 'Quondam', '{\"blocks\":[{\"key\":\"5qp5f\",\"text\":\"Quondam merupakan suatu aplikasi Ecommerce yang membantu masyarakat  dalam jual beli secara online dan bisa juga bertemu secara langsung antara penjual dan pembeli dan Quondam menjual barang bekas dan barang baru. Quondam memiliki tujuan yaitu memudahkan masyarakat dalam melakukan kegiatan jula beli produk baru ataupun bekas. Dengan tampilan sederhana yang mudah diakses oleh semua kalangan. Dengan penggunaan yang mudah dalam menggunakan aplikasi ini akan dapat meringankan para penggunanya baik bagi para penjual untuk memasang iklan dan sekaligus bagi pembeli untuk mencari beragam produk barang bekas dan barang baru untuk kebutuhan sehari-hari.     \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1,\"style\":\"fontsize-24\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fnrq3\",\"text\":\"- Jual  Beli \",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d4kne\",\"text\":\"Jual beli barang baru maupun barang bekas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5kaem\",\"text\":\"- Jangkauan  Luas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"eku6m\",\"text\":\"Terjangkau dan mudah  di cari karna tersebar luas ke seluruh indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Quondam.png', 'https://youtu.be/cdDW_g5JUVk', 'https://www.figma.com/proto/mlBlkyZAkjP9ULEMaRuqbu/Quondam?node-id=8%3A7&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=8%3A7', 'https://api.informatics-expo.id/Quondam.png', 670, 8, 3, '2022-07-30 07:17:17', '2022-07-30 07:41:10'),
(447, 'iNFOSHOP', '{\"blocks\":[{\"key\":\"cnnvb\",\"text\":\"iNFOSHOP is an application for buying and selling goods that is easy and simple to apply, you can manage, change, clean, delete the sales items you want, with INFOSHOP you will easily sell the products you need, we provide space for sellers to sell items here , with the system we provide, you will be able to easily sell your products. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"12nj8\",\"text\":\"INFOSHOP, your business marketing information.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'iNFOSHOP.png', 'https://youtu.be/TnrKLqHsXbU', 'https://www.figma.com/proto/uy1c8foPTQx4ko2UN6IFPp/iNFOSHOP?page-id=0%3A1&node-id=5%3A48&viewport=356%2C311%2C0.06&scaling=min-zoom&starting-point-node-id=5%3A48&show-proto-sidebar=1', 'https://api.informatics-expo.id/iNFOSHOP.png', 691, 9, 3, '2022-07-30 07:32:17', '2022-07-30 10:43:18'),
(448, 'Wisata Budaya', '{\"blocks\":[{\"key\":\"7t9br\",\"text\":\"Wisata budaya sendiri adalah perjalanan seorang wisatawan yang didampingi oleh tour guide untuk mempelajari budaya-budaya yang terdapat di Indonesia .\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4dee3df6f9_84723POSTER WISATA BUDAYA.jpeg', 'https://youtu.be/NZDXg1XJJIk', '', 'https://api.informatics-expo.id/62e4dee3df6f9_84723POSTER WISATA BUDAYA.jpeg', 656, 4, 3, '2022-07-30 07:33:56', '2022-07-30 07:53:32'),
(450, 'EATS.', '{\"blocks\":[{\"key\":\"5njnp\",\"text\":\"EATS. is a restaurant data management application. EATS helps manage your restaurant data flexibility and efficiently.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'EATS..jpeg', 'https://youtu.be/R6VdeJEPaQw', 'https://www.figma.com/file/OHEElqX9vWWfQlcksY3Kt4/NMS?node-id=0%3A1', 'https://api.informatics-expo.id/EATS..jpeg', 669, 9, 3, '2022-07-30 08:36:05', '2022-07-30 08:36:05'),
(451, 'Permainan Sepak Bola Kampung', '{\"blocks\":[{\"key\":\"8tn6u\",\"text\":\"Hasil animasi dari kelompok TDR-3000 yaitu permainan bola kampung sederhana yang mengimplementasikan permainan tradisional anak-anak pada pedesaan. Mekanisme game kami yaitu, akan keluar dari running processing apabila mengenai pemain, out, dan mencetak gol.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Permainan Sepak Bola Kampung.jpeg', 'https://www.youtube.com/watch?v=Gh1_7BUe1D8', '', 'https://api.informatics-expo.id/Permainan Sepak Bola Kampung.jpeg', 702, 11, 3, '2022-07-30 08:52:56', '2022-07-30 08:54:37'),
(452, 'SosTance', '{\"blocks\":[{\"key\":\"s9jg\",\"text\":\"SosTance adalah aplikasi yang memiliki tujuan utama yaitu menyalurkan bantuan sosial dari pemerintah kepada masyarakat yang kurang mampu. Di dalam aplikasi ini pengguna dapat melihat ketersediaan stok bahan pokok dan pengguna dapat langsung menambahkan barang yang diinginkan di kolom tambah list kebutuhan. Di samping itu SosTance juga dapat menyediakan bantuan berupa modal tempat usaha yang dapat digunakan oleh masyarakat untuk memulai usaha nya. Pengguna cukup memasukkan provinsi, kota, dan alamat lengkap pada fitur penyediaan modal tempat usaha.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SosTance.jpeg', 'https://youtu.be/6ReA0X-b2DY', 'https://www.figma.com/file/mkt5nLz2Ic6DlBb8L75qJD/Untitled', 'https://api.informatics-expo.id/SosTance.jpeg', 682, 3, 3, '2022-07-30 08:56:35', '2022-07-30 09:26:25'),
(453, 'The Return Of Purbasari', '{\"blocks\":[{\"key\":\"5o56j\",\"text\":\"Animasi yang menceritakan tentang turunnya tahta suatu kerajaan. Kisah ini bermula di tanah Pasundan, dimana putri sulung yang cemburu dengan putri bungsu sehingga menimbulkan konflik. Konflik tersebut berakhir dengan makna didalamnya. Penasaran dengan cerita The return of Purbasari? ayoo di tontooonnn!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'The Return Of Purbasari.png', 'https://youtu.be/IajL2waup0A', '', 'https://api.informatics-expo.id/The Return Of Purbasari.png', 705, 4, 3, '2022-07-30 09:12:05', '2022-07-30 09:15:19'),
(454, 'CukurMas', '{\"blocks\":[{\"key\":\"bebe2\",\"text\":\"CukurMas merupakan Sistem Informasi berbasis web yang diperuntukkan bagi UKM dan UMKM jasa cukur atau yang lebih dikenal luas dengan istilah barbershop. Harapan atas dibuat dan dikembangkan CukurMas ini dapat membantu dan berpengaruh terhadap pelaku usaha barbershop juga customer yang mencari jasa cukur sehingga digitalisasi proses bisnis dan tujuan dari pelayanan barbershop dapat tercapai sebaik mungkin. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CukurMas.png', 'https://www.youtube.com/watch?v=Chenf6UOw5g', 'https://docs.google.com/presentation/d/1GADX4pJJtTQmHR3n5ivoHTc6W-bnjvUGs8UgLATJva4/edit#slide=id.p', 'https://api.informatics-expo.id/CukurMas.png', 507, 3, 3, '2022-07-30 09:16:27', '2022-07-30 09:16:27'),
(455, 'MERIAM KARBIT', '{\"blocks\":[{\"key\":\"27t7f\",\"text\":\"MERIAM KARBIT \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":13,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b0qab\",\"text\":\"Tradisi Meriam Karbit memiliki sejarah yang menarik. Konon, dahulu Kesultanan Kadriah di Pontianak yang berdiri pada tahun 1771  1808 membunyikan meriam untuk mengusir hantu, khususnya kuntilanak yang ada di Kota Pontianak. Karena pada waktu itu, Raja pertama Pontianak yang bernama Syarif Abdurrahman Alkadrie ketika membuka lahan untuk bertempat tinggal di Pontianak sempat diganggu oleh hantu-hantu. Lalu Sultan memerintahkan pasukannya untuk mengusir hantu itu dengan meriam . Pontianak menurut cerita adalah sebuah kota yang memiliki hantu kuntilanak. Karena pada dasarnya Pontianak berasal dari kata bunting dan anak. Selain itu bunyi yang keras dari meriam karbit menandakan waktu azan magrib.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":701,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":701,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":701,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":701,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'MERIAM KARBIT.jpeg', 'https://youtu.be/zhfcS90JzAE', '', 'https://api.informatics-expo.id/MERIAM KARBIT.jpeg', 704, 4, 3, '2022-07-30 09:24:59', '2022-07-30 09:29:36'),
(456, 'Diversity', '{\"blocks\":[{\"key\":\"958up\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Diversity.jpeg', 'https://youtu.be/q8MO56fQqmg', '', 'https://api.informatics-expo.id/Diversity.jpeg', 699, 16, 3, '2022-07-30 09:29:10', '2022-07-30 09:29:10'),
(457, 'CharitAble', '{\"blocks\":[{\"key\":\"5f59o\",\"text\":\"CharitAble is an app designed as a solution for acquiring transparency in the transaction  of the donation,  reduce the amount of physical donation box or giving money to beggars as  it is prohibited by the law of the nation.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6ts99\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96ser\",\"text\":\"- CharitAbles Creators (2022)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CharitAble.png', 'https://youtu.be/SpgIj92mhbI', 'https://www.figma.com/proto/IG8KuGz8DGITjbaOWFuRGq/CharitAble-Rev?page-id=0%3A1&node-id=6%3A22&viewport=-517%2C480%2C0.59&scaling=contain&starting-point-node-id=2%3A2', 'https://api.informatics-expo.id/CharitAble.png', 716, 11, 3, '2022-07-30 10:16:58', '2022-07-30 10:20:12'),
(458, 'C\'mon Go Shopping', '{\"blocks\":[{\"key\":\"2tho3\",\"text\":\"C\'mon Go Shopping berupa aplikasi sistem informasi jual beli produk UMKM berbasis web merupakan aplikasi yang memiliki tujuan untuk menciptakan media yang dapat memperkenalkan produk-produk UKM dan memberikan layanan informasi bagi admin dan pembeli mengenai produk UMKM dan jumlah produk terjual dari transaksi tersebut. Sistem informasi manajemen ini dibentuk untuk memenuhi tugas akhir dari matakuliah Sistem Informasi Jurusan Informatika, Fakultas Teknologi Industri, Universitas Islam Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'C\'mon Go Shopping.png', 'https://www.youtube.com/watch?v=1CYtvFsz2jg', 'https://github.com/mylnisonya/PSI-CGS', 'https://api.informatics-expo.id/C\'mon Go Shopping.png', 712, 8, 3, '2022-07-30 10:19:20', '2022-07-30 10:20:17'),
(459, 'Tweelogy', '{\"blocks\":[{\"key\":\"9tqm6\",\"text\":\"Sebuah aplikasi berbasis web yang memiliki hubungan timbal balik antara penjual, supplier dan pembeli. Tweelogy memungkinkan penjual (admin) dapat memasarkan barang jualan yang diperoleh dari supplier, sedangkan pembeli dapat memilih dan membeli barang jualan tersebut. Di dalamnya juga terdapat 2 fitur SIM yang dapat membantu admin dalam mengetahui perkembangan, membuat laporan, dan mengambil keputusan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tweelogy.png', 'https://youtu.be/N1RWo_NHOgk', 'https://github.com/Hestri074/Tweelogy', 'https://api.informatics-expo.id/Tweelogy.png', 717, 8, 3, '2022-07-30 10:26:32', '2022-07-30 10:55:51'),
(460, 'Budaya Korupsi', '{\"blocks\":[{\"key\":\"a8oi3\",\"text\":\"Budaya sangatlah beragam, budaya juga mencerminkan bagaimana keunikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7p4ir\",\"text\":\"suatu daerah atau tempat yang bisa kita lihat, tetapi ada juga budaya yang bisa\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"57adg\",\"text\":\"membuat dampak yang buruk, apalagi kalau bukan budaya korupsi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Budaya Korupsi.png', 'https://youtu.be/mloEeFVWjMk', '', 'https://api.informatics-expo.id/Budaya Korupsi.png', 719, 16, 3, '2022-07-30 10:28:20', '2022-07-30 14:54:44'),
(461, 'Lomba 17 Agustus', '{\"blocks\":[{\"key\":\"9ped7\",\"text\":\"Animasi dengan cerita memperkenalkan perlombaan 17 Agustus kepada turis\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lomba 17 Agustus.png', 'https://www.youtube.com/watch?v=Nz3svXcSklg', '', 'https://api.informatics-expo.id/Lomba 17 Agustus.png', 625, 4, 3, '2022-07-30 10:42:12', '2022-07-30 10:42:12'),
(462, 'LocalPride', '{\"blocks\":[{\"key\":\"1o3je\",\"text\":\"LocalPride merupakan penyedia lapak online yang akan memberikan tempat untuk brand local yang bergerak di bidang fashion dan memiliki fitur Manajemen Information System. Dalam Manajemen Information System itu sendiri Penjual bisa membaca data yang bisa untuk membantu proses bisnis kedepannya, Seperti data produk terlaris, jumlah pendapatan perbulan, dan promosi penjualan. Tujuan MIS ini untuk memudahkan penjual membuat perencanaan pengendalian proses bisnisnya. Di tampilkan dalam bentuk diagram yang memudahkan penjual untuk membaca data tersebut.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2uf79\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"471jh\",\"text\":\"LocalPride ingin memajukan industri fashion di Indonesia maka dari itu kami memberikan lapak untuk brand local tersebut untuk mempromosikan produk mereka di LocalPride. Karena untuk Platform belanja online sekarang sangat brand local kecil belum bisa mendapatkan panggungnya untuk itu LocalPride menyediakan tempat untuk local brand.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LocalPride.png', '', 'https://drive.google.com/file/d/1qpL9uSBy7sjyVjQoaupe-nTP_lueELGn/view?usp=sharing', 'https://api.informatics-expo.id/LocalPride.png', 610, 8, 3, '2022-07-30 10:43:22', '2022-07-30 10:43:22'),
(463, 'DONASIA', '{\"blocks\":[{\"key\":\"bkpef\",\"text\":\"Donasia adalah solusi sistem pendonasian dengan targaet medis, bencana alam, dan zakat yang ada di indonesia. Donasia hanya menerima media uang dengan memakai dompet digital agar minim potongan. Uang yang didonasikan oleh donatur akan disampaikan ke penerima tanpa adanya potongan sedikitpun dan biaya tambahan seperti pajak dan laib-lain akan ditanggung oleh kami dengan iklan yang akan pengguna liat di halamna home.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e511fd92626_942272Poster DONASIA.png', 'https://youtu.be/_eAlOdWchtk', 'https://drive.google.com/file/d/1-SYgs23wJh-6uqyn9ShjA50v9TqkOHHY/view?usp=sharing', 'https://api.informatics-expo.id/62e511fd92626_942272Poster DONASIA.png', 720, 11, 3, '2022-07-30 11:11:57', '2022-07-30 11:11:57'),
(468, 'Layanan Kelurahan', '{\"blocks\":[{\"key\":\"668as\",\"text\":\"Layanan Kelurahan adalah aplikasi layanan masyarakat, guna membantu mempermudah pendataan pengurusan dokumen dan dapat lebih efisien. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Layanan Kelurahan.png', 'https://youtu.be/E2tQqR2_7F4', '', 'https://api.informatics-expo.id/Layanan Kelurahan.png', 727, 11, 3, '2022-07-30 11:37:55', '2022-07-30 11:37:55'),
(465, 'Malin Kundang', '{\"blocks\":[{\"key\":\"ci0b9\",\"text\":\"Malin kundang adalah cerita rakyat yang sangat terkenal di Indonesia dan sudah banyak diketahui oleh masyarakat, kami akan membuat cerita Malin kundang tersebut menjadi animasi 2D yang akan kami buat dengan Processing, selamat menonton\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang.png', 'https://youtu.be/B7NvNQC3onU', '', 'https://api.informatics-expo.id/Malin Kundang.png', 722, 19, 3, '2022-07-30 11:20:33', '2022-07-30 11:20:33'),
(466, 'GoCHAR', '{\"blocks\":[{\"key\":\"c12cv\",\"text\":\"GoCHAR adalah aplikasi donasi dengan sistem gamifikasi, dengan aplikasi ini berdonasi kini lebih fleksibel. Aplikasi ini dilengkapi dengan beberapa fitur yaitu, Donasi yang dapat membantu sesama, Galang Donasi yang dapat terjangkau ke seluruh pengguna, Misi yang dapat dikonversi menjadi poin, dan Peringkat yang didapat dari poin yang telah dikonversi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":161,\"length\":6,\"style\":\"BOLD\"},{\"offset\":196,\"length\":13,\"style\":\"BOLD\"},{\"offset\":253,\"length\":5,\"style\":\"BOLD\"},{\"offset\":298,\"length\":9,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GoCHAR.jpeg', 'https://youtu.be/ERH0eTeKOjk', 'https://www.figma.com/proto/9y3N2pTJ9FYWtMGbLUV43k/Untitled?node-id=13%3A726&scaling=scale-down&page-id=0%3A1&starting-point-node-id=13%3A726', 'https://api.informatics-expo.id/GoCHAR.jpeg', 684, 3, 3, '2022-07-30 11:28:40', '2022-07-30 17:03:14');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(467, 'REZERVA', '{\"blocks\":[{\"key\":\"3qnmo\",\"text\":\"Banyaknya restoran di Indonesia yang kewalahan dalam mengelola proses pemesanan, pembayaran, hingga pengelolaan restoran itu sendiri. Seperti halnya, pengelolaan keuangan, pendapatan, makanan, dan sejenisnya. Oleh karena itu Rezerva hadir untuk memudahkan restoran dalam pengelolaan hal yang telah disebutkan tadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8udug\",\"text\":\"Rezerva merupakan sebuah sistem informasi berbasis web untuk reservasi restoran. Dengan cara customer melalukan scanning barcode yang ada di meja restoran lalu akan diarahkan ke halaman rezerva untuk memesan makanan. Tidak hanya itu, customer bisa melakukan pembayaran secara cashless aplikasi ini juga memiliki dua subsistem, yaitu untuk customer dan managerial.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2o135\",\"text\":\"Target audiens yang kita incar, yaitu pemilik restoran yang kesulitan dalam pengelolaan restorannya dan menginginkan sebuah sistem pemesanan secara online dan pemantauan usaha secara berkala. Juga, customer yang tidak ingin repot mengantri di kasir sehingga mereka memesan melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"36tae\",\"text\":\"Rezerva memiliki beberapa fitur, di antaranya adalah pemesanan dan pembayaran makanan online, sistem keranjang, pengelolaan pesanan, laporan pendapatan, mengelola menu, laporan menu, trend analisis, dan masih banyak lagi.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'REZERVA.png', 'https://www.youtube.com/watch?v=al2Rr170rT4', 'https://github.com/AufaAsmawy19551/psi-rezerva', 'https://api.informatics-expo.id/REZERVA.png', 575, 9, 3, '2022-07-30 11:33:16', '2022-07-30 11:33:16'),
(469, 'SCULTOURING', '{\"blocks\":[{\"key\":\"el9q8\",\"text\":\"Kalian tahu Taman Mini Indonesia Indah?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"59emi\",\"text\":\"Walau tidakpernah kesana, setidaknya sebagian besar kita pasti tahu apa itu Taman Mini Indonesia Indah atau TMII.TMII merupakan suatu kawasan taman wisata bertema budaya Indonesia yang berada di Jakarta Timur.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":211,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":211,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":211,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":211,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":211,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"5ddp6\",\"text\":\"Eits, tapi bukan tentang TMII yang akan kita bahas di sini. Melainkan keberagaman budaya Indonesia yang bisa dilihat serta dipelajari disana.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":141,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":141,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":141,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":141,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":141,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"4g51n\",\"text\":\"Scultouring berkisah tentang dua anak SD yang mengunjungi TMII bersama gurunya. Lebih tepatnya, mereka mengunjungi salah satu kawasan di sana yang bernama Anjungan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":165,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":165,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":165,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":165,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":165,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"breqp\",\"text\":\"Apa saja yang mereka lihat di sana? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":36,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":36,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":36,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":36,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":36,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"emipa\",\"text\":\"Yuk, intip keseruan dan kelucuan mereka menjelajahi rekam budaya Indonesia di TMII  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":84,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'SCULTOURING.png', 'https://www.youtube.com/watch?v=IaggB96rcKc', 'https://github.com/AufaAsmawy19551/grafmul-budaya-nusantara', 'https://api.informatics-expo.id/SCULTOURING.png', 583, 4, 3, '2022-07-30 12:52:22', '2022-07-30 12:52:22'),
(470, 'Lompat Batu Nias', '{\"blocks\":[{\"key\":\"firfg\",\"text\":\"Tradisi lompat batu bisa ditemukan di Desa Bawomataluo Kabupaten Nias Selatan. Tradisi lompat batu ini disebut Fahombo, yang biasanya dilakukan para pemuda dengan cara melompati tumpukan batu yang mencapai setinggi 2 meter dan setebal 40 cm untuk menunjukkan bahwa mereka sudah pantas untuk dianggap secara fisik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":313,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":313,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":313,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":19,\"style\":\"BOLD\"},{\"offset\":0,\"length\":313,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":313,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Lompat Batu Nias.jpeg', 'https://youtu.be/oj8CvdKANbk', '', 'https://api.informatics-expo.id/Lompat Batu Nias.jpeg', 734, 4, 3, '2022-07-30 13:12:22', '2022-07-30 13:16:01'),
(471, 'Wisata Budaya', '{\"blocks\":[{\"key\":\"4rppm\",\"text\":\"Bhineka Tunggal Ika. Berbeda-beda, tetapi tetap satu jua. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"sc38\",\"text\":\"Itulah semboyan yang dipegang kuat oleh bangsa Indonesia. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1otqm\",\"text\":\"Semboyan itu menggambarkan bahwa meskipun bangsa Indonesia memiliki beragam budaya, suku bangsa, ras, bahasa, dan agama, \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5gc4q\",\"text\":\"tetapi bangsa ini tetap memegang erat prinsip persatuan dan kesatuan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4nr0o\",\"text\":\"sudahkah kamu mengenal seluruh kekayaan budaya di indonesia? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3poe\",\"text\":\"Yuk, jalan-jalan bareng Yanto dan Joko agar wawasan budaya kamu bisa bertambah ;)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e52f8d371da_276310posterfix.jpg', 'https://youtu.be/sotsuMVwu1E', '', 'https://api.informatics-expo.id/62e52f8d371da_276310posterfix.jpg', 591, 15, 3, '2022-07-30 13:18:05', '2022-07-30 13:18:05'),
(472, 'Tubes Dadakan, Bingung sampe Taman Mini (Mini Series)', '{\"blocks\":[{\"key\":\"7hn42\",\"text\":\"sebuah cerita mengenai seorang Mahasiswa yang tiba-tiba mendapatkan tugas dadakan dan kebingungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tubes Dadakan, Bingung sampe Taman Mini (Mini Series).png', 'https://youtu.be/g7NeuBgEGuQ', '', 'https://api.informatics-expo.id/Tubes Dadakan, Bingung sampe Taman Mini (Mini Series).png', 615, 4, 3, '2022-07-30 13:18:59', '2022-07-30 13:18:59'),
(473, 'RUKUN', '{\"blocks\":[{\"key\":\"43rf2\",\"text\":\"Rukun merupakan suatu sistem perangkat lunak untuk pengelolaan komunitas masyarakat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6bvi1\",\"text\":\"Khususnya mencakup fungsi seperti pelaporan gangguan, transaksi pembayaran, mempromosikan UMKM dan banyak fungsi lainnya. Rukun juga dapat digunakan setiap anggota masyarakat hingga pengurus komunitas setempat, transparansi data keuangan, peminjaman inventaris dan pengajuan dokumen tertentu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6n40b\",\"text\":\"Kehadiran RUKUN diharapkan dapat meningkatkan efisiensi dalam bermasyarakat. Hal ini didukung dengan fitur-fitur yang hadir untuk memudahkan pengguna dalam bermasyarakat. Dalam setiap fungsinya RUKUN akan tersinkronisasi secara otomatis dengan aplikasi ketiga sebagai pendukung setiap fungsi yang ada.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e530f99f808_771157POSTER ANTARES (2).png', 'https://youtu.be/TNvMW2Ph3QI', 'https://github.com/luhihsan/Rukun-App/tree/master', 'https://api.informatics-expo.id/62e530f99f808_771157POSTER ANTARES (2).png', 706, 11, 3, '2022-07-30 13:24:09', '2022-07-30 13:57:26'),
(482, 'StomousQ', '{\"blocks\":[{\"key\":\"1tqv7\",\"text\":\"Aplikasi desktop yang bertujuan mempermudah masyarakat dalam memberikan sumbangan dan pendataan sumbangan yang diberikan ke masjid sekitar. Dengan adanya StomousQ pencatatan sumbangan menjadi lebih tertata dan tersimpan dengan baik tanpa harus mendata manual yang hanya menghasilkan limbah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'StomousQ.png', 'https://youtu.be/ujgiztToPCk', '', 'https://api.informatics-expo.id/StomousQ.png', 745, 11, 3, '2022-07-30 14:07:53', '2022-07-30 14:07:53'),
(483, 'Ondel-ondel', '{\"blocks\":[{\"key\":\"frc5h\",\"text\":\"Topik yang diambil dalam project ini adalah kebudayaan. Kebudayaan yang diangkat adalah\\nondel-ondel yang terdiri dari sejarah, filosofi dan keunikan. Karakter ondel-ondel diambil karena sudah\\nterkenal di indonesia bahkan mancanegara. Tetapi, rata-rata tidak dijelaskan mengenai latar belakang\\nondel-ondel \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Ondel-ondel.jpeg', 'https://youtu.be/AJ1Gm4UWYTE', '', 'https://api.informatics-expo.id/Ondel-ondel.jpeg', 751, 4, 3, '2022-07-30 14:12:45', '2022-07-30 17:54:59'),
(474, 'RUKUN', '{\"blocks\":[{\"key\":\"43rf2\",\"text\":\"Rukun merupakan suatu sistem perangkat lunak untuk pengelolaan komunitas masyarakat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6bvi1\",\"text\":\"Khususnya mencakup fungsi seperti pelaporan gangguan, transaksi pembayaran, mempromosikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cp3sm\",\"text\":\"UMKM dan banyak fungsi lainnya. Rukun juga dapat digunakan setiap anggota masyarakat hingga\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5iks1\",\"text\":\"pengurus komunitas setempat, hingga didalamnya terdapat fungsi untuk transparansi data keuangan,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bogog\",\"text\":\"peminjaman inventaris hingga dapat digunakan untuk pengajuan dokumen tertentu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"25rbk\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6n40b\",\"text\":\"Kehadiran RUKUN diharapkan dapat meningkatkan efisiensi dalam bermasyarakat. Hal ini didukung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"75j9r\",\"text\":\"dengan fitur-fitur yang hadir untuk memudahkan pengguna dalam bermasyarakat. Dalam setiap\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"84mq1\",\"text\":\"fungsinya RUKUN akan tersinkronisasi secara otomatis dengan aplikasi ketiga sebagai pendukung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"tsip\",\"text\":\"setiap fungsi yang ada.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e530fbe6860_771157POSTER ANTARES (2).png', 'https://youtu.be/TNvMW2Ph3QI', 'https://github.com/luhihsan/Rukun-App/tree/master', 'https://api.informatics-expo.id/62e530fbe6860_771157POSTER ANTARES (2).png', 706, 11, 3, '2022-07-30 13:24:12', '2022-07-30 13:24:12'),
(476, 'PODS - Podcast and Audiobook', '{\"blocks\":[{\"key\":\"dai0m\",\"text\":\"PODS is an audio streaming and media services provider that focuses on podcasts and audiobooks. It is one of the largest podcast streaming service providers that offer an interactive live streaming feature.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"chlrh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7jj6p\",\"text\":\"You can enjoy our high-quality content from verified creators without any distraction from ads.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PODS - Podcast and Audiobook.jpeg', 'https://youtu.be/BGIpqrh-zl0', 'https://www.figma.com/proto/XQaUerPLwVfUcYoutLJDr4/FAD-PODS?node-id=44%3A81&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=44%3A81', 'https://api.informatics-expo.id/PODS - Podcast and Audiobook.jpeg', 743, 9, 3, '2022-07-30 13:29:32', '2022-07-31 01:59:50'),
(477, 'Malin Kundang', '{\"blocks\":[{\"key\":\"7s1db\",\"text\":\"Kisah Malin Kundang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang.jpeg', 'https://youtu.be/au4yXwtFCMs', '', 'https://api.informatics-expo.id/Malin Kundang.jpeg', 744, 4, 3, '2022-07-30 13:37:49', '2022-07-30 15:28:15'),
(478, 'Animasi Legenda Candi Prambanan', '{\"blocks\":[{\"key\":\"druol\",\"text\":\"Ceri singkat legenda terbentuknya Candi Prambanan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Legenda Candi Prambanan.png', 'https://drive.google.com/file/d/1osNAEkujTbBtt_L_xmGbcMzc7rATKg-2/view?usp=sharing', '', 'https://api.informatics-expo.id/Animasi Legenda Candi Prambanan.png', 746, 4, 3, '2022-07-30 13:52:06', '2022-07-30 13:56:11'),
(479, 'Keliling Indonesia', '{\"blocks\":[{\"key\":\"66lhl\",\"text\":\"Keliling Indonesia bercerita tentang seorang pemuda yang berkunjung kerumah orang tua sambil berjalan-jalan di tempat tersebut menikmati suasana di kota tersebut. Scene di mulai dengan menaiki pesawat kemudian turun di sebuah bandara yang kemudian berkunjung kerumah orang tua. Setelah berkunjung kerumah orang tuanya, pemuda tersebut berjalan-jalan ke salah satu tempat iconic di tempat tersebut. Setelah berjalan-jalan di tempat iconic, pemuda tersebut singgah ke tempat ibadah sebelum menuju ke sebuah pantai untuk menikmati sunset di kota tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Keliling Indonesia.jpeg', 'https://youtu.be/3TsoJjc0kUg', '', 'https://api.informatics-expo.id/Keliling Indonesia.jpeg', 696, 4, 3, '2022-07-30 13:53:36', '2022-07-30 13:53:36'),
(480, 'DESTAL ', '{\"blocks\":[{\"key\":\"51no1\",\"text\":\"Destal (Desa Digital) merupakan layanan pengaduan masyarakat desa untuk memudahkan dalam melaporkan masalah yang terjadi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"am9r9\",\"text\":\"Destal memiliki fitur :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bq364\",\"text\":\"1. Melaporkan permasalahan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"14rju\",\"text\":\"2. Mengedit dan menghapus laporan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ao1qg\",\"text\":\"3. Melihat statistik dari laporan yang telah terkirim berdasarkan kategori\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c1ipq\",\"text\":\"4. Melihat informasi kontak dan lokasi desa yang menggunakan DESTAL\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7c8tm\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DESTAL (Layanan Pengaduan Masyarakat).png', 'https://youtu.be/Qkerb2mxu1k', 'https://www.figma.com/proto/ozsE5BcbBw42sUunHUAfEx/Destal-by-ZEUS?node-id=72%3A297&scaling=scale-down&page-id=0%3A1&starting-point-node-id=72%3A297&show-proto-sidebar=1', 'https://api.informatics-expo.id/DESTAL (Layanan Pengaduan Masyarakat).png', 732, 11, 3, '2022-07-30 13:55:22', '2022-07-30 14:04:04'),
(484, 'Berkunjung ke Museum Keraton', '{\"blocks\":[{\"key\":\"b8u5r\",\"text\":\"      Bercerita mengenai 2 orang anak yang masih bersekolah bersama mengunjungi sebuah museum untuk mengenal lebih dalam mengenai adat dan budaya Jawa. Bertujuan agar anak keturunan kita bisa mengenal budaya-budaya leluhur kita agar tidak punah dan dilestarikan dan menumbuhkan rasa bangga dan memiliki atas adat budaya tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Berkunjung ke Museum Keraton.jpeg', '', '', 'https://api.informatics-expo.id/Berkunjung ke Museum Keraton.jpeg', 730, 4, 3, '2022-07-30 14:15:43', '2022-07-30 14:17:27'),
(485, 'Joni dan Joni dengan Pintu Ajaib di Candi Prambanan', '{\"blocks\":[{\"key\":\"ceoqr\",\"text\":\"Animasi ini menceritakan 2 orang pemuda yang sedang berlibur ke candi prambanan. Karena mereka baru pertama kali ke berwisata disana membuat mereka tersesat saat berada di komplek candi. Kemudian mereka melihat sebuah pintu berwarna pink. Saat mereka membuka pintu itu tiba-tiba mereka tersedot ke ruang-waktu. Kebetulan pemandu wisata disana lagi keliling, saat si pemandu melihat 2 pemuda itu tersedot oleh pintu itu, si pemandu segera berlari untuk menyelamatkan kedua pemuda itu, namun alhasil si pemandu pun ikut tersedot oleh pintu itu. Saat mereka tersadar mereka berada di masa lalu, ternyata mereka sadar saat candi prambanan sedang dibangun. Namun mereka bertiga tidak bisa dilihat oleh orang-orang disana seolah-olah mereka tidak ada. Sambil mencari jalan pulang mereka menyaksikan apa yang terjadi disana. Setelah beberapa hari berlalu, saat Roro Jonggrang dikutuk menjadi candi ke 1000. Mereka tiba-tiba melihat pintu pink itu, akhirnya mereka segera membuka pintu tersebut untuk kembali ke dunia mereka. Saat mereka keluar dari pintu, mereka sedang melayang diatas langit, ketika akan jatuh ke tanah, ternyata itu mimpi dari dari si Joni. selesai\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Joni dan Joni dengan Pintu Ajaib di Candi Prambanan.png', 'https://youtu.be/anxqK33Use', '', 'https://api.informatics-expo.id/Joni dan Joni dengan Pintu Ajaib di Candi Prambanan.png', 735, 8, 3, '2022-07-30 14:16:57', '2022-07-30 14:16:57'),
(486, 'COLOSSAL', '{\"blocks\":[{\"key\":\"16o5b\",\"text\":\"COLOSSAL merupakan layanan organisasi kepemudaan untuk memudahkan organisasi atau komunitas yang ada dalam mengatur keuangannya mulai dari pengeluaran, pemasukan, tagihan dan iuran anggota, serta laporan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d63bo\",\"text\":\"Keunggulan yang di miliki COLOSSAL ialah :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8n5m\",\"text\":\"Pengelolaan data yang akurat, dan risiko kesalahan dapat diminimalisir\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6a78b\",\"text\":\"Adanya perbandingan update data keuangan organisasi terkini dengan diagram\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6jsg1\",\"text\":\"Adanya update status anggota tentang tagihan iuran setiap bulan atau iuran harian dengan menampilkan status lunas dan atau belum lunas\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'COLOSSAL.jpeg', 'https://youtu.be/TsLGrIzbttA', 'https://linktr.ee/colossal_by_capella', 'https://api.informatics-expo.id/COLOSSAL.jpeg', 750, 8, 3, '2022-07-30 14:17:46', '2022-08-01 18:14:32'),
(487, 'Budaya Gotong Royong', '{\"blocks\":[{\"key\":\"9shdv\",\"text\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":653,\"style\":\"color-rgb(20,20,20)\"},{\"offset\":0,\"length\":653,\"style\":\"fontfamily-YAD1bxogMz4 0\\\", _fb_, auto\"}],\"entityRanges\":[{\"offset\":0,\"length\":653,\"key\":0},{\"offset\":653,\"length\":1,\"key\":1}],\"data\":{}},{\"key\":\"9s6p0\",\"text\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan bhinneka tunggal ika yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":335,\"style\":\"color-rgb(20,20,20)\"},{\"offset\":0,\"length\":335,\"style\":\"fontfamily-YAD1bxogMz4 0\\\", _fb_, auto\"}],\"entityRanges\":[{\"offset\":0,\"length\":335,\"key\":2},{\"offset\":335,\"length\":1,\"key\":3}],\"data\":{}},{\"key\":\"dv07e\",\"text\":\"Dari ratusan budaya yang mengakar pada diri generasi-generasi mudanya, budaya gotong-royong dan tolong menolong adalah salah satu dari budaya yang masih dilestarikan hingga saat ini. Gotong-royong sendiri merupakan salah satu asas dalam Pancasila. Secara makna gotong royong adalah sebuah kegiatan yang dilaksanakan secara bersama-sama dan memiliki sifat sukarela. Supaya kegiatan yang dilakukan bisa berjalan dengan lancar, ringan, dan juga mudah. Salah satu contoh kegiatan yang bisa dilakukan secara gotong royong ialah pembangunan fasilitas umum yang ditujukan bagi masyarakat luas, membersihkan lingkungan desa, hingga kerja bakti yang dilakukan secara bersama-sama. Sedangkan tolong menolong sendiri merupakan suatu kegiatan yang di dalamnya terdapat aksi saling tolong menolong di antara satu sama lain dengan tujuan untuk meringankan beban hidup dari seseorang ataupun beban dari sebuah pekerjaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman.\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman.\",\"targetOption\":\"_blank\"}}}},\"1\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\"}}}},\"2\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan bhinneka tunggal ika yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi.\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan bhinneka tunggal ika yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi.\",\"targetOption\":\"_blank\"}}}},\"3\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\"}}}}}}', 'Budaya Gotong Royong.png', 'https://drive.google.com/drive/folders/1DbteAekdYtFGKdA3fOUWlKyRYEGunHHV?usp=sharing', '', 'https://api.informatics-expo.id/Budaya Gotong Royong.png', 747, 17, 3, '2022-07-30 14:22:31', '2022-07-30 14:22:31'),
(488, 'S.A.T.A', '{\"blocks\":[{\"key\":\"16o5b\",\"text\":\"S.A.T.A (System Aplication Technology Agricultural) merupakan aplikasi sistem informasi yang berperan sebagai penyalur informasi terkait pertanian di domisili yogyakarta. namun untuk saat ini SATA hanya berfokus di bagian pupuk pertanian saja. tetapi jangan khawatir SATA dapat di kembangkan menjadi mencakup seluruh kebutuhan dan perkembangan di sektor pertanian. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d63bo\",\"text\":\"Berikut Fitur yang terdapat pada S.A.T.A :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8n5m\",\"text\":\"Dashboard yang memperlihatkan informasi berbentuk chart yang menunjukkan perkembangan dari data atau informasi terkait pupuk di domisili yogayakarta\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6a78b\",\"text\":\"Tampilan halaman yang memperlihatkan list data dari beberapa jenis pupuk yang terdaftar di server S.A.T.A\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6jsg1\",\"text\":\"Dan fitur bagi user yang mendaftar sebagai distributor yang dapat menginput atau meng update data yang akan ditampilkan di website S.A.T.A\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'sata-22.jpg', 'https://youtu.be/rfZZpOTBryc', 'https://sata-psi.000webhostapp.com/', 'https://api.informatics-expo.id/sata-22.jpg', 721, 9, 3, '2022-07-30 14:24:56', '2022-07-30 14:24:56'),
(489, 'INPUS', '{\"blocks\":[{\"key\":\"aflfe\",\"text\":\"INPUS adalah suatu sistem perangkat lunak untuk menginformasikan suatu program yang ada di sebuah masjid tertentu mencakup pada kepengurusan keanggotaan dan kegiatan yang dilakukan pada masjid secara terstruktur dan juga terdapat beberapa jadwal puasa serta waktu berbuka maupun imsak dan donasi uang atau takjil pada daerah tertentu serta terdapat fitur yang mencatat kegiatan masjid.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":386,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":386,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":386,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":386,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":386,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":386,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'INPUS.png', '', 'https://www.figma.com/file/HKpr3Uwi4sVKYw3cneKIKk/Untitled?node-id=0%3A1', 'https://api.informatics-expo.id/INPUS.png', 753, 8, 3, '2022-07-30 14:54:27', '2022-07-30 14:58:27'),
(490, 'HIDRASEE', '{\"blocks\":[{\"key\":\"4mmrh\",\"text\":\"HIDRASEE is a web application that provides user with water product deliveries, taking inspiration from Gojek and Grab. Users can select their current or preferred location and the system will provide you with the high rated, trusted water depots nearby. Users will have the ability to add and select their product of choice, which can be delivered either via store\'s driver or self pickup.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":390,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"2bs4h\",\"text\":\"HIDRASEE will help Indonesian citizens with easy access of water and hydration, with a single touch of application.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":115,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":115,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":115,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":115,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":115,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'HIDRASEE.png', 'https://youtu.be/SI2yjWArGPU', 'https://www.figma.com/file/x4PlqsYGW7vaUi3dXUGowM/Desktop-Hidrasee?node-id=61%3A49', 'https://api.informatics-expo.id/HIDRASEE.png', 754, 6, 3, '2022-07-30 14:59:28', '2022-07-30 14:59:28'),
(491, 'How\'s Life', '{\"blocks\":[{\"key\":\"bca8t\",\"text\":\"How\'s Life, a mental health system made for you.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"en1sg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"438ng\",\"text\":\"Connects you with your health counselor, now with a tap from your finger.\\nHelps your counselor assess your conditions gradually to make better decision.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f3onn\",\"text\":\"Hows Life presented in 3 forms\\nPatients App, a mobile app\\nCounselors App, also a mobile app\\nCampus Health System App, a web app\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e5gqb\",\"text\":\"*To use in integration with your campus health consultation system*\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'How\'s Life.png', 'https://youtube.com', 'https://lynk.id/howslife', 'https://api.informatics-expo.id/How\'s Life.png', 581, 18, 3, '2022-07-30 15:14:46', '2022-07-30 15:14:46'),
(492, 'Kebudayaan di Yogyakarta', '{\"blocks\":[{\"key\":\"4rudn\",\"text\":\"Ada apa aja sih di Yogyakarta?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1397d\",\"text\":\"Kali ini,  bersama Mas Tejo dan Mbak Dita, kita akan berkeliling Yogyakarta sembari belajar mengenai kebudayaan di Yogyakarta. Kira-kira ada apa aja yaa?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"63mv5\",\"text\":\"Yuk, langsung kita tonton!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kebudayaan di Yogyakarta.png', 'https://youtu.be/u9D99M7-Emc', '', 'https://api.informatics-expo.id/Kebudayaan di Yogyakarta.png', 755, 4, 3, '2022-07-30 15:31:19', '2022-07-30 15:31:19'),
(493, 'Menjelajah Samudra', '{\"blocks\":[{\"key\":\"blf0j\",\"text\":\"Mengambil tema budaya dari sebuah lagu ciptaan ibu Sud pada 1940 yang berjudul \\\"nenek moyangku seorang pelaut\\\" mengandung nilai-nilai pesan moral dan mengekspresikan bahwa bangsa kita adalah bangsa yang terbiasa mengarungi samudera, lautan yang luas, dan menjelajahi bermacam-macam pulau. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":244,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":245,\"length\":43,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Menjelajah Samudra.png', 'https://youtu.be/-Lxa92Z20Ks', '', 'https://api.informatics-expo.id/Menjelajah Samudra.png', 760, 14, 3, '2022-07-30 15:48:31', '2022-07-30 15:48:31'),
(494, 'MIBOOK', '{\"blocks\":[{\"key\":\"bsqc9\",\"text\":\"Layanan Peminjaman Buku (MiBook) adalah suatu sistem perangkat lunak yang dirancang untuk mengelola data perpustakaan dalam skala kecil termasuk pinjam-kembali buku. Layanan MiBook juga dapat menerima buku-buku yang ingin disumbangkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":235,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MIBOOK.png', 'https://youtu.be/gpq8vGlSHu0', '', 'https://api.informatics-expo.id/MIBOOK.png', 567, 4, 3, '2022-07-30 15:50:26', '2022-07-30 15:51:57'),
(495, 'Malin Kundang The West Sumatran Folktales', '{\"blocks\":[{\"key\":\"1u863\",\"text\":\"Malin Kundang The West Sumatran Folktales\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":41,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d52ei\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cpa32\",\"text\":\"Sebuah karya sederhana dari kelompok kami mengenai Animasi yang mengangkat kisah rakyat Sumatra Barat yang melegenda,  yakni Malin Kundang. Animasi ini, keseluruhannya dibuat menggunakan software processing. Selamat Menyaksikan !\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5jlju\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2mmnl\",\"text\":\"PS : Jangan lupa like video dan vote karya kami : ) \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang The West Sumatran Folktales.jpeg', 'https://youtu.be/6gqhtae5DrQ', '', 'https://api.informatics-expo.id/Malin Kundang The West Sumatran Folktales.jpeg', 742, 4, 3, '2022-07-30 16:09:14', '2022-07-30 18:16:28'),
(496, 'sangkuriang', '{\"blocks\":[{\"key\":\"61er9\",\"text\":\"Grafika dan Multimedia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'sangkuriang.png', 'https://youtu.be/F9zL626gDMA', '', 'https://api.informatics-expo.id/sangkuriang.png', 764, 4, 3, '2022-07-30 16:13:24', '2022-07-30 16:13:24'),
(497, '1000 Candi Dalam Semalam', '{\"blocks\":[{\"key\":\"7ont3\",\"text\":\"Roro x Bandung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '1001 Candi Dalam Semalam.png', 'https://youtu.be/J4Hk3eL9vBc', 'https://github.com/gabriel-tama/tubes_gmm', 'https://api.informatics-expo.id/1001 Candi Dalam Semalam.png', 733, 4, 3, '2022-07-30 16:16:55', '2022-07-30 16:19:26'),
(498, 'Silap', '{\"blocks\":[{\"key\":\"7tm1f\",\"text\":\"Sistem layanan puskesmas (SILAP) merupakan sebuah aplikasi yang dapat memudahkan pasien untuk mengakses layanan puskesmas dengan skala kecil, khususnya pada layanan informasi, lokasi terdekat dan konsultasi.\\n\\nFitur SILAP: \\n1. Statistik penyakit yang sedang ramai di Indonesia\\n2. Pendaftaran pasien puskesmas\\n3. Konsultasi dengan dokter atau bidan\\n4. Lokasi puskesmas terdekat\\n5. Lihat jadwal kegiatan puskesmas\\n6. Lihat berita seputar puskesmas dan kesehatan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Silap.png', 'https://youtu.be/GYkMV6GOMl4', 'https://www.canva.com/design/DAFH4ZyO6CI/bj1Z-Eo_tyi3XP_Wi4XJeA/edit?utm_content=DAFH4ZyO6CI&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton', 'https://api.informatics-expo.id/Silap.png', 761, 18, 3, '2022-07-30 16:23:12', '2022-07-30 16:23:12'),
(499, 'Malin Kundang Reborn', '{\"blocks\":[{\"key\":\"etku9\",\"text\":\"Animasi ini diangkat dari CeritaMalin Kundangyang merupakan cerita yang berasaldari provinsiSumatera Barat,Indonesia.Legendaini menceritakantentang seorang anak yang durhaka pada ibunya dan oleh sebab itu diadikutuk menjadi batu oleh ibunya sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":258,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":258,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":258,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":258,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7h43o\",\"text\":\"Malin Kundang termasuk anak yang rajin dan suka membantu orang tuanya. Ketika ayahnya pergi dan tidak kembali lagi, dia ingin membantu ibunya dengan merantau untuk mencari harta yang banyak.\\nKetika Malin Kundang sudah sukses dan memiliki istri yang cantik, dia kembali ke desanya. Sayangnya ketika ibunya memeluknya, dia tidak mengakui ibunya. Karena durhaka, Malin Kundangdikutuk oleh ibunya menjadi batu. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":190,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":191,\"length\":216,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":190,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":191,\"length\":216,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":190,\"style\":\"fontsize-18\"},{\"offset\":191,\"length\":216,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":190,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"},{\"offset\":191,\"length\":216,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang Reborn.png', 'https://youtu.be/hbON1ZYx0Yk', '', 'https://api.informatics-expo.id/Malin Kundang Reborn.png', 758, 16, 3, '2022-07-30 16:29:38', '2022-07-30 16:29:38'),
(502, 'MyFinport', '{\"blocks\":[{\"key\":\"4f98h\",\"text\":\"Aplikas MyFinport merupakan aplikasi pengelolaan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MyFinport.jpeg', 'https://www.youtube.com/watch?v=nDN4_09myxM', 'https://github.com/raihanph21/PSI-Tubes-Kelompok-3', 'https://api.informatics-expo.id/MyFinport.jpeg', 770, 9, 3, '2022-07-30 16:39:46', '2022-07-30 16:40:40'),
(501, 'AssistMe', '{\"blocks\":[{\"key\":\"a0agl\",\"text\":\"AssistMe adalah aplikasi panggilan darurat yang dapat dipakai dengan mudah bagi masyarakat umum ketika berada dikondisi gawat darurat. Aplikasi ini merespon dengan cepat tanggap untuk berbagai situasi gawat darurat misalnya terjadi pencurian, pembegalan, kerusuhan, kecelakaan, kebakaran, penanganan medis darurat hingga bencana alam.  Di dalam aplikasi AsssistMe terdapat fitur-fitur seperti No.Darurat, Daerah Rawan, Laporan, Berita dan fitur utama aplikasi ini yaitu One Tap Button. Diharapkan dengan fitur-fitur tersebut akan membantu masyarakat umum untuk tidak  perlu lagi merasa khawatir dalam menjalankan rutinitas sehari-hari.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AssistMe.jpeg', 'https://youtu.be/JlJtTAyX6x8', 'https://www.figma.com/proto/elT6utfPoDpsq92PcD6OP7/AssistMe?node-id=15%3A10&scaling=scale-down&page-id=0%3A1&starting-point-node-id=15%3A10&show-proto-sidebar=1', 'https://api.informatics-expo.id/AssistMe.jpeg', 697, 16, 3, '2022-07-30 16:37:48', '2022-07-30 16:38:30'),
(503, 'Pulang Kampung', '{\"blocks\":[{\"key\":\"seff\",\"text\":\"Menceritakan seorang perantau yang akhirnya pulang ke kampung halamannya di Yogyakarta. Melihat indahnya kampung halaman ditambah megahnya rumah adat sebagai tanda keaslian suku dan budaya \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":188,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":188,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":188,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pulang Kampung.jpeg', 'https://youtu.be/UBluw_V2hBc', '', 'https://api.informatics-expo.id/Pulang Kampung.jpeg', 766, 17, 3, '2022-07-30 16:41:42', '2022-07-30 16:41:42'),
(504, 'Tale of Danau Toba', '{\"blocks\":[{\"key\":\"ar01c\",\"text\":\"Indonesia terkenal akan legendanya di berbagai daerah. Banyak kisah yang unik dan menarik dari legenda tersebut, salah satu legenda yang terkenal adalah Danau Toba. Danau toba adalah sebuah danau yang terletak di Sumatera Utara yang konon kisahnya lahir dari sebuah kisah penghianatan janji Toba kepada istrinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7oc9r\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dvq9a\",\"text\":\"Lalu, bagaimanakah seorang gadis kecil Anya mengupas legenda Danau Toba ini? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"80ul8\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4sb9g\",\"text\":\"Mari kita ikuti kisah Anya dalam mengupas legenda Danau Toba\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tale of Danau Toba.png', 'https://youtu.be/l3f7SRF0qrw', '', 'https://api.informatics-expo.id/Tale of Danau Toba.png', 765, 2, 3, '2022-07-30 16:50:49', '2022-07-30 16:50:49'),
(505, 'PEMKER', '{\"blocks\":[{\"key\":\"679td\",\"text\":\"PEMKER merupakan aplikasi yang digunakan unruk melakukan pemungutan suara secara online (e-voting). Dengan adanya PEMKER, pemungutan suara menjadi lebih efisien dan hemat kertas.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PEMKER.jpeg', 'https://youtu.be/5kwh5CmjqIY', 'https://drive.google.com/file/d/15rNEQp5ABP84d-h5ogP5cOOHJnbGJS7z/view?usp=sharing', 'https://api.informatics-expo.id/PEMKER.jpeg', 767, 9, 3, '2022-07-30 16:51:24', '2022-07-30 17:01:59');
